var book = {
	"name": "၄ မိစ့ၭ",
	"numChapters": 36,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> တၭလၧအဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧခးအံဇံၭအလးခဲၫ့ နံၫနံၪ့လနံၪ့, လၩနံၫဘံၪ့လဘံၪ့, လၩထၪ့လနံၩနီၪယ ဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ, လၧၡါမုနၧၫ့ဖၫစဲနၫလၧဆၧ",
			"2": "<sup>2</sup> အီၪကီၪ့အတဲၩဆံၫ့ဎံၪအဖၧၩ့တၭ, စံၭဝ့ၫဒၪ,- ဝံထၪ့ နၬထၪ့ကယဲၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့ဘဲၫအဂံၪ့ ဒီၪ့ၥံၪအၥိၭ, ဘဲၫအဖါအဂံၪ့လဖၪအၥိၭ, ဘဲၫအမံၩ့ လဖၪအဆၧဝံထၪ့နၬထၪ့အၥိၭ, ကယဲၦခွၫဘဲၫအခိၪ",
			"3": "<sup>3</sup> လဖၪအၥိၭ,- လၧအၥၭၡါအနံၪ့နံၫဆံၫဒဲအၪနဲၪ့အနီၪ, ကယဲၦလၧၦအံၫစရ့လၭဖိၪအကျၩ လၧအလ့ၩဒုၭဆၧ ၥ့ၪထီးအလူၬနီၪဆံၭ. တၭနဝ့ၫဒၪဒဲစအၫရၧၫ့ဘၪဝံထၪ့",
			"4": "<sup>4</sup> နၬထၪ့ဝ့ၫဘဲၫအၥုၭမုအဒီၪ့လဖၪအၥိၭနီၪလီၫ.- တၭ ၦလဒီၪ့အခွၫလဂၩ,လဒီၪ့အခွၫလဂၩ, လၧအမွဲအဖါ အဂံၪ့ခိၪအဖိၪနီၪ မိဘၪအီၪလၧနၥံၪအၥိၭလၧကယဲ အဒီၪ့ၥံၪဆုၬဆုၬလီၫ.",
			"5": "<sup>5</sup> တၭၦလဖၪယီၩ မွဲၦလၧအဘၪဆၧၫ့ထုၪ့လၧနၥံၪအ",
			"6": "<sup>6</sup> ၥိၭအမံၩ့,- လၧစရုဘံၫ့လဒီၪ့နီၪ, စၡ့ဒအၧၫ အဖိၪခွၫ စအံၫလဲဇၧၫ. လၧစစံမအၧၫ့ လဒီၪ့နီၪ စဇုရၡၭဒအဲၫ အဖိၪခွၫစၡလုၫမအ့လၭလီၫ.",
			"7": "<sup>7</sup> လၧစယုဒၫလဒီၪ့နီၪ, စအမံနဒၭ အဖိၪခွၫစနၫၡိၫ့.",
			"8": "<sup>8</sup> လၧစအံၫစခၫလဒီၪ့နီၪ, စဇုအၫ အဖိၪခွၫ စနၥၫ့နအ့",
			"9": "<sup>9</sup> လၭ.- လၧစဇ့ၭဘလၧၫ့လဒီၪ့နီၪ, စဟံလၧၫ့အဖိၪခွၫ",
			"10": "<sup>10</sup> စအံလဲအၭ,- လၧစယိၥၭအဖိၪခွၫအကျၩနီၪ, ၦအံဖြံၫ့ အဒီၪ့နီၪ, စအၫမဟၧၭအဖိၪခွၫ စအံၫလံၭၡမၫ,လၧစမ နၭစ့ၫလဒီၪ့နီၪ, စပံဒၫဇၧၫအဖိၪခွၫစဂမၫလအ့လၭ.",
			"11": "<sup>11</sup> လၧစဘံၪ့ယမံၫ့လဒီၪ့နီၪ, စဂံၭဒအိၫနဲၫအဖိၪခွၫစအၭ",
			"12": "<sup>12</sup> ဘဒၫ့,- လၧစဒၫ့လဒီၪ့နီၪ, စအၫမၡၭဒအဲၫအဖိၪခွၫစအ",
			"13": "<sup>13</sup> ဟဲၫအံဇၧၫ.- လၧစအၭၡၧၫလဒီၪ့နီၪ စအီၭရၫ့အဖိၪခွၫ",
			"14": "<sup>14</sup> စပံၫဇအ့လၭ- လၧစဂၭလဒီၪ့နီၪ, စဒယုၫအ့လၭအ",
			"15": "<sup>15</sup> ဖိၪခွၫစအံၫလဲအစၭ.- လၧစနၭၥလဲၫလဒီၪ့နီၪ, စအံနၫ့",
			"16": "<sup>16</sup> အဖိၪခွၫစအဟဲရၫလီၫ.- အဝ့ၫၥံၪနီၪ မွဲၦလၧဆၧကိၭ ဝ့ၫလၧဆၧအီၪကီၪ့အဖၧၩ့, အဖါအၡၩလဒီၪ့အၦဒိၪ လဖၪ, ၦအံၫစရ့လၭဖိၪ အၡၩလထီၫ့လဖၪ အခိၪၥံၪ",
			"17": "<sup>17</sup> လီၫ.- တၭစမိစ့ၭဒဲစအၫရၧၫ့ မၩန့ၦၡၩလၧဆၧကိၭအ",
			"18": "<sup>18</sup> မံၩ့လဖၪနီၪ, တၭလၩနံၫဘံၪ့လဘံၪ့ လၩထၪ့လနံၩနီၪ ဒုၭအီၪကိၩ့အီၪကီၪ့ဆၧအီၪကီၪ့ ထီးအလူၬး တၭအ ဝ့ၫၥံၪနီၪလီၩထဲၩ့အဆၨၩအထံၭ ဘဲၫအဒီၪ့လဖၪအ ၥိၭ,ဘဲၫအဖါလဖၪအဂံၪ့ အၥိၭ, ဘဲၫအမံၩ့လဖၪအဆၧ ဝံထၪ့နၬထၪ့အၥိၭ လၧအၥၭၡါအနံၪ့နံၫဆံၫ ဒဲနံၫဆံၫ",
			"19": "<sup>19</sup> အဖၫ့ခိၪနီၪ, ဘဲၫအခိၪလဖၪအၥိၭနီၪလီၫ.- ဘဲၫယဟိ ဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪ, အဝ့ၫဒၪဝံထၪ့နၬထၪ့လၧ စဲနၫအၡါမုနၧၫ့ဖၫ အဖၧၩ့နီၪလီၫ.",
			"20": "<sup>20</sup> တၭစအံၫစရ့လၭအဖိၪဝဲၡါ, စရုဘံၫ့အဖိၪအဆၨၩ အဆၬဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭ ဘဲၫအဝ့ၫၥံၪအဖါလ ဖၪအဆၧဝံဆၧနၬအၥိၭ, ဘဲၫအမံၩ့လဖၪအဆၧဝံဆၧ နၬအၥိၭ, ဘဲၫအခိၪလဖၪအၥိၭ, ကယဲၦခွၫလၧအၥၭ ၡါအနံၪ့နံၫဆံၫဒဲနံၫဆံၫအဖၫ့ခိၪနီၪ, ကယဲၦလ့ၩဒုၭဆၧ",
			"21": "<sup>21</sup> ၥ့ၪထီးအလူၬနီၪ, ဆၧဝံထၪ့နၬထၪ့ၦၡၩလံလၬဎူၫထီၫ့ ဒဲယဲယၩလၧစရုဘံၫ့ လဒီၪ့အကျၩလီၫ.",
			"22": "<sup>22</sup> တၭစစံမအၧၫ့အဖိၪ အဆၨၩအဆၬ, ဘဲၫအဂံၪ့ဒီၪ့ လဖၪအၥိၭ, ဘဲၫအဝ့ၫၥံၪအဖါလဖၪ အဂံၪ့အၥိၭဘဲၫ အမံၩ့လဖၪအဆၧဝံထၪ့နၬထၪ့အၥိၭ, ဘဲၫအခိၪလဖၪ အၥိၭ, ကယဲၦခွၫလၧအၥၭၡါအနံၪ့နံၫဆံၫ ဒဲနံၫဆံၫအ",
			"23": "<sup>23</sup> ဖၫ့ခိၪနီၪ, ကယဲၦလ့ၩဒုၭဆၧၥ့ၪထီးအလူၬနီၪ,- ဆၧဝံ ထၪ့နၬထၪ့ ၦၡၩယဲလၬခွံၫထီၫ့ၥၧၫ့ယၩ, လၧစံမအၧၫ့ လဒီၪ့အကျၩလီၫ.",
			"24": "<sup>24</sup> လၧစဂၭအဖိၪအဆၨၩအဆၬ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪ အၥိၭ, ဘဲၫအဝ့ၫၥံၪအဖါလဖၪအဂံၪ့အၥိၭ, ဘဲၫအမံၩ့ လဖၪအဆၧဝံထၪ့နၬထၪ့အၥိၭ, ၦလၧအၥၭၡါအနံၪ့ နံၫဆံၫဒဲနံၫဆံၫအဖၫ့ခိၪနီၪ, ကယဲၦလ့ၩဒုၭဆၧၥ့ၪထီး",
			"25": "<sup>25</sup> အလူၬနီၪ,- ဆၧဝံထၪ့နၬထၪ့ၦၡၩလံလၬယဲထီၫ့ဎူၫယၩ ယဲဆံၫ လၧစဂၭအဒီၪ့အကျၩလီၫ.",
			"26": "<sup>26</sup> လၧစယုဒၫအဖိၪအဆၨၩအဆၬ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪ အၥိၭ, ဘဲၫအဝ့ၫၥံၪအဖါလဖၪအဂံၪ့အၥိၭ, ဘဲၫအမံၩ့ လဖၪအဆၧဝံထၪ့နၬထၪ့အၥိၭ, ၦလၧအထၪ့ဘၭအ နံၪ့နံၫဆံၫဒဲနံၫဆံၫအဖၫ့ခိၪနီၪ, ကယဲၦလၧအလ့ၩဒုၭ",
			"27": "<sup>27</sup> ဆၧၥ့ၪထီးအလူၬနီၪ,- ဆၧဝံထၪ့နၬထၪ့ၦၡၩနွ့ၫလၬ လံထီၫ့ဎူၫယၩ လၧစယုဒၫလဒီၪ့အကျၩလီၫ.",
			"28": "<sup>28</sup> လၧစအံစခၫအဖိၪအဆၨၩအဆၬ, ဘဲၫအဂံၪ့ဒီၪ့လ ဖၪအၥိၭ, ဘဲၫအဝ့ၫၥံၪအဖါလဖၪအဂံၪ့အၥိၭ, ဘဲၫအ မံၩ့လဖၪအဆၧဝံထၪ့နၬထၪ့အၥိၭ, ၦလၧအၥၭၡါအ နံၪ့နံၫဆံၫဒဲနံၫဆံၫအဖၫ့ခိၪနီၪ, ကယဲၦလ့ၩဒုၭဆၧၥ့ၪ",
			"29": "<sup>29</sup> ထီးအလူၬနီၪ,- ဆၧဝံထၪ့နၬထၪ့ၦၡၩယဲလၬလံထီၫ့ လံယၩ, လၧစအံစခၫလဒီၪ့အကျၩလီၫ.",
			"30": "<sup>30</sup> လၧစဇ့ၭဘလၧၫ့အဖိၪအဆၨၩအဆၬ, ဘဲၫအဂံၪ့ဒီၪ့ လဖၪအၥိၭ, ဘဲၫအဝ့ၫၥံၪအဖါလဖၪအဂံၪ့အၥိၭ, ဘဲၫ အမံၩ့လဖၪအဆၧဝံထၪ့နၬထၪ့အၥိၭ, ၦလၧအၥၭၡါ အနံၪ့နံၫဆံၫ ဒဲနံၫဆံၫအဖၫ့ခိၪနီၪ, ကယဲၦလ့ၩဒုၭဆၧ",
			"31": "<sup>31</sup> ၥ့ၪထီးအလူၬနီၪ,- ဆၧဝံထၪ့နၬထၪ့ၦၡၩ ယဲလၬနွ့ၫ ထီၫ့လံယၩ, လၧစဇ့ၭဘလၧၫ့လဒီၪ့အကျၩလီၫ.",
			"32": "<sup>32</sup> လၧစယိၥၭအဖိၪစအံဖြံၫ့ အဖိၪအဆၨၩအဆၬ,ဘဲၫ အဂံၪ့ဒီၪ့လဖၪအၥိၭ, ဘဲၫအဝ့ၫၥံၪအဖါလဖၪအဂံၪ့အ ၥိၭ, ဘဲၫအမံၩ့လဖၪအဆၧဝံထၪ့နၬထၪ့အၥိၭ, ၦလၧအ ၥၭၡါအနံၪ့နံၫဆံၫဒဲနံၫဆံၫအဖၫ့ခိၪနီၪ, ကယဲၦလ့ၩဒုၭ",
			"33": "<sup>33</sup> ဆၧၥ့ၪထီးအလူၬနီၪ,- ဆၧဝံထၪ့နၬထၪ့ၦၡၩ လံလၬ ဒဲယဲယၩ, လၧစအံဖြံၫ့လဒီၪ့အကျၩလီၫ.",
			"34": "<sup>34</sup> လၧစမနၭစ့ၫအဖိၪအဆၨၩအဆၬ, ဘဲၫအဂံၪ့ဒီၪ့လ ဖၪအၥိၭ, ဘဲၫအဝ့ၫၥံၪအဖါလဖၪအဂံၪ့အၥိၭ, ဘဲၫ အမံၩ့လဖၪ အဆၧဝံထၪ့နၬထၪ့အၥိၭ, ၦလၧအၥၭၡါ အနံၪ့နံၫဆံၫဒဲနံၫဆံၫအဖၫ့ခိၪနီၪ ကယဲၦလ့ၩဒုၭဆၧၥ့ၪ",
			"35": "<sup>35</sup> ထီးအလူၬနီၪ,- ဆၧဝံထၪ့နၬထၪ့ၦၡၩ ၥၧၫ့လၬနံၫထီၫ့ နံၫယၩ လၧစမနၭစ့ၫလဒီၪ့အကျၩလီၫ.",
			"36": "<sup>36</sup> လၧစဘံၪ့ယမံၫ့အဖိၪအဆၨၩအဆၬ, ဘဲၫအဂံၪ့ဒီၪ့ လဖၪအၥိၭ, ဘဲၫအဝ့ၫၥံၪအဖါလဖၪအဂံၪ့အၥိၭ, ဘဲၫ အမံၩ့လဖၪအဆၧဝံထၪ့နၬထၪ့အၥိၭ, ၦလၧအၥၭၡါ အနံၪ့နံၫဆံၫဒဲနံၫဆံၫအဖၫ့ခိၪနီၪ, ကယဲၦလ့ၩဒုၭဆၧ",
			"37": "<sup>37</sup> ၥ့ၪထီးအလူၬနီၪ,- ၦၡၩၥၧၫ့လၬယဲထီၫ့ဒဲလံယၩ, လၧ အဘၪဆၧဝံထၪ့နၬထၪ့လၧစဘံၪ့ယမံၫ့လဒီၪ့အကျၩလီၫ.",
			"38": "<sup>38</sup> လၧစဒၫ့အဖိၪအဆၨၩအဆၬ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪ အၥိၭ, ဘဲၫအဝ့ၫၥံၪအဖါလဖၪအဂံၪ့အၥိၭ, ဘဲၫအမံၩ့ လဖၪအဆၧဝံထၪ့နၬထၪ့အၥိၭ, ၦလၧအၥၭၡါအနံၪ့ နံၫဆံၫဒဲအၪနဲၪ့အနီၪ, ကယဲၦလ့ၩဒုၭဆၧၥ့ၪထီးအ",
			"39": "<sup>39</sup> လူၬနီၪ,- ဆၧဝံထၪ့နၬထၪ့နီၪ ၦၡၩဎူၫလၬနံၫထီၫ့နွ့ၫ ယၩ, လၧစဒၫ့လဒီၪ့အကျၩလီၫ.",
			"40": "<sup>40</sup> လၧစအၭၡၧၫအဖိၪအဆၨၩအဆၬ, ဘဲၫအဂံၪ့ဒီၪ့ လဖၪအၥိၭ, ဘဲၫအဝ့ၫၥံၪအဖါလဖၪအဂံၪ့အၥိၭ, ဘဲၫ အမံၩ့အဆၧဝံထၪ့နၬထၪ့အၥိၭ, ၦလၧအၥၭၡါအနံၪ့ နံၫဆံၫဒဲနံၫဆံၫအဖၫ့ခိၪနီၪ, ကယဲၦလ့ၩဒုၭဆၧၥ့ၪထီး",
			"41": "<sup>41</sup> အလူၬနီၪ,- ဆၧဝံထၪ့နၬထၪ့ၦၡၩ လံလၬလထီၫ့ယဲ ယၩ, လၧစအၭၡၧၫလဒီၪ့အကျၩလီၫ.",
			"42": "<sup>42</sup> လၧစနၭၥလဲၫအဖိၪအဆၨၩအဆၬ, ဘဲၫအဂံၪ့ဒီၪ့ လဖၪအၥိၭ ဘဲၫအဝ့ၫၥံၪအဖါလဖၪအဂံၪ့အၥိၭ, ဘဲၫ အမံၩ့လဖၪအဆၧဝံထၪ့နၬထၪ့အၥိၭ, ၦလၧအၥၭၡါ အနံၪ့နံၫဆံၫဒဲနံၫဆံၫအဖၫ့ခိၪနီၪ, ကယဲၦလ့ၩဒုၭဆၧ",
			"43": "<sup>43</sup> ၥ့ၪထီးအလူၬနီၪ,- ဆၧဝံထၪ့နၬထၪ့ၦၡၩ ယဲလၬၥၧၫ့ ထီၫ့ဒဲလံယၩ လၧစနၭၥလဲၫလဒီၪ့အကျၩလီၫ.",
			"44": "<sup>44</sup> အဝ့ၫၥံၪနီၪ မွဲၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫလၧ စမိစ့ၭဒဲစအၫရၧၫ့ဝံထၪ့နၬထၪ့ဝ့ၫ, ဒဲၦအံၫစရ့လၭဖိၪ အၦဒိၪလဆံၫနံၫဂၩ, လဂၩလၧအဖါလဖၪ အဂံၪ့အ ဂး, လဂၩလၧအဖါလဖၪ အဂံၪ့အဂး ဆုၬဆုၬလီၫ.",
			"45": "<sup>45</sup> တၭကယဲၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧၦအံၫစ ရ့လၭဖိၪအကျၩဘဲၫအဖါလဖၪ အဂံၪ့အၥိၭ, လၧအ ၥၭၡါအနံၪ့နံၫဆံၫဒဲနံၫဆံၫအဖၫ့ခိၪနီၪ, ကယဲၦလၧအ လ့ၩဒုၭဆၧၥ့ၪ လၧၦအံၫစရ့လၭဖိၪအကျၩ ထီးအ",
			"46": "<sup>46</sup> လူၬ,- ၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ ထီးအလူၬနီၪမွဲ ဎူၫကုၬၥၧၫ့ထီၫ့ယဲယၩယဲဆံၫလီၫ.",
			"47": "<sup>47</sup> အ့ၪမွဲၦလံဝဲၫဖိၪ ဘဲၫအဝ့ၫၥံၪအဖါ လဖၪအၡၩလ ဆၨၩအၥိၭနီၪ, ဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧအကျၩ",
			"48": "<sup>48</sup> အ့ၬ.- အဂဲးဘဲၫယီၩ ယဟိဝၩချဲၩ့ယူၭဆၧလၧစမိစ့ၭ",
			"49": "<sup>49</sup> တၭ,စံၭဝ့ၫဒၪ,- န့ၫစလံဝဲၫလဒီၪ့နီၪနဝံထၪ့နၬထၪ့ဘၪ အ့ၬ. ဒဲနဝံထၪ့ဘၪအဝ့ၫၥံၪ အခိၪလၧၦအံၫစရ့လၭ",
			"50": "<sup>50</sup> ဖိၪအကျၩအ့ၬ.- တၭနဘၪအီၪက့ၪၦလံဝဲၫဖိၪလၧဆၧ အုၩ့လၩ့အတဲၩဆံၫ့ဎံၪအဖၫ့ခိၪ, ဒဲလၧအဆၧဖိၪဆၧ လံၩထီးအလူၬအဖၫ့ခိၪ, ဒဲလၧကယဲဆၧလၧအဘၪ ဆဲၫ့လၧအလးနီၪလီၫ. အဝ့ၫၥံၪနီၪ ဘၪဆိၬတဲၩဆံၫ့ ဎံၪ,ဒဲအဆၧဖိၪဆၧလံၩထီးအလူၬ, ဒဲဘၪမၩအခ့ၫအ ၡၩအဆၧမၩ, ဒဲဘၪၥုၪ့အတဲၩဝၬဖီၩ့ တဲၩဆံၫ့ဎံၪနီၪ",
			"51": "<sup>51</sup> လီၫ.- ထီးတဲၩဆံၫ့ဎံၪမိစဲၪ့ထၪ့တၭ, ၦလံဝဲၫဖိၪၥံၪမိ ဘၪရိလၩ့ခွံၬဝ့ၫလီၫ. ထီးတဲၩဆံၫ့ဎံၪနီၪ မိဘၪဆၧမၩ ကဲၪထၪ့တၭ, ၦလံဝဲၫဖိၪၥံၪမိဘၪမၩထၪ့ဝ့ၫလီၫ. တၭ ၦလခီၫဘၩ့မုးဖိၪလၧအၥုၭဘူၭအၥၭနီၪ မိဘၪဆၧမၩ",
			"52": "<sup>52</sup> ၥံၫဝ့ၫလီၫ.- တၭၦအံၫစရ့လၭဖိၪဘၪၥုၪ့တဲၩ ထီးအၡၩ လဆၨၩဒၪဝ့ၫအၥုၪ့တဲၩအလး, ဒဲထီးအၥုၭဖိၪအလၫ့",
			"53": "<sup>53</sup> အနဲၩ့လၧအၥုၭမုအကျၩကိၭဂၩဒ့ၭလီၫ.- အ့ၪမွဲၦလံ ဝဲၫဖိၪလဖၪနီၪ မိဘၪၥုၪ့အတဲၩဝၬဖီၩ့ဆၧအုၩ့လၩ့အ တဲၩဆံၫ့ဎံၪအီၪဝ့ၫအလး, ဘဲၫၥိၭဆၧၥၭထၪ့ထီးဘၪ ၦအံၫစရ့လၭဖိၪလဂ့ၩ, တၭၦလံဝဲၫဖိၪမိဘၪယိဆၧယိ အလးဘၪဆဲၫ့လၧဆၧအုၩ့လၩ့ အတဲၩဆံၫ့ဎံၪနီၪလီၫ.",
			"54": "<sup>54</sup> တၭၦအံၫစရ့လၭဖိၪမၩဝ့ၫထီးအလူၬ ဘဲၫယဟိဝၩ မၪလူၬစမိစ့ၭအၥိၭနီၪ, မၩဝ့ၫဘဲၫနီၪၥိၭလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭဒဲစအၫရၧၫ့တၭ, စံၭဝ့ၫ",
			"2": "<sup>2</sup> ဒၪ,- ထီးဒၪၦအံၫစရ့လၭဖိၪလဂၩလါလါနီၪ ဘၪၥုၪ့ တဲၩထီးအၥုၭဖိၪ အလၫ့ဒၪဝ့ၫအနဲၩ့, လၧအဝ့ၫၥံၪအ ဖါအဆၧနဲၪ့အဖၫ့လၬလီၫ. ဆဲၫဎၩ့ ဒဲဆၧအီၪကီၪ့အ",
			"3": "<sup>3</sup> တဲၩဆံၫ့ဎံၪဝၬဖီၩ့ဝ့ၫနီၪ မိဘၪၥုၪ့အတဲၩလီၫ.- ၦဘၪ ဆဲၫ့လၧစယုဒၫအၥုၪ့တဲၩအလး အၥုၭဖိၪအလၫ့လဖၪ ဒဲအၡၩခမျၧးလဖၪနီၪ ဘၪၥုၪ့အတဲၩ လၧမုထၪ့လခီၫ တၭ, စအမံနဒၭအဖိၪခွၫ စနၫၡိၫ့မိကဲၪထၪ့ၦယုဒၫဖိၪ",
			"4": "<sup>4</sup> အၦဒိၪလီၫ.- တၭအဝ့ၫဒၪအၥုၭမု, ၦၡၩလၧအဘၪ ဆၧဝံထၪ့နၬထၪ့ဝ့ၫလၧအကျၩနီၪ မွဲၦနွ့ၫလၬလံထီၫ့",
			"5": "<sup>5</sup> ဎူၫယၩလီၫ.- တၭၦလၧအဘၪၥုၪ့တဲၩလၧအနဲၩ့ထံၭ နီၪမွဲၦအံစခၫဖိၪလဒီၪ့တၭ, စဇုအၫအဖိၪခွၫစနၥၫ့န",
			"6": "<sup>6</sup> အ့လၭမိကဲၪထၪ့ၦအံစခၫဖိၪအၦဒိၪလီၫ.- တၭအၥုၭ မုလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧအကျၩနီၪမွဲၦယဲ",
			"7": "<sup>7</sup> လၬလံထီၫ့လံယၩလီၫ.- ၦဇ့ၭဘလၧၫ့ဖိၪလဆၨၩအ ဒီၪ့, တၭစဟံလၧၫ့ အဖိၪခွၫစအံၫလဲအၭမိကဲၪထၪ့ၦ",
			"8": "<sup>8</sup> ဇ့ၭဘလၧၫ့ဖိၪအၦဒိၪလီၫ.- အဝ့ၫဒၪအၥုၭမု, ၦလၧ အဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧအကျၩနီၪမွဲၦယဲလၬနွ့ၫ",
			"9": "<sup>9</sup> ထီၫ့လံယၩလီၫ.- ကယဲၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ ဝ့ၫဘၪဆဲၫ့လၧၦယုဒၫၥုၪ့တဲၩ အလးနီၪမွဲၦၡၩလကုၬ ဎိၭလၬဎူၫထီၫ့လံယၩ, ဘဲၫအၥုၭမုလဖၪအၥိၭနီၪလီၫ. အဝ့ၫၥံၪနီၪမိဘၪစဲၪ့ထၪ့ဆိၫဝ့ၫလီၫ",
			"10": "<sup>10</sup> လၧမုခံၫ့လခီၫနီၪမိအီၪ လၧစရုဘံၫ့အၥုၪ့တဲၩအလး အၥုၭဖိၪအလၫ့, ဘဲၫအၥုၭမုလဖၪအၥိၭနီၪလီၫ. တၭ စၡ့ဒအၧၫအဖိၪခွၫစအံၫလဲဇၧၫနီၪ မိကဲၪထၪ့ၦရုဘံၫ့",
			"11": "<sup>11</sup> ဖိၪအၦဒိၪလီၫ.- တၭအဝ့ၫဒၪအၥုၭမု, ၦလၧအဘၪဆၧ ဝံထၪ့နၬထၪ့ဝ့ၫ လၧအကျၩမွဲၦလံလၬဎူၫထီၫ့ယဲယၩ",
			"12": "<sup>12</sup> လီၫ.- တၭၦလၧအဘၪၥုၪ့အတဲၩလၧအဝ့ၫဒၪအနဲၩ့ ထံၭနီၪမွဲစစံမအၧၫ့ဖိၪလဒီၪ့တၭ စဇုရၡၭဒအဲၫအဖိၪ ခွၫစၡလုၫမအ့လၭနီၪ မိကဲၪထၪ့ၦစံမအၧၫ့ဖိၪအၦဒိၪ",
			"13": "<sup>13</sup> လီၫ.- တၭအဝ့ၫဒၪအၥုၭမု, ၦလၧအဘၪဆၧဝံထၪ့နၬ ထၪ့လၧအကျၩနီၪ မွဲၦယဲလၬခွံၫထီၫ့ၥၧၫ့ယၩလီၫ.",
			"14": "<sup>14</sup> ထီးနီၪလဖၧၫ့ ၦဂၭလဒီၪ့နီၪ ဒဲစရယုၫအ့လၭ အဖိၪ ခွၫစအံၫဘဲအစၭနီၪ မိကဲၪထၪ့ၦဂၭဖိၪၥံၪအၦဒိၪလီၫ.",
			"15": "<sup>15</sup> တၭအဝ့ၫဒၪအၥုၭမု, ၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧအကျၩနီၪ မွဲၦလံလၬယဲထီၫ့ဎူၫယၩယဲဆံၫလီၫ.",
			"16": "<sup>16</sup> တၭကယဲၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ ဘၪဆဲၫ့လၧ ၦရုဘံၫ့ဖိၪၥုၪ့တဲၩအလးနီၪ မွဲၦလကုၬယဲလၬလထီၫ့ လံယၩယဲဆံၫ, ဘဲၫအၥုၭမုလဖၪ အၥိၭနီၪလီၫ. တၭ အဝ့ၫၥံၪမိဘၪစဲၪ့ထၪ့ဝ့ၫ နံၫဆၫ့လဆၫ့လီၫ.",
			"17": "<sup>17</sup> ထီးနီၪလဖၧၫ့ ဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ မိဘၪစဲၪ့ ထၪ့တၭ, ၦလံဝဲၫဖိၪလဖၪအီၪလၧၦခမျၧး အၥၭကျၩ နီၪလီၫ. ဘဲၫအၥုၪ့တဲၩအၥိၭနီၪ မိဘၪလ့ၩဆၧ, လဂၩ လၧအလးဒၪဝ့ၫ, လဂၩလၧအလးဒၪဝ့ၫ လၧအဝ့ၫၥံၪ အၥုၭဖိၪအလၫ့အနဲၩ့ထံၭ ကိၭဂၩဒ့ၭလီၫ.",
			"18": "<sup>18</sup> လၧမုနုၬလခီၫနီၪ မိအီၪလၧအံဖြံၫ့ၥုၪ့တဲၩအလးအ ၥုၭဖိၪအလၫ့, ဘဲၫအၥုၭမုလဖၪ အၥိၭနီၪလီၫ. တၭစ အၫမဟၧၭအဖိၪခွၫ စအံၫလံၭၡမၫနီၪ မိကဲၪထၪ့ၦအံ",
			"19": "<sup>19</sup> ဖြံၫ့ဖိၪအၦဒိၪလီၫ.- တၭအဝ့ၫဒၪအၥုၭမု, လၧအဘၪ ဆၧဝံထၪ့နၬထၪ့ လၧအကျၩနီၪ, မွဲၦလံလၬယဲယၩ",
			"20": "<sup>20</sup> လီၫ.- တၭၦမနၭစ့ၫဖိၪလဒီၪ့ မိအီၪလၧအနဲၩ့ထံၭလီၫ. တၭစပံၫဒၫဇၧၫအဖိၪခွၫ စဂမၫလအ့လၭနီၪမိကဲၪထၪ့",
			"21": "<sup>21</sup> ၦမနၭစ့ၫဖိၪအၦဒိၪလီၫ.- တၭအဝ့ၫဒၪအၥုၭမု, ၦလၧ အဘၪဝံထၪ့နၬထၪ့လၧအကျၩနီၪ, မွဲၦၥၧၫ့လၬနံၫထီၫ့",
			"22": "<sup>22</sup> နံၫယၩလီၫ.- ထီးနီၪလဖၧၫ့ၦဘံၪ့ယမံၫလဒီၪ့နီၪ, တၭ စဂံၭဒအိၫနဲၫအဖိၪခွၫစအၭဘဒၫ့နီၪ, မိကဲၪထၪ့ၦဘံၪ့",
			"23": "<sup>23</sup> ယမံၫ့ဖိၪၥံၪအၦဒိၪလီၫ.- တၭအဝ့ၫဒၪအၥုၭမု, ၦလၧ အဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫလၧအကျၩနီၪ, မွဲၦၥၧၫ့လၬ",
			"24": "<sup>24</sup> ယဲထီၫ့လံယၩလီၫ.- ကယဲၦလၧအဘၪဆၧဝံထၪ့နၬ ထၪ့ဝ့ၫဘၪဆဲၫ့လၧၦအံဖြံၫ့ဖိၪၥုၪ့တဲၩအလးနီၪ မွဲၦလ ကုၬဎိၭထီၫ့လယၩ, ဘဲၫအၥုၭမုလဖၪအၥိၭလီၫ. တၭ အဝ့ၫၥံၪမိဘၪလ့ၩဆၧ လၧၥၧၫ့ဆၫ့လဆၫ့လီၫ.",
			"25": "<sup>25</sup> လၧမုဖၩလခီၫနီၪ မိအီၪလၧစဒၫ့အၥုၪ့တဲၩအလး အၥုၭဖိၪအလၫ့, ဘဲၫအၥုၭမုလဖၪအၥိၭနီၪလီၫ.စအၫ မၡၭဒအဲၫအဖိၪခွၫ စအဟဲၫအံဇၧၫနီၪ မိကဲၪထၪ့ၦဒၫ့",
			"26": "<sup>26</sup> ဖိၪၥံၪအၦဒိၪလီၫ.- တၭအဝ့ၫဒၪအၥုၭမု, ၦလၧအ ဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫလၧအကျၩနီၪ, မွဲၦဎူၫလၬနံၫ",
			"27": "<sup>27</sup> ထီၫ့နွ့ၫယၩလီၫ.- တၭၦလၧအမိၥုၪ့အတဲၩ လၧအနဲၩ့ ထံၭနီၪမွဲၦအၭၡၧၫအဒီၪ့လဒီၪ့လီၫ. တၭစအီၭရၫ့အ ဖိၪခွၫစပ့ဇၫအ့လၭနီၪ မိကဲၪထၪ့ၦအၭၡၧၫဖိၪအၦဒိၪ",
			"28": "<sup>28</sup> လီၫ.- တၭအဝ့ၫဒၪအၥုၭမု, ၦလၧအဘၪဆၧဝံထၪ့နၬ ထၪ့ဝ့ၫလၧအကျၩနီၪ, မွဲၦလံလၬလထီၫ့ယဲယၩလီၫ.",
			"29": "<sup>29</sup> ထီးနီၪလဖၧၫ့ စနၭၥလဲၫလဒီၪ့နီၪ, တၭစအံနၫ့အဖိၪ ခွၫစအဟဲရၫ့နီၪ မိကဲၪထၪ့ၦနၭၥလဲၫဖိၪအၦဒိၪလီၫ.",
			"30": "<sup>30</sup> တၭအဝ့ၫဒၪအၥုၭမု, ၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ",
			"31": "<sup>31</sup> လၧအကျၩနီၪ,မွဲၦယဲလၬၥၧၫ့ထီၫ့လံယၩလီၫ.- တၭ ကယဲၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ ဘၪဆဲၫ့လၧစဒၫ့ အၥုၪ့တဲၩအလးနီၪ မွဲလကုၬယဲလၬ နွ့ၫထီၫ့ဎူၫယၩ လီၫ. တၭအဝ့ၫၥံၪမိဘၪလ့ၩဝ့ၫ လၧအၥုၭဖိၪ အလၫ့ လဖၪလၧဆၧအလးခဲၫ့နီၪလီၫ.",
			"32": "<sup>32</sup> အဝ့ၫၥံၪနီၪ မွဲလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫလၧၦ အံၫစရ့လၭဖိၪအကျၩ ဘဲၫအဝ့ၫၥံၪအဖါလဖၪအဂံၪ့ အၥိၭနီၪလီၫ. ကယဲၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ ဘၪဆဲၫ့လၧဆၧၥုၪ့တဲၩအလးလဖၪထီးအလူၬ ဘဲၫအ ၥုၭမုလဖၪအၥိၭနီၪ မွဲၦဎူၫကုၬၥၧၫ့ထီၫ့ယဲယၩယဲဆံၫ",
			"33": "<sup>33</sup> လီၫ.- အ့ၪမွဲၦလံဝဲၫဖိၪ ဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫလၧၦ အံၫစရ့လၭဖိၪအကျၩအ့ၬး ဘဲၫယဟိဝၩမၪလူၬစမိစ့ၭ",
			"34": "<sup>34</sup> အၥိၭနီၪလီၫ.- တၭၦအံၫစရ့လၭဖိၪ မၩဝ့ၫဘဲၫကယဲ ဆၧလၧယဟိဝၩမၪလူၬစမိစ့ၭအၥိၭနီၪလီၫ. ၥုၪ့ထၪ့ အတဲၩလၧအၥုၭဖိၪ အလၫ့အနဲၩ့ထံၭနီၪ, ဒဲစဲၪ့ထၪ့ ဘဲၫနီၪ, ၦၡၩလဂၩဒဲလဂၩ ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭ, ဘဲၫအဝ့ၫၥံၪအဖါအဂံၪ့လဖၪအၥိၭ ဆုၬဆုၬလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> မုလနံၩလၧယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ လၧခိၪလီၩ့ စဲနၫအလီၩ့နီၪစအၫရၧၫ့ ဒဲစမိစ့ၭအဆၨၩအဆၬမွဲအ",
			"2": "<sup>2</sup> ယီၩ,- တၭအယီၩမွဲစအၫရၧၫ့အဖိၪခွၫလဖၪအမံၩ့,",
			"3": "<sup>3</sup> အဖိၪဝဲၡါစနၫဒၭ, ဒဲစအဘဲဟုၫ,ဒဲစအံၫလအ့ဇၧၫဒဲစ အံၥမၫလီၫ. အဝ့ၫၥံၪနီၪမွဲစအၫရၧၫ့အဖိၪခွၫ,ၦလုဆၧ လဖၪလၧအဒိၭဂုၪအၥၭ, လၧအအီၪက့ၪထၪ့အလး",
			"4": "<sup>4</sup> ဘဲၫၥိၭအမိမၩန့ၦလုဆၧ အဆၧမၩလဖၪလီၫ.- ထီးအ ဖ့ၪလၫ့မ့ၪလၩ့မဲၩဒၪဆၧ လၧယဟိဝၩအမ့ၬယၫတၭ, စနၫဒၭဒဲစအဘဲဟုၫၥံၫဝ့ၫ လၧယဟိဝၩအမ့ၬယၫလၧ ၡါမုနၧၩ့ဖၫစဲနၫတၭ, အဖိၪအလံၩအီၪအ့ၬ. စအံၫလ အ့ဇၧၫဒဲစအံၥမၫနီၪ မၩၦလုဆၧအဆၧမၩလၧအဖါစ အၫရၧၫ့အမ့ၬယၫလီၫ.",
			"5": "<sup>5</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ,စံၭဝ့ၫဒၪ, ဒုၭဂဲၫ ဘူၭၦလံဝဲၫဖိၫလဒီၪ့တၭအီၪက့ၪအဝ့ၫၥံၪ လၧၦလုဆၧ လဂၩစအၫရၧၫ့အမ့ၬယၫ, ဘဲၫၥိၭအဝ့ၫၥံၪမိမၩအခ့ၫ",
			"7": "<sup>7</sup> အၡၩအဆၧဆံၭ.- တၭအဝ့ၫၥံၪဘၪထီးလၩ့အၥၭလၧ အဆၧယိ, ဒဲဆၧအီၪကီၪ့ထီးအလူၬ,အဆၧယိလၧ ဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအမ့ၬယၫ, ဘဲၫၥိၭအမိမၩ",
			"8": "<sup>8</sup> တဲၩဆံၫ့ဎံၪအဆၧမၩလီၫ.- တၭအဝ့ၫၥံၪဘၪယိကယဲ ဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအဆၧဖိၪဆၧလံၩ, ဒဲၦအံၫ စရ့လၭဖိၪအဆၧယိဘဲၫၥိၭ အမိမၩတဲၩဆံၫ့ဎံၪအဎီး",
			"9": "<sup>9</sup> အၡၩအဆၧမၩလီၫ.- တၭနဘၪဖ့ၪလၫ့ၦလံဝဲၫဖိၪလၧစ အၫရၧၫ့, ဒဲလၧအဖိၪခွၫလဖၪလီၫ. ဆၧဖ့ၪလၫ့ဝ့ၫတၡါ",
			"10": "<sup>10</sup> လၧၦအံၫစရ့လၭဖိၪအကျၩလီၫ.- နမိဘၪအီၪက့ၪလၩ့ စအၫရၧၫ့ဒဲအဖိၪခွၫလဖၪတၭ, အဝ့ၫၥံၪဘၪထီးန့ဝ့ၫလၧ ၦလုဆၧအဆၧမၩလီၫ. တၭၦလခီၫဘၩ့မုးဖိၪ လၧအၥုၭ ဘူၭအၥၭနီၪ မိဘၪဆၧမၩၥံၫဝ့ၫလီၫ. ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭစံၭဝ့ၫဒၪ,",
			"11": "<sup>11</sup> ယဝ့ၫ ဒၪယီၩ, ယိခွါ, ယဝ့ၫဒၪယီၩယမၩန့ယူၭၦလံဝဲၫဖိၪ လၧၦအံၫစရ့လၭဖိၪအကျၩ လၧကယဲၦဝဲၡါ လၧအဝဲ ထၪ့ဒၧၩ့လးလၧၦအံၫစရ့လၭဖိၪအကျၩ ထီးအလူၬအ လးလီၫ. အခိးမွဲဘဲၫနီၪတၭ ၦလံဝဲၫဖိၪမိကဲၪထၪ့ယဆၧ",
			"13": "<sup>13</sup> လီၫ.- အဂဲးဘဲၫယီၩကယဲဆၧဝဲၡါနီၪမွဲယဆၧလီၫ. မု နံၩလၧယကျီၪ့ၥံၫခွံၬ ကယဲဆၧဝဲၡါလၧခးအံဇံၭအဖၧၩ့ နီၪ,ယအီၪက့ၪဆံၫ့ဎံၪ ကယဲဆၧဝဲၡါလၧၦအံၫစရ့လၭ ဖိၪအကျၩ, ၦၡၩမွဲဂ့ၩ, ဆၧဖိၪဆၧဎါလၧယဂးမွဲဂ့ၩ, အဝ့ၫၥံၪမိကဲၪထၪ့ယဆၧလီၫ. ယဝ့ၫဒၪယီၩ ယမွဲယ ဟိဝၩလီၫ.",
			"14": "<sup>14</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ လၧၡါမုနၧၫ့ဖၫစဲနၫတၭ,",
			"15": "<sup>15</sup> စံၭဝ့ၫဒၪ,- ဝံထၪ့နၬထၪ့ၦလံဝဲဖိၪ ဘဲၫအဖါလဖၪအဂံၪ့ အၥိၭ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪ အၥိၭနီၪဆံၭ. ကယဲၦခွၫ လၧအၥၭအီၪလၩလဘံၪ့ ဒဲအၪနဲၪ့အနီၪကိၭဂၩဒ့ၭ",
			"16": "<sup>16</sup> နီၪနမိဘၪဝံထၪ့နၬထၪ့ဝ့ၫလီၫ.- တၭစမိစ့ၭဝံထၪ့နၬထၪ့ ဝ့ၫဘဲၫယဟိဝၩအလူအၥိၭ, ဘဲၫဆၧမၪလူၬဝ့ၫ အၥိၭ",
			"17": "<sup>17</sup> နီၪလီၫ.- တၭအယီၩမွဲစလံဝဲၫအဖိၪခွၫလဖၪ ဘဲၫအမံၩ့ အီၪဝ့ၫအၥိၭနီၪလီၫ. စဂၧၡၧၫ့ဒဲစကိဟၭ, ဒဲစမရၫရဲၫ",
			"18": "<sup>18</sup> လီၫ.- အယီၩမွဲစဂၧၡၧၫ့အဖိၪခွၫအမံၩ့ ဘဲၫအဂံၪ့ဒီၪ့",
			"19": "<sup>19</sup> လဖၪအၥိၭနီၪ, စလံဘနဲၫ, ဒဲၡံမအဲၫလီၫ.- တၭစကိ ဟၭအဖိၪခွၫဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪ မွဲစအၫမရၫ့ ဒဲစအံၭဇဟၫ, ဒဲစဟံဘြၧၫ့, ဒဲစအၧၭဇအ့လၭလီၫ.",
			"20": "<sup>20</sup> တၭစမရၫရဲၫအဖိၪခွၫ ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪ, မွဲစမၫလံၫ, ဒဲစမုၡဲၫလီၫ. အယီၩမွဲၦလံဝဲၫဖိၪ အဂံၪ့",
			"21": "<sup>21</sup> ဒီၪ့လဖၪဘဲၫအဖါလဖၪအဂံၪ့အၥိၭနီၪလီၫ.- တၭၦလံ ဘနဲၫဖိၪအဂံၪ့ဒီၪ့, ဒဲၦၡံမအဲၫဖိၪအဂံၪ့ဒီၪ့နီၪ, ကဲၪ ထၪ့ဝ့ၫဘၪဆဲၫ့လၧစဂၧၡၧၫ့လီၫ. အနီၪမွဲၦဂၧၡၧၫ့ဖိၪ",
			"22": "<sup>22</sup> အဂံၪ့ဒီၪ့လဖၪလီၫ.- တၭၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ ဝ့ၫလၧအကျၩ, ဘဲၫအခွၫလၧအၥၭအီၪ လၩလဘံၪ့,ဒဲ အၪနဲၪ့အနီၪဘဲၫအဆၧဝံဆၧနၬအၥိၭနီၪ, ၦလၧအဘၪ ဆၧဝံထၪ့နၬထၪ့ဝ့ၫလၧအကျၩနီၪ, မွဲၦနွ့ၫထီၫ့ယဲယၩ",
			"23": "<sup>23</sup> လီၫ.- တၭၦဂၧၡၧၫ့ဖိၪအဂံၪ့ဒီၪ့လဖၪနီၪ ဘၪၥုၪ့အ",
			"24": "<sup>24</sup> တဲၩလၧတဲၩဆံၫ့ဎံၪ အချိၫ့လၧမုနုၬလခီၫလီၫ.- တၭၦ ဂၧၡၧၫ့ဖိၪအဖါအဂံၪ့ အၦဒိၪနီၪမွဲစလၫအ့ၫလၭအဖိၪ",
			"25": "<sup>25</sup> ခွၫစအံၫလဲၫအစၭလီၫ.- တၭစဂၧၡၧၫ့အဖိၪခွၫၥံၪအ ဆၧယိဘၪဆဲၫ့လၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪနီၪ, မွဲ ဆၧအီၪကီၪ့အလး, ဒဲတဲၩအဆၧချႃၬဘံၭ ဒဲဆၧလၩ့ ဆဲၩလၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪ အတရၫ့အဂး,",
			"26": "<sup>26</sup> ဒဲဝၩ့အဆၧလၩ့ဆဲၩ, ဒဲဆၧဒီၪ့ချႃၬဘံၭဆၧလၧဝၩ့အ တရၫ့အဂးလၧအအီၪလၧတဲၩဆံၫ့ဎံၪအနဲၩ့, ဒဲလၧဆၧ လုလးအနဲၩ့ဝၬဖီၩ့ဝ့ၫ, ဒဲအဖျံၩလဖၪ လၧအမၩဆၧ ထီးအလူၬအဂးလီၫ.",
			"27": "<sup>27</sup> တၭၦအၫမရၫ့ဖိၪအဂံၪ့ဒီၪ့, ဒဲၦအံၭဇဟၫဖိၪအဂံၪ့ ဒီၪ့,ဒဲၦဟံဘြၧၫ့ဖိၪအဂံၪ့ဒီၪ့, ဒဲၦအံၭဇအ့လၭဖိၪအဂံၪ့ ဒီၪ့နီၪဘၪဆဲၫ့လၧစကိဟၭလီၫ. အဝ့ၫၥံၪနီၪမွဲၦကိဟၭ",
			"28": "<sup>28</sup> အဂံၪ့ဒီၪ့လဖၪလီၫ.- တၭကယဲအဖိၪခွၫလဖၪဘၪဆၧ ဝံထၪ့နၬထၪ့လၧအၥၭအီၪလၩလဘံၪ့ ဒဲအၪနဲၪ့အနီၪ မွဲဎိၭထီၫ့ဎူၫယၩလီၫ. တၭအဝ့ၫၥံၪမွဲၦလၧအယိဆၧ",
			"29": "<sup>29</sup> ဘၪဆဲၫ့လၧဆၧအလးဆံၫ့ဎံၪအဆၧယိလီၫ.- တၭစ ကိဟၭအဖိၪခွၫၥံၪအဂံၪ့ဒီၪ့လဖၪနီၪ ဘၪၥုၪ့အတဲၩလၧ",
			"30": "<sup>30</sup> တဲၩဆံၫ့ဎံၪအနဲၩ့ထံၭ လၧမုခံၫ့လခီၫလီၫ.- တၭၦကိ ဟၭဖိၪအဖါအဂံၪ့ဒီၪ့လဖၪအၦဒိၪနီၪ မွဲစအၧၭဇအ့ လၭအဖိၪခွၫ စအလံၭဇဖၫ့လီၫ.",
			"31": "<sup>31</sup> တၭအဝ့ၫၥံၪအဆၧယိနီၪမွဲတလၫ,ဒဲစပွဲ, ဒဲမ့ၪဒိၩ့မိ ၡါ, ဒဲဆၧလုအလးလဖၪ, ဒဲဆၧအလးဆံၫ့ဎံၪအဆၧဖိၪ ဆၧလံၩလၧၦမၩအဆၧ လၧအဝ့ၫဒဲဆၧလၩ့ဆဲၩ, ဒဲက",
			"32": "<sup>32</sup> ယဲဆၧဘၪဆဲၫ့လၧအမၩဆၧထီးအလူၬ.- တၭၦလု ဆၧလဂၩစအၫရၧၫ့အဖိၪခွၫစအံၫလအ့ဇၧၫနီၪ မိကဲၪ ထၪ့ၦလံဝဲၫဖိၪအၦဒိၪလဖၪအခိၪလီၫ. ဒဲယိၦလၧအ ယိဆၧအလးဆံၫ့ဎံၪ အဆၧလီၫ.",
			"33": "<sup>33</sup> တၭၦမၫလံၫဖိၪအဂံၪ့ဒီၪ့, ဒဲၦမုၡံၫဖိၪ အဂံၪ့ဒီၪ့နီၪ ဘၪဆဲၫ့လၧစမရၫရဲၫလီၫ. အဝ့ၫၥံၪနီၪမွဲစမရၫရဲၫ အ",
			"34": "<sup>34</sup> ဂံၪ့ဒီၪ့လဖၪလီၫ.- တၭၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ ဝ့ၫ,ဘဲၫကယဲၦခွၫလၧအၥၭအီၪ လၩလဘံၪ့ဒဲအၪနဲၪ့ အနီၪထီးအလူၬ, ဘဲၫအဆၧဝံထၪ့နၬထၪ့ဝ့ၫအၥိၭနီၪ",
			"35": "<sup>35</sup> မွဲဎူၫထီၫ့နံၫယၩလီၫ.- တၭၦမရၫရဲၫဖိၪအဖါအဂံၪ့ ဒီၪ့လဖၪအၦဒိၪနီၪ မွဲစအဘဲၫဟလၭအဖိၪခွၫ စဇုၫရ အ့လၭလီၫ. အဝ့ၫၥံၪနီၪဘၪၥုၪ့အတဲၩ လၧတဲၩဆံၫ့",
			"36": "<sup>36</sup> ဎံၪအနဲၩ့ထံၭလၧမုဖၩလခီၫလီၫ.- တၭစမရၫရဲၫအ ဖိၪခွၫအဆၧပၧၩ့ဆၧယိဆၧနီၪ မွဲတဲၩဆံၫ့ဎံၪအၥံၪ့ပၪ, ဒဲအနိၪဘီၩ့ ဒဲအထုၪ့လဖၪ, ဒဲအခၪ့ဖုၪ့လဖၪ, ဒဲအဆၧ",
			"37": "<sup>37</sup> ဖိၪဆၧလံၩထီးအလူၬ,- တၭကယဲဆၧဘၪဆဲၫ့လၧအ ဆၧမၩ, ဒဲဆၧဝၩ့ဝၬဖီၩ့နီၪအထုၪ့လဖၪ, ဒဲအခၪ့ဖျၪ့လ ဖၪ, ဒဲအနိၪစဲၩၥံၪ, ဒဲအဖျံၩလဖၪလီၫ.",
			"38": "<sup>38</sup> အ့ၪမွဲၦလၧအၥုၪ့အတဲၩ လၧတဲၩဆံၫ့ဎံၪ မုထၪ့လ ခီၫ, လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အမ့ၬယၫမုထၪ့လ ခီၫနီၪမိမွဲစမိစ့ၭဒဲစအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪလီၫ. အ ဝ့ၫၥံၪမိယိဆၧအလးဆံၫ့ဎံၪ အဆၧယိ လၧၦအံၫစရ့ လၭဖိၪအဆၧယိအဂးလီၫ. တၭၦလခီၫဘၩ့မုးဖိၪလၧ",
			"39": "<sup>39</sup> အၥုၭဘူၭအၥၭနီၪမိဘၪဆၧမၩၥံၫဝ့ၫလီၫ.- တၭကယဲ ၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧၦလံဝဲၫဖိၪအကျၩ, လၧစမိစ့ၭ, ဒဲစအၫရၧၫ့ဝံထၪ့နၬထၪ့ဝ့ၫ ဘဲၫအဝ့ၫၥံၪအ ၥိၭလၧယဟိဝၩအဆၧမၪလူၬ ကယဲၦခွၫလၧအၥၭအီၪ လၩလဘံၪ့ဒဲအၪနဲၪ့အနီၪ မွဲနံၫလၬနံၫထီၫ့လီၫ.",
			"40": "<sup>40</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, ဝံထၪ့နၬထၪ့ကယဲၦခွၫဝဲၡါ လၧအံၫစရ့လၭဖိၪအကျၩ လၧအအီၪလၩလဘံၪ့ဒဲအၪ",
			"41": "<sup>41</sup> နဲၪ့အနီၪတၭ, မၩန့အမံၩ့အဆၧဝံထၪ့နၬထၪ့ဆံၭ.- တၭ နဘၪမၩန့ ၦလံဝဲၫဖိၪလၧယဂး, (ယဝ့ၫဒၪယီၩယမွဲ ယဟိဝၩ,) လၧကယဲၦဝဲၡါ လၧၦအံၫစရ့လၭဖိၪအ ကျၩအလး ဒဲၦလံဝဲၫဖိၪအဆၧဖိၪဆၧဎါအဒိၩ့လဖၪ လၧကယဲဆၧဝဲၡါ လၧၦအံၫစရ့လၭဖိၪအဆၧဖိၪဆၧ",
			"42": "<sup>42</sup> ဎါအဒိၩ့ၥံၪအလးလီၫ.- တၭစမိစ့ၭဝံထၪ့နၬထၪ့ကယဲ ၦဝဲၡါလၧအံၫစရ့လၭဖိၪအကျၩ, ဘဲၫယဟိဝၩမၪလူၬ",
			"43": "<sup>43</sup> ဝ့ၫအၥိၭနီၪလီၫ.- တၭကယဲၦခွၫဝဲၡါ လၧအမံၩ့အဆၧ ဝံထၪ့နၬထၪ့လၧအအီၪလၩလဘံၪ့ ဒဲအၪနဲၪ့အနီၪ,ဆၧ ဝံထၪ့နၬထၪ့အီၪဝ့ၫနံၫလၬနံၫထီၫ့နံၫယၩနွ့ၫဆံၫၥၧၫ့ဂၩ",
			"44": "<sup>44</sup> လီၫ.- ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,",
			"45": "<sup>45</sup> မၩန့ၦလံဝဲၫဖိၪ လၧကယဲၦဝဲၡါ လၧၦအံၫစရ့လၭဖိၪ အကျၩအလး, ဒဲၦလံဝဲၫဖိၪအဆၧဖိၪဆၧဎါအဒိၩ့လၧ",
			"46": "<sup>46</sup> အဝ့ၫၥံၪအဆၧဖိၪဆၧဎါအဒိၩ့အလးဆံၭ.- ၦလံဝဲၫ ဖိၪၥံၪမွဲယဆၧတၭး ယမွဲယဟိဝၩလီၫ. တၭၦဝဲၡါလၧ ၦအံၫစရ့လၭဖိၪအကျၩ အၪနဲၪ့ၦလံဝဲၫဖိၪလၧအမိဒိၭ",
			"47": "<sup>47</sup> ဆၧဎွ့ၩန့ထဲၩ့ဝ့ၫၦနံၫယၩနွ့ၫဆံၫၥၧၫ့ဂၩနီၪ,- နမိဘၪ မၩန့လၧအဂးယဲၡက့လၭ ဘဲၫအခိၪလဖၪအၥိၭနီၪ လီၫ. ဘဲၫဆၧအလးဆံၫ့ဎံၪအၡက့လၭ အၥိၭနီၪလီၫ.",
			"48": "<sup>48</sup> (ၡက့လၭလဘံၪ့နီၪ မွဲဂ့ရၫအဘံၪ့နံၫဆံၫလီၫ.)- တၭ စ့ၩလၧအဎွ့ၩန့ထဲၩ့ ၦလၧအအီၪအၪလါကဲၪကၩနီၪန",
			"49": "<sup>49</sup> ဘၪဖ့ၪလၫ့ဝ့ၫလၧစအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪလီၫ.- တၭ ၦလၧအအီၪအၪနဲၪ့ ၦလၧအဒိၭဆၧဎွ့ၩန့ထဲၩ့ဝ့ၫလၧ ၦလံဝဲၫဖိၪနီၪ စမိစ့ၭမၩန့ အဆၧအဎွ့ၩန့ ထဲၩ့အစ့ၩ",
			"50": "<sup>50</sup> လီၫ.- မၩန့စ့ၩလၧၦဝဲၡါလၧၦအံၫစရ့လၭဖိၪအကျၩ, စ့ၩလထီၫ့ၥၧၫ့ယၩဎူၫဆံၫယဲၡက့လၭ, ဘဲၫဆၧအလး",
			"51": "<sup>51</sup> ဆံၫ့ဎံၪအၡက့လၭအၥိၭနီၪလီၫ.- တၭစမိစ့ၭဖ့ၪလၫ့ၦ လၧအဘၪဆၧဎွ့ၩန့ထဲၩ့အစ့ၩ လၧစအၫရၧၫ့ဒဲအဖိၪ ခွၫလဖၪ, ဘဲၫယဟိဝၩအလူအၥိၭ, ဘဲၫယဟိဝၩမၪ လူၬစမိစ့ၭအၥိၭနီၪလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ, ဒဲစအၫရၧၫ့တၭ, စံၭ",
			"2": "<sup>2</sup> ဝ့ၫဒၪ,- ဝံထၪ့နၬထၪ့စကိဟၭအဖိၪခွၫၥံၪ လၧစလံဝဲၫ အဖိၪခွၫလဖၪအကျၩ, ဘဲၫအဝ့ၫၥံၪအဂံၪ့ဒီၪ့ လဖၪ",
			"3": "<sup>3</sup> အၥိၭ, ဘဲၫအဖါလဖၪအဂံၪ့အၥိၭနီၪ,- လၧအၥၭၡါ အနံၪ့ၥၧၫ့ဆံၫဒဲအၪနဲၪ့အနီၪဖိးလၧအနံၪ့ယဲဆံၫ ကယဲ ၦလၧအလ့ၩနုၬ လၧၦၥုၭမုအကျၩဘဲၫၥိၭအမိမၩဆၧ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪဖၧၩ့နီၪဆံၭ.",
			"4": "<sup>4</sup> အယီၩမွဲစကိဟၭအဖိၪခွၫလဖၪ အဆၧမၩလၧဆၧ အီၪကီၪ့အတဲၩဆံၫ့ဎံၪဖၧၩ့နီၪ ဘၪဆဲၫ့ လၧဆၧဆံၫ့",
			"5": "<sup>5</sup> ဎံၪထုၬလဖၪနီၪလီၫ.- ထီးၦခမျၧးစဲၪ့ထၪ့တၭ, စအၫ ရၧၫ့ဒဲအဖိၪခွၫၥံၪမိဘၪဂဲၫတၭ, အဝ့ၫၥံၪမိဘၪရိလၩ့ ခွံၬဆၧချႃၬဘံၭအဆၧဒီၪ့, ဒဲချႃၬဘံၭဆၧအုၩ့လၩ့အ",
			"6": "<sup>6</sup> တလၫလၧဆၧနီၪလမံၩ့လီၫ.- တၭမွဲအဘၪအီၪက့ၪ ဆၧချႃၬဘံၭ တဟၫၡၭအဖံၭလၧအဖၫ့ခိၪတၭ, ဘၪ ဒၩလၩ့ဖၬဘဲၩ့အလၫထၧၫ့ဘံၪ့ယၫ လဘံၪ့ လၧအဖၫ့",
			"7": "<sup>7</sup> ခိၪဒဲအီၪက့ၪအနိၪယိၭဘီၩ့လီၫ.- တၭဘၪဒၩလၩ့ဖၬ ဘဲၩ့အလၫလၧဆၧမ့ၬယၫ အကိၪအစပွဲအလီၩ့, ဒဲအီၪ က့ၪထွ့ၫပၪပဲၪလဖၪ, ဒဲနိၪထိၩ့လဖၪ, ဒဲလိၫ့လဖၪ, ဒဲ ဆၧချႃၬဘံၭလၧအချႃၬဘံၭဆၧလၧအဝ့ၫလဖၪ, ဒဲကိၪ",
			"8": "<sup>8</sup> လထံၪဎးဘီၩ့ဎးဘၪအီၪလၧအလီၩ့လီၫ.- ဘၪဒၩလၩ့ ဖၬဘဲၩ့အဝီၩ လၧအဖၫ့ခိၪတၭ, ချႃၬဘံၭဝ့ၫလၧဆၧ ချႃၬဘံၭတဟၫၡၭအဖံၭ, အီၪက့ၪအနိၪယိၭဘီၩ့လီၫ.",
			"9": "<sup>9</sup> ဘၪမၩန့ဖၬဘဲၩ့အလၫတၭ, ချႃၬဘံၭဆၧဖၩ့အမ့ၪဒိၩ့ မိၡါ, ဒဲအမ့ၪဒိၩ့ၥံၪ,ဒဲအဆၧထံၬန့မ့ၪ, ဒဲၥိၪအဖီၩ့လ",
			"10": "<sup>10</sup> ဖၪလၧအမၩဆၧလၧအဝ့ၫလီၫ.- တၭဘၪအီၪက့ၪဝ့ၫ လၧဆၧဖိၪဆၧလံၩ ထီးအလူၬလၧဆၧချႃၬဘံၭ တ ဟၫၡၭအဖံၭအဖၧၩ့တၭ, အီၪက့ၪဝ့ၫလၧယိဆၧအ",
			"11": "<sup>11</sup> ဖၫ့ခိၪလီၫ.- ဘၪဒၩလၩ့ဖၬဘဲၩ့အလၫလၧဆၧလုလး ထီၫ့အဖၫ့ခိၪတၭ, ချႃၬဘံၭဝ့ၫလၧဆၧချႃၬဘံၭတဟၫ",
			"12": "<sup>12</sup> ၡၭအဖံၭတၭ, အီၪက့ၪနိၪယိၭဘီၩ့ၥံၪလီၫ.- တၭအဝ့ၫ ၥံၪဘၪမၩန့ကယဲဆၧဖိၪဆၧလံၩ လၧအမၩဆၧလၧအ ဝ့ၫလၧဆၧအလးဆံၫ့ဎံၪအဖၧၩ့နီၪ, အီၪက့ၪဝ့ၫလၧ ဆၧလၫအဖၧၩ့တၭ, ချႃၬဘံၭဝ့ၫ လၧဆၧချႃၬဘံၭတ ဟၫၡၭအဖံၭ, တၭအီၪက့ၪလၩ့ဝ့ၫလၧနိၪယိၭဘီၩ့အ",
			"13": "<sup>13</sup> လီၩ့လီၫ.- တၭအဝ့ၫၥံၪဘၪမၩန့ခွံၬဖံၫ့ချၪလၧဆၧလု လးအဖၫ့ခိၪ, ဒဲဒၩလၩ့ဖၬဘဲၩ့အလၫလၧအဖၫ့ခိၪလီၫ.",
			"14": "<sup>14</sup> တၭလၧအဖၫ့ခိၪနီၪ မိဘၪအီၪက့ၪကယဲအဆၧဖိၪဆၧ လံၩလၧအမၩအဆၧလၧအဝ့ၫ, ဖၧၩ့မ့ၪလဖၪ, နိၪပုၭ ယၪလဖၪ, ဒဲအဆွးလဖၪးဒဲလိၫ့လဖၪ,ဒဲကယဲဆၧလု လးအဆၧဖိၪ ဆၧလံၩထီးအလူၬလီၫ. တၭဘၪဒၩ လၩ့ဆၧချႃၬဘံၭတဟၫၡၭအဖံၭ လၧအဖၫ့ခိၪတၭ",
			"15": "<sup>15</sup> အီၪက့ၪနိၪယိၭဘီၩ့လီၫ.- ထီးစအၫရၧၫ့ ဒဲအဖိၪခွၫ လဖၪချႃၬဘံၭဆၧအလးဆံၫ့ဎံၪ, ဒဲကယဲဆၧအလး ဆံၫ့ဎံၪအဆၧဖိၪဆၧလံၩထီးအလူၬဂီၩ့တၭ, ထီးၦခ မျၧးမိလ့ၩဆၧတၭ, လၧဆၧနီၪအလးခဲၫ့ စကိဟၭအ ဖိၪခွၫလဖၪဘၪဂဲၫဘဲၫၥိၭအမိဆိၬဝ့ၫလီၫ. မွဲလါနၫ့အ ဝ့ၫၥံၪထိၭဘၪဆၧဆံၫ့ဎံၪအ့ၬ. မွဲအမိၥံၫဘၪခိၬလီၫ. ဆၧလဖၪနီၪမွဲစကိဟၭအဖိၪခွၫ လဖၪအဆၧယိၭလၧ ဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪဖၧၩ့လီၫ.",
			"16": "<sup>16</sup> တၭၦလုဆၧလဂၩ စအၫရၧၫ့အဖိၪခွၫစအံၫလအ့ ဇၧၫအဆၧမၩနီၪ မွဲဆၧမၩဘၪဆဲၫ့လၧၥိၪလၧဆၧဖၩ့ အဂး, ဒဲဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ, ဒဲဆၧမၩဘိၪ့ကိၪမုၬၥံၫ့ၥံၫ့ နံၩ, ဒဲၥိၪဂုၪဆၧ, ဆၧယိတဲၩဆံၫ့ဎံၪထၧၫ့ဖျိၪ့ယၫ, ဒဲ ကယဲဆၧအီၪလၧအဖၧၩ့ လၧဆၧအလးဆံၫ့ဎံၪအဖၧၩ့, ဒဲလၧအဆၧဖိၪဆၧလံၩအဖၧၩ့နီၪလီၫ.",
			"17": "<sup>17</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ, ဒဲစအၫရၧၫ့တၭစံၭဝ့ၫ",
			"18": "<sup>18</sup> ဒၪ,- ထီးဒၪ့ထ့ၬခွံၬ ၦကိဟၭဖိၪ အဂံၪ့ဒီၪ့ၥံၪလဆၨၩ",
			"19": "<sup>19</sup> လၧၦလံဝဲၫဖိၪအကျၩနီၪလဂ့ၩ.- အ့ၪမွဲမၩအဝ့ၫၥံၪဘဲၫ ယီၩ, ထီးအၥုၭဘူၭအၥၭ လၧဆၧဆံၫ့ဎံၪထုၬလဖၪ တၭ,ဘဲၫၥိၭအမိမၧၫ့ဝ့ၫဒဲထီးၥံၫလဂ့ၩတၭ, စအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪ ဘၪလ့ၩနုၬ ဒဲအီၪက့ၪအဝ့ၫၥံၪလဂၩ လၧအဆၧမၩ, ဒဲလဂၩလၧအဆၧယိၭဆုၬဆုၬလီၫ.",
			"20": "<sup>20</sup> အ့ၪမွဲထီးဆၧဆံၫ့ဎံၪ ဘၪဆၧချႃၬဘံၭဝ့ၫ အဘိၩ့ဘၭ နီၪလ့ၩနုၬယိဘၪဝ့ၫအ့ၬ, မိၥံၫဘၪခိၬလီၫ.",
			"21": "<sup>21</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ဝံထၪ့ နၬထၪ့စဂၧၡၧၫ့အဖိၪခွၫဆ့ ဘဲၫအဖါလဖၪအဂံၪ့အၥိၭ,",
			"23": "<sup>23</sup> ဘဲၫအဝ့ၫၥံၪအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪဆံၭ.- လၧအၥၭ ၡါအနံၪ့ၥၧၫ့ဆံၫဒဲအၪနဲၪ့အနီၪ ဖိးလၧအနံၪ့ယဲဆံၫနီၪ, နဘၪဝံထၪ့နၬထၪ့ဝ့ၫ ကယဲၦလၧအလ့ၩနုၬလၧအမိ မၩဆၧလၧၦခမျၧးအဂးနီၪ, ဘဲၫၥိၭအမိမၩဆၧအီၪ",
			"24": "<sup>24</sup> ကီၪ့အတဲၩဆံၫ့ဎံၪ အဎီးအၡၩအဆၧမၩလီၫ.- အယီၩ မွဲစဂၧၡၧၫ့အဖိၪခွၫၥံၪအဂံၪ့ဒီၪ့လဖၪ အဆၧမၩလၧအ",
			"25": "<sup>25</sup> မိမၩဆၧ,ဒဲယိဆၧလီၫ.- တၭအဝ့ၫၥံၪဘၪယိတဲၩဆံၫ့ ဎံၪအဒီၪ့,ဒဲဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အဆၧချႃၬဘံၭ တဟၫၡၭအဖံၭလၧအအီၪလၧအဖၫ့ခိၪ, ဒဲဆၧဒီၪ့လၩ့ ဆဲၩလၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အတရၫ့အဂး,",
			"26": "<sup>26</sup> ဒဲလၧဝၩ့ အဆၧဒီၪ့လၩ့ဆဲၩလဖၪ, ဒဲဆၧဒီၪ့ချႃၬဘံၭ ဆၧလၧဝၩ့အတရၫ့ခိၪထိၭအဂး လၧအအီၪလၧတဲၩ ဆံၫ့ဎံၪဒဲဆၧလုအလး,ဒဲဝၬဖီၩ့ဝ့ၫ, ဒဲအဖျံၩလဖၪ,ဒဲက ယဲအဆၧဖိၪဆၧလံၩဘၪဆဲၫ့လၧအဆၧမၩ, ဒဲကယဲ ဆၧလၧဆၧမၩဝ့ၫအလးနီၪ, အဝ့ၫၥံၪမိဘၪမၩဝ့ၫလီၫ.",
			"27": "<sup>27</sup> ဘဲၫစအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪအနိၭအီၪဝ့ၫအၥိၭနီၪ, မိကဲၪထၪ့ကယဲၦဂၧၡၧၫ့ဖိၪအဖိၪခွၫၥံၪအဆၧမၩ, လၧ ကယဲအဆၧယိ,ဒဲလၧကယဲအဆၧမၩလီၫ. တၭနၥံၪ ဘၪအီၪက့ၪဝ့ၫလၧအဆၧယိၭ ဒဲအဆၧယိအလးနီၪ",
			"28": "<sup>28</sup> ထီးအလူၬအဖၧၩ့လီၫ.- အနီၪမွဲစဂၧၡၧၫ့အဖိၪခွၫၥံၪ အဂံၪ့ဒီၪ့လဖၪအဆၧမၩ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ ဎံၪဖၧၩ့လီၫ. တၭအဆၧယိနီၪအီၪဝ့ၫလၧၦလုဆၧလ ဂၩစအၫရၧၫ့အဖိၪခွၫ စအံၥမၫအစူၪဖၧၩ့လီၫ.",
			"29": "<sup>29</sup> စမရၫရဲၫအဖိၪခွၫလဖၪနီၪ နဘၪဝံထၪ့နၬထၪ့ဝ့ၫ ဘဲၫအဝ့ၫၥံၪအဂံၪ့ဒီၪ့လဖၪအၥိၭ ဘဲၫအဖါလဖၪအဂံၪ့",
			"30": "<sup>30</sup> အၥိၭနီၪလီၫ.- လၧအၥၭၡါအနံၪ့ၥၧၫ့ဆံၫဒဲအၪနဲၪ့အ နီၪဖိးလၧအနံၪ့ယဲဆံၫနီၪ နဘၪဝံထၪ့နၬထၪ့ဝ့ၫ, ကယဲ ၦလၧအလ့ၩနုၬ လၧအမိမၩဆၧ လၧၦခမျၧးအဂးနီၪ, ဘဲၫၥိၭအမိမၩဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪအဎီးအၡၩ",
			"31": "<sup>31</sup> အဆၧမၩလီၫ.- တၭအယီၩမွဲဆၧယိၭအဆၧယိအလး, ဘဲၫကယဲအဆၧမၩလၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪဖၧၩ့ အၥိၭနီၪ, တဲၩဆံၫ့ဎံၪအၥံၪ့ပၪလဖၪ, ဒဲအနိၪယိၭဘီၩ့",
			"32": "<sup>32</sup> လဖၪ,ဒဲအထုၪ့လဖၪ, ဒဲအခၪ့ဖျၪ့လဖၪ,- ဒဲဝၩ့ဝၬဖီၩ့ ဝ့ၫအထုၪ့လဖၪ, ဒဲအခၪ့ဖျၪ့လဖၪဒဲအနိၪစဲၩလဖၪ,ဒဲအ ဖျံၩလဖၪ, ဒဲအဆၧဖိၪဆၧလံၩထီးအလူၬ, ဒဲဆၧဘၪ ဆဲၫ့လၧအမၩဆၧ ထီးအလူၬလီၫ. တၭနၥံၪမိဘၪဝံ ထၪ့နၬထၪ့အဆၧယိၭအလး အဆၧဖိၪဆၧလံၩနီၪလၧ",
			"33": "<sup>33</sup> အမံၩ့လဖၪလီၫ.- အဝ့ၫနီၪမွဲစမရၫရဲၫ အဖိၪခွၫၥံၪအ ဂံၪ့ဒီၪ့လဖၪအဆၧမၩ, ဘဲၫကယဲအမၩဆၧ လၧဆၧ အီၪကီၪ့အတဲၩဆံၫ့ဎံၪအဖၧၩ့အၥိၭ, လၧၦလုဆၧလ ဂၩစအၫရၧၫ့အဖိၪခွၫ စအံၥမၫအစူၪဖၧၩ့လီၫ.",
			"34": "<sup>34</sup> တၭစမိစ့ၭဒဲစအၫရၧၫ့, ဒဲဆၧအီၪကီၪ့အၦဒိၪလဖၪ, ဝံထၪ့နၬထၪ့ၦကိဟၭဖိၪ ဘဲၫအဝ့ၫၥံၪအဂံၪ့ဒီၪ့လဖၪအ",
			"35": "<sup>35</sup> ၥိၭ, ဒဲဘဲၫအဖါလဖၪအဂံၪ့အၥိၭ,- လၧအၥၭၡါအနံၪ့ ၥၧၫ့ဆံၫဒဲအၪနဲၪ့အနီၪ ဖိးလၧအနံၪ့ယဲဆံၫ, ကယဲၦလၧ အလ့ၩနုၬ လၧအမိမၩဆၧလၧၦခမျၧးအဂးနီၪ ဘဲၫၥိၭ အမိမၩဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪအဎီးအၡၩ အဆၧ",
			"36": "<sup>36</sup> မၩ,- ဆၧဝံထၪ့နၬထၪ့ဝ့ၫ ဘဲၫအဒီၪ့လဖၪအၥိၭနီၪ, ၦနံၫ",
			"37": "<sup>37</sup> ထီၫ့နွ့ၫယၩယဲဆံၫလီၫ.- အဝ့ၫၥံၪနီၪမွဲၦလၧအဘၪဆၧ ဝံထၪ့နၬထၪ့ဝ့ၫ လၧၦကိဟၭဖိၪအဂံၪ့ဒီၪ့လဖၪအကျၩ, ကယဲၦလၧအမိမၩဆၧလၧ ဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ ဖၧၩ့, လၧစမိစ့ၭ ဒဲစအၫရၧၫ့ဝံထၪ့နၬထၪ့ဝ့ၫ ဘဲၫယဟိ ဝၩ အဆၧမၪလူၬအီၪဝ့ၫအၥိၭ လၧစမိစ့ၭ အစူၪဖၧၩ့ လီၫ.",
			"38": "<sup>38</sup> တၭၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧစဂၧၡၧၫ့အ ဖိၪခွၫၥံၪအကျၩ ဘဲၫအဝ့ၫၥံၪ အဂံၪ့ဒီၪ့လဖၪအၥိၭ,",
			"39": "<sup>39</sup> ဒဲဘဲၫအဖါလဖၪအဂံၪ့အၥိၭ,- လၧအၥၭၡါအနံၪ့ၥၧၫ့ ဆံၫ,ကယဲၦလၧအလ့ၩနုၬ လၧအမိမၩဆၧလၧၦခမျၧး အဂးနီၪ, ဘဲၫၥိၭအမိမၩဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအ",
			"40": "<sup>40</sup> ဎီးအၡၩအဆၧမၩ,- ဆၧဝံထၪ့နၬထၪ့ဝ့ၫဘဲၫအဒီၪ့လ ဖၪအၥိၭ, ဘဲၫအဖါလဖၪအဂံၪ့ဒီၪ့အၥိၭနီၪ, ၦနံၫထီၫ့",
			"41": "<sup>41</sup> ဎူၫယၩၥၧၫ့ဆံၫလီၫ.- အဝ့ၫၥံၪနီၪ မွဲၦလၧအဘၪဆၧ ဝံထၪ့နၬထၪ့ဝ့ၫ လၧစဂၧၡၧၫ့အဖိၪခွၫၥံၪအဂံၪ့ဒီၪ့လ ဖၪအကျၩ, ကယဲၦလၧအမၩဆၧ လၧဆၧအီၪကီၪ့အ တဲၩဖၧၩ့, လၧစမိစ့ၭဒဲစအၫရၧၫ့ဝံထၪ့နၬထၪ့ဝ့ၫ,ဘဲၫယ ဟိဝၩအဆၧမၪလူၬ အၥိၭနီၪလီၫ.",
			"42": "<sup>42</sup> တၭၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧစမရၫရဲၫ အဖိၪခွၫၥံၪအဂံၪ့ဒီၪ့လဖၪအကျၩ, ဘဲၫအဝ့ၫၥံၪအဂံၪ့",
			"43": "<sup>43</sup> ဒီၪ့လဖၪအၥိၭ, ဘဲၫအဖါလဖၪအဂံၪ့အၥိၭ,- လၧအ ၥၭၡါအနံၪ့ၥၧၫ့ဆံၫဒဲအၪနဲၪ့အနီၪ ဖိးလၧအနံၪ့ယဲဆံၫ ကယဲၦလၧအလ့ၩနုၬ လၧအမိမၩဆၧလၧၦခမျၧးအ ဂးနီၪ, ဘဲၫၥိၭအမိမၩဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪအ",
			"44": "<sup>44</sup> ဎီးအၡၩအဆၧမၩ,- ဆၧဝံထၪ့နၬထၪ့ဝ့ၫဘဲၫအဝ့ၫၥံၪ",
			"45": "<sup>45</sup> အဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪ, ၦၥၧၫ့ထီၫ့နံၫယၩလီၫ.- အဝ့ၫ ၥံၪနီၪမွဲၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ လၧစမရၫရဲၫအ ဖိၪခွၫၥံၪအဂံၪ့ဒီၪ့လဖၪအကျၩ, လၧစမိစ့ၭဒဲစအၫရၧၫ့ ဝံထၪ့နၬထၪ့ဝ့ၫ, ဘဲၫယဟိဝၩအလူအၥိၭလၧစမိစ့ၭအ စူၪဖၧၩ့နီၪလီၫ.",
			"46": "<sup>46</sup> ကယဲၦလၧအဘၪ ဆၧဝံထၪ့နၬထၪ့ဝ့ၫလၧၦလံဝဲၫဖိၪ အကျၩ လၧစမိစ့ၭဒဲစအၫရၧၫ့ဒဲၦအံၫစရ့လၭအၦဒိၪ လဖၪဝံထၪ့နၬထၪ့ဝ့ၫဘဲၫအဝ့ၫၥံၪ အဂံၪ့ဒီၪ့လဖၪအၥိၭ,",
			"47": "<sup>47</sup> ဘဲၫအဖါလဖၪအဂံၪ့အၥိၭ,-",
			"48": "<sup>48</sup> လၧအၥၭၡါအနံၪ့ၥၧၫ့ ဆံၫဒဲအၪနဲၪ့အနီၪ, ဖိးလၧအနံၪ့ယဲဆံၫကယဲၦလၧအ လ့ၩနုၬလၧအမိမၩဆၧအဎီးအၡၩအဆၧမၩ, ဒဲယိၭ ဆၧအဆၧမၩလၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪအဖၧၩ့နီၪ, ဆၧဝံထၪ့နၬထၪ့ ၦဎိၭထီၫ့ယဲယၩဎိၭဆံၫလီၫ.",
			"49": "<sup>49</sup> ဘဲၫယဟိဝၩအဆၧမၪလူၬအၥိၭ အဝ့ၫၥံၪဘၪဆၧ ဝံထၪ့နၬထၪ့ဝ့ၫလၧစမိစ့ၭအစူၪဖၧၩ့, ထီးဒၪၦဘဲၫအ ဆၧမၩအၥိၭ, ဘဲၫအယိဆၧအၥိၭဆုၬဆုၬလီၫ. အ ဝ့ၫၥံၪဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ ဘဲၫယဟိဝၩမၪလူၬ စမိ စ့ၭအၥိၭနီၪလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ,စံၭဝ့ၫဒၪ, မၪလူၬ ၦအံၫစရ့လၭဖိၪ လၧအမိဒုၭစဲၪ့ထၪ့ခွံၬ ၦခံၫထူၬဆၫ အၧၩ့,ဒဲကယဲၦလၧအအီၪ လၧဆၧဖၧၩ့လးယွၩလၩ့ဝ့ၫ, ဒဲကယဲၦလၧအလဆံၫ့ဘၪ လၧဆၧၥံၫအကၠီၩ့ လဂၩ",
			"3": "<sup>3</sup> လါလါလၧၦၥုၪ့တဲၩအလးဖၧၩ့နီၪဆံၭ.- ၦခွၫဒဲၦမုၪ နီၪဆ့နၥံၪဘၪဒုၭစဲၪ့ထၪ့ဝ့ၫ လၧၦၥုၪ့တဲၩအလးဖၧၩ့ လၧခီၫ့လခီၫဘဲၫၥိၭ အထီးမၩၥၭလိၪၦၥုၪ့တဲၩအလး",
			"4": "<sup>4</sup> လဖၪလၧယအီၪအကျၩလဂ့ၩလီၫ.- ၦအံၫစရ့လၭဖိၪ မၩဘဲၫနီၪတၭ, ဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧၦၥုၪ့တဲၩအလး လၧခီၫ့လခီၫလီၫ. ဘဲၫယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭၦ အံၫစရ့လၭဖိၪမၩဝ့ၫ ဘဲၫနီၪအၥိၭလီၫ.",
			"5": "<sup>5</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, စံၭၦ အံၫစရ့လၭဖိၪ, ထီးၦခွၫမွဲဂ့ၩ, ၦမုၪမွဲဂ့ၩ,မၩမၪယ ဟိဝၩလၧဆၧလဖၪလမံၩ့မံၩ့ လၧၦၡၩအဆၧဒဲၩဘၭ ထီးအလူၬအကျၩတၭ, အဆၧဒဲၩဘၭအ့ၪအီၪတၭ,",
			"7": "<sup>7</sup> အဝ့ၫၥံၪမိဘၪလီၩလၩ့ အဆၧမၪလၧအမၩဘၪဝ့ၫ တၭ,မိဘၪဖ့ၪထဲၩ့လၧအဆၧမၪအကၠီၩ့, လၧနီၪအမ့ၬ ယၫ,အီၪက့ၪအၪထၪ့ယဲပိၩ့လပိၩ့တၭ, မိဘၪဖ့ၪထဲၩ့",
			"8": "<sup>8</sup> ဝ့ၫလၧၦလၧအမၩမၪဘၪဝ့ၫလဂၩနီၪလီၫ.- အ့ၪမွဲၦလ ဂၩနီၪအၡၩဎွ့ၩထဲၩ့ဆၧလၧအမိဒိၭန့ဆၧ လၧဆၧမၪ အကၠီၩ့, အ့ၪလအီၪဘၪတၭ မွဲအဖ့ၪထဲၩ့ဆၧလၧဆၧ မၪအကၠီၩ့ လၧယဟိဝၩ လၧၦလုဆၧ လဂၩနီၪဆံၭ. လၧနီၪအမ့ၬယၫဘၪဖ့ၪလၫ့ဒံၭၥိၪဖၫလဒုၩ လၧဆၧမၩ ဖီၩ့ဖျ့ၭအဂး, ဘဲၫၥိၭအမိမၩဖီၩ့ဖျ့ၭဆၧလၧအဝ့ၫနီၪအ",
			"9": "<sup>9</sup> ဂးလီၫ.- တၭကယဲဆၧလုဝံဝါဝ့ၫ ဘၪဆဲၫ့လၧၦအံၫစရ့ လၭအဆၧဆံၫ့ဎံၪထီးအလူၬ လၧအဂဲၫဆိၬ လၧၦလု",
			"10": "<sup>10</sup> ဆၧလဂၩအအီၪနီၪ, မိကဲၪထၪ့အဆၧလီၫ.- ထီးဒၪၦ အဆၧဆံၫ့ဎံၪလမံၩ့မံၩ့နီၪ မိကဲၪထၪ့အဆၧဒၪဝ့ၫ, ထီး ဒၪဆၧလၧၦဖ့ၪလၫ့ၦလုဆၧလဂၩဂၩနီၪ မိကဲၪထၪ့အ ဆၧလီၫ.",
			"11": "<sup>11</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, လီၩ ဘၪဆၧလၧၦအံၫစရ့လၭဖိၪတၭ, စံၭအဝ့ၫၥံၪ, ထီးဒၪၦ",
			"13": "<sup>13</sup> အမၫအ့ၪကၠၪခွံၬအၥၭတၭ မၩမၪဘၪဝ့ၫ,- တၭၦဂူၫ ဂၩမံၫဎုၬဝ့ၫတၭ, အီၪကဒုၩလၧအဝၩအမ့ၬၥၪနီၪ, ဒဲအီၪ ၥူၪ, ဒဲဘၪစံၪစၪဝ့ၫနီၪ, ၦထိးအၥၭလအီၪဘၪ, ဒဲဆၧလ",
			"14": "<sup>14</sup> ဖျီၪထၪ့ဘၪဝ့ၫနီၪ,- အဝၩအၥၭအ့ၪကဲၪ့ထၪ့ ဒဲၥၭကဲၪ့ အမၫတၭ, အမၫနီၪ အ့ၪဘၪဆၧစံၪစၪတၭး အ့ၪလ မွဲဘၪနီၪ, အဝၩအၥၭအ့ၪကဲၪ့ထၪ့ ဒဲၥၭကဲၪ့အမၫတၭ,",
			"15": "<sup>15</sup> အမၫနီၪအ့ၪလစံၪစၪဘၪတၭ,- ထီးနီၪလဖၧၫ့ၦလဂၩ နီၪဘၪဂဲၫၥိၫ့အမၫ လၧၦလုဆၧလဂၩအအီၪ, ဒဲအ ဝ့ၫဘၪဂဲၫဆိၬ အဆၧမၩဘိၪ့လၧအဂး, ဘုၪမုယီၩအ ကိၪမုၬလအ့ဖၭဆံၫပိၩ့လပိၩ့, တၭဂါလၩ့ဘၪၥိၪ လၧ အဖၫ့ခိၪအ့ၬ. အီၪက့ၪဘၪလီဘၫ့ လၧအဖၫ့ခိၪအ့ၬ. အဂဲးဘဲၫယီၩ မွဲဆၧမၩဘိၪ့ လၧဆၧၥၭကဲၪ့အကၠီၩ့, ဆၧမၩဘိၪ့နၪ့ထၪ့ဆၧ လၧအဒုၭနၪ့ထၪ့ထဲၩ့ဆၧမၩ လီၫ.",
			"16": "<sup>16</sup> ၦလုဆၧလဂၩနီၪ ဘၪဒုၭၥုၭဘူၭၦမုၪတၭ အီၪက့ၪ",
			"17": "<sup>17</sup> ဝ့ၫလၧယဟိဝၩအမ့ၬယၫလီၫ.- တၭၦလုဆၧလဂၩနီၪ ဘၪမၩန့ထံၫဆံၫ့ဎံၪ လၧထွ့ၫဂၪ့ခိၪအဖၧၩ့, ဒဲဂၪ့ခိၪအ မုၬလၧအအီၪလၧတဲၩဆံၫ့ဎံၪအဖုၫဒၩ အလီၩ့နီၪၦလု ဆၧလဂၩဘၪမၩန့ဝ့ၫတၭ, အီၪက့ၪလၧထံၫကျၩလီၫ.",
			"18": "<sup>18</sup> ၦလုဆၧလဂၩနီၪဘၪအီၪက့ၪၦမုၪလၧယဟိဝၩအမ့ၬ ယၫတၭ, ဒုၭအီၪဘိၪ့ၦမုၪအခိၪတၭ, အီၪက့ၪဆၧလုနၪ့ ထၪ့ထဲၩ့လၧအမွဲဆၧလုၥၭကဲၪ့ လၧအစူၪဖၧၩ့တၭ, ၦ လုဆၧလဂၩနီၪဘၪအီၪ လၧထံၫအခၪလၧအစူၪဖၧၩ့",
			"19": "<sup>19</sup> လၧအဒုၭဆိၪအၧၩ့ဆၧလီၫ.- တၭၦလုဆၧလဂၩနီၪ ဘၪဒုၭဆိၪလၩ့ၦမုၪအၥၭတၭ, စံၭဝ့ၫ, ၦခွၫအ့ၪလမံၫ ဎုၬဘၪလၧနၧၩတၭ, နအ့ၪလကၠၪခွံၬဘၪနၥၭလၧနဝၩ အလးဖိးလၧဆၧလဆံၫ့ဘၪတၭ, မွဲနဖီၩ့ဖျ့ၭလၧထံၫ",
			"20": "<sup>20</sup> အခၪယီၩ လၧအဒုၭဆိၪအၧၩ့ဆၧဆံၭ.- အ့ၪမွဲနအ့ၪ ကၠၪခွံၬယူၭနၥၭလၧဆၧလၧနဝၩအလး, ဒဲနလဆံၫ့ဘၪ တၭ, ဖ့ၪယူၭၦခွၫလဂၩမံၫဎုၬလၧနၧၩ လၧအလမွဲဘၪ",
			"21": "<sup>21</sup> နဝၩတၭ,- ထီးနီၪလဖၧၫ့ၦလုဆၧလဂၩနီၪ ဘၪဒုၭဆိၪ လၩ့ၦမုၪအၥၭ လၧဆၧဆိၪအၧၩ့တၭ, ၦလုဆၧနီၪမိ ဘၪစံၭၦမုၪ, ထီးယဟိဝၩဒုၭအုၪနကံၪထံၭ, ဒဲနဂူၭဖိၫ့ ယိၭထၪ့တၭ, မွဲယဟိဝၩအီၪက့ၪနၧၩ လၧဆၧဆိၪအၧၩ့, ဒဲဆိၪလၩ့ဆၧအလး လၧနၡၩလဆၨၩ အကျၩဆံၭ.",
			"22": "<sup>22</sup> တၭထံၫလၧအဒုၭဆိၪအၧၩ့ ဆၧယီၩမိလ့ၩနုၬ လၧန ဂူၭဖိၫ့ဖၧၩ့ ဘဲၫၥိၭအမိဒုၭယိၭထၪ့နဂူၭဖိၫ့, ဒဲဒုၭအုၪန ကံၪထံၭလီၫ. တၭၦမုၪမိဘၪစံၭ, အၩမံၩ့, အၩမံၩ့း",
			"23": "<sup>23</sup> တၭၦလုဆၧလဂၩ ဘၪကွ့ၭဆၧဆိၪအၧၩ့လဖၪနီၪလၧ",
			"24": "<sup>24</sup> လံၬဖၧၩ့, ဒဲထုၭခွံၬဝ့ၫလၧထံၫခၪအဖၧၩ့နီၪလီၫ.- တၭ ဘၪဒုၭအီၩၦမုၪ လၧထံၫခၪ လၧအဒုၭဆိၪအၧၩ့ဆၧ တၭ,ထံၫလၧအဒုၭဆိၪအၧၩ့ဆၧ မိလ့ၩနုၬလၧအဖၧၩ့ လၧဆၧခၪလီၫ.",
			"25": "<sup>25</sup> ထီးနီၪလဖၧၫ့ၦလုဆၧလဂၩနီၪ ဘၪမၩန့ဆၧမၩဘိၪ့ ၥၭကဲၪ့လၧၦမုၪအစူၪဖၧၩ့တၭ, မိဝံဝါဝ့ၫလၧယဟိဝၩ",
			"26": "<sup>26</sup> အမ့ၬယၫတၭ, ဂဲၫဆိၬဝ့ၫလၧဆၧလုလးလီၫ.- တၭၦ လုဆၧလဂၩဘၪမၩန့လစူၪ လၧဆၧလုအဖၧၩ့,အဆၧ နၪ့ထၪ့ထဲၩ့နီၪ, ဒဲဆူၭခဲၩထၪ့ဝ့ၫလၧဆၧလုလးအဖၫ့ခိၪ တၭ, လၧခဲၫ့ထဲၩ့မိဘၪဒုၭအီၩၦမုၪလၧထံၫအခၪလီၫ.",
			"27": "<sup>27</sup> ထီးအဒုၭအီၩဝ့ၫ လၧထံၫဂီၩ့တၭ, ဆၧမိမၩအၥၭ လၧၦမုၪနီၪအ့ၪလဆံၫ့ဘၪ, ဒဲမၩမၪဘၪအဝၩတၭထံၫ လၧအဒုၭဆိၪအၧၩ့ဆၧ မိလ့ၩနုၬလၧအဖၧၩ့လၧဆၧခၪ တၭ, အဂူၭဖိၫ့မိယိၭထၪ့ ဒဲအကံၪထံၭမိအုၪဝ့ၫတၭ, ၦမုၪနီၪ မိကဲၪထၪ့ဆၧဆိၪအၧၩ့အလး လၧအၡၩလ",
			"28": "<sup>28</sup> ဆၨၩဒၪဝ့ၫအကျၩလီၫ.- တၭၦမုၪနီၪအ့ၪလဘၪၥၭလိၪ ဘၪ, အ့ၪဆံၫ့ဝ့ၫတၭ, ထီးနီၪလဖၧၫ့ မိဖီၩ့ဖျ့ၭဒဲမိဒၧၩ့ ထၪ့ဝ့ၫဆ့လီၫ.",
			"29": "<sup>29</sup> ထီးၦမုၪကၠၪခွံၬအၥၭ လၧဆၧလၧအဝၩအလးဒဲလ",
			"30": "<sup>30</sup> ဆံၫ့ဘၪနီၪ, ၥနိၫဘၪဆဲၫ့လၧဆၧၥၭကဲၪ့မွဲအနီၪ,- ဒဲလ ခီၫထီးအဝၩအၥၭအ့ၪကဲၪ့ထၪ့ဒဲၥၭကဲၪ့အမၫ, ဒဲအီၪ က့ၪၦမုၪလၧယဟိဝၩအမ့ၬယၫတၭ, ၦလုဆၧလဂၩနီၪ",
			"31": "<sup>31</sup> ဘၪမၩဝ့ၫၥနိၫယီၩထီးအလူၬလီၫ.- တၭၦခွၫမိဖီၩ့ဖျ့ၭ ဆၧဒဲၩဘၭ, ဒဲၦမုၪမိထိးအဆၧဒဲၩဘၭလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,လီၩ ဘၪလၧၦအံၫစရ့လၭဖိၪတၭစံၭအဝ့ၫၥံၪ, ၦခွၫမွဲဂ့ၩ, ၦမုၪမွဲဂ့ၩ, ထီးအမိမၩလၩ့ဖၭအၥၭလၧအမိဆိၪလၩ့ အၥၭလၧၦနၭစရ့ၭဖိၪအဆၧဆိၪလၩ့အၥၭနီၪ, ဘဲၫၥိၭ",
			"3": "<sup>3</sup> အမိမၩလၩ့ဖၭအၥၭလၧယဟိဝၩအဂးတၭ,- မိဘၪ မၩလၩ့ဖၭအၥၭလၧစဘံၭထံၫ, ဒဲၥံၭထံၫဂၬထံၫလီၫ. တၭအီၩဘၪစဘံၭထံၫအဆဲၪ့, ဒဲၥံၭထံၫဂၬထံၫအဆဲၪ့ အ့ၬ. တၭအီၩဘၪထံၫ လၧစဘံၭၥၪစုၪလၩ့အၥၭလၧ အဖၧၩ့အ့ၬ. တၭစဘံၭၥၪၥံၫ့ဆ့ၬမွဲဂ့ၩ အဎဲၫ့မွဲဂ့ၩ, အၪ့",
			"4": "<sup>4</sup> ဘၪအ့ၬ.- မုနံၩမုနၩလၧအအီၪလၩ့ဖၭအၥၭနီၪအၪ့ ဘၪဆၧလၧၦမၩဝ့ၫ လၧစဘံၭမုအၥၪနးမံၩ့အ့ၬး လၧ",
			"5": "<sup>5</sup> အချံၫဖိးလၧအဖံၭနးမံၩ့အ့ၬ.- ကိၭမုနံၩမုနၩဘၪဆဲၫ့ လၧအဆၧဆိၪလၩ့အၥၭ လၧအမိမၩလၩ့ဖၭအၥၭနီၪ, ဒီၩလိၩ့ဆၧမိဘၪ အခိၪအလီၩ့အ့ၬ. မိဘၪကဲၪထၪ့ဆၧ ဆံၫ့ဎံၪလၧယဟိဝၩအဂး, မိဘၪဖ့ၪလၫ့အခိၪၥူၫဘီၩ့ ထီၫထၪ့ထီးမုနံၩလဖၪ လၧအမၩလၩ့ဖၭအၥၭလၧယ",
			"6": "<sup>6</sup> ဟိဝၩအဂးနီၪ မိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလီၫ.- တၭကိၭမု နံၩမုနၩလၧအမၩလၩ့ဖၭအၥၭ လၧယဟိဝၩအဂးနီၪ",
			"7": "<sup>7</sup> ထီးၥုၭဘူၭဘၪအၥၭ လၧဆၧအစွၪလဂ့ၩ.- အဖါမွဲ ဂ့ၩးအမိမွဲဂ့ၩ, အထၧၫ့ဖုဝဲခွၫမွဲဂ့ၩ, အထၧၫ့ဖုဝဲမုၪမွဲ ဂ့ၩ,အ့ၪၥံၫတၭး လၧအၥံၫအကၠီၩ့နီၪ, မၩစံၪစၪလၩ့အ ၥၭအ့ၬ. အဂဲးဘဲၫယီၩ ဆၧလၩ့ဖၭဘၪဆဲၫ့လၧယွၩအီၪ",
			"8": "<sup>8</sup> လၧအလီၩ့လီၫ.- ကိၭမုနံၩမုနၩဒ့ၭလၧအလၩ့ဖၭနီၪ",
			"9": "<sup>9</sup> မိကဲၪထၪ့ဆၧဆံၫ့ဎံၪ လၧယဟိဝၩအဂးလီၫ.- ၦၡၩ အ့ၪၥံၫရှုၭလၧအနဲၩ့ထံၭတၭ အ့ၪမၩစံၪစၪဘၪအခိၪ လၧအလၩ့ဖၭတၭ, ထီးနီၪလဖၧၫ့မုနံၩလၧအဆံၫ့ထၪ့ နီၪမိဘၪလိၩ့ခွံၬအခိၪ, မုနွ့ၫနံၩလနံၩနီၪ မိဘၪလိၩ့ဝ့ၫ",
			"10": "<sup>10</sup> လီၫ.- တၭဎိၭနံၩလနံၩနီၪထိၪလွံနံၫဘံၪ့မွဲဂ့ၩ, ကၪကဲၪ ဖိၪနံၫဘံၪ့မွဲဂ့ၩ, မိဘၪဂဲၫဆိၬဝ့ၫ လၧၦလုဆၧလဂၩအ အီၪ ထီးဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အတရၫ့ထံၭနီၪ",
			"11": "<sup>11</sup> လီၫ.- တၭၦလုဆၧလဂၩနီၪ ဘၪလုထၪ့လဘံၪ့လၧဆၧ လုဆၧဒဲၩဘၭအဂး, ဒဲလဘံၪ့လၧဆၧလုမ့ၪအဂး, ဒဲမၩ ဆၧဖီၩ့ဖျ့ၭလၧအဂး လၧၦမၩမၪဆၧ လၧဆၧၥံၫအ ကၠီၩ့တၭ, ဘၪမၩဆံၫ့ဎံၪအခိၪလၧမုလနံၩဎးနီၪလီၫ.",
			"12": "<sup>12</sup> ဘၪအီၪက့ၪဆံၫ့ဎံၪ လၧယဟိဝၩအဂးအနံၩအၥၫ့လၧ အအီၪလၩ့ဖၭတၭ, ဘၪဂဲၫဆိၬၥိၪလနံၪ့ဖိၪလၧဆၧလု မၪဘၪဆၧအဂးလီၫ. အ့ၪမွဲမုနံၩမုနၩလၧအအီၪဝံဝ့ၫ လဖၪနီၪမိလၩ့မါဝ့ၫ, အဂဲးဘဲၫယီၩအဆၧလၩ့ဖၭနီၪ ဘၪစံၪစၪယူၭလီၫ.",
			"13": "<sup>13</sup> အယီၩမွဲၦနၭစရ့ၭဖိၪအၥနိၫ ထီးအမုနံၩမုနၩလၧအ အီၪလၩ့ဖၭလဖၪနီၪ မိလၧၫ့ထၪ့ဎွ့ၩထၪ့တၭး ၦမိဒုၭ",
			"14": "<sup>14</sup> ဂဲၫဝ့ၫလၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအတရၫ့,- တၭ ဘၪမၩဘိၪ့အဆၧမၩဘိၪ့ယဟိဝၩ, ၥိၪဖၫလနံၪ့ဖိၪ အလၧၫ့အဎွ့ၩလဒုၩ လၧဆၧလုမ့ၪအဂး, ဒဲၥိၪမိလနံၪ့ ဖိၪအလၧၫ့အဎွ့ၩလဒုၩ လၧဆၧလုဆၧဒဲၩဘၭအဂး, ဒဲၥိၪဖၫအလၧၫ့အဎွ့ၩလဒုၩ လၧဆၧလုဘၪလိၬအိၭ",
			"15": "<sup>15</sup> လိၬအဂး,- တၭအီၪက့ၪဒၩ့လဖျိၪ့အီၪလၧကိၪလအီၪ ဘၪလၧမံၪနီၪ, ဒဲကိၪပၪပဲၪလဲၩဎုၬလၧၥိၪ,ဒဲကိၪလအီၪ ဘၪလၧမံၪဘၧၩ့ဖျၪဒၪဂုၪအၥၭလၧၥိၪ, ဒဲအဆၧမၩ",
			"16": "<sup>16</sup> ဘိၪ့ကိၪမုၬ,ဒဲအဆၧလုအီၩလီၫ.- ၦလုဆၧလဂၩဘၪ အီၪက့ၪဝ့ၫလၧယဟိဝၩအမ့ၬယၫတၭ, လုထၪ့အဆၧ",
			"17": "<sup>17</sup> လုဆၧဒဲၩဘၭ,ဒဲအဆၧလုမ့ၪလီၫ.- တၭမွဲအဘၪလု ထၪ့ၥိၪဖၫ,ဆၧလုဘၪလိၬအိၭလိၬ လၧယဟိဝၩအဂး, ဒဲဒၩ့လဖျိၪ့အီၪလၧကိၪလအီၪဘၪလၧမံၪနီၪတၭး ၦလု ဆၧလဂၩဘၪမၩဘိၪ့အဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲအဆၧ",
			"18": "<sup>18</sup> လုအီၩလီၫ.- ၦနၭစရၭ့ဖိၪဘၪလိၩ့အခိၪ ဘၪဆဲၫ့လၧ အအီၪလၩ့ဖၭ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအတရၫ့ ထံၭနီၪတၭ,ဘၪမၩန့အခိၪၥူၫဘၪဆဲၫ့ လၧအအီၪလၩ့ ဖၭတၭ, ဒုၭနုၬဝ့ၫလၧမ့ၪဖၧၩ့လၧအအီၪလၧဆၧလုဘၪ",
			"19": "<sup>19</sup> လိၬအိၭလိၬအဖၫ့လၬလီၫ.- တၭၦလုဆၧလဂၩနီၪဘၪ မၩန့ၥိၪဖၫ အခိၬထံၭခိၪလၧအအၪ့ဎွံအၥၭ, ဒဲကိၪလ အီၪဘၪလၧမံၪလဘံၪ့လၧဒၩ့ဖၧၩ့ ဒဲကိၪလအီၪဘၪလၧ မံၪဘၧၩ့ဖျၪဒၪလဘံၪ့တၭ, ဘၪအီၪက့ၪဝ့ၫ လၧၦနၭစ ရ့ၭဖိၪအစူၪဖၧၩ့ လၧအခိၪၥူၫဘၪဆဲၫ့လၧအအီၪလၩ့ဖၭ",
			"20": "<sup>20</sup> နီၪဘၪလိၩ့ခွံၬဝ့ၫအလးခဲၫ့လီၫ.- တၭၦလုဆၧလဂၩနီၪ ဘၪဝံဝါဝ့ၫ လၧဆၧမၩဘိၪ့ဝံဝါဝ့ၫ လၧယဟိဝၩ အမ့ၬ ယၫလီၫ. ဆၧနီၪမွဲဆၧဆံၫ့ဎံၪ လၧၦလုဆၧလဂၩအဂး, ဒဲၥၭနၫၡါအဆၧဝံဝါ, ဒဲခိၬထံၭခိၪ အဆၧဆိၬထၪ့ဝံဝါ လီၫ. လၧခဲၫ့ထဲၩ့တၭ, ၦနၭစရ့ၭဖိၪမိအီၩဘၪစဘံၭ",
			"21": "<sup>21</sup> ထံၫလီၫ.- အနီၪမွဲၥနိၫဘၪဆဲၫ့ လၧၦနၭစရ့ၭဖိၪလၧအ ဆိၪလၩ့ယူၭအၥၭနီၪ, ဒဲအဆၧမၩဘိၪ့ယဟိဝၩလၧ အအီၪလၩ့ဖၭဆၧအဂးလီၫ. လၧနီၪအမ့ၬယၫဆၧလၧ အစူၪန့ဘၪဝ့ၫအီၪဒံၭလီၫ. ဘဲၫဆၧလၧအနိၭဆိၪလၩ့ အၥၭအၥိၭနီၪမိဘၪမၩဘဲၫနီၪၥိၭ, ဘဲၫဆၧၥီၪ့ဘၪဆဲၫ့ လၧအအီၪလၩ့ဖၭအၥိၭနီၪလီၫ.",
			"22": "<sup>22</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, လီၩ ဘၪလၧစအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪတၭစံၭ, နၥံၪဘၪ ဆိၪဂ့ၩၦအံၫစရ့လၭဖိၪ ဘဲၫယီၩ, စံၭအဝ့ၫၥံၪ,",
			"24": "<sup>24</sup> မွဲယဟိဝၩ ဆိၪဂ့ၩနၧၩ ဒဲယိထဲၩ့နၧၩဆံၭ.",
			"25": "<sup>25</sup> မွဲယဟိဝၩ ဒုၭဖၩ့ထၪ့ နၧၩလၧအမ့ၬ, ဒုၭဘၪနၧၩ လၧအခိးအတၩဆံၭ.",
			"26": "<sup>26</sup> မွဲယဟိဝၩ အီၪက့ၪဖၩ့ထၪ့ အမ့ၬလၧနလီၩ့, ဒဲဖ့ၪ လၫ့နၧၩလၧဆၧဘၪလိၬအိၭလိၬဆံၭ.",
			"27": "<sup>27</sup> အဝ့ၫၥံၪမိဘၪအီၪက့ၪယမံၩ့ လၧၦအံၫစရ့လၭဖိၪ အလီၩ့တၭ ယမိဆိၪဂ့ၩ အဝ့ၫၥံၪလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> တၭမုလနံၩလၧစမိစ့ၭမၩထၪ့တဲၩဆံၫ့ဎံၪဂီၩ့, ဒဲဂုၪ ဝ့ၫဒဲမၩဆံၫ့ဎံၪဝ့ၫ, ဒဲအဆၧဖိၪဆၧလံၩထီးအလူၬ, ဒဲ ဆၧလုလး, ဒဲအဆၧဖိၪဆၧလံၩထီးအလူၬ,ဒဲဂုၪအဝ့ၫ",
			"2": "<sup>2</sup> ၥံၪ, ဒဲမၩဆံၫ့ဝ့ၫဂီၩ့တၭ,ဆၧမၩအၥၭလၧ- ၦအံၫစရ့ လၭဖိၪအၦဒိၪလဖၪ, အဖါအဂံၪ့အခိၪလဖၪလၧအမွဲ ၦဒီၪ့လဖၪအၦဒိၪ ဒဲအီၪဝ့ၫလၧၦဘၪဆၧဝံထၪ့ဝ့ၫ အ",
			"3": "<sup>3</sup> ဖၫ့ခိၪနီၪမၩဘိၪ့ဆၧလီၫ.- တၭအဝ့ၫၥံၪဂဲၫဆိၬအဆၧ မၩဘိၪ့လၧယဟိဝၩအမ့ၬယၫ, လဲၪ့အီၪလၧအခိၪဎူၫ ခိၪ, ဒဲချီဖၫလဆံၫနံၫဒုၩ, ၦဒိၪနံၫဂၩလဲၪ့လခိၪ, ဒဲၦဒိၪ လဂၩချီဖၫလဒုၩလီၫ. အဝ့ၫၥံၪဆိၬဝ့ၫလၧတဲၩဆံၫ့ဎံၪ",
			"4": "<sup>4</sup> အမ့ၬယၫလီၫ.- ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭ",
			"5": "<sup>5</sup> ဝ့ၫဒၪ,- မၩန့အဝ့ၫၥံၪဘဲၫၥိၭ အမိမၩဆၧအီၪကီၪ့အ တဲၩဆံၫ့ဎံၪ အဎီးအၡၩအဆၧမၩနီၪဆံၭ. တၭနဘၪ ဖ့ၪလၫ့ဝ့ၫလၧ ၦလံဝဲၫဖိၪလဂၩ, ဘဲၫဆၧမၩအၥိၭကိၭ",
			"6": "<sup>6</sup> ဂၩဒ့ၭလီၫ.- စမိစ့ၭမၩန့လဲၪ့လဖၪ,ဒဲချီဖၫၥံၪနီၪတၭ,",
			"7": "<sup>7</sup> ဖ့ၪလၫ့ဝ့ၫလၧၦလံဝဲၫဖိၪလီၫ.- တၭလဲၪ့နံၫခိၪဒဲချီဖၫလံ ဒုၩနီၪဖ့ၪလၫ့ဝ့ၫ လၧစဂၧၡၧၫ့အဖိၪခွၫလဖၪ ဘဲၫအမၩ",
			"8": "<sup>8</sup> ဆၧအၥိၭနီၪလီၫ.- တၭလဲၪ့လံခိၪ ဒဲချီဖၫ ဎိၭဒုၩနီၪ, ဖ့ၪလၫ့ဝ့ၫ လၧစမရၫရဲၫအဖိၪခွၫၥံၪ ဘဲၫအမၩဆၧအ ၥိၭလၧၦလုဆၧစအၫရၧၫ့အဖိၪခွၫ စအံၥမၫအစူၪဖၧၩ့",
			"9": "<sup>9</sup> လီၫ.- အ့ၪမွဲဖ့ၪလၫ့ဝ့ၫစကိဟၭ အဖိၪခွၫလဖၪနီၪဆၧ နးမံၩ့အ့ၬ. အဂဲးဘဲၫယီၩ ဆၧဘၪဆဲၫ့လၧဆၧအလး ဆံၫ့ဎံၪလၧအဘၪယိၭလၧအခိၬထံၭခိၪနီၪ မွဲအဝ့ၫၥံၪ အဆၧမၩလီၫ.",
			"10": "<sup>10</sup> လၧဆၧမၩဘိၪ့ ဖလါဆၧလုလးအဂးနီၪ, ၦဒိၪလ ဖၪမၩဘိၪ့ထၪ့ဆၧလၧမုလနံၩနီၪ လၧအဘၪဂုၪအၥၭ, ဒဲၦဒိၪလဖၪမၩဘိၪ့ထၪ့အဆၧမၩဘိၪ့နီၪ လၧဆၧလု",
			"11": "<sup>11</sup> အမ့ၬယၫလီၫ.- တၭယဟိဝၩစံၭစမိစ့ၭ,အဝ့ၫၥံၪမိဘၪ မၩဘိၪ့ထၪ့အဆၧမၩဘိၪ့နီၪ လၧဆၧမၩဘိၪ့ဖလါဆၧ လုလးအဂး, ၦဒိၪလဂၩအနံၩဒၪဝ့ၫ, ၦဒိၪလဂၩအနံၩ ဒၪဝ့ၫဆုၬဆုၬလီၫ.",
			"12": "<sup>12</sup> တၭၦလၧအမၩဘိၪ့အဆၧမၩဘိၪ့ လၧမုခၪ့ထံၭအနံၩ နီၪ, မွဲယုဒၫအဒီၪ့ဖိၪစအမံနဒၭအဖိၪခွၫ စနၫၡိၫ့လီၫ.",
			"13": "<sup>13</sup> တၭအဝ့ၫဒၪအဆၧမၩဘိၪ့နီၪ မွဲလိၫ့စ့ၩလဖျိၪ့ အလ ယၧးၡက့လၭလယၩၥၧၫ့ဆံၫ, ထွ့ၫစ့ၩလဖျိၪ့ အလ ယၧးၡက့လၭနွ့ၫဆံၫ, ဘဲၫဆၧအလးဆံၫ့ဎံၪ အၡက့ လၭအၥိၭနီၪ, နံၫဖျိၪ့လူၬဎွ့ၩဝ့ၫ လၧကိၪမုၬလဲၩဎုၬလၧ",
			"14": "<sup>14</sup> ၥိၪလၧဆၧမၩဘိၪ့ကိၪမုၬအဂး,- နိၪထိၩ့ထီၫ့လဘံၪ့ အလယၧးၡက့လၭ လဆံၫဎွ့ၩဝ့ၫလၧဆၧနၧၫ့မၧၫ့ဆူၭ",
			"15": "<sup>15</sup> ခဲၩ,- ချီဖၫဖိၪလဒုၩ, ၥိၪဖၫလဒုၩ, ၥိၪလနံၪ့ဖိၪလဒုၩ",
			"16": "<sup>16</sup> လၧဆၧလုမ့ၪအဂး,- ဘ့ၪဖိၪလဒုၩလၧဆၧလုဆၧဒဲၩ",
			"17": "<sup>17</sup> ဘၭအဂး,- ချီဖၫနံၫဒုၩ, ၥိၪဖၫဖိၪယဲဒုၩ, ဘ့ၪဖၫယဲဒုၩ ၥိၪလနံၪ့ဖိၪယဲဒုၩ လၧဆၧလုဘၪလိၬ အိၭလိၬအဂး လီၫ. အနီၪမွဲစအမံနဒၭအဖိၪခွၫ စနၫၡိၫ့အဆၧမၩဘိၪ့ လီၫ.",
			"18": "<sup>18</sup> နံၫနံၩလနံၩနီၪ ၦအံစခၫဖိၪအၦဒိၪ စဇုအၫအဖိၪခွၫ",
			"19": "<sup>19</sup> စနၥၫ့နအ့လၭနီၪ မၩဘိၪ့ထၪ့ဆၧလီၫ.- အဝ့ၫဒၪမၩ ဘိၪ့ထၪ့အဆၧမၩဘိၪ့နီၪ မွဲလိၫ့စ့ၩလဖျိၪ့ အလယၧးၡ က့လၭ လယၩၥၧၫ့ဆံၫ, ထွ့ၫစ့ၩလဖျိၪ့ အလယၧးၡ က့လၭနွ့ၫဆံၫ, ဘဲၫဆၧအလးဆံၫ့ဎံၪ အၡက့လၭအ ၥိၭနီၪ,ဎွ့ၩဝ့ၫနံၫဖျိၪ့လူၬ လၧကိၪမုၬလဲၩဎုၬ လၧၥိၪလၧ",
			"20": "<sup>20</sup> ဆၧမၩဘိၪ့ကိၪမုၬအဂး,- နိၪထိၩ့ထီၫ့လဘံၪ့ အလ ယၧးၡက့လၭလဆံၫ, ဎွ့ၩဝ့ၫလၧဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ,",
			"21": "<sup>21</sup> ချီဖၫဖိၪလဒုၩ, ၥိၪဖၫလဒုၩ, ၥိၪလနံၪ့ဖိၪလဒုၩလၧဆၧ",
			"22": "<sup>22</sup> လုမ့ၪအဂး,- ဘ့ၪဖိၪလဒုၩ လၧဆၧလုဆၧဒဲၩဘၭအ",
			"23": "<sup>23</sup> ဂး,- ချီဖၫနံၫဒုၩ,ၥိၪဖၫယဲဒုၩ, ဘ့ၪဖၫယဲဒုၩ,ၥိၪလနံၪ့ ဖိၪယဲဒုၩလၧဆၧလုဘၪလိၬအိၭလိၬအဂးလီၫ. အနီၪ မွဲစဇုအၫအဖိၪခွၫစနၥၫ့နအ့လၭ အဆၧမၩဘိၪ့လီၫ.",
			"24": "<sup>24</sup> ၥၧၫ့နံၩလနံၩနီၪ ၦဇ့ၭဘလၧၫ့ဖိၪအၦဒိၪစဟံလၧၫ့",
			"25": "<sup>25</sup> အဖိၪခွၫစအလဲအၭနီၪမၩဘိၪ့ဆၧလီၫ.- အဝ့ၫဒၪအ ဆၧမၩဘိၪ့နီၪ မွဲလိၫ့စ့ၩလဖျိၪ့ အလယၧးၡက့လၭလ ယၩၥၧၫ့ဆံၫ, ထွ့ၫစ့ၩလဖျိၪ့အလယၧးၡက့လၭ နွ့ၫဆံၫ ဘဲၫဆၧအလးဆံၫ့ဎံၪအၡက့လၭအၥိၭနီၪ, ဎွ့ၩဝ့ၫနံၫ ဖျိၪ့လူၬ လၧကိၪမုၬ လဲၩဎုၬ လၧၥိၪလၧဆၧမၩဘိၪ့ကိၪ",
			"26": "<sup>26</sup> မုၬအဂး,- ဒဲနိၪထိၩ့ထီၫ့လဘံၪ့ အလယၧးၡက့လၭ",
			"27": "<sup>27</sup> လဆံၫ,ဎွ့ၩဝ့ၫလၧဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ,- ချီဖၫဖိၪလဒုၩ, ၥိၪဖၫလဒုၩ, ၥိၪလနံၪ့ဖိၪလဒုၩ လၧဆၧလုမ့ၪအဂး, ဘ့ၪဖိၪလဒုၩလၧဆၧလုဆၧဒဲၩဘၭအဂး,",
			"28": "<sup>28</sup> ချီဖၫနံၫ ဒုၩ, ဒဲၥိၪဖၫယဲဒုၩ,ဒဲဘ့ၪဖၫယဲဒုၩ, ၥိၪလနံၪ့ဖိၪယဲ ဒုၩလၧဆၧဘၪလိၬအိၭလိၬအဂးလီၫ. အဝ့ၫနီၪမွဲစဟံ လၧၫ့အဖိၪခွၫ စအလဲအၭအဆၧမၩဘိၪ့လီၫ.",
			"30": "<sup>30</sup> လံနံၩလနံၩနီၪ ၦရုဘံၫ့ဖိၪအၦဒိၪ စရှ့ဒအၧၫအဖိၪ",
			"31": "<sup>31</sup> ခွၫစအံၫလဲဇၧၫနီၪမၩဘိၪ့ဆၧလီၫ.- အဝ့ၫဒၪအဆၧ မၩဘိၪ့နီၪမွဲလိၫ့စ့ၩလဖျိၪ့ အလယၧးၡက့လၭ လယၩ ၥၧၫ့ဆံၫ, ထွ့ၫစ့ၩလဖျိၪ့အလယၧးၡက့လၭနွ့ၫဆံၫ, ဘဲၫ ဆၧအလးဆံၫဎံၪအၡက့လၭအၥိၭနီၪ ဎွ့ၩဝ့ၫနံၫဖျိၪ့ လူၬလၧကိၪမုၬလဲၩဎုၬ လၧၥိၪလၧဆၧမၩဘိၪ့ကိၪမုၬ",
			"32": "<sup>32</sup> အဂး,- နိၪထိၩ့ထီၫ့အလယၧးၡက့လၭလဆံၫဎွ့ၩဝ့ၫ",
			"33": "<sup>33</sup> လၧဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ,- ချီဖၫဖိၪလဒုၩ,ၥိၪဖၫလဒုၩ,",
			"34": "<sup>34</sup> ၥိၪလနံၪ့ဖိၪလဒုၩလၧဆၧလုမ့ၪအဂး,- ဘ့ၪဖိၪလဒုၩ",
			"35": "<sup>35</sup> လၧဆၧလုဆၧဒဲၩဘၭအဂး,- ချီဖၫနံၫဒုၩ, ၥိၪဖၫယဲ ဒုၩ, ဘ့ၪဖၫယဲဒုၩ, ၥိၪလနံၪ့ဖိၪယဲဒုၩ လၧဆၧလုဘၪ လိၬအိၭလိၬအဂးလီၫ. အနီၪမွဲစရှ့ဒအၧၫအဖိၪခွၫ စ အံၫလဲဇၧၫအဆၧမၩဘိၪ့လီၫ.",
			"36": "<sup>36</sup> ယဲနံၩလနံၩနီၪ ၦစံမအၧၫ့ဖိၪအၦဒိၪစဇုရၡၭဒအဲၫ",
			"37": "<sup>37</sup> အဖိၪခွၫစရှ့လုၫမအ့လၭနီၪမၩဘိၪ့ဆၧလီၫ.- အဝ့ၫဒၪ အဆၧမၩဘိၪ့နီၪ မွဲလိၫ့စ့ၩလဖျိၪ့အလယၧးၡက့လၭ လယၩၥၧၫ့ဆံၫ, ထွ့ၫစ့ၩလဖျိၪ့အလယၧးၡက့လၭနွ့ၫ ဆံၫ,ဘဲၫဆၧအလးဆံၫ့ဎံၪအၡက့လၭ အၥိၭနီၪဎွ့ၩဝ့ၫ နံၫဖျိၪ့လူၬလၧကိၪမုၬလဲၩဎုၬ လၧၥိၪလၧဆၧမၩဘိၪ့ကိၪ",
			"38": "<sup>38</sup> မုၬအဂး,- နိၪထိၩ့ထီၫ့လဘံၪ့အလယၧးၡက့လၭလ",
			"39": "<sup>39</sup> ဆံၫဎွ့ၩဝ့ၫလၧဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ,- ချီဖၫဖိၪလဒုၩ,",
			"40": "<sup>40</sup> ၥိၪလနံၪ့ဖိၪလၧဆၧလုမ့ၪအဂး,- ဘ့ၪဖိၪလဒုၩလၧဆၧ",
			"41": "<sup>41</sup> လုဆၧဒဲၩဘၭအဂး,- ချီဖၫနံၫဒုၩ, ၥိၪဖၫယဲဒုၩ, ဘ့ၪ ဖၫယဲဒုၩ, ၥိၪလနံၪ့ဖိၪယဲဒုၩ လၧဆၧလုဘၪလိၬအိၭ လိၬအဂးလီၫ. အနီၪမွဲစဇုရၡၭဒအဲၫအဖိၪခွၫစရှ့လုၫ မအ့လၭအဆၧမၩဘိၪ့လီၫ.",
			"42": "<sup>42</sup> ဎူၫနံၩလနံၩနီၪ ၦဂၭဖိၪအၦဒိၪ စဒုၫအ့လၭအဖိၪ",
			"43": "<sup>43</sup> ခွၫစအံၫလဲအစၭနီၪမၩဘိၪ့ဆၧလီၫ- အဝ့ၫဒၪအဆၧ မၩဘိၪ့နီၪ မွဲလိၫ့စ့ၩလဖျိၪ့အလယၧးၡက့လၭလယၩ ၥၧၫ့ဆံၫ, ထွ့ၫစ့ၩလဖျိၪ့ အလယၧးၡက့လၭ နွ့ၫဆံၫ, ဘဲၫဆၧအလးဆံၫ့ဎံၪ အၡက့လၭအၥိၭနီၪ ဎွ့ၩဝ့ၫနံၫ ဖျိၪ့လူၬလၧကိၪမုၬလဲၩဎုၬ လၧၥိၪ လၧဆၧမၩဘိၪ့ကိၪ",
			"44": "<sup>44</sup> မုၬအဂး,- နိၪထိၩ့ထီၫ့အလယၧးၡက့ၭလၭလဆံၫ, ဎွ့ၩ",
			"45": "<sup>45</sup> ဝ့ၫလၧဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ,- ချီဖၫဖိၪလဒုၩ, ၥိၪဖၫလ",
			"46": "<sup>46</sup> ဒုၩ, ၥိၪလနံၪ့ဖိၪလဒုၩ လၧဆၧလုမ့ၪအဂး.- ဘ့ၪဖိၪ",
			"47": "<sup>47</sup> လဒုၩလၧဆၧလုဆၧဒဲၩဘၭအဂး,- ချီဖၫနံၫဒုၩ, ၥိၪဖၫ ယဲဒုၩ,ဘ့ၪဖၫယဲဒုၩ, ၥိၪလနံၪ့ဖိၪယဲဒုၩလၧဆၧလုဘၪ လိၬအိၭလိၬအဂးလီၫ. အနီၪမွဲစဒုၫအ့လၭ အဖိၪခွၫ စအံၫလဲအစၭအဆၧမၩဘိၪ့လီၫ.",
			"48": "<sup>48</sup> နွ့ၫနံၩလနံၩနီၪ ၦအံဖြံၫ့ဖိၪအၦဒိၪ စအၫမဟၧၭအ",
			"49": "<sup>49</sup> ဖိၪခွၫစအံၫလံၭၡမၫနီၪမၩဘိၪ့ဆၧလီၫ.- အဝ့ၫဒၪအ ဆၧမၩဘိၪ့နီၪ မွဲလိၫ့စ့ၩလဖျိၪ့ အလယၧးၡက့လၭလ ယၩၥၧၫ့ဆံၫ, ထွ့ၫစ့ၩလဖျိၪ့ အလယၧးၡက့လၭ နွ့ၫ ဆံၫ,ဘဲၫဆၧအလးဆံၫ့ဎံၪ အၡက့လၭအၥိၭနီၪ, ဎွ့ၩ ဝ့ၫနံၫဖျိၪ့လူၬလၧကိၪမုၬလဲၩဎုၬ လၧၥိၪလၧဆၧမၩဘိၪ့",
			"50": "<sup>50</sup> ကိၪမုၬအဂး, နိၪထိၩ့ထီၫ့အလယၧးၡက့လၭလဆံၫ,",
			"51": "<sup>51</sup> ဎွ့ၩဝ့ၫလၧဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ,- ချီဖၫဖိၪလဒုၩ, ၥိၪဖၫ",
			"52": "<sup>52</sup> လဒုၩ, ၥိၪလနံၪ့ဖိၪလဒုၩ လၧဆၧလုမ့ၪအဂး, ဘ့ၪဖိၪ",
			"53": "<sup>53</sup> လဒုၩလၧဆၧလုဆၧဒဲၩဘၭအဂး,- ချီဖၫနံၫဒုၩ, ၥိၪ ဖၫယဲဒုၩ, ဘ့ၪဖၫယဲဒုၩ, ၥိၪလနံၪ့ဖိၪယဲဒုၩ လၧဆၧလု ဘၪလိၬအိၭလိၬအဂးလီၫ. အနီၪမွဲစအၫမဟၧၭအဖိၪ ခွၫစအံၫလံၭၡမၫ အဆၧမၩဘိၪ့လီၫ.",
			"54": "<sup>54</sup> ဎိၭနံၩလနံၩနီၪ ၦမနၭစ့ၫဖိၪအၦဒိၪစပဒၫဇၧၫအဖိၪ",
			"55": "<sup>55</sup> ခွၫစဂမၫလအ့လၭနီၪ မၩဘိၪ့ဆၧလီၫ.- အဝ့ၫဒၪအ ဆၧမၩဘိၪ့နီၪမွဲလိၫ့စ့ၩလဖျိၪ့ အလယၧးၡက့လၭလ ယၩၥၧၫ့ဆံၫ, ထွ့ၫစ့ၩလဖျိၪ့ အလယၧးၡက့လၭနွ့ၫဆံၫ ဘဲၫဆၧအလးဆံၫ့ဎံၪအၡက့လၭအၥိၭနီၪ, ဎွ့ၩဝ့ၫနံၫ ဖျိၪ့လူၬ လၧကိၪမုၬလဲၩဎုၬလၧၥိၪ လၧဆၧမၩဘိၪ့ကိၪ",
			"56": "<sup>56</sup> မုၬအဂး,- နိၪထိၩ့ထီၫ့အလယၧးၡက့လၭလဆံၫ, ဎွ့ၩ",
			"57": "<sup>57</sup> ဝ့ၫလၧဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ,- ချီဖၫဖိၪလဒုၩ, ၥိၪဖၫလ",
			"58": "<sup>58</sup> ဒုၩ, ၥိၪလနံၪ့ဖိၪလဒုၩလၧဆၧလုမ့ၪအဂး,- ဘ့ၪဖိၪလ",
			"59": "<sup>59</sup> ဒုၩလၧဆၧလုဆၧဒဲၩဘၭအဂး,- ချီဖၫနံၫဒုၩ, ၥိၪဖၫယဲ ဒုၩ,ဘ့ၪဖၫယဲဒုၩ, ၥိၪလနံၪ့ဖိၪယဲဒုၩ လၧဆၧလုဘၪလိၬ အိၭလိၬအဂးလီၫ. အနီၪမွဲစပဒၫဇၧၫအဖိၪခွၫ စဂမၫ လအ့လၭအဆၧမၩဘိၪ့လီၫ.",
			"60": "<sup>60</sup> ခွံၫနံၩလနံၩနီၪ ၦဘံၪ့ယမံၫ့ဖိၪအၦဒိၪ စဂံဒအိၫနဲၫ",
			"61": "<sup>61</sup> အဖိၪခွၫစအဘဲဒၫ့မၩဘိၪ့ဆၧလီၫ.- အဝ့ၫဒၪအဆၧမၩ ဘိၪ့နီၪမွဲလိၫ့စ့ၩ လဖျိၪ့အလယၧးၡက့လၭလယၩၥၧၫ့ ဆံၫ,ထွ့ၫစ့ၩလဖျိၪ့ အလယၧးၡက့လၭနွ့ၫဆံၫဘဲၫဆၧ အလးဆံၫ့ဎံၪအၡက့လၭအၥိၭနီၪ ဎွ့ၩဝ့ၫနံၫဖျိၪ့လူၬ လၧကိၪမုၬလဲၩဎုၬ လၧၥိၪလၧဆၧ မၩဘိၪ့ကိၪမုၬအ",
			"62": "<sup>62</sup> ဂး,- နိၪထိၩ့ထီၫ့လဘံၪ့အလယၧးၡက့လၭလဆံၫ,",
			"63": "<sup>63</sup> ဎွ့ၩဝ့ၫလၧဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ,- ချီဖၫဖိၪလဒုၩ,ၥိၪဖၫ",
			"64": "<sup>64</sup> ဖိၪလဒုၩ, ၥိၪလနံၪ့ဖိၪလဒုၩလၧဆၧလုမ့ၪအဂး,- ဘ့ၪ",
			"65": "<sup>65</sup> ဖိၪလဒုၩလၧဆၧလုဆၧဒဲၩဘၭအဂး,- ချီဖၫနံၫဒုၩ, ၥိၪ ဖၫယဲဒုၩ, ဘ့ၪဖၫယဲဒုၩ, ၥိၪလနံၪ့ဖိၪယဲဒုၩလၧဆၧလု ဘၪလိၬအိၭလိၬအဂးလီၫ. အနီၪမွဲ စဂ့ၭဒအိၫနဲၫအ ဖိၪခွၫ စအဘဲဒၫ့ အဆၧမၩဘိၪ့နီၪလီၫ.",
			"66": "<sup>66</sup> ဆံၫနံၩလနံၩနီၪ ၦဒၫ့ဖိၪအၦဒိၪစအၫမၡၭဒအဲၫအ",
			"67": "<sup>67</sup> ဖိၪခွၫစအဟဲအဇၧၫမၩဘိၪ့ဆၧလီၫ.- အဝ့ၫဒၪအဆၧ မၩဘိၪ့နီၪမွဲလိၫ့စ့ၩလဖျိၪ့ အလယၧးၡက့လၭလယၩ ၥၧၫ့ဆံၫ, ထွ့ၫစ့ၩအလယၧးၡက့လၭနွ့ၫဆံၫ, ဘဲၫဆၧ အလးဆံၫ့ဎံၪအၡက့လၭအၥိၭနီၪ, ဎွ့ၩဝ့ၫနံၫဖျိၪ့လူၬ လၧကိၪမုၬလဲၩဎုၬ လၧၥိၪလၧဆၧ မၩဘိၪ့ကိၪမုၬ အ",
			"68": "<sup>68</sup> ဂး,- နိၪထိၩ့ထီၫ့အလယၧးၡက့လၭလဆံၫ, ဎွ့ၩဝ့ၫ",
			"69": "<sup>69</sup> လၧဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ,- ချီဖၫဖိၪလဒုၩ,ၥိၪဖၫလဒုၩ,",
			"70": "<sup>70</sup> ၥိၪလနံၪ့ဖိၪလဒုၩလၧဆၧလုမ့ၪအဂး,- ဘ့ၪဖိၪလဒုၩ",
			"71": "<sup>71</sup> လၧဆၧလုဆၧဒဲၩဘၭအဂး,- ချီဖၫနံၫဒုၩ, ၥိၪဖၫယဲ ဒုၩ,ဘ့ၪဖၫယဲဒုၩ, ၥိၪလနံၪ့ဖိၪယဲဒုၩ, လၧဆၧလုဘၪ လိၬအိၭလိၬအဂးလီၫ. အနီၪမွဲစအၫမၡၭဒအဲၫအဖိၪ ခွၫစအဟဲအဇၧၫ အဆၧမၩဘိၪ့လီၫ.",
			"72": "<sup>72</sup> ဆံၫလနံၩလနံၩနီၪ မွဲၦအၭၡၧၫဖိၪအၦဒိၪစအီၭရၫ့",
			"73": "<sup>73</sup> အဖိၪခွၫစပ့ၫဂအ့လၭနီၪမၩဘိၪ့ဆၧလီၫ. အဝ့ၫဒၪအ ဆၧမၩဘိၪ့နီၪ မွဲလိၫ့စ့ၩ အလယၧးၡက့လၭလယၩ ၥၧၫ့ဆံၫ,ထွ့ၫစ့ၩလဖျိၪ့အလယၧးၡက့ၭလၭနွ့ၫဆံၫ, ဘဲၫ ဆၧအလးဆံၫ့ဎံၪအၡက့လၭအၥိၭနီၪ ဎွ့ၩဝ့ၫနံၫဖျိၪ့ လူၬ လၧကိၪမုၬလဲၩဎုၬ လၧၥိၪ လၧဆၧမၩဘိၪ့ ကိၪမုၬ",
			"74": "<sup>74</sup> အဂး,- နိၪထိၩ့ထီၫ့အလယၧးၡက့လၭလဆံၫ, ဎွ့ၩဝ့ၫ",
			"75": "<sup>75</sup> လၧဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ,- ချီဖၫဖိၪလဒုၩ,ၥိၪဖၫလဒုၩ,",
			"76": "<sup>76</sup> ၥိၪလနံၪ့ဖိၪလဒုၩလၧဆၧလုမ့ၪအဂး,- ဘ့ၪဖိၪလဒုၩ",
			"77": "<sup>77</sup> လၧဆၧလုဆၧဒဲၩဘၭအဂး,- ချီဖၫနံၫဒုၩ,ၥိၪဖၫယဲဒုၩ, ဘ့ၪဖၫယဲဒုၩ, ၥိၪလနံၪ့ဖိၪယဲဒုၩ, လၧဆၧလုဘၪလိၬ အိၭလိၬအဂးလီၫ. အနီၪမွဲစအီၭရၫ့ အဖိၪခွၫစပ့ၫဂ အ့လၭအဆၧမၩဘိၪ့လီၫ.",
			"78": "<sup>78</sup> လဆံၫနံၫနံၩလနံၩနီၪ ၦနၭၥလဲၫအၦဒိၪစအံနၫ့အ",
			"79": "<sup>79</sup> ဖိၪခွၫစအဟဲရၫနီၪမၩဘိၪ့ဆၧလီၫ.- အဝ့ၫဒၪအဆၧ မၩဘိၪ့နီၪ မွဲလိၫ့စ့ၩလဖျိၪ့အလယၧးၡက့လၭလယၩ ၥၧၫ့ဆံၫ, ထွ့ၫစ့ၩလဖျိၪ့အလယၧးၡက့လၭနွ့ၫဆံၫ, ဘဲၫ ဆၧအလးဆံၫ့ဎံၪ အၡက့လၭအၥိၭနီၪ, ဎွ့ၩဝ့ၫနံၫဖျိၪ့ လူၬလၧကိၪမုၬလဲၩဎုၬလၧၥိၪ လၧဆၧမၩဘိၪ့ကိၪမုၬ",
			"80": "<sup>80</sup> အဂး,- နိၪထိၩ့ထီၫ့လဘံၪ့အလယၧးၡက့လၭလဆံၫ",
			"81": "<sup>81</sup> ဎွ့ၩဝ့ၫလၧဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ,- ချီဖၫဖိၪလဒုၩ, ၥိၪဖၫ",
			"82": "<sup>82</sup> လဒုၩ, ၥိၪလနံၪ့ဖိၪလဒုၩ လၧဆၧလုမ့ၪအဂး,- ဘ့ၪဖိၪ",
			"83": "<sup>83</sup> လဒုၩလၧဆၧလုဆၧဒဲၩဘၭအဂး,- ချီဖၫနံၫဒုၩ, ၥိၪဖၫ ယဲဒုၩ,ဘ့ၪဖၫယဲဒုၩ, ၥိၪလနံၪ့ဖိၪယဲဒုၩ လၧဆၧလုဘၪ လိၬအိၭလိၬအဂးလီၫ. အဝ့ၫနီၪမွဲစအံနၫ့အဖိၪခွၫစအ",
			"84": "<sup>84</sup> ဟဲရၫအဆၧမၩဘိၪ့နီၪလီၫ.- အနီၪမွဲဆၧမၩဘိၪ့ဖလါ ဆၧလုလး, လၧမုနံၩလၧအဘၪဆၧဂုၪဝ့ၫ လၧၦအံၫစရ့ လၭဖိၪအၦဒိၪလဖၪလီၫ. လိၫ့စ့ၩလဆံၫနံၫဖျိၪ့, ထွ့ၫစ့ၩ",
			"85": "<sup>85</sup> လဆံၫနံၫဖျိၪ့,နိၪထိၩ့ထီၫ့လဆံၫနံၫဘံၪ့,- လိၫ့စ့ၫလ ဖျိၪ့အလယၧးၡက့လၭလယၩၥၧၫ့ဆံၫဆုၬဆုၬနီၪ, ထွ့ၫ လဖျိၪ့နွ့ၫဆံၫဆုၬဆုၬလီၫ. လိၫ့စ့ၩဒဲထွ့ၫစ့ၩထီးအလူၬ အလယၧးၡက့လၭနံၫထီၫ့လံယၩ ဘဲၫဆၧအလးဆံၫ့",
			"86": "<sup>86</sup> ဎံၪအၡက့လၭအၥိၭနီၪလီၫ.- နိၪထိၩ့ထီၫ့နီၪအီၪလ ဆံၫနံၫဘံၪ့ဎွ့ၩလၧဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ, လဘံၪ့ဆံၫၡ က့လၭ, လဘံၪ့ဆံၫၡက့လၭဘဲၫဆၧအလးဆံၫ့ဎံၪအ ၡက့လၭအၥိၭနီၪလီၫ. နိၪထိၩ့ထီၫ့ထီးအလူၬ မွဲၡက့",
			"87": "<sup>87</sup> လၭလယၩနံၫဆံၫလီၫ.- ကယဲချီဖၫလၧဆၧလုမ့ၪအ ဂးနီၪမွဲလဆံၫနံၫဒုၩ, ၥိၪဖၫလဆံၫနံၫဒုၩ, ၥိၪလနံၪ့ဖိၪ လဆံၫနံၫဒုၩ, အီၪလၧအဆၧမၩဘိၪ့ကိၪမုၬအဂးလီၫ. ဒဲဘ့ၪဖိၪၥံၪလၧဆၧလုဆၧဒဲၩဘၭအဂးနီၪ အီၪလဆံၫ",
			"88": "<sup>88</sup> နံၫဒုၩလီၫ.- တၭကယဲချီဖၫၥံၪ, လၧဆၧလုဘၪလိၬအိၭ လိၬအဂးနီၪမွဲနံၫဆံၫလံဒုၩ, ၥိၪဖၫဎူၫဆံၫ, ဘ့ၪဖၫဎူၫ ဆံၫ,ၥိၪလနံၪ့ဖိၪဎူၫဆံၫတၭး အနီၪမွဲဆၧမၩဘိၪ့ဖလါ ဆၧလုလးလၧအဘၪဆၧဂုၪဝ့ၫ အလးခဲၫ့နီၪလီၫ.",
			"89": "<sup>89</sup> တၭထီးစမိစ့ၭလ့ၩနုၬလၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ ဎံၪဖၧၩ့, ဘဲၫၥိၭအမိချဲၩ့ဒုၪ့ (ယွၩ) တၭ, နါဂၧၫ့ၦချဲၩ့ ဒုၪ့ဝ့ၫလၧဆၧယၫ့ၥၭအဖၫ့ခိၪ လၧအအီၪလၧဆၧအုၩ့ လၩ့အတလၫအဖၫ့ခိၪ လၧခ့ၫရူၬနံၫဒုၩအဘိၩ့ဆၧၩ့ နီၪး မွဲအချဲၩ့ဒုၪ့အဝ့ၫဒၪလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ချဲၩ့ ဆၧလၧစအၫရၧၫ့တၭ, စံၭအဝ့ၫ, ထီးနအ့ၪစီၩ့ထၪ့မ့ၪ ဒိၩ့ၥံၪတၭ, မ့ၪဒိၩ့နွ့ၫဖျိၪ့လဖၪနီၪ ဘၪဖၩ့ထၪ့ဆဲၫဎၩ့",
			"3": "<sup>3</sup> လိၬအၥၭလၧမ့ၪဒိၩ့မိၡါလီၫ.- တၭစအၫရၧၫ့ မၩဝ့ၫ ဘဲၫနီၪလီၫ. မွဲအစီၩ့ထၪ့မ့ၪဒိၩ့ၥံၪ ဆဲၫဎၩ့လၧမ့ၪဒိၩ့မိ",
			"4": "<sup>4</sup> ၡါ,ဘဲၫယဟိဝၩမၪလူၬစမိစ့ၭအၥိၭနီၪလီၫ.- တၭမ့ၪ ဒိၩ့မိၡါနီၪ မွဲထီၫ့ခိလီၪ့လလီၪ့ လၧဆၧဘၪဆဲၫ့လၧအ ထုၪ့မွဲဂ့ၩ, ဒဲလၧအဖီၫလဖၪမွဲဂ့ၩ, မွဲထီၫ့လလီၪ့ဎးလီၫ. ဘဲၫဆၧအဒီၩ့အထ့ၬ လၧယဟိဝၩဒုၭနဲၪစမိစ့ၭအၥိၭ နီၪ,အဝ့ၫဒၪ မၩမ့ၪဒိၩ့မိၡါ ဘဲၫနီၪအၥိၭလီၫ.",
			"5": "<sup>5</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, မၩန့ ၦလံဝဲၫဖိၪ လၧၦအံၫစရ့လၭဖိၪအကျၩတၭ, မၩဆံၫ့",
			"7": "<sup>7</sup> ထၪ့အဝ့ၫၥံၪဆံၭ.- တၭဘဲၫၥိၭနမိမၩဆံၫ့ထၪ့ဝ့ၫနီၪန ဘၪမၩဝ့ၫဘဲၫယီၩ, ဎွံၪထံၫဆံၫ့ဎံၪလၧအလီၩ့တၭ, မွဲ အလိၩ့အဆီၪ့လၧအယၪလီၩ့ထၧၫ့ဂၩယၫ, ဒဲအၪ့ဆူၫ",
			"8": "<sup>8</sup> ဝၭအကီၩ့အၥိၭ, ဒဲမၩဆံၫ့ထၪ့အနၫ့ဆါၥံၪဆံၭ.- တၭ မွဲအမၩန့ချီဖၫဖိၪလဒုၩ, ဒဲအဆၧမၩဘိၪ့ကိၪမုၬ, ကိၪ မုၬလဲၩဎုၬအၥၭ လၧၥိၪနီၪဆံၭ. တၭနဘၪမၩန့ချီဖၫ",
			"9": "<sup>9</sup> နံၫဒုၩဒဲလဒုၩ လၧဆၧလုဆၧဒဲၩဘၭအဂးလီၫ.- နဘၪ ဂဲၫဆိၬၦလံဝဲၫဖိၪ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအမ့ၬ ယၫတၭ, ဒုၭအီၪကီၪ့ၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့",
			"10": "<sup>10</sup> ထီးအလူၬလီၫ.- နဘၪအီၪက့ၪလၩ့ ၦလံဝဲၫဖိၪလၧယ ဟိဝၩအမ့ၬယၫတၭ, ၦအံၫစရ့လၭဖိၪ မိဘၪအီၪက့ၪ",
			"11": "<sup>11</sup> အစူၪလၧၦလံဝဲၫဖိၪအလီၩ့လီၫ.- တၭစအၫရၧၫ့ဘၪဝံ ဝါၦလံဝဲၫဖိၪ လၧယဟိဝၩအမ့ၬယၫ, ၦအံၫစရ့လၭဖိၪ အဆၧမၩဘိၪ့ ဘဲၫၥိၭအမိမၩယဟိဝၩအဎီးအၡၩအ",
			"12": "<sup>12</sup> ဆၧမၩလီၫ.- ၦလံဝဲၫဖိၪဘၪအီၪက့ၪအစူၪ လၧချီဖၫ လဖၪအခိၪအလီၩ့တၭ, နဘၪလုထၪ့လဒုၩ လၧဆၧလု ဆၧဒဲၩဘၭအဂး, လဒုၩလၧဆၧလုမ့ၪလၧယဟိဝၩအ ဂး, ဘဲၫၥိၭအမိမၩဆၧဖီၩ့ဖျ့ၭ လၧၦလံဝဲၫဖိၪအဂးလီၫ.",
			"13": "<sup>13</sup> တၭနဘၪအီၪက့ၪၦလံဝဲၫဖိၪ လၧစအၫရၧၫ့အမ့ၬယၫ, ဒဲလၧအဖိၪခွၫၥံၪအမ့ၬယၫ, ဒဲမၩဘိၪ့ဝ့ၫ လၧဆၧမၩ",
			"14": "<sup>14</sup> ဘိၪ့လၧယဟိဝၩအဂးလီၫ.- ဘဲၫနီၪၥိၭနဘၪအၪ့နၩ့ ဖၭၦလံဝဲၫဖိၪလၧၦအံၫစရ့လၭဖိၪအကျၩတၭ, ၦလံဝဲၫ",
			"15": "<sup>15</sup> ဖိၪၥံၪမိကဲၪထၪ့ယဆၧလီၫ.- လၧခဲၫ့ထဲၩ့တၭၦလံဝဲၫ ဖိၪဘၪလ့ၩနုၬမၩ ဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အဆၧ မၩလီၫ. နဘၪမၩဆံၫ့ထၪ့အဝ့ၫၥံၪတၭ မၩဘိၪ့ဝ့ၫလၧ",
			"16": "<sup>16</sup> ဆၧမၩဘိၪ့အဂးလီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪနီၪဘၪ ဆၧဖ့ၪလၫ့တၡါ လၧယၧၩလၧၦအံၫစရ့လၭဖိၪအကျၩ လၧၦလၧအဝဲထၪ့ဒၧၩ့လး ထီးအလူၬအလးလီၫ. ယ မၩန့ယူၭဝ့ၫလၧယဂး လၧကယဲၦဝဲၡါ လၧၦဝဲၡါလၧ",
			"17": "<sup>17</sup> ၦအံၫစရ့လၭဖိၪအကျၩအလးယူၭ.- အဂဲးဘဲၫယီၩ ကယဲဆၧဝဲၡါ လၧၦအံၫစရ့လၭဖိၪအကျၩ,ၦၡၩမွဲဂ့ၩ, ဆၧဖိၪဆၧဎါမွဲဂ့ၩ, မွဲယဆၧလီၫ. မုလနံၩလၧယကျီၪ့ ခွံၬ ကယဲဆၧဝဲၡါ လၧခးအံဇံၭအဖၧၩ့နီၪ ယအီၪက့ၪ",
			"18": "<sup>18</sup> ဆံၫ့ဎံၪအဝ့ၫၥံၪ လၧယဂးလီၫ.- ယမၩန့ယူၭၦလံဝဲၫ ဖိၪလၧဆၧဝဲၡါ လၧၦအံၫစရ့လၭဖိၪအကျၩ ထီးအလူၬ",
			"19": "<sup>19</sup> အဂးယူၭ.- တၭယဖ့ၪလၫ့ယူၭ ၦလံဝဲၫဖိၪလၧဆၧဖ့ၪ လၫ့လၧစအၫရၧၫ့ ဒဲလၧအဖိၪခွၫလဖၪအဂး လၧၦအံၫ စရ့လၭဖိၪအကျၩ, ဘဲၫၥိၭအဝ့ၫၥံၪမိမၩၦအံၫစရ့လၭ ဖိၪအဆၧမၩ လၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪဖၧၩ့, ဒဲ မၩဆၧဖီၩ့ဖျ့ၭ လၧၦအံၫစရ့လၭဖိၪအဂး, ဘဲၫၥိၭထီး ၦအံၫစရ့လၭဖိၪ ၥုၭဘူၭအၥၭ လၧဆၧအလးဆံၫ့ဎံၪ အအီၪတၭ, ဆၧၥံၫဖျဲၪထီးအီၪလဂ့ၩလီၫ.",
			"20": "<sup>20</sup> စမိစ့ၭဒဲစအၫရၧၫ့, ဒဲကယဲၦအံၫစရ့လၭဖိၪအဆၧ အီၪကီၪ့နီၪမၩၦလံဝဲၫဖိၪ ဘဲၫကယဲဆၧလၧယဟိဝၩ မၪလူၬစမိစ့ၭ လၧၦလံဝဲၫဖိၪ အဂဲးအကၠီၪ့ အၥိၭနီၪ လီၫ. ၦအံၫစရ့လၭဖိၪ မၩအဝ့ၫၥံၪဘဲၫနီၪအၥိၭလီၫ.",
			"21": "<sup>21</sup> ၦလံဝဲၫဖိၪ မၩဆံၫ့ထၪ့ အၥၭတၭ အၪ့ဆူၫဝၭ အကီၩ့ အၥိၭတၭ, စအၫရၧၫ့မၩဘိၪ့အဝ့ၫၥံၪ လၧဆၧမၩဘိၪ့ အဂးလၧယဟိဝၩအမ့ၬယၫတၭ, စအၫရၧၫ့ မၩဆၧ",
			"22": "<sup>22</sup> ဖီၩ့ဖျ့ၭလၧအဂး ဘဲၫၥိၭအမိဆံၫ့ထၪ့ဝ့ၫလီၫ.- လၧခဲၫ့ ထဲၩ့တၭ ၦလံဝဲၫဖိၪလ့ၩနုၬမၩဆၧ လၧဆၧအီၪကီၪ့အ တဲၩဆံၫ့ဎံၪဖၧၩ့ လၧစအၫရၧၫ့ဒဲအဖိၪခွၫလဖၪ အမ့ၬယၫ လီၫ. ဘဲၫယဟိဝၩမၪလူၬ စမိစ့ၭလၧၦလံဝဲၫဖိၪအဂဲး အကၠီၪ့အၥိၭနီၪ မၩဝ့ၫ လၧအဝ့ၫၥံၪ ဘဲၫနီၪအၥိၭလီၫ. ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,",
			"23": "<sup>23</sup> ဆၧ ယီၩလမံၩ့ဘၪဆဲၫ့ လၧၦလံဝဲၫဖိၪ, လၧအၥၭၡါနံၫဆံၫ ယဲနံၪ့ဒဲလၧအဖၫ့ခိၪဒံၭ မိဘၪလ့ၩနုၬဘဲၫၥိၭ အမိဘၪ",
			"25": "<sup>25</sup> မၩဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအဆၧမၩလီၫ.- ထီးအ ၥၭဎွ့ၩထၪ့အနံၪ့ယဲဆံၫတၭ, မိဘၪအီၪပထုၬ လၧအ",
			"26": "<sup>26</sup> ဆၧမၩတၭ, မၩဘၪလၧၩ့ဝ့ၫအ့ၬ.- အ့ၪမွဲအမိမၩဆၧ အခ့ၫအၡၩအဆၧမၩ လၧအထၧၫ့ဖုဝဲလဖၪ အၥိၭလၧ ဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪဖၧၩ့, ဘဲၫၥိၭအမိယိဆၧယိ တၭ,မၩလၧၩ့အဎီးအၡၩ အဆၧမၩလၧၩ့အ့ၬ. ဘၪ မၩၦလံဝဲဖိၪ လၧဆၧယိအဂဲးအကၠီၪ့ ဘဲၫနီၪၥိၭလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> လၧအဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧခးအံဇံၭအဖၧၩ့ နံၫနံၪ့ လနံၪ့လၩခၪ့ထံၭလဘံၪ့နီၪ, ယဟိဝၩချဲၩ့ဆၧ လၧစ",
			"2": "<sup>2</sup> မိစ့ၭလၧၡါမုနၧၫ့ဖၫ စဲနၫအဖၧၩ့တၭ, စံၭဝ့ၫဒၪ,- မွဲၦ အံၫစရ့လၭဖိၪ မၩဘိၪ့လ့ၩဖၬ လၧအဆၧၫ့အထီလၧ",
			"3": "<sup>3</sup> ဆၧဖၭဝဲၩဝ့ၫနီၪဆံၭ.- လၩလဘံၪ့ယီၩ လဆံၫလံနံၩလ နံၩမုဂၪလၩ့နီၪ နၥံၪဘၪမၩဝ့ၫ လၧအဆၧၫ့အထီဆၧ ဖၭဝဲၩဝ့ၫအဖၧၩ့လီၫ. ဘဲၫအထူၫအရူၫထီးအလူၬအ ၥိၭ,ဒဲဘဲၫဆၧဘၪဆဲၫ့ လၧအဝ့ၫထီးအလူၬ အၥိၭနီၪ,",
			"4": "<sup>4</sup> နၥံၪမိဘၪထီးန့လီၫ.- တၭစမိစ့ၭလီၩဘၪ ၦအံၫစရ့",
			"5": "<sup>5</sup> လၭဖိၪဘဲၫၥိၭအမိမၩဘိၪ့လ့ၩဖၬလီၫ.- တၭလၩခၪ့ ထံၭလၩထၪ့လဆံၫလံနံၩလနံၩ မုဂၪလၩ့နီၪ အဝ့ၫၥံၪ မၩဝ့ၫလၧဘိၪ့လ့ၩဖၬ လၧၡါမုနၧၫ့ဖၫစဲနၫ အဖၧၩ့လီၫ. ဘဲၫကယဲဆၧလၧ ယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪ,ၦ အံၫစရ့လၭဖိၪမၩဝ့ၫဘဲၫနီၪအၥိၭလီၫ.",
			"6": "<sup>6</sup> ၦၡၩလနၩ့နၩ့, လၧအဘၪဆၧလဆံၫ့ဘၪလၧၦၡၩ အစွၪအကၠီၩ့တၭ, လၧမုလနံၩနီၪ အဝ့ၫၥံၪထီးန့ဘိၪ့ လ့ၩဖၬၥ့ၪအ့ၬ. တၭလၧမုလနံၩနီၪ အဝ့ၫၥံၪဂဲၫလၧစ",
			"7": "<sup>7</sup> မိစ့ၭဒဲစအၫရၧၫ့အအီၪ,- တၭၦလဖၪနီၪစံၭအဝ့ၫ, ပဝ့ၫ ဒၪယီၩပဘၪဆၧလဆံၫ့ဘၪလၧၦလဂၩ အစွၪလါနၫ့ တၭ, ဆၧပဒၩ့ပၧၩ ဘဲၫၥိၭပထီးမၩဘိၪ့ယဟိဝၩအ ဆၧမၩဘိၪ့ လၧအဆၧၫ့အထီ ဖၭဝဲၩဝ့ၫအဖၧၩ့, လၧ",
			"8": "<sup>8</sup> ၦအံၫစရ့လၭဖိၪအကျၩလဂ့ၩနီၪ,မွဲဘၪလဲၪ.- စမိစ့ၭ စံၭအဝ့ၫၥံၪ,အီၪခိၭဒၪခလူၬဘီၪး တၭယဟိဝၩမိမၪ လူၬဆၧလၧနၥံၪအဂဲးအကၠီၪ့ဘဲၫၥ့ၪလဲၪနီၪ, ယမိခိၭနၪ လီၫ. ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,",
			"9": "<sup>9</sup> လီၩ ဘၪၦအံၫစရ့လၭဖိၪတၭ စံၭဝ့ၫ, ထီးဒၪၦၡၩလၧနၥံၪ အကျၩမွဲဂ့ၩ, လၧနၥံၪအဆၨၩအဆၬ အကျၩမွဲဂ့ၩ, အ့ၪဘၪဆၧလဆံၫ့ဘၪ လၧဆၧအစွၪမွဲဂ့ၩ, အ့ၪအီၪ လၧဖၧၩ့ၥၭလၧအယဲၩ့မွဲဂ့ၩ, လါနၫ့, မိဘၪထီးန့ဘိၪ့",
			"11": "<sup>11</sup> လ့ၩဖၬ လၧယဟိဝၩအဂးဆ့လီၫ.- လၩနံၫဘံၪ့ လ ဘံၪ့လၩထၪ့လဆံၫလံနံၩလနံၩ လၧမုဂၪလၩ့နီၪအဝ့ၫ ၥံၪဘၪထီးန့ဝ့ၫ, ဘၪအၪ့ကိၪလအီၪဘၪ လၧမံၪဒဲဆၧ",
			"12": "<sup>12</sup> ခၪလီၫ.- မွဲအအီၪက့ၪလၩ့ထးဘၪ ထီးဆၧဖၩ့ထၪ့နး ဆံၭအ့ၬ. တၭဘိၭခါဘၪအဎွံၪနးဘီၩ့အ့ၬ, ဘဲၫကယဲ ဘိၪ့လ့ၩဖၬအထူၫအရူၫအၥိၭနီၪ အဝ့ၫမိဘၪထီးန့ဝ့ၫ",
			"13": "<sup>13</sup> လီၫ.- အ့ၪမွဲၦအဆံၫ့လမွဲဘၪ ၦလ့ၩဆၧလစီၪ့စီၪ့နီၪလ ထီးန့ဘၪဘိၪ့လ့ၩဖၬတၭ, မိဘၪဆၧဒၪ့ထ့ၬခွံၬလၧအ ၡၩလဆၨၩဒၪဝ့ၫအကျၩလီၫ. အဂဲးဘဲၫယီၩ ဆၧမၩ ဘိၪ့ယဟိဝၩအဆၧမၩဘိၪ့ လၧအဆၧၫ့အထီဖၭဝဲၩ ဝ့ၫ,လဂဲၫဆိၬဘၪဝ့ၫတၭ, ၦလဂၩနီၪ မိဘၪအဆၧဒဲၩ",
			"14": "<sup>14</sup> ဘၭလီၫ.- တၭၦလခီၫဘၩ့မုးဖိၪ လၧအအီၪလၧနၥံၪအ ကျၩလဂၩနီၪအၥၭအ့ၪအီၪ လၧအမိထီးန့ဘိၪ့လ့ၩဖၬ လၧယဟိဝၩအဂး, ဘဲၫဆၧလ့ၩဖၬ အထူၫအရူၫအ ၥိၭ, ဘဲၫဆၧစ့ၩရၫ့ဘၪဆဲၫ့ လၧဆၧနီၪအၥိၭ, မွဲအမိ ဘၪမၩဘဲၫနီၪလီၫ. နၥံၪဘၪအီၪ လၧဆၧအထူၫအရူၫ လမံၩ့ဎး လၧၦလခီၫဘၩ့မုးဖိၪအဂး ဒဲလၧၦလၧအအီၪ ဖျဲၪလၧခးဖၧၩ့အဂးလီၫ.",
			"15": "<sup>15</sup> တၭမုလနံၩ လၧၦမၩကဲၪထၪ့ တဲၩဆံၫ့ဎံၪနီၪဆၧ အုၪ့လၩ့ဘံၭခွံၬတဲၩဆံၫ့ဎံၪ ထီးဆၧထိးအၥၭအတဲၩ အဖၫ့ခိၪလီၫ. တၭမုဂၪလၩ့ထီၩ့လၧမုဂီၩနီၪ ဆၧလၩ့ ဂၬလၧမ့ၪ အဆၧဖၩ့အီၪဝ့ၫ လၧတဲၩဆံၫ့ဎံၪ အဖၫ့ခိၪ",
			"16": "<sup>16</sup> လီၫ.- ဆၧမၩအၥၭဘဲၫနီၪ လထံၪဎးလီၫ. လၧမုဆၫ လခီၫဆၧအုၪ့လၩ့ဘံၭဝ့ၫ, ဒဲလၧမုနၩလခီၫ ဆၧလၩ့",
			"17": "<sup>17</sup> ဂၬမ့ၪနီၪလီၫ.- ထီးဆၧအုၪ့ဘၪ ဆၧမၩန့ထၪ့ခွံၬဝ့ၫ လၧတဲၩဆံၫ့ဎံၪအဖၫ့ခိၪတၭ, ထီးနီၪလဖၧၫ့ ၦအံၫစရ့ လၭဖိၪၥံၪလ့ၩဆၧလီၫ. တၭထီးဆၧအုၪ့အီၪဝ့ၫနီၪ ၦ အံၫစရ့လၭဖိၪၥံၪ ဆၪ့ထၪ့အတဲၩလဖၪ ထီးနီၪလီၫ.",
			"18": "<sup>18</sup> ထီးယဟိဝၩအဆၧမၪလူၬ အီၪဝ့ၫနီၪ ၦအံၫစရ့လၭဖိၪ ၥံၪလ့ၩဆၧ, ဒဲထီးယဟိဝၩ အဆၧမၪလူၬအီၪဝ့ၫနီၪဆၫ့ ထၪ့အတဲၩလဖၪလီၫ. ထီးဒၪအမုနံၩၥံၪ လၧဆၧအုၪ့ အီၪဝ့ၫလၧတဲၩဆံၫ့ဎံၪအဖၫ့ခိၪ အဘိၩ့ဘၭနီၪ အဝ့ၫၥံၪ",
			"19": "<sup>19</sup> အီၪဝ့ၫလၧတဲၩလဖၪအဖၧၩ့လီၫ.- ထီးဆၧအုၪ့အီၪဝ့ၫ လၧတဲၩဆံၫ့ဎံၪအဖၫ့ခိၪ အၪနံၩအၪၥၫ့တၭ, ၦအံၫစရ့ လၭဖိၪၥံၪ ထီးန့ ယဟိဝၩ အဆၧမၪလူၬ တၭလ့ၩဝ့ၫ",
			"20": "<sup>20</sup> အ့ၬ.- တၭလၧဆၧအုၪ့အီၪဝ့ၫ လၧတဲၩဆံၫ့ဎံၪအဖၫ့ခိၪ မုနံၩလနၩ့နၩ့နီၪ, ဆၧမၩအၥၭဘဲၫယဟိဝၩ အဆၧ မၪလူၬအၥိၭ, အဝ့ၫၥံၪအီၪလၧတဲၩလဖၪအဖၧၩ့တၭ, ဘဲၫယဟိဝၩအဆၧမၪလူၬအၥိၭနီၪ အဝ့ၫၥံၪလ့ၩဆၧ",
			"21": "<sup>21</sup> လီၫ.- ထီးဆၧအုၪ့အီၪလၧမုဂၪလၩ့ ထီၩ့လၧမုဂီၩတၭ, ဆၧအုၪ့ဘၪဆၧမၩန့ထၪ့ခွံၬ လၧမုဂီၩနီၪ, ဆၧမၩအ ၥၭလၧအဝ့ၫၥံၪလ့ၩဆၧလီၫ. မုဆၫမွဲဂ့ၩ, မုနၩမွဲဂ့ၩ, ဆၧအ့ၪမၩန့ထၪ့ခွံၬ ဆၧအုၪ့တၭ အဝ့ၫၥံၪ လ့ၩဆၧ",
			"22": "<sup>22</sup> လီၫ.- ဆၧအုၪ့အ့ၪအီၪ လၧတဲၩဆံၫ့ဎံၪအဖၫ့ခိၪနံၫနံၩ မွဲဂ့ၩ,လၩလဘံၪ့မွဲဂ့ၩ, လနံၪ့မွဲဂ့ၩ, ၦအံၫစရ့လၭဖိၪ ၥံၪအီၪဝ့ၫ လၧအတဲၩလဖၪအဖၧၩ့တၭ, လ့ၩဆၧအ့ၬ. ထီးဆၧမၩန့ထၪ့ခွံၬဝ့ၫတၭ, အဝ့ၫၥံၪ လ့ၩဆၧလီၫ.",
			"23": "<sup>23</sup> ဘဲၫယဟိဝၩအဆၧမၪလူၬ အၥိၭအဝ့ၫၥံၪအီၪ လၧအ တဲၩလဖၪအဖၧၩ့, ဒဲဘဲၫယဟိဝၩအဆၧမၪလူၬအၥိၭ နီၪအဝ့ၫၥံၪလ့ၩဆၧလီၫ. ဆၧမၪလူၬဘဲၫယဟိဝၩမၪ လူၬစမိစ့ၭအၥိၭနီၪ အဝ့ၫၥံၪထီးန့ဝ့ၫလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, တဲၩ့န့ ခွ့ၩစ့ၩနံၫဖျိၪ့လၧနဂးဆံၭ. နဘၪမၩဝ့ၫလၧဆၧခိလီၪ့ လလီၪ့ဎးလီၫ. တၭမိအီၪလၧနဂး ဘဲၫၥိၭနမိကိၭထၪ့ ဆၧအီၪကီၪ့, ဒဲဘဲၫၥိၭနမိဒုၭလ့ၩထၪ့ ၦၡၩအီၪလၧၥုၪ့",
			"3": "<sup>3</sup> တဲၩအလးဖၧၩ့နီၪလီၫ.- ထီးၦအူၪထၪ့ဝ့ၫတၭ, ၦဆၧ အီၪကီၪ့ဖိၪ မိဘၪအီၪကီၪ့ လၧနအီၪထီးဆၧအီၪကီၪ့",
			"4": "<sup>4</sup> အတဲၩဆံၫ့ဎံၪအတရၫ့နီၪ ထီးအလူၬလီၫ.- ၦအ့ၪအူၪ ဝ့ၫန့ၫလဖျိၪ့တၭ, ၦဒိၪလဖၪၦအံၫစရ့လၭဖိၪ အထီၫ့",
			"5": "<sup>5</sup> လဖၪအခိၪၥံၪနီၪ မိဘၪအီၪကီၪ့လၧနအီၪလီၫ.- ထီးန ၥံၪအူၪဆၧၥၭမဲၪအၥီၫတၭ, ၦအတဲၩၥံၪအီၪလၧမုထၪ့",
			"6": "<sup>6</sup> လခီၫနီၪမိလ့ၩဆၧလီၫ.- ထီးနၥံၪအူၪဆၧၥၭမဲၪအၥီၫ နံၫဘျၩ့လဘျၩ့နီၪတၭ, ၦအတဲၩၥံၪအီၪလၧမုခံၫ့လခီၫ နီၪဘၪလ့ၩဆၧလီၫ. လၧအလ့ၩဆၧအဂးနီၪဘၪအူၪ",
			"7": "<sup>7</sup> ဆၧၥၭမဲၪအၥီၫလီၫ.- အ့ၪမွဲထီးၦဆၧအီၪကီၪ့ဖိၪ မိ အီၪကီၪ့တၭ, နၥံၪဘၪအူၪဆၧလါနၫ့တၭ, အူၪဆၧၥၭ",
			"8": "<sup>8</sup> မဲၪအၥီၫလဂ့ၩ.- တၭၦလုဆၧလဖၪ, စအၫရၧၫ့အဖိၪ ခွၫလဖၪဘၪအူၪခွ့ၩလီၫ. တၭမိကဲၪထၪ့ ဆၧအထူၫ အရူၫအဆိၩအကၠၪ လၧနၥံၪအဆၨၩ အဆၬလဆိၩ",
			"9": "<sup>9</sup> ဘၪလဆိၩလီၫ.- တၭနၥံၪအ့ၪဒုၭၥုၭ လၧနၥံၪအခး ဖၧၩ့နီၪ, နၥံၪအဒုၪအဒၩ လၧအမၩအၧၩ့ မၩၥၫ့နၥံၪ တၭ,နၥံၪဘၪအူၪထၪ့ခွ့ၩ လၧဆၧၥၭမဲၪအၥီၫတၭ, န ၥံၪမိဘၪဆၧနၪ့ထၪ့ထဲၩ့နၥံၪ လၧယဟိဝၩနၥံၪအယွၩ အမ့ၬယၫ, ဒဲနၥံၪမိဘၪဆၧမၩဖီၩ့မၩဖျ့ၭနၥံၪ လၧနၥံၪ",
			"10": "<sup>10</sup> အဒုၪအဒၩ အစူၪဖၧၩ့လီၫ.- တၭလၧနၥံၪၥုၪ့ထိၬၥၭ ထိၬအမုနံၩလဖၪ, ဒဲလၧနၥံၪမၩဘိၪ့အဆၧၫ့အထီဒဲ လၧနၥံၪအလၩလဖၪအခၪ့ထံၭနီၪ နၥံၪဘၪအူၪခွ့ၩထီး နၥံၪအဆၧလုမ့ၪ, ဒဲထီးနၥံၪ အဆၧလုဘၪလိၬအိၭ လိၬ, ဘဲၫၥိၭအမိကဲၪထၪ့ဆၧနၪ့ထၪ့ထဲၩ့ ဆၧလၧနၥံၪ အဂးလၧနၥံၪအယွၩအမ့ၬယၫလီၫ. ယဝ့ၫဒၪယီၩယ မွဲယဟိဝၩနၥံၪအယွၩလီၫ.",
			"11": "<sup>11</sup> တၭလၧနံၫနံၪ့လနံၪ့, လၩနံၫဘံၪ့လဘံၪ့ လၩထၪ့အ နံၩနံၫဆံၫနီၪ, ဆၧမၩအၥၭလၧဆၧမၩန့ထၪ့ခွံၬ ဆၧ အုၪ့လၧဆၧထိးအၥၭ အတဲၩဆံၫ့ဎံၪအဖၫ့ခိၪလီၫ.",
			"12": "<sup>12</sup> ၦအံၫစရ့လၭဖိၪ စဲၪ့ထၪ့လၧၡါမုနၧၫ့ဖၫ စဲနၫအဖၧၩ့ တၭ, ဆၧအုၪ့အီၪထီဝ့ၫ လၧၡါမုနၧၫ့ဖၫပၫရၫ့နီၪလီၫ.",
			"13": "<sup>13</sup> အဝ့ၫၥံၪစဲၪ့ထၪ့ဆိၫဝ့ၫ ဘဲၫယဟိဝၩမၪလူၬဆၧလၧ စမိစ့ၭအစူၪဖၧၩ့အၥိၭနီၪလီၫ.",
			"14": "<sup>14</sup> လၧယၫလဆၫ့ၦယုဒၫဖိၪအၡၩ ဆၪ့ထၪ့တဲၩအၥုၭ ဖိၪအလၫ့ဘဲၫအၥုၭမုလဖၪအၥိၭနီၪ လ့ၩဝ့ၫတၭ, စအ မံနဒၭအဖိၪခွၫစနၫၡိၫ့ အီၪဝ့ၫလၧအၥုၭမုအဖၫ့ခိၪလီၫ.",
			"15": "<sup>15</sup> တၭစဇုအၫအဖိၪခွၫ စနၥၫ့အ့လၭ အီၪဝ့ၫလၧၦအံ",
			"16": "<sup>16</sup> စခၫလဒီၪ့အၥုၭမုအဖၫ့ခိၪလီၫ.- တၭစဟံလၧၫ့အဖိၪ ခွၫစအလဲအၭအီၪဝ့ၫ လၧၦဇ့ၭဘလၧၫ့လဒီၪ့ အၥုၭမု",
			"17": "<sup>17</sup> အဖၫ့ခိၪနီၪလီၫ.- ၦရိလၩ့ခွံၬ တဲၩဆံၫ့ဎံၪတၭ, စဂၧ ၡၧၫ့အဖိၪခွၫလဖၪ, ဒဲစမရၫရဲၫအဖိၪခွၫလဖၪ လ့ၩဝ့ၫ",
			"18": "<sup>18</sup> တၭ,ဆိၬထၪ့တဲၩဆံၫ့ဎံၪနီၪလီၫ.- တၭၦရုဘံၫ့ဖိၪအ တဲၩၥုၭဖိၪအလၫ့ လ့ၩထၪ့ဝ့ၫဘဲၫအၥုၭမုလဖၪ အၥိၭ နီၪတၭ, စရှ့ဒအၧၫအဖိၪခွၫ စအလဲဇၧၫအီၪဝ့ၫလၧအ ၥုၭမုအဖၫ့ခိၪနီၪလီၫ.",
			"19": "<sup>19</sup> တၭစဇုရၡၭဒအဲၫအဖိၪခွၫ စၡလုၫမအ့လၭ အီၪဝ့ၫ",
			"20": "<sup>20</sup> လၧၦစံမအၧၫ့လဒီၪ့ အၥုၭမုအဖၫ့ခိၪနီၪလီၫ.- တၭစဒ ယုၫအ့လၭအဖိၪခွၫစအံၫလဲစၭနီၪ အီၪဝ့ၫလၧၦဂၭလ",
			"21": "<sup>21</sup> ဒီၪ့အၥုၭမုအဖၫ့ခိၪနီၪလီၫ.- တၭၦကိဟၭဖိၪ လ့ၩ ဆၧတၭ, ဆိၬဆၧအလးဆံၫ့ဎံၪလီၫ. တၭလၧအလ ချႃၭထီၩ့ဒံၭဘၪနီၪ, ၦၡၩၥံၪမၩထၪ့တဲၩဆံၫ့ဎံၪလီၫ.",
			"22": "<sup>22</sup> ၦအံဖြံၫ့ဖိၪ အၥုၪ့တဲၩၥုၭဖိၪအလၫ့ လ့ၩထၪ့ဘဲၫအၥုၭ မုလဖၪအၥိၭနီၪတၭ, စအၫမဟၧၭအဖိၪခွၫ စအလံၭ",
			"23": "<sup>23</sup> ၡမၫနီၪအီၪဝ့ၫလၧ အၥုၭမုအဖၫ့ခိၪနီၪလီၫ.- တၭစပဒၫ ဇၧၫအဖိၪခွၫစဂမၫလအ့လၭနီၪ အီၪဝ့ၫလၧၦမနၫစ့ၫ",
			"24": "<sup>24</sup> ဖိၪလဒီၪ့ အၥုၭမုအဖၫ့ခိၪနီၪလီၫ.- တၭစဂံဒအိၫနဲၫ အဖိၪခွၫ စအၭဘဒၫ့အီၪဝ့ၫ လၧၦဘံၪ့ယမံၫ့ဖိၪ လဒီၪ့",
			"25": "<sup>25</sup> အၥုၭမုအဖၫ့ခိၪနီၪလီၫ.- တၭၦဒၫ့ဖိၪအတဲၩၥုၭဖိၪအ လၫ့နီၪလ့ၩဆၧလီၫ. မွဲအအီၪလၧၦၥုၪ့တဲၩအဒီၪ့လဖၪ ထီးအလူၬလၧအၥုၭမုလဖၪ အလးခဲၫ့လီၫ. တၭစအၫ မၡၭဒအဲၫအဖိၪခွၫ စအဟဲအဇၧၫ အီၪဝ့ၫလၧအၥုၭမု",
			"26": "<sup>26</sup> အဖၫ့ခိၪနီၪလီၫ.- တၭစအီၭရၫ့အဖိၪခွၫ စပ့ၫဂအ့လၭ အီၪဝ့ၫလၧၦအၭၡၧၫဖိၪလဒီၪ့ အၥုၭမုအဖၫ့ခိၪလီၫ.",
			"27": "<sup>27</sup> တၭစအံၫနၫ့အဖိၪခွၫ စအဟဲရၫအီၪဝ့ၫလၧၦနၭၥလဲၫ",
			"28": "<sup>28</sup> ဖိၪလဒီၪ့အၥုၭမုအဖၫ့ခိၪနီၪလီၫ.- ထီးၦအံၫစရ့လၭဖိၪ လ့ၩဆၧတၭ, ဆၧလဖၪနီၪမွဲအလ့ၩဆၧဘဲၫအၥုၭမုလ ဖၪအၥိၭနီၪလီၫ.",
			"29": "<sup>29</sup> စမိစ့ၭလီၩဘၪ ၦမံဒအၫ့ဖိၪ စရဂုၫအ့လၭ အဖိၪခွၫ စဟိဘၭ ထၧၫ့ဘူၭထၧၫ့ထံး လၧစမိစ့ၭ, ပဝ့ၫဒၪယီၩ ပလ့ၩဆၧလၧဆၧအလး လၧယဟိဝၩစံၭ, ယမိဖ့ၪလၫ့ နၥံၪတၭ, ဂဲၫနဝ့ၫဒၪလၧပၥိၭဘီၪ, တၭပမိမၩဂ့ၩနၧၩ လီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩချဲၩ့ဆၧဂ့ၩ လၧၦအံၫစရ့",
			"30": "<sup>30</sup> လၭဖိၪအဂဲးအကၠီၪ့လီၫ.- တၭအဝ့ၫဒၪစံၭဝ့ၫ, ယလ့ၩ အ့ၬ, ယမိထဲၩ့ထဲၩ့လၧယခးဒၪယဝ့ၫ, ဒဲလၧယဘူၭယ",
			"31": "<sup>31</sup> ထံးဒၪယဝ့ၫအအီၪလီၫ.- တၭအဝ့ၫနီၪစံၭဝ့ၫ, ထီးလ့ၩ ဒၪလါပၧၩလဂ့ၩ, အဂဲးဘဲၫယီၩ နၥ့ၪယၫလၧပဘၪၥုၪ့ တဲၩၥံၪလၧၡါမုနၧၫ့ဖၫနီၪတၭ, နမိကဲၪထၪ့မ့ၬၥၪအလး",
			"32": "<sup>32</sup> လၧပဂးလီၫ.- နအ့ၪလ့ၩလၧပၥိၭတၭ, ဆၧမၩအၥၭ လၧဆၧဂ့ၩလၧယဟိဝၩမၩပၧၩနီၪ ပမိမၩထဲၩ့နၧၩလၧ ဆၧလမံၩ့ဎးလီၫ.",
			"33": "<sup>33</sup> အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧယဟိဝၩအခိၪလီၩ့နီၪ လ့ၩ ၥၧၫ့နံၩဖၧၩ့ၥၭတၭ, လၧအၥၧၫ့နံၩဖၧၩ့ၥၭနီၪ ယဟိဝၩ အဆၧအုၩ့လၩ့အတလၫ လ့ၩလၧအဝ့ၫၥံၪအမ့ၬယၫ ဘဲၫၥိၭအမိအၪ့ဎၬန့ ဆၧအီၪပွံၭအလး လၧအဝ့ၫၥံၪအ ဂးလီၫ.",
			"34": "<sup>34</sup> ထီးအဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧၥုၪ့တဲၩအလးဖၧၩ့တၭ, ယဟိဝၩ အဆၧအုၪ့အီၪလၧအဖၫ့ခိၪ လၧမုဆၫလခီၫ လီၫ.",
			"35": "<sup>35</sup> ထီးတလၫနီၪလ့ၩထၪ့ဆၧတၭ, ဆၧမၩအၥၭလၧစမိ စ့ၭစံၭဝ့ၫဒၪ, ယဟိဝၩဧ့, ဂဲထုၪ့ဘီၪ, မွဲနဒုၪနဒၩလၩ့ ပြံၩလၩ့ပၩဆံၭ. မွဲၦလၧအၥၭဂဲၫ့နၧၩနီၪ စဲၪ့ဖျိၭလၧ နမ့ၬယၫဆံၭ.",
			"36": "<sup>36</sup> ထီးအအီၪပွံၭဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ယဟိဝၩဧ့,ဂဲၫထဲၩ့ ထဲၩ့ လၧၦအံၫစရ့လၭဖိၪ အထီၫ့ၥံၪအဘျၩ့အလၬလ ဖၪအအီၪနီၪဆံၭ."
		},
		"11": {
			"1": "<sup>1</sup> ၦခမျၧးၥူၭဝံၪၥူၭလၩဆၧအၧၩ့ လၧယဟိဝၩ အနါ ဖၧၩ့တၭ, ယဟိဝၩနါဂၧၫ့ဝ့ၫနီၪ, အၥၭထၪ့ခဲၩထၪ့တၭ, ယဟိဝၩအမ့ၪအၪ့ခွံၬ ၦအီၪလၧဆၧၥုၪ့တဲၩအလးလၧ",
			"2": "<sup>2</sup> အနဲၩ့ထံၭအထုၬလဖၪအဖၧၩ့နီၪလီၫ.- ၦခမျၧးနီၪကိၭ ထၪ့စမိစ့ၭတၭ, စမိစ့ၭဘၩဆိၪဖၪ ယဟိဝၩတၭ, မ့ၪ",
			"3": "<sup>3</sup> လၩ့ဖံၬခွံၬဝ့ၫဒၪလီၫ.- တၭမွဲအကိၭဆၧအလးနီၪ အ မံၩ့တၫဘံရၫလီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩအမ့ၪအၪ့ ဆၧလၧအကျၩလီၫ.",
			"4": "<sup>4</sup> ၦကျီၪမွံၩလဖၪ လၧၦခမျၧးအကျၩနီၪ ၥၭကွံၩဆၧ တၭ,ၦအံၫစရ့လၭဖိၪ ဆၧၫ့နၩ့ဂၪ့ဒီၭဝ့ၫတၭ, စံၭဝ့ၫဒၪ,",
			"5": "<sup>5</sup> မွဲပလၫမိဒုၭအၪ့ပၧၩ လၧဆၧယၪလဲၪ.- ပနၪ့ထၪ့ထဲၩ့ ဒ့ၪၥံၪယၪၥံၪ လၧပအၪ့လၧခးအံဇံၭအဖၧၩ့ အၪအၪ လ့ၬ,ထံၩၥၪၥံၪ, ဒဲတဲၪ့တီၩၥၪၥံၪ, ဒဲၥၧၫ့ခိၪၥၪဖၭဒိၪၥံၪ,",
			"6": "<sup>6</sup> ဒဲၥၧၫ့ခိၪၥၪဝီၩ, ၥၧၫ့ခိၪၥၪဘွၩလီၫ.- အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ ပၥၭဎွ့လၩ့ယူၭ, လၧမၪ့နၫယီၩအဖၫ့ခိၪ ဆၧအီၪလၧ",
			"7": "<sup>7</sup> ပမ့ၬယၫနးမံၩ့အ့ၬ.- မၪ့နၫနီၪမၩအၥၭ ဘဲၫဟီၫ့ပီၩ့ အချံၫအၥိၭတၭ, အလွ့မၩအၥၭ ဘဲၫချိၪၥဲၪ့အၥိၭနီၪ",
			"8": "<sup>8</sup> လီၫ.- ၦခမျၧးစဲၪ့ဝံၩ့ဝၩ့တၭ, အၪ့ထုၫ့ဝ့ၫတၭ, ဂူၬဝ့ၫလၧ ဆုၪ့ဂူၬမွဲဂ့ၩ, အၪ့ဆူၫဝ့ၫလၧဆုၪ့ဖၧၩ့မွဲဂ့ၩတၭ, အၪ့ ဎူဝ့ၫလၧဖၧၩ့ဖၧၩ့, ဒဲအၪ့ဎိၪမံၫ့အပၪပဲၪ လၧဖံၫ့ချၪဖၧၩ့ လီၫ. တၭထဲးယိဝ့ၫနီၪ မၩအၥၭဘဲၫၥိၪၥံၫ့ဆ့ၬအဆၧ",
			"9": "<sup>9</sup> ထဲးယိဝ့ၫအၥိၭနီၪလီၫ.- ထီးဆၩ့ထံၫလၩ့ဘၪလၧၦၥုၪ့ တဲၩအလးလၧမုနၩလခီၫတၭ, မၪ့နၫနီၪလၩ့ဘၪလၧ အဖၫ့ခိၪလီၫ.",
			"10": "<sup>10</sup> စမိစ့ၭနါဂၧၫ့ၦခမျၧးဂၪ့ဝ့ၫ လၧအဂံၪ့ဒီၪ့ထီးအလူၬ, လဂၩလၧအတဲၩအတရၫ့, လဂၩလၧအတဲၩအတရၫ့ တၭ, ယဟိဝၩအၥၭထၪ့ ခဲၩထၪ့ဝ့ၫလီၫ. တၭမွဲဆၧ",
			"11": "<sup>11</sup> အၧၩ့လၧစမိစ့ၭအမ့ၬယၫဆ့လီၫ.- တၭစမိစ့ၭစံၭဆၧ လၧယဟိဝၩ, မွဲဘၪနီၫလၧနမၩအၧၩ့နခ့ၫနၡၩလဲၪ. မွဲ ဘၪနီၫလၧယလဘၪခိးဘၪတၩ လၧနမ့ၬယၫတၭ, န အီၪက့ၪၦခမျၧးထီးအလူၬယီၩ အဆၧအွံၪဆၧယိၭလၧ",
			"12": "<sup>12</sup> ယလီၩ့လဲၪ.- မွဲယဒၧၩ့ထၪ့ယဝ့ၫ ၦခမျၧးထီးအလူၬ ယီၩဧၪ. ယဝ့ၫဒၪယီၩဘဲၫၥိၭနမိစံၭယၧၩ, ဆိၬအဝ့ၫ ၥံၪလၧနၥၭနၫၡါဘဲၫဖါယိဖိၪၥၪဆံၭနီၪ ဆိၬဝ့ၫအၥိၭ, ထီၩ့လၧခးလၧနဆိၪလၩ့နၥၭ လၧအဝ့ၫၥံၪအဖါလဖၪ",
			"13": "<sup>13</sup> နီၪ,မွဲယထၪ့ဖိၪအဝ့ၫၥံၪဆ့ဧၪ.- ယမိအီၪလၧဆၧယၪ လၧယမိဖ့ၪလၫ့ၦထီးအလူၬယီၩ ခီၫခီၫလဲၪ. အဂဲးဘဲၫ ယီၩအဝ့ၫၥံၪ ဂၪ့ဝ့ၫလၧယအီၪတၭစံၭဝ့ၫ, ဖ့ၪလၫ့ပၧၩ",
			"14": "<sup>14</sup> လၧဆၧယၪဘဲၫၥိၭပမိအၪ့ဆၧဘီၪ.- ယဆိၬယဝ့ၫၦ ထီးအလူၬအဆၧယီၩ လဂၩဎးကဲၪအ့ၬ. အဂဲးဘဲၫယီၩ",
			"15": "<sup>15</sup> ဎၧၫ့လါကဲၪကၩလၧယဂးလီၫ.- နအ့ၪမၩယၧၩဘဲၫ နီၪတၭ, ယအ့ၪဘၪခိးဘၪတၩ လၧနမ့ၬယၫတၭ, မၩ ၥံၫလါယၧၩတၡါဆံၭ. မွဲယထီးဒၪဘၪ ယဆၧအၧၩ့ လဂ့ၩ.",
			"16": "<sup>16</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, ဒုၭအီၪကီၪ့ၦၥုၪ့က့ၭၥၭၡါ နွ့ၫဆံၫလၧယအီၪယီၩ, ၦလၧနၥ့ၪယၫလၧအမွဲၦခမျၧး အၥုၪ့က့ၭၥၭၡါ, ဒဲကဲၪၦဒိၪၥံၪလၧအဖၫ့ခိၪနီၪ, ဂဲၫဆိၬ ဝ့ၫလၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪဖၧၩ့, ဘဲၫၥိၭအမိ",
			"17": "<sup>17</sup> ဆၧၫ့ထုၪ့ထီးနီၪလၧနၥိၭဆံၭ.- ယမိဂဲၫလၩ့ချဲၩ့ဒုၪ့နၧၩ ထီးနီၪတၭ, ယမိမၩန့ၥၭ လၧအအီၪလၧနလီၩ့လနၩ့ တၭ,ယမိအီၪက့ၪလၩ့လၧအဝ့ၫၥံၪအလီၩ့တၭ, အဝ့ၫ ၥံၪဘၪဆိၬ ၦခမျၧးအဆၧအွံၪဆၧယိၭ လၧနၥိၭတၭ,",
			"18": "<sup>18</sup> နဆိၬဘၪလဂၩဎးအ့ၬ.- တၭနဝ့ၫဒၪယီၩ စံၭၦခမျၧး, မၩဆံၫ့ဎံၪလၩ့နၥံၪအၥၭ လၧကဲဂီၩခိၬအဂးဆံၭး တၭ နၥံၪမိအၪ့ဆၧယၪလီၫ. အဂဲးဘဲၫယီၩ နၥံၪဂၪ့လၧယ ဟိဝၩ အနါဖၧၩ့တၭ, စံၭ, မွဲပလၫမိဒုၭအၪ့ပၧၩ လၧ ဆၧယၪလဲၪ. အဂဲးဘဲၫယီၩ လၧခးအံဇံၭအဖၧၩ့နီၪ, ဆၧဂ့ၩအီၪလၧပဂးလီၫ. တၭယဟိဝၩ မိဖ့ၪလၫ့နၥံၪ",
			"19": "<sup>19</sup> လၧဆၧယၪဘဲၫၥိၭနၥံၪမိအၪ့ဘၪလီၫ.- တၭနၥံၪမိအၪ့ ဆၧလနံၩနီၪကၭအ့ၬ, နံၫနံၩကၭအ့ၬ, ယဲနံၩကၭအ့ၬ,",
			"20": "<sup>20</sup> ဆံၫနံၩကၭအ့ၬ, အနံၩနံၫဆံၫကၭအ့ၬ,- အ့ၪမွဲလၩ ထၧၫ့ဘံၪ့ယၫထီးအဂဲၫထၪ့ လၧနၥံၪအနၫဖၧၩ့တၭ, မိ ကဲၪထၪ့ဆၧၥၭလဲၩလၧနၥံၪအဂးလီၫ. အဂဲးဘဲၫယီၩ နၥံၪလဒူၩလယၪ့ဘၪယဟိဝၩလၧအအီၪ လၧနၥံၪအ ကျၩတၭ, နၥံၪဂၪ့ယူၭလၧအမ့ၬယၫတၭ, စံၭ,ပဂဲၫစဲၪ့",
			"21": "<sup>21</sup> ထၪ့ခွံၬလၧအံဇံၭနီၪ မွဲအဂဲးဘဲၫၥ့ၪလဲၪ.- တၭစမိစ့ၭ စံၭဝ့ၫဒၪ, ၦခမျၧးလၧယအီၪလၧအကျၩနီၪမွဲၦလ့ၩဝ့ၫ လၧအခၪ့ဎူၫကုၬလီၫ. တၭနစံၭယူၭ, ယမိဖ့ၪလၫ့အ ဝ့ၫၥံၪလၧဆၧယၪတၭ, မိအၪ့ဘၪလၩထၧၫ့ဘံၪ့ယၫ",
			"22": "<sup>22</sup> လ့ၬၬ- ၥိၪဒဲဘ့ၪအဒီၪ့လဖၪ, ဒဲချီၥံၪအဒီၪ့လဖၪ, မွဲအမိ ဘၪဆၧမၩၥံၫဝ့ၫလၧအဝ့ၫၥံၪ မိဘျဲၩအၪ့အဂးနီၪဆ့ဧၪး အ့ၪလမွဲဘၪတၭ ကယဲဒ့ၪၥံၪယၪၥံၪလၧမၫဆမံၭဖၧၩ့ နီၪမွဲဆၧဘၪဒုၭအီၪကီၪ့ဝ့ၫ လၧအဝ့ၫၥံၪမိဘျဲၩအၪ့အ",
			"23": "<sup>23</sup> ဂးဆ့ဧၪ.- တၭယဟိဝၩစံၭစမိစ့ၭ,ယဟိဝၩအစူၪနီၪ မွဲအလၩ့ဖၨၪယူၭဧၪ. ယလူယီၩတီၩဧၪ,လတီၩဘၪ ဧၪနီၪ, နမိဒၪဘၪဘိၩ့နဲၪ့ယီၩလီၫ.",
			"24": "<sup>24</sup> စမိစ့ၭစဲၪ့ထၪ့ဝ့ၫတၭ, လီၩဘၪၦခမျၧးလၧယဟိဝၩ အလူတၭ, ဒုၭအီၪကီၪ့ၦအံၫစရ့လၭဖိၪ အၥုၪ့က့ၭအၥၭ ၡါနွ့ၫဆံၫတၭ, အီၪက့ၪဝ့ၫဝၬဖီၩ့ တဲၩဆံၫ့ဎံၪနီၪလီၫ.",
			"25": "<sup>25</sup> ယဟိဝၩဂဲၫလၩ့လၧဆၧအုၪ့အဖၧၩ့တၭ, ချဲၩ့ဆၧလၧ အဝ့ၫနီၪတၭ, မၩန့ၥၭအီၪလၧအလီၩ့လနၩ့တၭ, ဖ့ၪ လၫ့ဝ့ၫလၧၦၥုၪ့က့ၭၥၭၡါ နွ့ၫဆံၫနီၪလီၫ. တၭထီးၥၭ နီၪအီၪပွံၭလၧအဝ့ၫၥံၪအလီၩ့တၭ, ဆၧမၩအၥၭလၧ အဝ့ၫၥံၪချဲၩ့ထၪ့ဝ့ၫ လၧမီၪအချိၬလီၫ. အ့ၪမွဲလၧခဲၫ့မၩ",
			"26": "<sup>26</sup> လၧၩ့အ့ၬ.- တၭၦနံၫဂၩအီၪထး လၧၦၥုၪ့တဲၩအလး ဖၧၩ့လီၫ. လဂၩအမံၩ့မွဲစအ့လဒၭ,နံၫဂၩလဂၩအမံၩ့မွဲ စမံဒၭလီၫ. တၭၥၭမုနီၪအီၪဝ့ၫလၧအဝ့ၫၥံၪအလီၩ့လီၫ. တၭအီၪဝ့ၫလၧၦအမံၩ့ကွ့ၭအၥၭလါနၫ့တၭ, လ့ၩထၪ့ လၧတဲၩဆံၫ့ဎံၪအဖၧၩ့အ့ၬ, မွဲအချဲၩ့ဆၧလၧမီၪအချိၬ",
			"27": "<sup>27</sup> လၧၦၥုၪ့တဲၩအလးဖၧၩ့လီၫ.- ၦဖိၪၥၪခွၫလဂၩစဲၪ့လီၩ ဘၪစမိစ့ၭတၭ,စံၭဝ့ၫဒၪ, စအ့လဒၭ,ဒဲစမံဒၭနီၪချဲၩ့ဆၧ",
			"28": "<sup>28</sup> လၧမီၪအချိၬလၧၦၥုၪ့တဲၩအလးဖၧၩ့လီၫ.- တၭစမိစ့ၭ အခ့ၫအၡၩ လၧအၡၩဖိၪၥၪခွၫအကျၩ, စနိၫ့အဖိၪခွၫ စယီရှုၫအ့ၫလဂၩချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, ယက",
			"29": "<sup>29</sup> ဆါစမိစ့ၭဧ့, ပဒၩ့အဝ့ၫၥံၪဘီၪ.- တၭစမိစ့ၭစံၭဝ့ၫ, နၥၭ ခ့ၬဝ့ၫလၧယဂးဧၪ. ယဆိၫ့လၧကယဲယဟိဝၩအၡၩ ခမျၧးထီးအလူၬ,မွဲမီၪၥံၪလီၫ. မွဲယဟိဝၩအီၪက့ၪအ",
			"30": "<sup>30</sup> ၥၭမုလၧအဝ့ၫၥံၪအလီၩ့ဆံၭ.- တၭစမိစ့ၭလ့ၩနုၬလၧ ၦၥုၪ့တဲၩအလး, အဝ့ၫနီၪဒဲၦအံၫစရ့လၭဖိၪအၥုၪ့က့ၭ အၥၭၡါလဖၪလီၫ.",
			"31": "<sup>31</sup> လံၩလမံၩ့ စဲၪ့ထၪ့ခွံၬလၧယဟိဝၩတၭ, ဂဲၫဆိၬ ထိၪဝံၪလၧမၫဆမံၭနီၪတၭ, ဒုၭလၩ့ထ့ၬဝ့ၫလၧၦၥုၪ့ တဲၩအလးအနဲၩ့ ဘူၭထၪ့လနံၩဖၧၩ့ၥၭကၪယူၭ, အ ယီၩလခီၫတၭ, လနံၩဖၧၩ့ၥၭကၪယူၭ အနီၪလခီၫဝၬ ဖီၩ့ၦၥုၪ့တဲၩအလး အဆီၩ့ဆီထၪ့ဘူၭကၪနံၫဖျါ လၧ",
			"32": "<sup>32</sup> ဂၪ့ခိၪအဖၫ့ခိၪလီၫ.- ၦခမျၧးဆၧၫ့ထုၪ့ၥံၫ့နံၩချီၩ့နီၪ, ဒဲၥၫ့နၩချီၩ့နီၪ, ဒဲဆၧဖၩ့ထၪ့လနံၩၥံၫနံၩချီၩ့တၭ, အၪ့ ထုၫ့ထိၪဝံၪလဖၪလီၫ. တၭၦလၧအအၪ့ထုၫ့ကီၪ့အၡၩ ထုၬနီၪအၪ့ထုၫ့ဟိမၧၫဆံၫဖျိၪ့လီၫ. တၭအၪ့လိၫလၩ့ ဝ့ၫဝၬဖီၩ့ၦၥုၪ့တဲၩအလး ကိၭစီၪ့ဒ့ၭလီၫ.",
			"33": "<sup>33</sup> ဆၧယၪအီၪဒံၭ လၧအၥွၫဆူၭဖၧၩ့ အဘိၩ့ဘၭနီၪ လချႃၭအဲၪ့ဘျ့ၭဒံၭဘၪတၭ, ယဟိဝၩ အၥၭထၪ့ခဲၩ ထၪ့ဘၪၦခမျၧးတၭ, ကျီၪ့ၦခမျၧးလၧဆၧၥံၫချဲၫ့နၭမၬ",
			"34": "<sup>34</sup> လီၫ.- တၭကိၭဆၧအလးနီၪအမံၩ့ လၧကံၭဘြိၫဟၭ တဝၫလီၫ. အဂဲးဘဲၫယီၩ မွဲအခုၪ့လၩ့ဘၧၩ့ခွံၬၦလၧ",
			"35": "<sup>35</sup> အၥၭကွံၩဆၧလဖၪနီၪလီၫ.- တၭၦခမျၧးစဲၪ့ထၪ့လၧ ကံၭဘြိၫဟၭတဝၫတၭ, လ့ၩဝ့ၫထီၩ့လၧဟၫဇရီၭတၭ, အီၪဝ့ၫလၧဟၫဇရီၭနီၪလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> တၭနမံရအၫ့ ဒဲစအၫရၧၫ့ချဲၩ့ထၫ့ဒုၪဒၩစမိစ့ၭလၧ ၦကုၡၫမုၪလၧအန့မၫ လၧအဝ့ၫအဂဲးအကၠီၪ့လီၫ. အ ဂဲးဘဲၫယီၩ အဝ့ၫဒၪန့ဘၪအမၫ လၧကုၡၫမုၪလဂၩနီၪ",
			"2": "<sup>2</sup> လီၫ.- တၭအဝ့ၫၥံၪစံၭဝ့ၫ, ယဟိဝၩချဲၩ့ဆၧန့ၫလၧစမိ စ့ၭလဂၩဎးဧၪ, မွဲအချဲၩ့ဆၧလၧပၧၩဆ့မွဲအ့ၬဧၪ. တၭ",
			"3": "<sup>3</sup> ယဟိဝၩနါဂၧၫ့ဝ့ၫဒၪလီၫ.- (တၭစမိစ့ၭလဂၩနီၪအၥၭ ဆၧၩ့နဲၪ့ကယဲၦၡၩ လၧဂၪ့ခိၪချိၫ့ ထီးအလူၬလီၫ.)",
			"4": "<sup>4</sup> တၭယဟိဝၩစံၭစမိစ့ၭချဲၫ့ချံၭ, ဒဲစအၫရၧၫ့ဒဲနးမံရအၫ့ နီၪ, ဂဲၫထၪ့ခွံၬနၥံၪဝ့ၫၥၧၫ့ဂၩ လၧဆၧအီၪကီၪ့အတဲၩ ဆံၫ့ဎံၪဆံၭ. တၭအဝ့ၫၥံၪၥၧၫ့ဂၩနီၪ ဂဲၫထၪ့လၧခီၫ့",
			"5": "<sup>5</sup> လီၫ.- ယဟိဝၩဂဲၫလၩ့ လၧဆၧအုၪ့အထုၪ့ဖၧၩ့တၭ, ဆၧၫ့ထုၪ့လၧတဲၩဆံၫ့ဎံၪအတရၫ့တၭ, ကိၭန့စအၫရၧၫ့ ဒဲနးမံရအၫ့တၭ, အဝ့ၫၥံၪလ့ၩထၪ့ဝ့ၫနံၫဂၩလူၬလီၫ.",
			"6": "<sup>6</sup> အဝ့ၫဒၪစံၭ, ခိၭနၪယလူဆံၭ. မီၪအ့ၪအီၪလၧနၥံၪအ ကျၩလဂၩတၭ, ယၧၩယဟိဝၩယီၩ ယမိဒုၭၥ့ၪယၫဝ့ၫ လၧယနၫ့ဆါဒၪယဝ့ၫအဂဲးအကၠီၪ့ လၧဆၧဒၪဆၧလၧ ယၫလခီၫ, ဒဲယမိချဲၩ့ဆၧလၧအဝ့ၫဒၪ လၧဆၧမံၫမးအ",
			"7": "<sup>7</sup> ဖၧၩ့လီၫ.- ယခ့ၫယၡၩစမိစ့ၭမွဲဘဲၫနီၪၥိၭအ့ၬး မွဲၦလၧ",
			"8": "<sup>8</sup> အလူတီၩ လၧယဂံၪ့ဖၧၩ့ထၧၫ့ဖျိၪ့ယၫလီၫ.- ယမိချဲၩ့ ဆၧလၧအဝ့ၫနိၭခီၫနိၭ, လၧဆၧအီၪဖျီၪ, လၧဆၧချဲၩ့ ဒီၩ့မွဲအ့ၬ. တၭဆၧလၩ့ဂၬ ယဟိဝၩအခံးအဂၩ့နီၪမိ ဒၪဘၪဝ့ၫလီၫ. မၩအၥၭဘဲၫနီၪတၭ, နၥံၪချဲၩ့ထၫ့ဒုၪ ဒၩယခ့ၫယၡၩ စမိစ့ၭနီၪ, မွဲဘၪနီၪနၥံၪလၥၭမဲၪဘၪ",
			"9": "<sup>9</sup> လဲၪ.- တၭယဟိဝၩအၥၭထၪ့ခဲၩထၪ့ဘၪဝ့ၫတၭ, စဲၪ့",
			"10": "<sup>10</sup> ထၪ့ခွံၬဝ့ၫဒၪလီၫ.- ဆၧအုၪ့နီၪစဲၪ့ထၪ့ခွံၬလၧတဲၩဆံၫ့ ဎံၪအဖၫ့ခိၪတၭ, ယိခွါ, နးမံရအၫ့ဘၪဆၧခံၫထူၬဆၫ အၧၩ့ဘွၩဘဲၫမူၭခိၪဖီၫအၥိၭနီၪလီၫ. စအၫရၧၫ့ယိနး မံရအၫ့တၭ, ယိခွါ, ဘၪဆၧခံၫထူၬ ဆၫအၧၩ့လီၫ.",
			"11": "<sup>11</sup> တၭစအၫရၧၫ့စံၭစမိစ့ၭ, အၩလါၬ ယကဆါဧ့,ဆၧ လၧပမၩဘဲၫၦဂီၩ့ဖိၪအၥိၭတၭ, ပမၩမၪဆၧနီၪ, မွဲန",
			"12": "<sup>12</sup> ထီးအီၪက့ၪလါဆၧဒဲၩဘၭလၧပလီၩ့လဂ့ၩ,- မွဲအဝ့ၫ ဒၪထီးမၩလါအၥၭဘဲၫၦၥံၫ လၧအဂဲၫထၪ့လၧအမိအ ဒၧၩ့လးဖၧၩ့နီၪ အယၪမိဘၪ ဆၧအၪ့ခွံၬဝ့ၫ လခီၫအ",
			"13": "<sup>13</sup> ၥိၭနီၪလဂ့ၩ.- စမိစ့ၭကိၭထၪ့လၧယဟိဝၩတၭ, စံၭ",
			"14": "<sup>14</sup> ဝ့ၫဒၪ,ယွၩဧ့, မၩဘျၪထဲၩ့လါအဝ့ၫဒၪဆံၭ,- ယဟိဝၩ စံၭစမိစ့ၭ, မွဲန့ၫအဖါအ့ၪထိၪဖျံၭအမ့ၬတၭ, အမ့ၬမိမဲ နွ့ၫနံၩမွဲအ့ၬဧၪ. မွဲအဘၪဆၧအီၪက့ၪလၩ့ဖၭဝ့ၫ လၧ ၦၥုၪ့တဲၩအလး လၧခီၫ့နွ့ၫနံၩဆံၭ. လၧခဲၫ့ထဲၩ့တၭ, မိဘၪဆၧထိးဆၧၫ့ထဲၩ့ဒီၭလီၫ.",
			"15": "<sup>15</sup> တၭနးမံရအၫ့ဘၪဆၧဒုၭအီၪလၩ့ဖၭဝ့ၫ လၧၦၥုၪ့ တဲၩအလး လၧခီၫ့နွ့ၫနံၩလီၫ. တၭဆၧလချႃၭထိး ဆၧၫ့ထဲၩ့ဒံၭဘၪနးမံရအၫ့နီၪ, ၦခမျၧးလ့ၩဆၧအ့ၬ.",
			"16": "<sup>16</sup> လၧခဲၫ့ထဲၩ့တၭ ၦခမျၧးစဲၪ့ထၪ့ဝ့ၫ လၧဟၫဇရီၭတၭၥုၪ့ အတဲၩလၧၡါမုနၧၫ့ဖၫပၫရၫ့လီၫ."
		},
		"13": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, အၪ့မၧၫ့ၦလ့ၩယိခးကၫနအၫ့ လၧယဖ့ၪလၫ့ၦအံၫစရ့လၭ ဖိၪၥံၪဆံၭ. လၧအဖါလဖၪအဒီၪ့နီၪအကျၩ, နၥံၪဘၪ အၪ့မၧၫ့ဝ့ၫ လဒီၪ့လဂၩလဒီၪ့လဂၩ, ၦဒိၪလၧအကျၩ",
			"3": "<sup>3</sup> ကိၭဂၩဒ့ၭလီၫ.- တၭဘဲၫယဟိဝၩ အဆၧမၪလူၬအ ၥိၭနီၪစမိစ့ၭအၪ့မၧၫ့လၩ့ဝ့ၫ လၧၡါမုနၧၫ့ဖၫပၫရၫ့နီၪ အဖၧၩ့လီၫ. ၦထီးအလူၬနီၪ မွဲၦအံၫစရ့လၭဖိၪအခိၪ",
			"4": "<sup>4</sup> လဖၪလီၫ.- အယီၩမွဲအမံၩ့လဖၪ, လၧစရုဘံၫ့အဒီၪ့",
			"5": "<sup>5</sup> အကျၩနီၪစဇၭကၧၫအဖိၪခွၫစၡၫ့မုအၫ.- လၧစစံမ",
			"6": "<sup>6</sup> အၧၫ့အဒီၪ့အကျၩနီၪ စဟိရဲၫအဖိၪခွၫစၡၫဖၭ.- လၧ စယုဒၫ အဒီၪ့အကျၩနီၪ စယဖၧၫနံၫအဖိၪခွၫ စကၫ",
			"7": "<sup>7</sup> လ့ၭ.- လၧစအံစခၫအဒီၪ့အကျၩနီၪ စယိၥၭအဖိၪခွၫ",
			"8": "<sup>8</sup> စအဲဂလၭ.- လၧစအံဖြံၫ့အဒီၪ့အကျၩနီၪ စနိၫ့အဖိၪခွၫ",
			"9": "<sup>9</sup> စဟိၡအၫ.- လၧစဘံၪ့ယမံၫ့အဒီၪ့အကျၩနီၪ စရၭဖုၫ",
			"10": "<sup>10</sup> အဖိၪခွၫစပၫလတံၫ.- လၧစဇ့ၭဘလၧၫ့အဒီၪ့အကျၩ",
			"11": "<sup>11</sup> နီၪစဇိဒံၫအဖိၪခွၫစဂၭဒအ့လၭ.- လၧစယိၥၭအဒီၪ့အ ကျၩနီၪ, မွဲစမနၭစ့ၫအဒီၪ့အကျၩစစုစဲၫအဖိၪခွၫစဂၭ",
			"12": "<sup>12</sup> ဒဲၫ.- လၧစဒၫ့အဒီၪ့အကျၩနီၪ စဂမၫလဲၫအဖိၪခွၫစအၫ့",
			"13": "<sup>13</sup> မအ့လၭ.- လၧစအၭၡၧၫ အဒီၪ့အကျၩနီၪ စမဲၫခအ့",
			"14": "<sup>14</sup> လၭအဖိၪခွၫစစံၥၧၫ.- လၧစနၭၥလဲၫအဒီၪ့အကျၩနီၪ",
			"15": "<sup>15</sup> စဝီဖစဲၫအဖိၪခွၫစနၫဘဲၫ.- လၧစဂၭအဒီၪ့အကျၩနီၪ စမၫခဲၫအဖိၪခွၫ စဂုၫအ့လၭနီၪလီၫ.",
			"16": "<sup>16</sup> အဝ့ၫၥံၪနီၪ မွဲၦလဖၪလၧစမိစ့ၭအၪ့မၧၫ့ အလ့ၩယိ ထံၫၥံၪခးၥံၪအမံၩ့လီၫ. တၭစမိစ့ၭကိၭ စနိၫ့အဖိၪခွၫ စဟိၡအၫအမံၩ့ လၧစယီရှုၫအ့ၫလီၫ.",
			"17": "<sup>17</sup> တၭစမိစ့ၭအၪ့မၧၫ့အဝ့ၫၥံၪ လ့ၩယိခးကၫနအၫ့တၭ, စံၭဝ့ၫ, လ့ၩထၪ့ဖၧၩ့ၥၭလၧမုထၪ့လခီၫတၭ, လ့ၩထၪ့",
			"18": "<sup>18</sup> လၧခိၪလီၩ့ထိၩ့ချိၬနီၪဆံၭ.- တၭယိခးလဘံၪ့နီၪ မွဲအ မၩအၥၭဘဲၫၥ့ၪလဲၪ, ဒဲၦထံၫဖိၪခးဖိၪ လၧအအီၪလၧ အဖၧၩ့နီၪမွဲအဂဲးအဘၭဆီၪ့ဧၪ, မွဲအဆါဧၪ, မွဲၦၡၩ",
			"19": "<sup>19</sup> ၡၩခိၬဧၪး မွဲအၪဂၩဧၪ,- တၭခးလၧအဝ့ၫၥံၪအီၪလၧ အဖၧၩ့နီၪ မွဲအမၩအၥၭဘဲၫၥ့ၪလဲၪ. မွဲဂ့ၩဧၪ, မွဲအၧၩ့ ဧၪ,ဒိၩ့ၥံၪတဝၫ့ၥံၪ လၧအအီၪဝ့ၫ လၧအဖၧၩ့နီၪမွဲအမၩ အၥၭဘဲၫၥ့ၪလဲၪ. မွဲၦအီၪလၧတဲၩလဖၪအဖၧၩ့ဧၪ, မွဲ",
			"20": "<sup>20</sup> ဒိၩ့အီၪလၧအခိၪဒၧၩ့လဖၪလဲၪ.- တၭခးနီၪမွဲအမၩ အၥၭဘဲၫၥ့ၪလဲၪ. ၥံၪ့ၥံၪဝၪၥံၪလၧအဖၧၩ့အီၪ, လအီၪ လဲၪ. အီၪက့ၪဒူၩနၥံၪအၥၭဆံၭ. တၭဂဲၫထဲၩ့ဆိၬ ခး နီၪအဆၧၥၪဆံၭ. ဆၧလၧမုနံၩလဖၪနီၪ မွဲစဘံၭၥၪဆိၫ အမုနံၩလဖၪလီၫ.",
			"21": "<sup>21</sup> အဝ့ၫၥံၪလ့ၩထၪ့ဝ့ၫတၭ, ယိထံၫၥံၪခးၥံၪလၧၡါမု နၧၫ့ဖၫဇံၫ့ဖိးလၧရံဟီၭအီၪ ထီးၦလ့ၩလၧဟၫမၭလီၫ.",
			"22": "<sup>22</sup> အဝ့ၫၥံၪလ့ၩထၪ့လၧမုခံၫ့တၭ, လ့ၩထီၩ့လၧဟံဘြၧၫ့ ထီးစအၫနၭအဖိၪအလံၩ, စအဟဲမၫ့, စၡံၡဲၫ, စတၫ လမ့ၫအီၪဝ့ၫလီၫ. တၭဒိၩ့ဟံဘြၧၫ့နီၪ ဘၪဆၧမၩကဲၪ ထၪ့ဝ့ၫဆိၫနဲၪ့ဒိၩ့ဇိဧၫ့ လၧအံဇံၭအဖၧၩ့နီၪ နွ့ၫနံၪ့လီၫ.",
			"23": "<sup>23</sup> အဝ့ၫၥံၪလ့ၩထီၩ့ လၧထံၫအ့ၡကီၫလၭတၭ, ဖ့ၬထ့ၬစ ဘံၭမုအထဲၩ့လထဲၩ့ အီၪလၧစဘံၭၥၪလဖုၫ ထီးနီၪ တၭ,ယိၭဝ့ၫလၧနိၪယိၭဘီၩ့ လၧၦနံၫဂၩအဘိၩ့ဆၧၩ့ လီၫ. တၭမွဲအဂဲၫထဲၩ့ဆိၬၥလဲၩၥၪ ဒဲချိၪ့ဒိၩ့ၥၪလီၫ.",
			"24": "<sup>24</sup> တၭၦၡၩကိၭဆၧအလးနီၪ အမံၩ့လၧထံၫအ့ၡကီၫလၭ လၧစဘံၭၥၪလဖုၫ လၧၦအံၫစရ့လၭဖိၪ ဖ့ၬထ့ၬဝ့ၫထီး နီၪအကၠီၩ့လီၫ.",
			"25": "<sup>25</sup> တၭအနံၩလံဆံၫအလးခဲၫ့နီၪ အဝ့ၫၥံၪဂဲၫထဲၩ့ထဲၩ့",
			"26": "<sup>26</sup> ဝ့ၫလၧအယိထံၫၥံၪခးၥံၪလီၫ.- ဂဲၫထဲၩ့တၭလ့ၩလၧ စမိစ့ၭဒဲစအၫရၧၫ့အအီၪ ဒဲလၧကယဲၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့အအီၪ ထီၩ့လၧၡါမုနၧၫ့ဖၫပၫရၫ့ လၧ ကၫဒ့ၭတၭ, ဂဲၫထဲၩ့န့ဆၧချဲၩ့လၧအဝ့ၫၥံၪအဂး, ဒဲလၧ ကယဲဆၧအီၪကီၪ့အဂးတၭ, ဒုၭနဲၪဝ့ၫလၧခးနီၪအဆၧ",
			"27": "<sup>27</sup> ၥၪလီၫ.- အဝ့ၫၥံၪလီၩဘၪဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ခးလၧန အၪ့မၧၫ့ပလ့ၩတၭ, ပလ့ၩနုၬပဝ့ၫနီၪ, မွဲတၡါအယွၩ ဝ့ၫလၧဆၧနူထံၫဒဲန့ၫစၩ့လီၫ. တၭအယီၩမွဲအဆၧၥၪ",
			"28": "<sup>28</sup> လီၫ.- မွဲလါနၫ့ၦခမျၧးလၧအအီၪဝ့ၫ လၧခးဖၧၩ့နီၪအ ဂဲးဆီၪ့အဘၭဆီၪ့, ဒဲအဒိၩ့လဖၪအီၪလၧအခိၪဒၧၩ့, ဒဲဒိၪမၬတၭ ပဒၪဘၪဆ့စအၫနၭအဖိၪအလံၩ ထီးနီၪ",
			"29": "<sup>29</sup> လီၫ.- တၭၦအၫမလ့ၭဖိၪအီၪဝ့ၫ လၧမုခံၫ့လခီၫ, ဒဲၦဟ့ ၥၭဖိၪ, ဒဲၦယ့ဘုၫဖိၪ, ဒဲၦအၫမိၫဖိၪအီၪဝ့ၫလၧခိၪလီၩ့ ထိၩ့ချိၬဒဲၦကၫနအၫ့ဖိၪ အီၪဝ့ၫလၧမၫဆမံၭနဲၩ့, ဒဲလၧ ထံၫယီၫဒၫ့အနဲၩ့နီၪလီၫ.",
			"30": "<sup>30</sup> စကၫလ့ၭလဂၩနီၪ ဒုၭအီၪလၩ့မါပံၭၦခမျၧးလၧစမိ စ့ၭအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ, မွဲပလ့ၩထၪ့ၡီၩ့မၩန့ဝ့ၫ ဆံၭ. အဂဲးဘဲၫယီၩ ပမၩနၧၩ့မၩစၪဝ့ၫၥ့ၪယီၫခိၬလီၫ.",
			"31": "<sup>31</sup> အ့ၪမွဲၦလၧအလ့ၩထၪ့ လၧအၥိၭလဖၪစံၭဝ့ၫဒၪ, ပလ့ၩ ထၫ့ဒုၪဒၩၦခမျၧးနီၪၥ့ၪအ့ၬ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪ",
			"32": "<sup>32</sup> အဂဲးအဘၭဆီၪ့နဲၪ့ ပဂဲးပဘၭဒံၭလီၫ.- အဝ့ၫၥံၪဂဲၫ ထဲၩ့ဆိၬဆၧချဲၩ့အအၧၩ့ ဘၪဆဲၫ့လၧခး လၧအလ့ၩယိ ဝ့ၫနီၪ, လၧၦအံၫစရ့လၭဖိၪအအီၪတၭ, စံၭဝ့ၫဒၪ, ခး လၧပလ့ၩယိဝ့ၫလဘံၪ့နီၪ မွဲခးလၧအအၪ့ခွံၬ ၦလၧအ အီၪလၧအဖၧၩ့တၭ, ကယဲၦလၧအဒၪဘၪလၧအဖၧၩ့",
			"33": "<sup>33</sup> နီၪမွဲၦလၧအဂၩ့ထီၫလီၫ.- တၭပဒၪဘၪၦဆီၪ့ဖိၪထီး နီၪ, စအၫနၭအဖိၪအလံၩ ဘၪဆဲၫ့လၧၦဆီၪ့ဖိၪတၭ, လၧပမ့ၬယၫဒၪပဝ့ၫနီၪ ပမၩပၥၭ ဘဲၫထွ့ၥံၪခၩ့ၥံၪအ ၥိၭနီၪတၭ, လၧအဝ့ၫၥံၪအမ့ၬယၫနီၪ ပမွဲဘဲၫနီၪၥိၭဆ့ လီၫ."
		},
		"14": {
			"1": "<sup>1</sup> ၦဆၧအီၪကီၪ့ဖိၪ ထီးအလူၬ ထုၭထၪ့အလူဂၪ့ဝ့ၫ",
			"2": "<sup>2</sup> တၭ, ၦခမျၧးအမ့ၬထံၫလၩ့ဝ့ၫ ၥၫ့နၩချီၩ့လီၫ.- တၭၦ အံၫစရ့လၭဖိၪထီးအလူၬ ၥူၭဝံၪၥူၭလၩဆၧ လၧစမိစ့ၭ အလီၩ့, ဒဲလၧစအၫရၧၫ့အလီၩ့လီၫ. တၭၦဆၧအီၪကီၪ့ ဖိၪထီးအလူၬစံၭဝ့ၫ, အၩလါ, မွဲပၥံၫထးလါယူၭလၧ ခးအံဇံၭအဖၧၩ့နီၪ, ဂ့ၩဒၪဆၧ, အ့ၪလမွဲဘၪဘဲၫနီၪ တၭးမွဲပၥံၫထးလါယူၭ, လၧၡါမုနၧၫ့ဖၫယီၩ ဂ့ၩဒၪဆၧ",
			"3": "<sup>3</sup> ဒံၭ.- တၭယဟိဝၩဒုၭဂဲၫပၧၩ လၧခးယီၩဘဲၫၥိၭပမိ လၩ့ထံၩဖါလၧနၭၥံၪဖၩ့ၥံၪ, ဒဲပဖိၪပမၫပဖိၪပလံၩမိ ကဲၪထၪ့ ဆၧအၪ့ဂူၬန့နီၪ, မွဲဘၪလဲၪ. ပအ့ၪထဲၩ့ထဲၩ့",
			"4": "<sup>4</sup> ဘၪယူၭလၧခးအံဇံၭနီၪ, မွဲလဂ့ၩဘၪဧၪ.- အဝ့ၫၥံၪ ချဲၩ့လိၬအၥၭလဂၩဒဲလဂၩ, မွဲပအီၪက့ၪလၩ့ ၦလဂၩ လၧပခိၪတၭ, ထဲၩ့ထဲၩ့ၡီၩ့လၧအံဇံၭအဖၧၩ့နီၪဘီၪ.",
			"5": "<sup>5</sup> တၭစမိစ့ၭ ဒဲစအၫရၧၫ့ထိၪလၩ့ထံၩဖါအၥၭ လၧၦ အံၫစရ့လၭ အဆၧအီၪကီၪ့ဖိၪထီးအလူၬ အမ့ၬယၫ",
			"6": "<sup>6</sup> လီၫ.-တၭစနိၫ့အဖိၪခွၫ စယီရှုၫအ့ၫဒဲစယဖၧၫနံၫအဖိၪ ခွၫစကၫလ့ၭ အီၪလၧၦလၧအလ့ၩယိခးနီၪ အကျၩၡၫ့",
			"7": "<sup>7</sup> အကီၩ့အၥိၭလီၫ.- အဝ့ၫၥံၪချဲၩ့ဆၧလၧၦအံၫစရ့လၭ အဆၧအီၪကီၪ့ဖိၪထီးအလူၬတၭ, စံၭဝ့ၫဒၪ, ခးလၧပ ခၫ့ဂၬဝ့ၫဘဲၫၥိၭပမိယိဝ့ၫလဘံၪ့နီၪ မွဲခးဂ့ၩဂ့ၩလ့ၬလ",
			"8": "<sup>8</sup> ဘံၪ့လီၫ.- အ့ၪဘၪယဟိဝၩအၥၭလၧပၧၩတၭ, မွဲအမိ ဒုၭလ့ၩနုၬပၧၩလၧခးဖၧၩ့နီၪ မိဖ့ၪလၫ့ဝ့ၫ လၧပၧၩလီၫ.",
			"9": "<sup>9</sup> မွဲခးလၧအယွၩဝ့ၫလၧဆၧနူထံၫ, ဒဲန့ၫစၩ့လီၫ.- ထီး ပိၩ့ထၪ့လၧၩ့ယွၩလဂ့ၩ, ဒဲၥၭမဲၪၦခမျၧးအီၪဝ့ၫလၧခး ဖၧၩ့နီၪလဂ့ၩ, အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမွဲဆၧအၪ့ လၧပ ဂးလီၫ. အဆၧဒိၭနဲၩ့အၥၭအီၪအ့ၬ. တၭယဟိဝၩအီၪ",
			"10": "<sup>10</sup> လၧပၥိၭတၭး ထီးၥၭမဲၪအဝ့ၫၥံၪလဂ့ၩ.- တၭဆၧ အီၪကီၪ့ထီးအလူၬ အီၪက့ၪလၩ့အလူ လၧၦၡၩမိဘၪ ခွံၬအဝ့ၫၥံၪလၧလိးလီၫ. တၭယဟိဝၩ အလၩအဖၩ့ အီၪဖျီၪထၪ့ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအဖၧၩ့လၧ ၦအံၫစရ့လၭဖိၪထီးအလူၬ အမ့ၬယၫလီၫ.",
			"11": "<sup>11</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, ၦခမျၧးယီၩမိမၩကြၩ့ထ မးယၧၩဆံၭယံၬလဲၪ. လၧကယဲဆၧလၩ့လၭ လၧယမၩ လၧအကျၩထီးအလူၬအကၠီၩ့နီၪ ဆံၭယံၬမိနဲၩယၧၩလဲၪ.",
			"12": "<sup>12</sup> ယမိကျီၪ့ခွံၬ အဝ့ၫၥံၪလၧဆၧၥံၫချဲၫ့, ဒဲမၩဂၭဂီၩ့ခွံၬ ဝ့ၫတၭ, ယမိမၩနၧၩလၧၦဆၨၩဒိၪနဲၪ့ အဝ့ၫနီၪဒံၭလီၫ.",
			"13": "<sup>13</sup> တၭစမိစ့ၭစံၭယဟိဝၩ, ၦအံဇံၭဖိၪမိနါဂၧၫ့ (အဂဲး ဘဲၫယီၩနဒုၭဂဲၫထၪ့ၦခမျၧးယီၩ လၧအကျၩလၧနစီၩ့",
			"14": "<sup>14</sup> နမၩ့လီၫ.)- တၭအဝ့ၫၥံၪမိလီၩဘၪ ၦခးဖိၪယီၩလီၫ. အဝ့ၫၥံၪနါဂၧၫ့ယူၭ, ယဟိဝၩဧ့, လၧနအီၪလၧၦခမျၧး ယီၩအကျၩ, ယဟိဝၩဧ့, လၧၦၡၩယိဆၧၫ့နမ့ၬ, ဒဲလၧ ဆၧအုၪ့ဆၧၫ့ထုၪ့ဝ့ၫလၧအဖၫ့ခိၪ, ဒဲလၧနလ့ၩလၧအ မ့ၬယၫ လၧဆၧအုၪ့အထုၪ့ လၧမုဆၫလခီၫ, ဒဲလၧမ့ၪ",
			"15": "<sup>15</sup> အထုၪ့လၧမုနၩလခီၫလီၫ.- တၭနအ့ၪမၩၥံၫၦလဆၨၩ ယီၩဘဲၫၦလဂၩဎးအၥိၭနီၪတၭ, ၦဆၨၩလဖၪလၧအ",
			"16": "<sup>16</sup> နါဂၧၫ့နပရၧၫ့နီၪ မိချဲၩ့ဆၧတၭ, မိစံၭ,- မွဲယဟိဝၩဒုၭ ဂဲၫနုၬၦခမျၧးယီၩ လၧခးလၧအဆိၪလၩ့အၥၭ လၧအ ဂဲးအကၠီၪ့ လၧအဝ့ၫၥံၪလၥ့ၪယၫဘၪတၭ, မွဲအမၩၥံၫ",
			"17": "<sup>17</sup> ဝ့ၫလၧၡါမုနၧၫ့ဖၫနီၪလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ, ယဟိဝၩ ဧ့, မွဲနစီၩ့နမၩ့ဒိၪထၪ့, ဘဲၫနချဲၩ့ဆၧအၥိၭနီၪဆံၭး န",
			"18": "<sup>18</sup> စံၭ,- ယဟိဝၩမွဲအၥၭထၪ့ကၪ, ဒဲအခိးအတၩအၪ,ဒဲ ကွဲၪဖျါခွံၬဆၧအၧၩ့ဆၧၥၫ့, ဒဲဆၧၥူၭဆၧမၪတၭ, ၦလၧ အဆၧဒဲၩဘၭအီၪ လၧအလီၩ့လဖၪ, လအီၪက့ၪဘၪ ဆၧဒဲၩဘၭလါလါနီၪ, မွဲအ့ၬ. ဒုၭအီၪအဖါလဖၪအဆၧ ဒဲၩဘၭလၧဖိၪလဖၪအလီၩ့, ထီၩ့လၩ့လၧၥၧၫ့ဆိၩလ",
			"19": "<sup>19</sup> ဆိၩ,ဒဲလံဆိၩလဆိၩလီၫ.- ကွဲၪဖျါခွံၬလါၦခမျၧးအ ဆၧအၧၩ့ဆၧၥၫ့, ဘဲၫနခိးနတၩအၪအၥိၭတၭ, ဘဲၫန ကွဲၪဖျါခွံၬ ၦခမျၧးယီၩ အဆၧလၧအံဇံၭထီၩ့လၩ့ခီး ဘိၩ့နဲၪ့ယီၩဆံၭ.",
			"20": "<sup>20</sup> တၭယဟိဝၩစံၭဝ့ၫဒၪ, ယကွဲၪဖျါခွံၬယူၭ,ဘဲၫနလူ",
			"21": "<sup>21</sup> အၥိၭနီၪယူၭ,- မွဲမၬယမၧၫ့ယဝ့ၫတၭ, ဂၪ့ခိၪထၧၫ့ဖျိၪ့ ယၫမိလၧၫ့ထၪ့ဎွ့ၩထၪ့ လၧယဟိဝၩ အလၩအဖၩ့",
			"22": "<sup>22</sup> လီၫ.- မွဲကယဲၦလဖၪနီၪ လၧအဒၪဘၪ ယလၩယဖၩ့, ဒဲယဆၧလၩ့လၭ လၧယမၩလၧအံဇံၭအဖၧၩ့, ဒဲလၧ ၡါမုနၧၫ့ဖၫတၭ, ကျဲၩ့ဖစီၩ့ယၧၩဆံၫဘျၩ့ယီၩတၭ,",
			"23": "<sup>23</sup> လခိၭနၪဘၪယလူယထၫတၭ, မွဲတၡါ အဝ့ၫၥံၪမိဒၪ ဘၪခးလၧယဆိၪလၩ့ယၥၭ လၧအဂဲးအကၠီၪ့ လၧအ ဝ့ၫၥံၪအဖါလဖၪနီၪအ့ၬ. တၭၦလၧအမၩကြၩ့ထမး",
			"24": "<sup>24</sup> ယၧၩမိဒၪဘၪဝ့ၫနးဂၩအ့ၬ.- အ့ၪမွဲယခ့ၫယၡၩစကၫ လ့ၭနီၪ မွဲအအီၪလၧအၥၭ လမံၩ့ဒၪ ဒဲဖိၬယခဲၫ့ လၧၫ့ လၧၫ့ဎွ့ၩဎွ့ၩတၭ, ယမိဒုၭလ့ၩနုၬအဝ့ၫ လၧခးထီးအ",
			"25": "<sup>25</sup> လ့ၩဆၧတၭ, အချံၫအၥၪမိန့ၥၫဝ့ၫလီၫ.- တၭၦအၫမ လ့ၭဖိၪ, ဒဲၦကၫနအၫ့ဖိၪ အီၪဝ့ၫလၧဆၧပျၩ့ဖၧၩ့လီၫ. တၭကဲဂီၩခိၬ ကၠၪထဲၩ့နၥံၪဝ့ၫတၭ, နုၬထဲၩ့နၥံၪဝ့ၫ လၧၡါမုနၧၫ့ဖၫ လၧဖၧၩ့ၥၭမၫဆမံၭဝီၩ အနဲၩ့ထံၭနီၪ ဆံၭ.",
			"26": "<sup>26</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭဒဲစအၫရၧၫ့တၭ, စံၭဝ့ၫ",
			"27": "<sup>27</sup> ဒၪ,- ဆၧအီၪကီၪ့အအၧၩ့ယီၩ မိၥူၭဝံၪၥူၭလၩဆၧလၧ ယလီၩ့ဆံၭယံၬလဲၪ. ၦအံၫစရ့လၭဖိၪ အၥူၭဝံၪၥူၭ",
			"28": "<sup>28</sup> လၩဆၧလၧယလီၩ့နီၪယနါဂၧၫ့ယူၭ,- စံၭအဝ့ၫၥံၪ,ယ မၧၫ့ယဝ့ၫယဟိဝၩစံၭဝ့ၫဒၪ, မွဲမၬဘဲၫနၥံၪချဲၩ့ဆၧလၧ ယနါဖၧၩ့အၥိၭနီၪ, ယမိမၩနၥံၪဘဲၫနီၪအၥိၭလီၫ.",
			"29": "<sup>29</sup> တၭနၥံၪအစွၪလဖၪမိလၩ့ထံၩဖါ လၧၡါမုနၧၫ့ဖၫယီၩ တၭ,ကယဲၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ, ဘဲၫဆၧဝံ ကီၪ့နၥံၪထီးအလူၬ လၧနၥံၪအၥၭၡါအနံၪ့နံၫဆံၫဒဲနံၫ ဆံၫအဖၫ့ခိၪ အၥိၭနီၪ, လၧအၥူၭဝံၪၥူၭလၩ လၧယ",
			"30": "<sup>30</sup> လီၩ့လီၫ.- မွဲမၬခးလၧယဆိၪလၩ့ယၥၭ လၧယမိဒုၭ အီၪနၥံၪလၧအဖၧၩ့နီၪ, နၥံၪနုၬဘၪအ့ၬ. အ့ၪမွဲမိလ့ၩ နုၬဘၪန့ၫစယဖၧၫနံၫအဖိၪခွၫစကၫလ့ၭ, ဒဲစနိၫ့အဖိၪ",
			"31": "<sup>31</sup> ခွၫစယီရှုၫအ့ၫလီၫ.- အ့ၪမွဲနၥံၪအဖိၪဆံၭလၧနၥံၪစံၭ အမိကဲၪထၪ့ဆၧအၪ့ဂူၬန့လဖၪနီၪ ယမိဒုၭလ့ၩနုၬအ ဝ့ၫၥံၪတၭ, အဝ့ၫၥံၪမိၥ့ၪယၫခးလဘံၪ့ လၧနၥံၪမၩကြၩ့",
			"32": "<sup>32</sup> ထမးနီၪလီၫ.- အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩ, နၥံၪအစွၪမိလၩ့",
			"33": "<sup>33</sup> ထံၩဖါလၧၡါမုနၧၫ့ဖၫယီၩလီၫ.- တၭနၥံၪအဖိၪအလံၩ မိဂၭဝံၩ့ဝၩ့ဆၧလၧ ၡါမုနၧၫ့ဖၫအနံၪ့လံဆံၫ, ဒဲဆိၬနၥံၪ အဆၧလဲးဆၧဘျၪ ထီးနၥံၪအစွၪလူၬ လၧၡါမုနၧၫ့ဖၫ",
			"34": "<sup>34</sup> လီၫ.- ဘဲၫနံၩဎွ့ၩအံၩဎွ့ၩအိၩ လၧနၥံၪလ့ၩယိခးအ နံၩလံဆံၫအၥိၭနီၪ, လနံၩလၧလနံၪ့အဂး, လနံၩလၧ လနံၪ့အဂး, နၥံၪမိဘၪဆိၬ နၥံၪအဆၧအၧၩ့ဆၧၥၫ့အ နံၪ့လံဆံၫလီၫ. တၭနၥံၪ မိၥ့ၪယၫ ယဂၧၩ့ထဲၩ့ ယၥၭ",
			"35": "<sup>35</sup> လီၫ.- ယဝ့ၫဒၪယဟိဝၩယီၩ ယချဲၩ့ယူၭဆၧယူၭ,မွဲမၬ ယမိမၩဆၧအီၪကီၪ့အအၧၩ့ လၧအအီၪကိၩ့အီၪကီၪ့ ထၫ့ဒုၪဒၩယၧၩထီးအလူၬလီၫ. အဝ့ၫၥံၪမိလူၬဝ့ၫလၧ ၡါမုနၧၫ့ဖၫယီၩတၭ, မိၥံၫဝ့ၫထီးအလူၬလီၫ.",
			"36": "<sup>36</sup> ၦလၧစမိစ့ၭအၪ့မၧၫ့အလ့ၩယိခးနီၪ လၧအဂဲၫထဲၩ့ တၭ, ဒုၭၥူၭဝံၪၥူၭလၩၦခမျၧးထီးအလူၬ လၧအလီၩ့",
			"37": "<sup>37</sup> လၧအဂဲၫဆိၬ အပရၧၫ့အၧၩ့အကၠီၩ့နီၪ,- ၦလဖၪလၧ အဂဲၫဆိၬခးအပရၧၫ့အအၧၩ့နီၪ ၥံၫဝ့ၫလၧဆၧဆၫဖျဲၪ",
			"38": "<sup>38</sup> လၧယဟိဝၩအမ့ၬယၫလီၫ.- အ့ၪမွဲစနိၫ့အဖိၪခွၫစယီ ရှုၫအ့ၫဒဲစယဖၧၫနံၫအဖိၪခွၫ စကၫလ့ၭလၧအအီၪဝ့ၫ လၧၦလၧအလ့ၩယိခးနီၪအကျၩ မၧၫ့ဒံၭဝ့ၫလီၫ.",
			"39": "<sup>39</sup> စမိစ့ၭလီၩလၩ့ဆၧချဲၩ့လဖၪ လၧၦအံၫစရ့လၭဖိၪ ထီးအလူၬတၭ, ၦခမျၧးအၥုၪ့အုၭ အၥၭအုၭနၭမၬ",
			"40": "<sup>40</sup> လီၫ.- မုဆဲၪ့ထၪ့နီၪ အဝ့ၫၥံၪဂဲထုၪ့ဂီၩဂီၩတၭ, လ့ၩ ထၪ့လၧခိၪလီၩ့ဒၩ့ခိၪတၭ, စံၭဝ့ၫဒၪ, ယိခွါ, ဖီၩၬ တၭပမိလ့ၩထၪ့ လၧဆၧအလး လၧယဟိဝၩစံၭဝဲၩနီၪ",
			"41": "<sup>41</sup> လီၫ. အဂဲးဘဲၫယီၩပမၩ ယူၭဆၧဒဲၩဘၭယူၭ.- တၭ စမိစ့ၭစံၭဝ့ၫဒၪ, ဆၧယီၩနၥံၪ လၨၪခၫ့ဖၬယဟိဝၩအ ဆၧမၪလူၬနီၪမွဲဘၪလဲၪ. တၭဆၧဘီၪထၪ့ယီၫထၪ့ဝ့ၫ",
			"42": "<sup>42</sup> ဒၪအ့ၬ.- လ့ၩထၪ့လဂ့ၩ, အဂဲးဘဲၫယီၩ ယဟိဝၩအီၪ လၧနၥံၪအကျၩအ့ၬ. ဘဲၫၥိၭနၥံၪထီးဘၪဆၧဖ့ၬၥံၫခွံၬ နၥံၪလၧနၥံၪ အဒုၪအဒၩအမ့ၬယၫလဂ့ၩ အဂးလီၫ.",
			"43": "<sup>43</sup> အဂဲးဘဲၫယီၩ ၦအၫမလ့ၭဖိၪ,ဒဲၦကၫနအၫ့ဖိၪအီၪထီး နီၪလၧနၥံၪအမ့ၬယၫတၭ, နၥံၪမိလၩ့ထံၩဖါလၧနၭၥံၪ ဖၩ့ၥံၪလီၫ. မွဲနၥံၪကၠၪခွံၬနၥံၪအၥၭလၧယဟိဝၩတၭ, ယဟိဝၩအီၪလၧနၥံၪအၥိၭအ့ၬ.",
			"44": "<sup>44</sup> မွဲလါနၫ့ အဝ့ၫၥံၪအီၪက့ၪဖိၫအၥၭထီးအလ့ၩထၪ့ လၧခိၪလီၩ့ဒၩ့ခိၪလီၫ. တၭယဟိဝၩအဆၧအုၩ့လၩ့ အတလၫ, ဒဲစမိစ့ၭနီၪ စဲၪ့ထၪ့ခွံၬလၧၦၥုၪ့တဲၩအလး ဖၧၩ့အ့ၬ.",
			"45": "<sup>45</sup> တၭၦအၫမလ့ၭဖိၪဂဲၫလၩ့, ဒဲၦကၫနအၫ့ဖိၪလၧအ အီၪလၧခိၪလီၩ့ ထိၩ့ချိၬနီၪတၭ, ဖ့ၬခွံၬအဝ့ၫၥံၪတၭ, မၩနၧၩ့မၩစၪအဝ့ၫၥံၪ ထီၩ့လၧဟီမၫလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ချဲၩ့ထၪ့ ဆၧလၧၦအံၫစရ့လၭဖိၪတၭ, စံၭအဝ့ၫၥံၪ, ထီးနၥံၪ လ့ၩနုၬလၧခးလၧနၥံၪ မိအီၪဝ့ၫအလးလၧယမိဖ့ၪလၫ့",
			"3": "<sup>3</sup> နၥံၪ,- တၭမိလုထၪ့ဆၧလုမ့ၪ လၧယဟိဝၩအဂး,ဆၧ လုမ့ၪမွဲဂ့ၩ, ဆၧလုဘၪဆဲၫ့လၧမၩတီၩ အလူလၧအ ဆိၪလၩ့အၥၭမွဲဂ့ၩ, ဆၧဖ့ၪလၫ့ဒၪဆၧမွဲဂ့ၩ, ဆၧမၩ ဘိၪ့အဆၧၫ့အထီဘဲၫၥိၭနၥံၪ မိမၩဆၧနၧၫ့မၧၫ့မုၬလၧ ယဟိဝၩအဂး, ဆၧလၧချီအကျၩမွဲဂ့ၩ, လၧၥိၪလၧ",
			"4": "<sup>4</sup> ဘ့ၪအကျၩမွဲဂ့ၩ,- ၦလၧအမၩဘိၪ့ယဟိဝၩ လၧအ ဆၧမၩဘိၪ့နီၪ, လၧဆၧမၩဘိၪ့ကိၪမုၬအဂး, မိဘၪဂဲၫ ဆိၬကိၪမုၬလအ့စရိၫ လဲၩဎုၬလၧၥိၪလဟံၫ့ လံပိၩ့လ",
			"5": "<sup>5</sup> ပိၩ့လီၫ.- ဒဲစဘံၭထံၫလဟံၫ့ လံပိၩ့လပိၩ့လၧဆၧလု အီၩအဂးနီၪ, လၧဆၧလုမ့ၪမွဲဂ့ၩ, ဆၧလုမွဲဂ့ၩ, နဘၪ",
			"6": "<sup>6</sup> မၩန့ၥိၪဖိၪလဒုၩ လၧအဂးလီၫ.- တၭလၧၥိၪဖၫဖိၪ လဒုၩအဂးနီၪ နဘၪမၩန့လၧဆၧမၩ ဘိၪ့ကိၪမုၬအ ဂး,ကိၪမုၬနံၫအ့စရိၫလဲၩဎုၬ လၧၥိၪလဟံၫ့ၥၧၫ့ပိၩ့လ",
			"7": "<sup>7</sup> ပိၩ့,- ဒဲလၧဆၧလုအီၩအဂးနီၪ နဘၪမၩဘိၪ့စဘံၭ ထံၫလဟံၫ့ၥၧၫ့ပိၩ့လပိၩ့, ဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိ",
			"8": "<sup>8</sup> ဝၩအဂးလီၫ.- တၭထီးနမၩန့ချီဖၫလဒုၩလၧဆၧလုမ့ၪ အဂးမွဲဂ့ၩ, လၧဆၧလုဘၪဆဲၫ့လၧအမၩတီၩအလူလၧ အဆိၪလၩ့အၥၭအဂးမွဲဂ့ၩ, လၧဆၧလုဘၪလိၬအိၭ",
			"9": "<sup>9</sup> လိၬမွဲဂ့ၩ, လၧယဟိဝၩအဂးတၭ,- ဘၪဂဲၫဆိၬချီဖၫလ ဒုၩ, လၧဆၧမၩဘိၪ့ကိၪမုၬ လၧၥၧၫ့အ့စရိၫလဲၩဎုၬလၧ",
			"10": "<sup>10</sup> ၥိၪအဟံၫ့ဖိၭဖၫ့,- တၭနမိဘၪဂဲၫဆိၬ ဆၧလုအီၩအ ဂးနီၪစဘံၭထံၫအဟံၫ့ဖိၭဖၫ့, လၧဆၧလုမ့ၪအဂး, ဒဲ",
			"11": "<sup>11</sup> ဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩအဂးလီၫ.- လၧချီဖၫလ ဒုၩအဂးမွဲဂ့ၩ, လၧၥိၪဖၫလဒုၩအဂးမွဲဂ့ၩ, လၧၥိၪဖိၪ လဒုၩအဂးမွဲဂ့ၩ, လၧဘ့ၪဖိၪလဒုၩအဂးမွဲဂ့ၩ, မိဘၪ",
			"12": "<sup>12</sup> မၩဘဲၫနီၪလီၫ.- ဘဲၫၦအီၪဎွ့ၩအံၩဎွ့ၩအိၩအၥိၭနီၪန ၥံၪဘၪမၩဆၧတၭ, နၥံၪမိဘၪမၩလၧ လဂၩအဂးလ ဂၩအဂးဘဲၫ အဆၧဝံထၪ့နၬထၪ့အီၪဝ့ၫ အၥိၭလီၫ.",
			"13": "<sup>13</sup> လၧအမၩဘိၪ့ဆၧလုမ့ၪ, ဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩ အဂးနီၪ, ၦလၧအအီၪဖျဲၪလၧခးဖၧၩ့ ထီးအလူၬမိဘၪ",
			"14": "<sup>14</sup> မၩဆၧနီၪလဖၪဘဲၫနီၪၥိၭလီၫ.- တၭၦလခီၫဘၩ့မုး ဖိၪအ့ၪအီၪလၧနၥံၪအကျၩ, ထီးဒၪၦလၧအအီၪလၧန ၥံၪအကျၩ လၧနၥံၪ အဆၨၩအဆၬ အဖၧၩ့ လဂၩဂၩ တၭ,အ့ၪမၩဆၧလုမ့ၪဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩအ ဂးတၭ, ဘဲၫနၥံၪမၩနၥံၪဝ့ၫအၥိၭနီၪ အဝ့ၫဒၪမိဘၪမၩ",
			"15": "<sup>15</sup> ဘဲၫနီၪအၥိၭဆ့လီၫ.- ဆၧအထူၫအရူၫလမံၩ့ဎး လၧၦ အီၪကီၪ့ဖိၪနၥံၪဝ့ၫအဂး, ဒဲလၧၦလခီၫဘၩ့မုးဖိၪလၧ အအီၪလၧနၥံၪအကျၩအဂးလီၫ. ဆၧအထူၫအရူၫအ ဆိၩအကၠၪလၩ့လၧနၥံၪ အဆၨၩအဆၬ လဆိၩဘၪလ ဆိၩလီၫ. ဘဲၫနၥံၪဝ့ၫအၥိၭနီၪ ၦလခီၫဘၩ့မုးဖိၪ မိမွဲ",
			"16": "<sup>16</sup> ဘဲၫနီၪအၥိၭ လၧယဟိဝၩအမ့ၬယၫလီၫ.- ဆၧၥနိၫလ မံၩ့ဎး, ဒဲဆၧအထူၫအရူၫလမံၩ့ဎး အီၪလၧနၥံၪအဂး ဒဲၦလခီၫဘၩ့မုးဖိၪ လၧအအီၪလၧနၥံၪ အကျၩအဂး လီၫ. ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,",
			"17": "<sup>17</sup> ချဲၩ့ ဆၧလၧၦအံၫစရ့လၭဖိၪတၭ, စံၭအဝ့ၫၥံၪ, ထီးနၥံၪ လ့ၩနုၬလၧခးဖၧၩ့ လၧယမိဒုၭဂဲၫနၥံၪ လၧအဖၧၩ့",
			"19": "<sup>19</sup> တၭ,- ထီးနၥံၪအၪ့ခးနီၪအကိၪတၭ, ဆၧမိမၩအၥၭ လၧနၥံၪဘၪဆိၬထၪ့ ဆၧမၩဘိၪ့ဝံဝါဝ့ၫ လၧယဟိဝၩ",
			"20": "<sup>20</sup> အဂးလီၫ.- နၥံၪမိဘၪမၩဘိၪ့ ကိၪပၪပဲၪလဘံၪ့လၧန ၥံၪအကိၪၥံၫ့ဆ့ၬအဆိၫ လၧဆၧမၩဘိၪ့ဆိၬထၪ့ဝံဝါဝ့ၫ အဂးလီၫ. ဘဲၫဆၧဆိၬထၪ့ဝံဝါဝ့ၫ ဘၪဆဲၫ့လၧခရဲး",
			"21": "<sup>21</sup> ဖၧၩ့အၥိၭနီၪ နၥံၪမိဘၪဆိၬထၪ့ဝံဝါဝ့ၫဆ့လီၫ.- လၧ ကိၪၥံၫ့ဆ့ၬဆိၫအဖၧၩ့နီၪ နၥံၪမိဘၪဖ့ၪလၫ့ ယဟိဝၩ လၧဆၧမၩဘိၪ့ ဆိၬထၪ့ဝံဝါဝ့ၫနီၪ, လၩ့လၧနၥံၪအ ဆၨၩအဆၬ လဆိၩဘၪလဆိၩလီၫ.",
			"22": "<sup>22</sup> တၭနၥံၪအ့ၪဂၭဖျိၭဖၧၩ့ၥၭ, ဒဲလထီးန့ ဘၪကယဲ",
			"23": "<sup>23</sup> ဆၧမၪလူၬလၧယဟိဝၩ လီၩဘၪစမိစ့ၭ,- ကယဲဆၧ လၧယဟိဝၩမၪလူၬ နၥံၪလၧစမိစ့ၭ အစူၪဖၧၩ့, လၧ မုလနံၩ လၧယဟိဝၩမၪလူၬစမိစ့ၭလံၩလံၩနီၪ လၩ့",
			"24": "<sup>24</sup> လၧနၥံၪအဆၨၩအဆၬ လဆိၩဘၪလဆိၩတၭ,- ဆၧ မိမၩအၥၭလၧၦၡၩ အ့ၪမၩမၪဆၧလၧအဂၭဖျိၭဆၧ အကၠီၩ့, လၧအအီၪဘံၭ လၧဆၧအီၪကီၪ့အမ့ၬယၫ တၭ,ဆၧအီၪကီၪ့ထီးအလူၬနီၪ ဘၪလုထၪ့ချီဖၫဖိၪလ ဒုၩလၧဆၧလုမ့ၪအဂး လၧဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိ ဝၩအဂးအီၪလၧအဆၧမၩဘိၪ့ကိၪမုၬ ဒဲအဆၧလု အီၩ, ဘဲၫအဆၧစ့ၩရၫ့အၥိၭ, ဒဲဘ့ၪဖိၪလၧဆၧလုဆၧ",
			"25": "<sup>25</sup> ဒဲၩဘၭအဂးလီၫ.- ၦလုဆၧလဂၩဘၪမၩဆၧဖီၩ့ဖျ့ၭ လၧၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့ထီးအလူၬ အဂး တၭ,ဆၧမိကွဲၪဖျါခွံၬအဆၧလီၫ. အဂဲးဘဲၫယီၩမွဲဆၧ လၥ့ၪယၫဘၪဆၧလီၫ. တၭဘၪဂဲၫဆိၬ အဆၧမၩ ဘိၪ့ဆၧလုမ့ၪ လၧယဟိဝၩအဂး ဒဲအဆၧလုဆၧဒဲၩ ဘၭလၧယဟိဝၩ အမ့ၬယၫ လၧအဆၧလၥ့ၪယၫဘၪ",
			"26": "<sup>26</sup> ဆၧအကၠီၩ့လီၫ.- တၭဆၧမိကွဲၪဖျါခွံၬ ၦအံၫစရ့လၭ ဖိၪအဆၧအီၪကီၪ့ထီးအလူၬအဆၧတၭ, ၦလခီၫဘၩ့ မုးဖိၪ လၧအအီၪလၧအကျၩ အဆၧလီၫ. အဂဲးဘဲၫ ယီၩၦခမျၧးထီးအလူၬ အီၪလၧဆၧလၥ့ၪယၫဘၪဆၧ အဖၧၩ့လီၫ.",
			"27": "<sup>27</sup> ၦလဂၩဂၩအ့ၪမၩဆၧဒဲၩဘၭ လၧအလၥ့ၪယၫဘၪ ဆၧအကၠီၩ့တၭ, ဘၪဂဲၫဆိၬဘ့ၪဖိၪလနံၪ့ဖိၪလဒုၩလၧ",
			"28": "<sup>28</sup> ဆၧလုဆၧဒဲၩဘၭအဂးလီၫ.- တၭလၧအမၩဆၧဒဲၩ ဘၭလၧယဟိဝၩအမ့ၬယၫ လၧအလၥ့ၪယၫဘၪဆၧ အကၠီၩ့, ၦလုဆၧလဂၩဘၪမၩဆၧဖီၩ့ဖျ့ၭ လၧအမၩ ဆၧဒဲၩဘၭလၧ အလၥ့ၪယၫဘၪဆၧအကၠီၩ့, ဘဲၫၥိၭ အမိမၩဆၧဖီၩ့ဖျ့ၭ လၧအဂးလီၫ. တၭဆၧမိကွဲၪဖျါ",
			"29": "<sup>29</sup> ခွံၬအဆၧလီၫ.- တၭလၧၦလၧအအီၪဖျဲၪလၧၦအံၫစရ့ လၭဖိၪအကျၩအဂးမွဲဂ့ၩ, လၧၦလခီၫဘၩ့မုးလၧအ အီၪလၧအကျၩ အဂးမွဲဂ့ၩ, နၥံၪဘၪအီၪလၧဆၧၥနိၫ လမံၩ့ဎး, လၧၦလၧအမၩဆၧဒဲၩဘၭ လၧအလၥ့ၪယၫ ဘၪဆၧအကၠီၩ့ လဂၩအဂးလီၫ.",
			"30": "<sup>30</sup> အ့ၪမွဲၦလၧအမၩဆၧ လၧအၥၭဒူၩလဂၩနီၪ, ၦအီၪ ဖျဲၪလၧခးဖၧၩ့မွဲဂ့ၩ, ၦလခီၫဘၩ့မုးဖိၪမွဲဂ့ၩ, အဝ့ၫနီၪ မၩကြၩ့ထမးယဟိဝၩတၭ မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫလၧ",
			"31": "<sup>31</sup> အၡၩလဆၨၩဒၪဝ့ၫအကျၩလီၫ.- မွဲအလဒူၩလယၪ့ ဘၪယဟိဝၩအလူအထၫ, ဒဲလၨၪခၫ့ဖၬအဆၧမၪလူၬ တၭ, အဝ့ၫလဂၩနီၪ မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫတၡါလီၫ. အဆၧဒဲၩဘၭနီၪ မိအီၪလၧအလီၩ့လီၫ.",
			"32": "<sup>32</sup> တၭၦအံၫစရ့လၭဖိၪအီၪဝ့ၫ လၧၡါမုနၧၫ့ဖၫအဘိၩ့ ဘၭနီၪ, ဆၧမၩအၥၭလၧအဒၪန့ၦလဂၩ လၧအအၪ့",
			"33": "<sup>33</sup> ထုၫ့ကီၪ့ၥံၪ့ထဲၩ့လၧမးၥံၫအနံၩလီၫ.- တၭၦလၧအဒၪ ချႃၭဝ့ၫလၧအအၪ့ထုၫ့ကီၪ့ၥံၪ့ထဲၩ့လဖၪနီၪ, ဂဲၫၥိၫ့ဝ့ၫ လၧစမိစ့ၭ, ဒဲစအၫရၧၫ့, ဒဲဆၧအီၪကီၪ့ ထီးအလူၬအ",
			"34": "<sup>34</sup> အီၪလီၫ.- တၭအဝ့ၫၥံၪအီၪက့ၪဝ့ၫ လၧဆၧခိၭထၬဝ့ၫ အလးနီၪ, အဂဲးဘဲၫယီၩ မိဘၪမၩဝ့ၫဘဲၫၥ့ၪလဲၪဘဲၫ",
			"35": "<sup>35</sup> ၥ့ၪလဲၪနီၪ, ဆၧဒုၭနဲၪဒံၭအ့ၬ.- တၭယဟိဝၩစံၭစမိ စ့ၭ,ၦလဂၩနီၪ မိဘၪဆၧမၩၥံၫတၡါဝ့ၫလီၫ. ဆၧအီၪ ကီၪ့ထီးအလူၬနီၪ မိဘၪခွံၬဝ့ၫ လၧလိးလၧၦၥုၪ့တဲၩ",
			"36": "<sup>36</sup> အလးလၧခီၫ့လခီၫလီၫ.- တၭဆၧအီၪကီၪ့ထီးအလူၬ နီၪလ့ၩဆိၬဝ့ၫလၧၦၥုၪ့တဲၩအလး လၧခီၫ့လခီၫ, ဒဲခွံၬ ဝ့ၫလၧလိးတၭ, ၥံၫဝ့ၫဘဲၫယဟိဝၩမၪလူၬ စမိစ့ၭအ ၥိၭနီၪလီၫ.",
			"37": "<sup>37</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ချဲၩ့ ဆၧလၧၦအံၫစရ့လၭဖိၪတၭ, လီၩဘၪအဝ့ၫၥံၪ, လၧ အမိမၩဆၧနွံၫ လၧအကီၩ့အၥိၭအနဲၩ့ထံၭ လၩ့လၧ အဆၨၩအဆၬ လဆိၩဘၪလဆိၩတၭ, လၧဆၧနဲၩ့ ထံၭအဆၧနွံၫအဖၫ့ခိၪနီၪ, မိဘၪအီၪက့ၪဖျံၩပၪပဲၪလၫ",
			"39": "<sup>39</sup> လီၫ.- တၭမွဲအမိကဲၪထၪ့ဆၧနွံၫ လၧနၥံၪအဂး, ဘဲၫၥိၭ နၥံၪမိယိဝ့ၫ, ဒဲနၪ့ထၪ့ထဲၩ့ကယဲ ယဟိဝၩအဆၧမၪလူၬ, ဒဲထီးန့ဝ့ၫတၭ, ဘဲၫၥိၭနၥံၪထီးအၪ့ဎၬဆၧ ထီးဒၪနၥံၪ အၥၭဒၪနၥံၪဝ့ၫ, ဒဲထီးဒၪနၥံၪအမ့ၬဒၪနၥံၪဝ့ၫ လၧနၥံၪ",
			"40": "<sup>40</sup> ဖိၬထွ့ၫလၧဆၧလဲးဆၧဘျၪနီၪလဂ့ၩလီၫ.- ဒဲဘဲၫၥိၭန ၥံၪမိနၪ့ထၪ့ထဲၩ့ဆၧ, ဒဲထီးန့ကယဲယဆၧမၪလူၬတၭ, ကဲၪထၪ့ၦဆံၫ့ဎံၪ လၧနၥံၪအယွၩအဂးလီၫ.",
			"41": "<sup>41</sup> ယဝ့ၫဒၪယီၩ, ယမွဲယဟိဝၩနၥံၪအယွၩလၧအဒုၭ စဲၪ့ထၪ့ခွံၬနၥံၪ လၧခးအံဇံၭအဖၧၩ့, ဘဲၫၥိၭယမိကဲၪ ထၪ့နၥံၪအယွၩတၭ, ယမွဲယဟိဝၩနၥံၪအယွၩလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> တၭၦလံဝဲၫအဖိၪခွၫ စကိဟၭအဖိၪခွၫ စအံဇဟၫ အဖိၪခွၫစကိရၫ, စရုဘံၫ့အဖိၪခွၫလဖၪ စအံၫလဲအၭ အဖိၪခွၫစဒၫၥၫ့ဒဲစအဘဲရၫ့ ဒဲစပ့လ့ၭအဖိၪခွၫစအၫ့,",
			"2": "<sup>2</sup> အဝ့ၫၥံၪဂဲထုၪ့လၧစမိစ့ၭအမ့ၬယၫ ဒဲၦအံၫစရ့လၭဖိၪ လနၩ့နၩ့ ၦဒိၪလၧဆၧအီၪကီၪ့အဖၧၩ့, ၦန့ဘၪဆၧလၩ ဖၩ့လၧဆၧအီၪကီၪ့အဖၧၩ့, ၦလၧအမံၩ့ဂၧၫ့ထၪ့ ၥၩ",
			"3": "<sup>3</sup> လၩ့နံၫယၩယဲဆံၫ,- တၭအဝ့ၫၥံၪအီၪကီၪ့ထၫ့ဒုၪဒၩ စမိစ့ၭဒဲစအၫရၧၫ့တၭ, စံၭအဝ့ၫၥံၪ, နၥံၪမၩန့ဆၧအၪ လၨၪလၧနၥံၪအဂးယူၭ, အဂဲးဘဲၫယီၩ ၦအီၪကီၪ့ဖိၪ ထီးအလူၬနီၪ မွဲဆံၫ့ဎံၪကိၭဂၩဒ့ၭတၭ, ယဟိဝၩအီၪ လၧအကျၩလီၫ. တၭနၥံၪအီၪက့ၪထၪ့ထီၫနၥံၪအၥၭ လၧယဟိဝၩ အဆၧအီၪကီၪ့အဖၫ့ခိၪနီၪ မွဲဘၪလဲၪ. စမိစ့ၭနါဂၧၫ့ဝ့ၫတၭ ထိၪလၩ့ထံၩဖါအၥၭတၭ,",
			"4": "<sup>4</sup> ချဲၩ့ ဆၧလၧစကိရၫဒဲဆၧအီၪကီၪ့ထီးအလူၬတၭ, စံၭဝ့ၫ ဒၪ,ကဲဂီၩခိၬနီၪ ၦလၧအမွဲအဆၧ,ဒဲဆံၫ့ဎံၪနီၪယဟိ ဝၩမိဒုၭၥ့ၪယၫတၭ, မိဒုၭၥုၭဘူၭအၥၭ လၧအအီၪ",
			"6": "<sup>6</sup> လီၫ.- မၩဆၧယီၩဘီၪ, နၥံၪဝ့ၫဒၪ,စကိရၫဒဲအဆၧအီၪ",
			"7": "<sup>7</sup> ကီၪ့ထီးအလူၬ, မၩန့ဖၧၩ့မ့ၪတၭ,- အီၪက့ၪမ့ၪလၧအ ဖၧၩ့, ဒဲအီၪက့ၪဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ လၧအဖၧၩ့လၧယ ဟိဝၩအမ့ၬယၫကဲဂီၩခိၬနီၪဆံၭ. တၭဆၧမိမၩအၥၭ လၧၦလၧယဟိဝၩရွံန့ဝ့ၫနီၪ, အဝ့ၫနီၪမွဲဆံၫ့ဎံၪလီၫ. န ၥံၪမၩန့ဆၧအၪလၨၪယူၭ လၧနၥံၪအဂးယူၭ, စလံဝဲၫ အဖိၪခွၫၥံၪဧ့,",
			"8": "<sup>8</sup> တၭစမိစ့ၭစံၭ, စကိရၫ,ခိၭနၪလါဆံၭ, စလံဝဲၫအဖိၪ",
			"9": "<sup>9</sup> ခွၫၥံၪဧ့,- ၦအံၫစရ့လၭဖိၪအယွၩ အၪ့နၩ့ဖၭနၥံၪလၧ ၦအံၫစရ့လၭအဆၧအီၪကီၪ့အဖၧၩ့ ဘဲၫၥိၭ အမိဒုၭ ဂဲၫဘူၭနၥံၪလၧအနၫ့ဆါဒၪဝ့ၫ, ဘဲၫနၥံၪမိမၩတဲၩဆံၫ့ ဎံၪအဆၧမၩနီၪ, ဒဲဆၧၫ့ထုၪ့လၧဆၧအီၪကီၪ့အမ့ၬယၫ ဘဲၫၥိၭနၥံၪမိမၩအခ့ၫအၡၩ အဆၧမၩနီၪ မွဲဆၧအဆံၭ",
			"10": "<sup>10</sup> နီၪဆ့ဧၪ.- တၭမွဲအဒုၭဂဲၫဘူၭယူၭနၧၩ, ဒဲစလံဝဲၫအ ဖိၪခွၫ, နထၧၫ့ဖုဝဲၥံၪထီးအလူၬ အီၪလၧနၧၩယူၭတၭ,",
			"11": "<sup>11</sup> နၥံၪအၪ့ဎၬဆ့ၦလုဆၧအလးဆ့ဧၪ.- အခိးမွဲဘဲၫနီၪ တၭနဝ့ၫဒၪဒဲနဆၧအီၪကီၪ့ ထီးအလူၬအီၪကီၪ့ထၫ့ဒုၪ ဒၩယဟိဝၩလီၫ. လၧနၥံၪၥူၭဝံၪၥူၭလၩဆၧ လၧအ လီၩ့အကၠီၩ့နီၪ, စအၫရၧၫ့မွဲဆၧဘဲၫၥ့ၪလဲၪၬ",
			"12": "<sup>12</sup> စမိစ့ၭအၪ့မၧၫ့ၦလ့ၩကိၭန့ စအံၫလဲအၭအဖိၪခွၫ စဒၫၥၫ့ဒဲစအဘဲရၫ့ၥံၪတၭ, အဝ့ၫၥံၪစံၭဝ့ၫဒၪ, ပလ့ၩ",
			"13": "<sup>13</sup> ထၪ့အ့ၬ.- နဒုၭစဲၪ့ထၪ့ခွံၬပၧၩ လၧခးလၧအယွၩဝ့ၫ လၧဆၧနူထံၫဒဲန့ၫစၩ့, ဘဲၫၥိၭပမိဘၪဆၧမၩၥံၫပၧၩ လၧၡါမုနၧၫ့ဖၫယီၩလဘၪဘၪတၭ, မွဲနအီၪက့ၪနၥၭ",
			"14": "<sup>14</sup> လၧနမိကဲၪဒိၪတၡါလၧပဖၫ့ခိၪဧၪ.- လၧနီၪအမ့ၬယၫ နဂဲၫၥိၫ့နုၬပၧၩ လၧခးလၧအယွၩလၩ့ လၧဆၧနူထံၫ ဒဲန့ၫစၩ့အ့ၬ. နဒုၭဖ့ၪၥၫပၧၩ လၧဆံၬၥံၪနၩၥံၪ, လၧစ ဘံၭမုအလးအ့ၬ. နမိအီၩ့ခွ့ၭထၪ့ၦလဖၪနီၪအမ့ၬၥၪ ဆ့ဧၪ. ပလ့ၩထၪ့အ့ၬ.",
			"15": "<sup>15</sup> စမိစ့ၭအၥၭခဲၩထၪ့ဒိၪမၬတၭ, စံၭယဟိဝၩ, ထိးဆၧၫ့ အဝ့ၫၥံၪအဆၧမၩဘိၪ့လဂ့ၩ, ကၥ့ၪယီၩ့လဒုၩ ယလ",
			"16": "<sup>16</sup> မၩန့ဘၪလၧအဝ့ၫၥံၪ, ဒဲယမၩအၧၩ့ဝ့ၫနးဂၩအ့ၬ.- တၭ စမိစ့ၭစံၭစကိရၫ, ကဲဂီၩခိၬနဝ့ၫဒၪ ဒဲနဆၧအီၪကီၪ့ထီး အလူၬအီၪလၧယဟိဝၩအမ့ၬယၫ, နဝ့ၫဒၪဒဲအဝ့ၫၥံၪ,",
			"17": "<sup>17</sup> ဒဲစအၫရၧၫ့ဆံၭ.- တၭမွဲၦမၩန့လဂၩအဖၧၩ့မ့ၪဒၪဝ့ၫ, လဂၩအဖၧၩ့မ့ၪဒၪဝ့ၫတၭ, အီၪက့ၪဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ လၧအဖၧၩ့တၭ, ဂဲၫဆိၬလၧယဟိဝၩအမ့ၬယၫလဂၩ အဖၧၩ့မ့ၪဒၪဝ့ၫ, လဂၩအဖၧၩ့မ့ၪဒၪဝ့ၫ, ဖၧၩ့မ့ၪနံၫယၩ ယဲဆံၫ. နဝ့ၫဒၪဆ့ဒဲစအၫရၧၫ့လဂၩ အဖၧၩ့မ့ၪဒၪဝ့ၫ, လဂၩအဖၧၩ့မ့ၪဒၪဝ့ၫဆံၭ.",
			"18": "<sup>18</sup> တၭအဝ့ၫၥံၪကိၭဂၩဒ့ၭမၩန့ဝ့ၫလဂၩအဖၧၩ့မ့ၪဒၪ ဝ့ၫဆုၬဆုၬတၭ, အီၪက့ၪမ့ၪလၧအဖၧၩ့တၭ, အီၪက့ၪ ဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ လၧအဖၫ့ခိၪတၭ, ဆၧၫ့ထုၪ့ဝ့ၫလၧ ဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအတရၫ့ဖၧၩ့ လၧစမိစ့ၭဒဲစ",
			"19": "<sup>19</sup> အၫရၧၫ့လီၫ.- တၭစကိရၫဒုၭအီၪကီၪ့ ဆၧအီၪကီၪ့ထီး အလူၬထၫ့ဒုၪဒၩဝ့ၫ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအ တရၫ့ထံၭလီၫ. တၭယဟိဝၩအလၩအဖၩ့ အီၪဖျီၪထၪ့ လၧဆၧအီၪကီၪ့အမ့ၬယၫလီၫ.",
			"20": "<sup>20</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ ဒဲစအၫရၧၫ့တၭ, စံၭဝ့ၫ",
			"21": "<sup>21</sup> ဒၪ,- မၩလၩ့ဖၭနၥံၪအနၫ့ဆါၥံၪ လၧဆၧအီၪကီၪ့ယီၩ အၥၭကျၩ, ဘဲၫၥိၭယမိဒုၭအၪ့ခွံၬအဝ့ၫၥံၪ လထံၪဎး",
			"22": "<sup>22</sup> ဆံၭ.- အဝ့ၫၥံၪထိၪလၩ့ထံၩဖါအၥၭတၭ, စံၭဝ့ၫဒၪ, ယွၩဧ့,ကယဲဆၧယၪထီးအလူၬ အၥၭလဖၪအယွၩဧ့, ၦလဂၩ မၩဆၧဒဲၩဘၭတၭ, နၥၭမိထၪ့ဘၪဆၧအီၪ",
			"23": "<sup>23</sup> ကီၪ့ထီးအလူၬဆ့ဧၪ.- ယဟိဝၩချဲၩ့ဒုၪ့စမိစ့ၭတၭ, စံၭ",
			"24": "<sup>24</sup> ဝ့ၫဒၪ,- ချဲၩ့ဆၧလၧဆၧအီၪကီၪ့တၭစံၭ, စဲၪ့ထၪ့ခွံၬလၧ ဆၧဝၬဖီၩ့စကိရၫ, ဒဲစဒၫၥၫ့, ဒဲစအဘဲရၫ့အတဲၩနီၪဆံၭ.",
			"25": "<sup>25</sup> စမိစ့ၭဂဲထုၪ့တၭ, လ့ၩလၧစဒၫၥၫ့, ဒဲစအဘဲရၫ့အ အီၪတၭ ၦအံၫစရ့လၭဖိၪ အၥုၪ့က့ၭၥၭၡါလဖၪ ဖိၬ",
			"26": "<sup>26</sup> ထၪ့အခဲၫ့လီၫ.- အဝ့ၫချဲၩ့ထၪ့ဆၧ လၧဆၧအီၪကီၪ့ တၭ,စံၭဝ့ၫဒၪး ယအၪ့ယၫနၥံၪ စဲၪ့ထၪ့ခွံၬလၧၦအၧၩ့ လဖၪယီၩအတဲၩဖၧၩ့ဆံၭ. တၭဆၧဘၪဆဲၫ့လၧအဝ့ၫ ၥံၪနီၪထီးထိၭဘၪ နးမံၩ့လဂ့ၩ, ဘၪလဘၪနၥံၪမိဘၪ ဆၧအၪ့ခွံၬဘၪခိၬနၥံၪ လၧအဝ့ၫၥံၪအဆၧဒဲၩဘၭထီး",
			"27": "<sup>27</sup> အလူၬအဖၧၩ့လီၫ.- တၭၦလဖၪနီၪစဲၪ့ထၪ့ဝ့ၫ လၧစကိ ရၫ, ဒဲစဒၫၥၫ့, ဒဲစအဘဲရၫ့ၥံၪၥုၪ့တဲၩအလးကိၭခီၫဒ့ၭ လီၫ. တၭစဒၫၥၫ့ဒဲအဘဲရၫ့ၥံၪ ဂဲထၪ့ဆၧၫ့ထုၪ့ဝ့ၫလၧ အတဲၩလဖၪအတရၫ့ဖၧၩ့နီၪ, ဒဲအမၫလဖၪ,ဒဲအဖိၪခွၫ",
			"28": "<sup>28</sup> လဖၪ,ဒဲအဖိၪဆံၭလဖၪလီၫ.- တၭစမိစ့ၭစံၭဝ့ၫဒၪ,လၧ ဆၧလမံၩ့ယီၩအကၠီၩ့နၥံၪမိၥ့ၪယၫ လၧယဟိဝၩအၪ့ မၧၫ့လၩ့ယၧၩဘဲၫၥိၭ ယမိမၩဆၧမၩလဖၪနီၪ, အဂဲး",
			"29": "<sup>29</sup> ဘဲၫယီၩ မွဲလၧယၥၭဒၪယဝ့ၫအ့ၬ.- ၦလဖၪနီၪအ့ၪ ၥံၫဘဲၫၦထီးအလူၬၥံၫဝ့ၫအၥိၭတၭ, ဆၧအ့ၪစ့ၩရၫ့ဝ့ၫ ဘဲၫဆၧစ့ၩရၫ့ ၦထီးအလူၬအၥိၭတၭ, ယဟိဝၩအၪ့",
			"30": "<sup>30</sup> မၧၫ့လၩ့ယၧၩအ့ၬ.- အ့ၪမွဲယဟိဝၩ အ့ၪဒုၭကဲၪထၪ့ ဆၧအၥၫ့လမံၩ့တၭ, ဂၪ့ခိၪအ့ၪအၩ့ထၪ့အနိၭ, ယုလၩ့ ခွံၬဝ့ၫ,ဒဲကယဲဆၧဘၪဆဲၫ့လၧအဝ့ၫၥံၪထီးအလူၬတၭ, အဝ့ၫၥံၪလၧအမၧၫ့ဝ့ၫအဘိၩ့ဘၭနီၪ အ့ၪလ့ၩလၩ့လၧ ဖျႃဖၧၩ့တၭ, နၥံၪမိၥ့ၪယၫလၧၦလဖၪနီၪ မၩကြၩ့ထ မးယူၭယဟိဝၩယူၭလီၫ.",
			"31": "<sup>31</sup> ထီးအချဲၩ့ဆၧချဲၩ့ထီးအလူၬနီၪဂီၩ့တၭ, ဆၧမၩအ",
			"32": "<sup>32</sup> ၥၭလၧဂၪ့ခိၪ အီၪလၧအဖၫ့လၬထ့ဖၭ,- ဒဲဂၪ့ခိၪအၩ့ ထၪ့အနိၭတၭအၪ့ယုလၩ့ခွံၬအဝ့ၫၥံၪ အဂံၪ့လဖၪ, ဒဲက ယဲၦၡၩလၧအဘၪဆဲၫ့လၧစကိရၫ, ဒဲအစူၪလးအခၪ့",
			"33": "<sup>33</sup> ခိၪထီးအလူၬ,- အဝ့ၫၥံၪဒဲကယဲၦၡၩဘၪဆဲၫ့လၧအ ဝ့ၫၥံၪထီးအလူၬ မၧၫ့ဝ့ၫနီၪ လ့ၩလၩ့လၧဖျႃဖၧၩ့တၭ, ဂၪ့ခိၪချႃၬဘံၭဆၧလၧအဖၫ့ခိၪတၭ, အဝ့ၫၥံၪလၩ့မါ",
			"34": "<sup>34</sup> ခွံၬဝ့ၫလၧဆၧအီၪကီၪ့ဖၧၩ့လီၫ.- တၭကယဲၦအံၫစရ့ လၭဖိၪလၧအအီၪဝၬဖီၩ့ဝ့ၫနီၪ စဲၪ့လၧအဝ့ၫၥံၪဂၪ့ကိၭ ထၪ့ဝ့ၫအကၠီၩ့နီၪလီၫ. အဂဲးဘဲၫယီၩ မွဲအစံၭဝ့ၫဒၪ,",
			"35": "<sup>35</sup> ဂၪ့ခိၪမိယုလၩ့ဘၪခိၬပဝ့ၫဒၪယီၩဆ့လီၫ.- မ့ၪဂဲၫလၩ့ လၧယဟိဝၩအအီၪတၭ, အၪ့ခွံၬၦၡၩနံၫယၩယဲဆံၫ လၧအမၩဘိၪ့ဆၧနၧၫ့မၧၫ့ဆူၭခဲၩနီၪလီၫ.",
			"36": "<sup>36</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ,စံၭဝ့ၫဒၪ, စံၭၦ လုဆၧလဂၩ, စအၫရၧၫ့အဖိၪခွၫစအံၫလအ့ဇၧၫ,ဘဲၫ ၥိၭအမိထုၭထၪ့ခွံၬဖၧၩ့မ့ၪလဖၪ လၧမ့ၪအၪ့ဆၧအဖၧၩ့ နီၪတၭဎွံၪနဝ့ၫမ့ၪနီၪဆံၭ, အဂဲးဘဲၫယီၩ ဆၧလဖၪနီၪ",
			"38": "<sup>38</sup> ဆံၫ့ဎံၪဝ့ၫလီၫ.- ၦၡၩမၩမၪဘၪအၥၭဒၪဝ့ၫလဖၪအ ဖၧၩ့မ့ၪၥံၪနီၪ, မွဲၦၡၩမၩဆၧပၪပဲၪ လၧအဝ့ၫၥံၪလၧ ဆၧမၩဘံၭဆၧလုလးအဂးနီၪဆံၭ. အဂဲးဘဲၫယီၩမွဲ အမၩဘိၪ့ဝ့ၫလၧယဟိဝၩအမ့ၬယၫအကၠီၩ့တၭ ဆံၫ့ ဎံၪဝ့ၫလီၫ. တၭဆၧကဲၪထၪ့ ဆၧမၩနဲၪ့ လၧၦအံၫစရ့",
			"39": "<sup>39</sup> လၭဖိၪအဂးလီၫ.- တၭၦလုဆၧလဂၩ စအံၫလအ့ဇၧၫ မၩန့ဖၧၩ့မ့ၪထီးဝီၩလဖၪ လၧၦၡၩလၧမ့ၪအၪ့ခွံၬဝ့ၫလ ဖၪနီၪမၩဘိၪ့လၧအဖၧၩ့တၭ, မၩဆၧပၪပဲၪလၧအမၩ",
			"40": "<sup>40</sup> ဘံၭဆၧလုလးအဂး,- ဆၧနၪ့ထၪ့ထဲၩ့လၧၦအံၫစရ့ လၭဖိၪအဂး, ဘဲၫၥိၭၦလခီၫဘၩ့မုးဖိၪ လၧအလမွဲဘၪ စအၫရၧၫ့အချံၫအၥၪနီၪ ထီးၥုၭဘူၭအၥၭ လၧအမိမၩ ဘိၪ့ဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ လၧယဟိဝၩအမ့ၬယၫလဂ့ၩး ဘဲၫၥိၭအထီးကဲၪထၪ့ဆၧ ဘဲၫစကိရၫ, ဒဲဘဲၫအၡၩလ ဒီၪ့အၥိၭး ဘဲၫယဟိဝၩစံၭဝ့ၫ လၧစမိစ့ၭအစူၪဖၧၩ့အ ၥိၭနီၪလဂ့ၩ.",
			"41": "<sup>41</sup> တၭဆၧဖၩ့ထၪ့လနံၩနီၪ ၦအံၫစရ့လၭဖိၪ အဆၧ အီၪကီၪ့ထီးအလူၬ ၥူၭဝံၪၥူၭလၩဆၧ လၧစမိစ့ၭဒဲစအၫ ရၧၫ့အလီၩ့တၭစံၭဝ့ၫဒၪ, နၥံၪမၩၥံၫယူၭ ယဟိဝၩအ",
			"42": "<sup>42</sup> ၡၩခမျၧးယူၭလီၫ.- ထီးဆၧအီၪကီၪ့နီၪ အီၪကီၪ့ထၫ့ ဒုၪဒၩစမိစ့ၭ, ဒဲစအၫရၧၫ့တၭ, ဆၧမၩအၥၭလၧအဝ့ၫ ၥံၪယိဝ့ၫလၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪတၭ, ယိခွါ, ဆၧအုၪ့နီၪချႃၬဘံၭခွံၬဝ့ၫတၭ, ယဟိဝၩအလၩအဖၩ့",
			"43": "<sup>43</sup> အီၪဖျီၪထၪ့လီၫ.- တၭစမိစ့ၭဒဲစအၫရၧၫ့ဂဲၫလၧဆၧ",
			"44": "<sup>44</sup> အီၪကီၪ့အတဲၩအမ့ၬယၫလီၫ.- ယဟိဝၩချဲၩ့ဆၧလၧ",
			"45": "<sup>45</sup> စမိစ့ၭတၭစံၭဝ့ၫဒၪ,- ဘဲၫၥိၭယမိဒုၭအၪ့ခွံၬဝ့ၫလၧဆၧ လဆိဖိၪအထးဖၧၩ့နီၪ, စဲၪ့ထၪ့ခွံၬလၧဆၧအီၪကီၪ့ယီၩ အကျၩဆံၭ. တၭအဝ့ၫၥံၪ ထိၪလၩ့ထံၩဖါအၥၭလီၫ.",
			"46": "<sup>46</sup> စမိစ့ၭစံၭစအၫရၧၫ့ မၩန့ဖၧၩ့မ့ၪလဖျိၪ့တၭ, အီၪက့ၪမ့ၪ လၧအဖၧၩ့လၧဆၧမၩန့ လၧဆၧလုလးအဖၫ့ခိၪတၭ, အီၪက့ၪဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ လၧအဖၫ့ခိၪတၭ, လ့ၩချဲၫ့ ချဲၫ့လၧဆၧအီၪကီၪ့အဖၧၩ့တၭ, မၩဆၧဖီၩ့ဖျ့ၭလၧအ ဂးနီၪဆံၭ. အဂဲးဘဲၫယီၩ ဆၧၥၭထၪ့စဲၪ့ထၪ့ယူၭလၧ",
			"47": "<sup>47</sup> ယဟိဝၩအအီၪယူၭ, ဆၧဆၫဖျဲၪအီၪထၪ့ၥၫ့ယူၭ.- စအၫ ရၧၫ့မၩန့ဆၧဘဲၫစမိစ့ၭမၪလူၬဝ့ၫအၥိၭတၭ, စဲၪ့ဖိး လၧဆၧအီၪကီၪ့အၥၭကျၩတၭ, ယိခွါ, ဆၧဆၫဖျဲၪအီၪ ထၪ့ၥၫ့ယူၭလၧၦခမျၧးအကျၩယူၭ, တၭမွဲအအီၪက့ၪ ဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ လၧအဖၫ့ခိၪတၭ, မၩဆၧဖီၩ့ဖျ့ၭ",
			"48": "<sup>48</sup> လၧၦခမျၧးအဂးလီၫ.- အဝ့ၫဒၪဆၧၫ့ထုၪ့လၧၦၥံၫလ",
			"49": "<sup>49</sup> ဖၪဒဲၦမၧၫ့လဖၪအဘိၩ့ဆၧၩ့နီၪလီၫ.- တၭဆၧဆၫအ ဖျဲၪအီၪထီဝ့ၫလီၫ. တၭလၧၦၥံၫ လၧစကိရၫ အမူၭအ ရါအကၠီၩ့အဖၫ့ခိၪနီၪ, ၦၥံၫလၧဆၧဆၫဖျဲၪအဖၧၩ့နီၪ မွဲလလၬလံထီၫ့ နွ့ၫယၩဆ့လီၫ.",
			"50": "<sup>50</sup> တၭစအၫရၧၫ့ထဲၩ့ထဲၩ့လၧစမိစ့ၭအအီၪ ထီးဆၧအီၪ ကီၪ့အတဲၩဆံၫ့ဎံၪအတရၫ့နီၪတၭ, ဆၧဆၫဖျဲၪအီၪထီ ဝ့ၫလီၫ."
		},
		"17": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭစံၭဝ့ၫဒၪ, ချဲၩ့ဆၧ လၧၦအံၫစရ့လၭဖိၪတၭ, မၩန့နိၪထိၭဘီၩ့ လၧလဂၩ လဘီၩ့, လဂၩလဘီၩ့ဘဲၫအဖါလဖၪအဂံၪ့အၥိၭ, အၦ ဒိၪလဖၪထီးအလူၬ ဘဲၫအဝ့ၫၥံၪအဖါလဖၪ အဂံၪ့အ ၥိၭ, နိၪထိၭဘီၩ့လဆံၫနံၫဘီၩ့နီၪဆံၭ. ကွ့ၭလဂၩအမံၩ့ လဂၩအမံၩ့ လၧအနိၪထိၭဘီၩ့ဒၪဝ့ၫအလီၩ့နီၪဆံၭ.",
			"3": "<sup>3</sup> တၭလၧလံဝဲၫအနိၪထိၭဘီၩ့အလီၩ့နီၪ နဘၪကွ့ၭစအၫ ရၧၫ့အမံၩ့လီၫ. အဂဲးဘဲၫယီၩ နိၪထိၭဘီၩ့လဘီၩ့နီၪ",
			"4": "<sup>4</sup> မိအီၪလၧအဖါၥံၪ အဂံၪ့အခိၪအဂးလီၫ.- တၭနဘၪ အီၪက့ၪလၩ့ဆၧလဖၪနီၪ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ ဎံၪအဖၧၩ့ လၧဆၧအုၩ့လၩ့အမ့ၬယၫ, ထီးဒၪအလး",
			"5": "<sup>5</sup> လၧယမိဂဲၫဒၪလိၬယၥၭ လၧနၥံၪနီၪလီၫ.- တၭဆၧမိ မၩအၥၭလၧၦလၧယရွံန့လဂၩ အနိၪထိၭဘီၩ့နီၪ မိဖီၫ ထၪ့, ဘဲၫၥိၭၦအံၫစရ့လၭဖိၪ အဆၧၥူၭဝံၪၥူၭလၩလၧ ယလီၩ့လၧအၥူၭဝံၪၥူၭလၩ လၧနၥံၪအလီၩ့အကၠီၩ့နီၪ ယမိဒုၭထုၬဝ့ၫဒၪလီၫ.",
			"6": "<sup>6</sup> စမိစ့ၭချဲၩ့ဆၧလၧၦအံၫစရ့လၭဖိၪတၭ, ကယဲအၦ ဒိၪလဖၪဖ့ၪလၫ့အဝ့ၫ လၧနိၪထိၭဘီၩ့, ၦဒိၪလဂၩလ ဘီၩ့လဂၩလဘီၩ့, ကိၭဂၩဒ့ၭ, ဘဲၫအဖါၥံၪအဂံၪ့ခိၪ အၥိၭနီၪ, နိၪထိၭဘီၩ့ လဆံၫနံၫဘီၩ့လီၫ. စအၫရၧၫ့ အနိၪထိၭဘီၩ့နီၪ အီၪဝ့ၫလၧနိၪထိၭဘီၩ့လဖၪ အကျၩ",
			"7": "<sup>7</sup> လီၫ.- တၭစမိစ့ၭ အီၪက့ၪနိၪထိၭဘီၩ့လဖၪ လၧဆၧ အုၩ့လၩ့အတဲၩဆံၫ့ဎံၪအဖၧၩ့ လၧယဟိဝၩ အမ့ၬယၫ",
			"8": "<sup>8</sup> လီၫ.- တၭဆၧမၩအၥၭ လၧဆၧဖၩ့ထၪ့လနံၩနီၪစမိစ့ၭ လ့ၩနုၬလၧဆၧအုၩ့လၩ့ အတဲၩဆံၫ့ဎံၪအဖၧၩ့တၭ, ယိ ခွါ, စအၫရၧၫ့အနိၪထိၭဘီၩ့ လၧလံဝဲၫအဂံၪ့အဂးလ ဘီၩ့နီၪဒိၭထၪ့ဝ့ၫယူၭ, ဒဲထိထၪ့ယူၭဖီၫထၪ့ယူၭ, ဒဲၥၪ",
			"9": "<sup>9</sup> ထၪ့ယူၭ ၡကၭၥၪနီၪလီၫ.- တၭစမိစ့ၭဂဲၫဆိၬထၪ့ခွံၬ နိၪထိၭဘီၩ့ထီးအလူၬ လၧအအီၪလၧယဟိဝၩအမ့ၬ ယၫနီၪ ဖိးလၧၦအံၫစရ့လၭဖိၪအအီၪတၭ, အဝ့ၫၥံၪ ယိဝ့ၫတၭ, မၩန့ဝ့ၫလဂၩအနိၪထိၭဘီၩ့ဒၪဝ့ၫ, လဂၩ အနိၪထိၭဘီၩ့ဒၪဝ့ၫလီၫ.",
			"10": "<sup>10</sup> တၭယဟိဝၩ စံၭစမိစ့ၭ, ဂဲၫဆိၬထၪ့ဒီၭ စအၫရၧၫ့ အနိၪထိၭဘီၩ့လၧဆၧအုၩ့လၩ့အမ့ၬယၫ, ဘဲၫၥိၭဆၧ မိအီၪက့ၪထၬဝ့ၫ လၧဆၧမၩနဲၪ့လၧအထၫ့ဒၩ ၦပိၩ့ထၪ့ ဆၧလဖၪနီၪဆံၭ. တၭနဘၪဒုၭလၩ့မါခွံၬ အဝ့ၫၥံၪအ ဆၧၥူၭဝံၪၥူၭလၩ လၧယလီၩ့ဘဲၫၥိၭအထီးၥံၫလဂ့ၩ.",
			"11": "<sup>11</sup> တၭစမိစ့ၭမၩဝ့ၫ, ဘဲၫယဟိဝၩမၪလူၬဝ့ၫအၥိၭနီၪ, မၩ ဝ့ၫဘဲၫနီၪၥိၭဆ့လီၫ.",
			"12": "<sup>12</sup> ၦအံၫစရ့လၭဖိၪချဲၩ့ဒုၪ့စမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,ယိခွါ,",
			"13": "<sup>13</sup> ပၥံၫ, ပဂၭဂီၩ့,ပဘၪဆၧဂၭဂီၩ့ကိၭဂၩဒ့ၭလီၫ.- ၦလၧ အလ့ၩဘူၭလၧယဟိဝၩ အတဲၩဆံၫ့ဎံၪကိၭဂၩဒ့ၭနီၪ, မိၥံၫတၭး မွဲပမိလူၬလၧဆၧၥံၫအကၠီၩ့နီၪဆ့ဧၪ."
		},
		"18": {
			"1": "<sup>1</sup> တၭယဟိဝၩစံၭစအၫရၧၫ့နဝ့ၫဒၪ, ဒဲနဖိၪခွၫလဖၪ, ဒဲနဖါအဂံၪ့အီၪလၧနၥိၭနီၪ မိဘၪထိးဆၧအလးဆံၫ့ဎံၪ အဆၧအၧၩ့လီၫ. တၭနၧၩဒဲနဖိၪခွၫလဖၪအီၪလၧနၥိၭ နီၪမိဘၪထိးနၥံၪ အၦလုဆၧအလး အဆၧအၧၩ့လီၫ.",
			"2": "<sup>2</sup> နထၧၫ့ဖုဝဲဆ့, ၦလံဝဲၫဖိၪလဒီၪ့, နဖါအဒီၪ့ဖိၪ, ဂဲၫဆိၬ လၧနၥိၭဘဲၫအဝ့ၫၥံၪမိအီၪလၧနၥိၭ, ဒဲမၩနခ့ၫနၡၩအ ဆၧနီၪဆံၭ. အ့ၪမွဲနဝ့ၫဒၪဒဲနဖိၪခွၫ အီၪလၧနၥိၭလဖၪ နီၪဘၪမၩဆၧလၧဆၧအုၩ့လၩ့ အတဲၩဆံၫ့ဎံၪအမ့ၬ",
			"3": "<sup>3</sup> ယၫလီၫ.- တၭအဝ့ၫၥံၪနီၪ ဘၪယိနဆၧယိ, ဒဲအဆၧယိ ဘၪဆဲၫ့လၧတဲၩဆံၫ့ဎံၪထၧၫ့ဖျိၪ့ယၫလီၫ. အ့ၪမွဲအၥုၭ ဘူၭအၥၭ လၧဆၧအလးဆံၫ့ဎံၪ အဆၧဖိၪဆၧလံၩဒဲ ဆၧလုလးအ့ၬ. ဘဲၫၥိၭအဝ့ၫၥံၪမွဲဂ့ၩ, နၥံၪဝ့ၫဆ့မွဲဂ့ၩ,",
			"4": "<sup>4</sup> ထီးၥံၫဘၪလဂ့ၩအဂဲးလီၫ.- အဝ့ၫၥံၪနီၪမိအီၪလၧနစူၪ ဖၧၩ့တၭ, ယိဆၧယိဘၪဆဲၫ့ လၧဆၧအီၪကီၪ့ဆံၫ့ဎံၪ နီၪ,ဒဲတဲၩဆံၫ့ဎံၪ အဆၧမၩထီးအလူၬအဂးလီၫ. တၭ ၦလခီၫဘၩ့မုးဖိၪ ၥူၭဘူၭဘၪအၥၭ လၧနၥံၪအအီၪ",
			"5": "<sup>5</sup> အ့ၬ.- နၥံၪဝ့ၫလဖၪ နၥံၪဘၪယိဆၧဘၪဆဲၫ့လၧအလး ဆံၫ့ဎံၪ, ဒဲဆၧယိဘၪဆဲၫ့ လၧဆၧလုလး, ဘဲၫၥိၭဆၧ",
			"6": "<sup>6</sup> ၥၭထၪ့ထီးဘၪလၧၩ့ ၦအံၫစရ့လၭဖိၪလဂ့ၩလီၫ.- တၭ ယဝ့ၫဒၪယီၩ, ယိခွါ, ယမၩန့နၥံၪအထၧၫ့ဖုဝဲ ၦလံဝဲၫ ဖိၪလၧၦအံၫစရ့လၭဖိၪ အကျၩလီၫ. ဆၧဖ့ၪလၫ့ဝ့ၫ လၧဆၧဖ့ၪလၫ့ လၧယဟိဝၩလမံၩ့, ဘဲၫၥိၭအမိမၩဆၧ အီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အခ့ၫအၡၩ အဆၧမၩလီၫ.",
			"7": "<sup>7</sup> အခိးမွဲဘဲၫနီၪတၭ, နဝ့ၫဒၪဒဲနဖိၪခွၫလဖၪ အီၪလၧနၥိၭ မိဘၪယိနၥံၪအၦလုဆၧ အဆၧမၩလၧကယဲဆၧဘၪ ဆဲၫ့လၧဆၧလုလး, ဒဲလၧကလကၫလၧယၫလခီၫတၭ, နၥံၪမိမၩဆၧလီၫ. ယဖ့ၪလၫ့ယူၭနၥံၪ လၧၦလုဆၧအ ဆၧမၩ, ဆၧဖ့ၪလၫ့ဘၪဆဲၫ့လၧဆၧမၩလီၫ. တၭၦလ ခီၫဘၩ့မုးဖိၪ လၧအၥုၭဘူၭအၥၭ မိဘၪဆၧမၩၥံၫဝ့ၫလီၫ.",
			"8": "<sup>8</sup> ယဟိဝၩစံၭစအၫရၧၫ့, ယိခွါ, ယဖ့ၪလၫ့ယူၭနၧၩ လၧဆၧယိဘၪဆဲၫ့ လၧဆၧမၩဘိၪ့ယၧၩ လၧဆၧမၩ ဘိၪ့ဆိၬထၪ့ဝံဝါဝ့ၫ, လၧၦအံၫစရ့လၭဖိၪ အဆၧဆံၫ့ဎံၪ လဖၪထီးအလူၬ အကျၩလီၫ. ယဖ့ၪလၫ့ဝ့ၫလၧနၧၩ ဒဲလၧနဖိၪခွၫလဖၪ လၧဆၧဂုၪဝ့ၫအကၠီၩ့, လၧဆၧအ",
			"9": "<sup>9</sup> ထူၫအရူၫအဆိၩအကၠၪလီၫ.- လၧဆၧဆံၫ့ဎံၪထုၬ လဖၪအကျၩလၧအဖီၩ့ဖျ့ၭမ့ၪနီၪ, မိကဲၪထၪ့နဆၧလဖၪ တၭ,မွဲအယီၩး ကယဲအဝ့ၫၥံၪမၩဘိၪ့ဆၧ, ကယဲအဆၧ မၩဘိၪ့ကိၪမုၬ, ဒဲကယဲအဆၧလုဆၧဒဲၩဘၭ, ဒဲကယဲ အဆၧလုမၪဘၪဆၧ ထီးအလူၬ လၧအမၩဘိၪ့ယၧၩ နီၪ,မွဲဆၧဆံၫ့ဎံၪထုၬလၧနဂး ဒဲလၧနဖိၪခွၫလဖၪအဂး",
			"10": "<sup>10</sup> လီၫ.- တၭနမိဘၪအၪ့ဝ့ၫ လၧဆၧအလးဆံၫ့ဎံၪထုၬအ ဖၧၩ့လီၫ. ကယဲၦခွၫမိအၪ့ဘၪဝ့ၫတၭ, မိကဲၪထၪ့ဆၧ",
			"11": "<sup>11</sup> ဆံၫ့ဎံၪလၧအဂးလီၫ.- အယီၩမွဲနဆၧဆ့း ဆၧမၩဘိၪ့ ဆိၬထၪ့ဝံဝါဝ့ၫလၧအဆၧဖ့ၪလၫ့အဖၧၩ့, ဒဲကယဲၦအံၫ စရ့လၭဖိၪအဆၧမၩဘိၪ့ဝံဝါဝ့ၫလဖၪလီၫ. ယဖ့ၪလၫ့ ယူၭလၧနၧၩ, ဒဲလၧနဖိၪခွၫလဖၪ, ဒဲလၧနဖိၪမုၪလဖၪ အီၪလၧနၥိၭ, လၧဆၧအထူၫအရူၫအဆိၩအကၠၪလီၫ. ကယဲၦလၧအဆံၫ့ လၧနဂံၪ့ဖၧၩ့နီၪ မိအၪ့ဘၪဝ့ၫကိၭ",
			"12": "<sup>12</sup> ဂၩဒ့ၭလီၫ.- ဆၧၥိၪအဂ့ၩထုၬထီးအလူၬ,ဒဲဘုၪကၠိၩ့ အဂ့ၩထုၬထီးအလူၬ, ဒဲအဆၧၥၪဆိၫလၧအမၩဘိၪ့ ယဟိဝၩနီၪ, ယဖ့ၪလၫ့ယူၭယဝ့ၫလၧနၧၩယူၭလီၫ.",
			"13": "<sup>13</sup> ကယဲဆၧၥၪလၧအမံၫ့ဆိၫ လၧခးဖၧၩ့နီၪလၧအဝ့ၫၥံၪမိ ဂဲၫဆိၬလၧယဟိဝၩအအီၪထီးအလူၬနီၪ မိကဲၪထၪ့န ဆၧလီၫ. ၦအဆံၫ့လၧနဂံၪ့ဖၧၩ့နီၪ မိအၪ့ဘၪဝ့ၫကိၭအ",
			"14": "<sup>14</sup> ဂၩဒ့ၭလီၫ.- ကယဲဆၧလၧၦဆိၪလၩ့အၥၭတၭ, အီၪ",
			"15": "<sup>15</sup> က့ၪဝ့ၫနီၪ မိကဲၪထၪ့နဆၧထီးအလူၬလီၫ.- ကယဲဆၧ လၧအဝဲထၪ့ဆၧဒၧၩ့လး လၧဆၧယၪထီးအလူၬအကျၩ လၧၦဂဲၫဆိၬဝ့ၫ လၧယဟိဝၩအအီၪ, ၦၡၩမွဲဂ့ၩ, ဆၧ ဖိၪဆၧဎါမွဲဂ့ၩ, မိကဲၪထၪ့နဆၧထီးအလူၬလီၫ. မွဲလါ နၫ့ၦၡၩအဝဲၡါနီၪ နမိဘၪဎွ့ၩန့ထဲၩ့တၡါတၭ, ဆၧဖိၪ",
			"16": "<sup>16</sup> ဆၧဎါလဆံၫ့ဘၪနီၪ နမိဘၪဎွ့ၩန့ထဲၩ့ဆ့လီၫ.- တၭ ဆၧလၧအမိဘၪဎွ့ၩန့ထဲၩ့ဝ့ၫနီၪ, လၧအအီၪလၩလံဘံၪ့ နဘၪဎွ့ၩန့ထဲၩ့ဝ့ၫတၭ, ဘဲၫနအီၪက့ၪအဎွ့ၩအၥိၭလၧ စ့ၩယဲၡက့လၭအဂး, ဘဲၫဆၧအလးဆံၫ့ဎံၪၡက့လၭ",
			"17": "<sup>17</sup> အၥိၭလၧအမွဲဂ့ရၫနံၫဆံၫလီၫ.- အ့ၪမွဲချီမိအဖိၪဝဲၡါ, ဒဲၥိၪအဖိၪဝဲၡါ, ဒဲဘ့ၪအဖိၪဝဲၡါနီၪ နဎွ့ၩန့ထဲၩ့ဘၪအ့ၬ. မွဲဆၧဆံၫ့ဎံၪလီၫ. နမိဘၪဎွံၪအၥွံၪ လၧဆၧလုလးအဖၫ့ ခိၪတၭ, နမိဘၪဆူၭခဲၩခွံၬအၥိၪ, ဆၧလုမၩလၧမ့ၪ,",
			"18": "<sup>18</sup> လၧဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩအဂးလီၫ.- တၭအဝ့ၫ ၥံၪအဆၧယၪလဖၪမိကဲၪထၪ့နဆၧ, ဘဲၫဆၧဝံဝါဝ့ၫအ ၥၭနၫၡါ, ဒဲခိၬထံၭခိၪအထွ့ၪနီၪ, မွဲနဆၧအၥိၭလီၫ.",
			"19": "<sup>19</sup> တၭကယဲဆၧမၩဘိၪ့ ဆိၬထၪ့ဝံဝါဝ့ၫ လၧဆၧဆံၫ့ဎံၪ လဖၪလၧၦအံၫစရ့လၭဖိၪ မၩဘိၪ့ယဟိဝၩ အကျၩ ထီးအလူၬနီၪ, ယဖ့ၪလၫ့ယူၭနၧၩ,ဒဲနဖိၪခွၫလဖၪ,ဒဲန ဖိၪမုၪလဖၪအီၪလၧနၥိၭ, လၧဆၧအထူၫအရူၫအဆိၩ အကၠၪလီၫ. မွဲဆၧအုၩ့လၩ့အဆိၩအကၠၪဘၪဆဲၫ့လၧ ထံၫလၪအဆၧအုၩ့လၩ့ လၧယဟိဝၩအမ့ၬယၫ လၧန ဂး, ဒဲလၧနချံၫနၥၪအီၪလၧနၥိၭအဂးလီၫ.",
			"20": "<sup>20</sup> တၭယဟိဝၩ စံၭစအၫရၧၫ့, နန့ၥၫဆၧလၧခးဖၧၩ့, ဒဲန့ဘၪဆၧအလးလၧအကျၩအ့ၬ. ဆၧလၧယၧၩယီၩ ယမွဲနဆၧ, ဒဲနန့ၥၫဆၧလၧၦအံၫစရ့လၭဖိၪ အကျၩ",
			"21": "<sup>21</sup> လီၫ.- တၭယိခွါ, ယဖ့ၪလၫ့ယူၭၦလံဝဲၫဖိၪ လၧအန့ၥၫ ဆၧအလးလၧဆံၫပိၩ့လပိၩ့ လၧၦအံၫစရ့လၭအဖၧၩ့ လၧအဝ့ၫၥံၪ အဆၧလၧအမၩဝ့ၫအကၠီၩ့, ဆၧအီၪကီၪ့",
			"22": "<sup>22</sup> အတဲၩဆံၫ့ဎံၪအဆၧမၩလီၫ.- တၭၦအံၫစရ့လၭဖိၪၥုၭ ဘူၭဘၪလၧၩ့အၥၭ လၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪနီၪ",
			"23": "<sup>23</sup> အ့ၬးမိဘၪဘၪခိၬအဆၧဒဲၩဘၭတၭၥံၫဝ့ၫလီၫ.- အ့ၪ မွဲၦလံဝဲၫဖိၪ ဘၪမၩဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အဎီး အၡၩအဆၧမၩ, ဒဲမိထိးအဆၧအၧၩ့လီၫ. မွဲဆၧအထူၫ အရူၫအဆိၩအကၠၪ လၩ့လၧနၥံၪအဆၨၩအဆၬ လ ဆိၩဘၪလဆိၩ လၧအဝ့ၫၥံၪန့ၥၫဆၧ လၧၦအံၫစရ့လၭ",
			"24": "<sup>24</sup> ဖိၪအကျၩအ့ၬ.- တၭၦအံၫစရ့လၭဖိၪ အဆၧဆံၫပိၩ့ လပိၩ့လၧအဝ့ၫၥံၪ မၩဘိၪ့လၧဆၧမၩဘိၪ့ ဝံဝါဝ့ၫလၧ ယဟိဝၩအဂးနီၪ, ယဖ့ၪလၫ့ယူၭ လၧၦလံဝဲၫဖိၪလၧ ဆၧန့ၥၫအဂးလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယလီၩဘၪ ဝဲၩယူၭအဝ့ၫၥံၪ လၧၦအံၫစရ့လၭဖိၪ အကျၩနီၪမိန့ၥၫ ဆၧနးစီၪ့အ့ၬ.",
			"25": "<sup>25</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ချဲၩ့ဆၧ လၧၦလံဝဲၫဖိၪတၭ, စံၭအဝ့ၫၥံၪ, ထီးနၥံၪမၩန့ဆၧဆံၫ ပိၩ့လပိၩ့လၧၦအံၫစရ့လၭဖိၪအစူၪဖၧၩ့, ဆၧလၧယမၩ န့လၧအဝ့ၫၥံၪဖ့ၪလၫ့နၥံၪ လၧအဝ့ၫလၧနၥံၪ န့ၥၫဆၧ အဂးတၭ, နၥံၪမိဘၪမၩန့လၧအဖၧၩ့နီၪ မၩဘိၪ့လၧဆၧမၩ ဘိၪ့ဝံဝါဝ့ၫ လၧယဟိဝၩအဂးဆံၫပိၩ့လပိၩ့, လၧဆၧ",
			"27": "<sup>27</sup> ဆံၫပိၩ့လပိၩ့နီၪအကျၩလီၫ.- တၭနၥံၪအဆၧဆိၬထၪ့ ဝံဝါဝ့ၫနီၪဆၧမိအီၪက့ၪဝ့ၫ လၧနၥံၪအဂးဘဲၫဘုၪ လၧ ခရဲးဖၧၩ့, ဒဲဘဲၫဆၧလၧၫ့ဎွ့ၩလၧဆၧဘံၭစဘံၭၥၪ အထံၫ",
			"28": "<sup>28</sup> အၥိၭနီၪလီၫ.- ဘဲၫနီၪအၥိၭနၥံၪမၩဘိၪ့ဝံဝါဝ့ၫဆ့ လၧယ ဟိဝၩအဂးလၧဆံၫပိၩ့လပိၩ့လၧ နၥံၪထိးန့လၧၦအံၫစရ့ လၭဖိၪထီးအလူၬအစူၪဖၧၩ့တၭ, နၥံၪဘၪဖ့ၪလၫ့ယဟိဝၩ အဆၧမၩဘိၪ့ဆိၬထၪ့ဝံဝါဝ့ၫနီၪ လၧၦလုဆၧစအၫရၧၫ့",
			"29": "<sup>29</sup> လဂၩနီၪလီၫ.- လၧနၥံၪဖ့ၪလၫ့ဆၧထီးအလူၬအကျၩနီၪ နၥံၪဘၪမၩဘိၪ့ ကယဲယဟိဝၩအဆၧမၩဘိၪ့ ဆိၬထၪ့ ဝံဝါဝ့ၫလၧအဆၧဂ့ၩထုၬ ထီးအလူၬအကျၩ, ဆၧဆံၫ့",
			"30": "<sup>30</sup> ဎံၪလၧအကျၩလီၫ.- တၭနၥံၪဘၪစံၭဆၧလၧအဝ့ၫၥံၪ, ထီးနၥံၪဆိၬထၪ့ဝံဝါဝ့ၫ ဆၧအဂ့ၩထုၬလၧအကျၩ, ဆၧ မိအီၪက့ၪဝ့ၫလၧ ၦလံဝဲဖိၪအဂး, ဘဲၫဆၧအီၪထၪ့လၧ ခရဲးဖၧၩ့အဆၧအၪထၪ့အၥိၭ, ဒဲဘဲၫဆၧအီၪလၧဆၧဘံၭ",
			"31": "<sup>31</sup> စဘံၭၥၪအဖၧၩ့ အဆၧအၪထၪ့အၥိၭနီၪလီၫ.- တၭနၥံၪ မိအၪ့ဘၪဝ့ၫလၧကိၭစီၪ့ဒ့ၭ, နၥံၪဝ့ၫဒဲနၥံၪအဂံၪ့ဖိၪၥံၪလီၫ. အဂဲးဘဲၫယီၩ မွဲနၥံၪမၩဆၧလၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့",
			"32": "<sup>32</sup> ဎံၪဖၧၩ့အလံၩ့အလဲၫလီၫ.- ထီးနၥံၪဆိၬထၪ့ဝံဝါဝ့ၫ ဆၧအဂ့ၩထုၬလၧအကျၩတၭ, နၥံၪဘၪဆၧဒဲၩဘၭလၧ အကၠီၩ့အ့ၬ. တၭနၥံၪမိမၩၥၭလိၪဘၪ ၦအံၫစရ့လၭဖိၪ အဆၧဆံၫ့ဎံၪလဖၪဆ့အ့ၬး နၥံၪမိၥံၫဘၪခိၬလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭဒဲစအၫရၧၫ့တၭ, စံၭဝ့ၫ",
			"2": "<sup>2</sup> ဒၪ,-အယီၩမွဲဆၧၥီၪ့ဆၧၥၫ့အထူၫအရူၫ လၧယဟိဝၩ မၪလူၬဆၧတၭ, စံၭဝ့ၫဒၪ, စံၭၦအံၫစရ့လၭဖိၪလၧအမိ ဂဲၫဆိၬန့နၧၩ လၧချီမိဝီၩအလၧၫ့အဎွ့ၩ, လၧအစံၫဖီး လအီၪဘၪ, လၧနိၪယိၭဘီၩ့လအီၪဘၪ လၧအလီၩ့နး",
			"3": "<sup>3</sup> ဆိၭလဒုၩနီၪဆံၭ.- တၭနၥံၪမိဘၪဖ့ၪလၫ့ဝ့ၫ လၧၦလု ဆၧစအံၫလအ့ဇၧၫ, ဘဲၫၥိၭအမိလ့ၩဆိၬဘၪဝ့ၫ လၧၦ ၥုၪ့တဲၩအလးဖၧၩ့လၧခီၫ့လခီၫတၭ, ဆၧဘၪမၩၥံၫဝ့ၫ",
			"4": "<sup>4</sup> လၧအမ့ၬယၫလီၫ.- တၭၦလုဆၧစအံၫလအ့ဇၧၫလဂၩ နီၪဘၪမၩန့အၥွံၪလၧအစူၪနိၩ့လဘီၩ့တၭ, ဎွံၪအၥွံၪ ဆဲၫဎၩ့လၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪအမ့ၬယၫ နွ့ၫ",
			"5": "<sup>5</sup> ဘျၩ့လီၫ.- တၭဆၧဘၪဆူၭထၪ့ခွံၬ ချီမိနီၪလၧမ့ၪလၧ အမ့ၬယၫလီၫ. အဖံၭဒဲအယၪ, ဒဲအၥွံၪ, ဒဲအအ့ၪနီၪမိ",
			"6": "<sup>6</sup> ဘၪဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪလီၫ.- တၭၦလုဆၧလဂၩဘၪ မၩန့ၥံၪ့ၡိၫအ့ရ့ၭ, ဒဲဟံစိၭ, ဒဲဆၧဝီၩနီၪတၭ, ဖျႃၭလၩ့",
			"7": "<sup>7</sup> ဝ့ၫလၧမ့ၪအၪ့ခွံၬချီမိလစီၪ့အဖၧၩ့နီၪလီၫ.- ထီးနီၪလ ဖၧၫ့ၦလုဆၧလဂၩ မိဘၪအၪ့ဆူၫဝၭအကီၩ့အၥိၭတၭ, ၥူၫဝၭဆံၫ့အယၪလၧထံၫလီၫ. လၧခဲၫ့ထဲၩ့တၭ မိဂဲၫ ထဲၩ့ဘၪလၧၦၥုၪ့တဲၩအလးဖၧၩ့တၭ, ၦလုဆၧလဂၩနီၪ",
			"8": "<sup>8</sup> မိအီၪလဆံၫ့ဘၪထီးမုဂၪလၩ့လီၫ.- တၭၦလၧအဆူၭ ထၪ့ခွံၬအဝ့ၫလဂၩနီၪ မိဘၪအၪ့ဆူၫဝၭ အကီၩ့အၥိၭ လၧထံၫ ဒဲၥူၫဝၭဆံၫ့အယၪလၧထံၫတၭ, အီၪလဆံၫ့",
			"9": "<sup>9</sup> ဘၪထီးမုဂၪလၩ့လီၫ.- ၦအဆံၫ့လဂၩ မိဘၪအၪ့ထုၫ့ ကီၪ့ထၪ့ချီမိအဖံၫ့ချၪတၭ, အီၪက့ၪလၩ့ဝ့ၫလၧၦၥုၪ့တဲၩ အလးလၧခီၫ့လခီၫ, လၧအလးဆံၫ့လီၫ. တၭမွဲအမိ ဘၪဆၧအီၪက့ၪထၬဝ့ၫ လၧၦအံၫစရ့လၭဖိၪ အဆၧအီၪ ကီၪ့အဂးလၧဆၧလၩ့ဖၭ အထံၫအဂးလီၫ. အနီၪမွဲဆၧ",
			"10": "<sup>10</sup> ဒဲၩဘၭအဆၧမၩဆံၫ့ခွံၬလီၫ.- ၦလၧအအၪ့ထုၫ့ကီၪ့ ထၪ့ချီမိအဖံၫ့ချၪလဂၩနီၪ ဘၪအၪ့ဆူၫဝၭအကီၩ့အၥိၭ တၭ,အီၪလဆံၫ့ဘၪထီးမုဂၪလၩ့လီၫ. တၭဆၧမိကဲၪ ထၪ့ဆၧအထူၫအရူၫ အဆိၩအကၠၪ လၧၦအံၫစရ့လၭ ဖိၪအဂး, ဒဲလၧၦလခီၫဘၩ့မုးဖိၪ လၧအအီၪလၧအ ကျၩအဂးနီၪလီၫ.",
			"11": "<sup>11</sup> ၦလၧအထိၭဘၪၦလဂၩဂၩအစွၪနီၪ မိဘၪအီၪလ",
			"12": "<sup>12</sup> ဆံၫ့ဘၪနွ့ၫနံၩလီၫ.- တၭမွဲအဘၪ မၩဆံၫ့ထၪ့အၥၭ လၧအဝ့ၫလၧမုၥၧၫ့နံၩလနံၩအဖၧၩ့တၭ, လၧမုနွ့ၫနံၩ မိဆံၫ့ထၪ့ဝ့ၫလီၫ. အ့ၪမွဲမုၥၧၫ့နံၩလနံၩနီၪ အ့ၪလမၩ ဆံၫ့ထၪ့ဘၪအၥၭတၭ, လၧမုနွ့ၫနံၩလနံၩနီၪမွဲလဆံၫ့",
			"13": "<sup>13</sup> ထၪ့ဘၪလီၫ.- ကယဲၦလၧအထိၭဘၪၦအၥံၫအစွၪလၧ အၥံၫယူၭလဂၩနီၪ ဒဲလမၩဆံၫ့ထၪ့ဘၪအၥၭလဂၩလါ လါနီၪ, မွဲအမၩၥၭလိၪယဟိဝၩ အတဲၩဆံၫ့ဎံၪလီၫ. တၭၦလဂၩနီၪမိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧအံၫစရ့လၭ လီၫ. မွဲဆၧလၩ့ဖၭအထံၫလဎွံၪဘၪအၥၭ လၧအလီၩ့ တၭ,မိအီၪလဆံၫ့ဘၪလီၫ. အဆၧလဆံၫ့ဘၪနီၪအီၪ",
			"14": "<sup>14</sup> ဒံၭလၧအလီၩ့လီၫ.- ထီးၦၡၩအ့ၪၥံၫလၧတဲၩဖၧၩ့တၭ, ၥနိၫမွဲအယီၩ, ကယဲၦၡၩလ့ၩနုၬလၧတဲၩဖၧၩ့, ဒဲကယဲ ဆၧအီၪလၧတဲၩဖၧၩ့ထီးအလူၬနီၪ မိအီၪလဆံၫ့ဘၪနွ့ၫ",
			"15": "<sup>15</sup> နံၩလီၫ.- တၭကယဲဆၧဖၧၩ့, ထွ့ၫလဘံၪ့လါလါ, အီၪဝဲ ထၪ့အၥၭ, လၧအခိၪချႃၭလအီၪဘၪလၧအဖၫ့ခိၪနီၪ မွဲ",
			"16": "<sup>16</sup> လဆံၫ့ဘၪလီၫ.- တၭကယဲၦလၧအထိၭဘၪ ၦလဂၩ လၧအဘၪဆၧဖ့ၬၥံၫခွံၬဝ့ၫ လၧဖၩ့ၥံၪနၭၥံၪအီၪလၧဆၧ ပျၩ့ဖၧၩ့မွဲဂ့ၩ, ဆၧအစွၪမွဲဂ့ၩ, ၦၡၩအဎွံၪမွဲဂ့ၩ, ဆၧၥွၪ ခိၪမွဲဂ့ၩ, မိဘၪအီၪလဆံၫ့ဘၪနွ့ၫနံၩလီၫ.",
			"17": "<sup>17</sup> ၦလဆံၫ့ဘၪအဂးနီၪ ၦၡၩဘၪမၩန့ချီမိလဒုၩ လၧ မ့ၪအၪ့ခွံၬဝ့ၫ ဘၪဆဲၫ့လၧဆၧဒဲၩဘၭ အဆၧမၩဆံၫ့ဝ့ၫ နီၪအဖံၫ့ချၪတၭ ဘၪအီၪက့ၪဎုၬထံၫမၧၫ့ လၧလိၫ့ဖၧၩ့",
			"18": "<sup>18</sup> လီၫ.- ၦအဆံၫ့လဂၩဘၪမၩန့ဟံစိၭတၭ, စုၪလၩ့ဝ့ၫ လၧထံၫနီၪအဖၧၩ့တၭ, ဎွံၪဝ့ၫလၧတဲၩလီၩ့, ဒဲဖၧၩ့, ဒဲထွ့ၫ လဖျိၪ့လါလါအလီၩ့, ဒဲလၧၦလၧအအီၪယူၭထီးနီၪလ ဖၪအလီၩ့, ဒဲလၧၦလၧအထိၭဘၪၦအဎွံၪမွဲဂ့ၩ, ၦလၧ အဘၪဆၧဖ့ၬၥံၫဝ့ၫမွဲဂ့ၩ, ဆၧအစွၪမွဲဂ့ၩ, ဆၧၥွၪခိၪ",
			"19": "<sup>19</sup> မွဲဂ့ၩ,အလီၩ့ဆ့လီၫ.- တၭၦအဆံၫ့လဂၩနီၪဘၪဎွံၪ ဆၧလၧၦလဆံၫ့ဘၪအလီၩ့ လၧမုၥၧၫ့နံၩလနံၩ, ဒဲလၧ မုနွ့ၫနံၩလနံၩလီၫ. လၧမုနွ့ၫနံၩလနံၩနီၪ ဘၪမၩဆံၫ့ အၥၭတၭ,အၪ့ဆူၫဝၭအကီၩ့အၥိၭ, ဒဲအၪ့လူထံၫတၭ,",
			"20": "<sup>20</sup> လၧမုဂၪလၩ့နီၪ မိဆံၫ့ထၪ့ဝ့ၫလီၫ.- ၦလၧအလဆံၫ့ဘၪ လဂၩအ့ၪလမၩဆံၫ့ထၪ့ဘၪအၥၭနီၪတၭ, အဝ့ၫလဂၩ နီၪမိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧဆၧအီၪကီၪ့လီၫ. အဂဲး ဘဲၫယီၩ မွဲအမၩၥၭလိၪယဟိဝၩအလး ဆံၫ့ဎံၪလီၫ. ဆၧဎွံၪဘၪဆၧလၩ့ဖၭအထံၫ လၧအလီၩ့အ့ၬ, မွဲၦလ",
			"21": "<sup>21</sup> ဆံၫ့ဘၪလဂၩလီၫ.- တၭမွဲအမိကဲၪထၪ့ဆၧအထူၫအ ရူၫအဆိၩအကၠၪ လၧအဝ့ၫၥံၪအဂး, လၧၦလၧအဎွံၪ ဆၧလၩ့ဖၭအထံၫလဂၩနီၪ မိဘၪအၪ့ဆူၫဝၭအကီၩ့အ ၥိၭတၭ, ၦလၧအထိၭဘၪဆၧလၩ့ဖၭ အထံၫနီၪမိအီၪ",
			"22": "<sup>22</sup> လဆံၫ့ဘၪထီးမုဂၪလၩ့လီၫ.- တၭကယဲဆၧလၧၦလ ဆံၫ့ဘၪအ့ၪထိၭဘၪဝ့ၫလမံၩ့မံၩ့နီၪ, မိအီၪလဆံၫ့ဘၪ, ဒဲၦလၧအထိၭဘၪဝ့ၫလဂၩနီၪ ဘၪအီၪလဆံၫ့ဘၪထီး မုဂၪလၩ့လီၫ."
		},
		"20": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ လၧလၩခၪ့ထံၭနီၪ ၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့ထီးအလူၬ, လ့ၩနုၬလၧၡါမုနၧၫ့ဖၫဇံၫ့ လီၫ.တၭၦခမျၧးအီၪဝ့ၫလၧကၫဒ့ၭတၭ, နးမံရအၫ့ၥံၫ ဝ့ၫထီးနီၪတၭ, ဘၪဆၧခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ ထီးနီၪလီၫ.",
			"2": "<sup>2</sup> တၭထံၫလၧဆၧအီၪကီၪ့ အဂးအီၪအ့ၬး အဝ့ၫၥံၪ အီၪကိၩ့အီၪကီၪ့ ထၫ့ဒုၪဒၩ စမိစ့ၭ ဒဲစအၫရၧၫ့ ၥံၪနီၪ",
			"3": "<sup>3</sup> လီၫ.- ၦခမျၧးလဖၪအဲၪ့လိၬစမိစ့ၭ ချဲၩ့ထၪ့ဆၧတၭ, စံၭဝ့ၫဒၪ, လၧပထၧၫ့ဖုဝဲလဖၪ ၥံၫလၧယဟိဝၩအမ့ၬ ယၫအခၫနီၪ, ပဝ့ၫဒၪယီၩ ပအ့ၪၥံၫအထီနီၪ ဂ့ၩဒၪအ",
			"4": "<sup>4</sup> ဆၧဒံၭလီၫ.- တၭနၥံၪဒုၭဂဲၫထၪ့ယဟိဝၩအဆၧအီၪ ကီၪ့လၧၡါမုနၧၫ့ဖၫ ဘဲၫၥိၭပဝ့ၫဒၪ, ဒဲပဆၧဖိၪဆၧဎါမိ",
			"5": "<sup>5</sup> ၥံၫထီးနီၪ, မွဲဘၪလဲၪ,- တၭနၥံၪဒုၭဂဲၫထၪ့ခွံၬပၧၩလၧ အံဇံၭအဖၧၩ့ဘဲၫၥိၭနၥံၪ မိဒုၭလ့ၩပၧၩလၧဆၧအလး အၧၩ့ယီၩမွဲဘၪလဲၪ. အလးလၧပဎွံၪလၩ့ဆၧချံၫအီၪ အ့ၬ,လၧချိၪ့ဒိၩ့အဂးအီၪအ့ၬ, လၧစဘံၭမုအဂးအီၪ အ့ၬ,လၧၥံၪ့ၥလဲၩၥၪအဂးအီၪအ့ၬး တၭထံၫလၧပမိ အီၩအဂးအီၪဆ့အ့ၬ.",
			"6": "<sup>6</sup> တၭစမိစ့ၭဒဲစအၫရၧၫ့ စဲၪ့ထၪ့လၧဆၧအီၪကီၪ့အမ့ၬ ယၫလၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪအတရၫ့, ဒဲထိၪ လၩ့ထံၩဖါအၥၭတၭ, ယဟိဝၩအလၩအဖၫ့အီၪဖျီၪ",
			"7": "<sup>7</sup> ထၪ့လၧအမ့ၬယၫလီၫ.- ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ",
			"8": "<sup>8</sup> တၭစံၭဝ့ၫဒၪ,- မၩန့နိၪထိၭလဘီၩ့နီၪ, ဒုၭအီၪကီၪ့ဆၧ အီၪကီၪ့နဝ့ၫဒၪဒဲနထၧၫ့ဖုဝဲစအၫရၧၫ့တၭ, မၪလူၬလိး မုလၧအဝ့ၫၥံၪအမ့ၬယၫဘီၪး မွဲအမိဒုၭယွၩလၩ့အထံၫ တၭ, နမိဒုၭဂဲၫထၪ့ထံၫ လၧအဂးလၧလိးမုဖၧၩ့နီၪလီၫ. တၭနမိဒုၭအီၩၦဆၧအီၪကီၪ့ဖိၪ, ဒဲအဆၧဖိၪဆၧဎါလ ဖၪနီၪဆ့လီၫ.",
			"9": "<sup>9</sup> တၭစမိစ့ၭ မၩန့နိၪထိၭဘီၩ့လဘီၩ့ လၧအအီၪလၧ ယဟိဝၩအမ့ၬယၫ, ဘဲၫအမၪလူၬဝ့ၫ အၥိၭနီၪလီၫ.",
			"10": "<sup>10</sup> တၭစမိစ့ၭ ဒဲစအၫရၧၫ့ဒုၭအီၪကီၪ့ ဆၧအီၪကီၪ့လၧယ ဟိဝၩအမ့ၬယၫတၭ, အဝ့ၫနီၪစံၭအဝ့ၫၥံၪ, ၦပိၩ့ထၪ့ ဆၧဖိၪၥံၪဧ့, ခိၭနၪဘိၩ့နဲၪ့ယီၩဘီၪ. ပဝ့ၫဒၪယီၩမွဲပ မိဘၪဒုၭဂဲၫထၪ့ထံၫလၧလိးမုအဖၧၩ့ယီၩ လၧနၥံၪအ",
			"11": "<sup>11</sup> ဂးဆ့ဧၪ.- စမိစ့ၭယၩ့ထၪ့အစူၪတၭ, ဒိၪလိးမုနီၪလၧအ နိၪထိၭ လဘီၩ့နံၫထံၪတၭ, ထံၫဂဲၫထၪ့ အၪအၪလ့ၬ တၭ,ၦဆၧအီၪကီၪ့ဖိၪအီၩဝ့ၫ ဒဲအဆၧဖိၪဆၧဎါလဖၪ ဆ့လီၫ.",
			"12": "<sup>12</sup> တၭယဟိဝၩစံၭစမိစ့ၭ ဒဲစအၫရၧၫ့, မွဲနၥံၪလနဲၩ ဘၪယၧၩ လၧနၥံၪမိအီၪက့ၪဆံၫ့ဎံၪယၧၩ လၧၦအံၫစ ရ့လၭဖိၪအမ့ၬယၫတၭ, နၥံၪမိဒုၭလ့ၩနုၬဘၪဆၧအီၪ ကီၪ့ယီၩလၧခးလဘံၪ့အဖၧၩ့ လၧယဖ့ၪလၫ့ယူၭအဝ့ၫ ၥံၪနီၪဆ့အ့ၬ.",
			"13": "<sup>13</sup> အနီၪမွဲထံၫမ့ရဘၫလီၫ. အဂဲးဘဲၫယီၩ ၦအံၫစရ့ လၭဖိၪအဲၪ့လိၬဆိၭချဲၩ့လိၬ လၧယဟိဝၩတၭ, အဝ့ၫဒၪ ဘၪဆၧအီၪက့ၪဆံၫ့ဎံၪဝ့ၫလၧအဝ့ၫၥံၪလီၫ.",
			"14": "<sup>14</sup> တၭစမိစ့ၭအၪ့မၧၫ့လၩ့အၥီၫ့လဖၪ လၧကၫဒ့ၭဘဲၫ ၥိၭအမိလ့ၩလၧအံဒၧၫ့အစဎွၩအအီၪလီၫ. တၭနထၧၫ့ ဖုဝဲအံၫစရ့လၭ စံၭဘဲၫယီၩ, ဆၧခိဆၧဝီၩ လၧအဘၪ",
			"15": "<sup>15</sup> ပၧၩထီးအလူၬနီၪနၥ့ၪယၫလီၫ.- ပဖါလဖၪလ့ၩလၩ့ လၧအံဇံၭအဖၧၩ့တၭ ပအီၪလၧအံဇံၭအဖၧၩ့ အၪနံၩ အၪၥၫ့ယူၭတၭ, ၦအံဇံၭဖိၪမၩအၧၩ့မၩၥၫ့ပၧၩ ဒဲပဖါ",
			"16": "<sup>16</sup> လဖၪလီၫ.- ပကိၭၡၭထၪ့လၧယဟိဝၩတၭ, မွဲအနါ ဂၧၫ့ပလူတၭ, အၪ့မၧၫ့လၫ့အၥီၫ့လဂၩတၭ, ဒုၭစဲၪ့ထၪ့ ခွံၬယူၭပၧၩလၧအံဇံၭနီၪ, ယိခွါ, ပအီၪလၧကၫဒ့ၭအ",
			"17": "<sup>17</sup> ဖၧၩ့,ဒိၩ့လဖျိၪ့အီၪလၧနနဲၩ့ထံၭ အထုၬလီၫ.- ဒုၭ ခၫ့ဂၬလါပၧၩ လၧနခးဘီၪ. ပမိခၫ့ဂၬဆံၬဖၧၩ့အ့ၬ, စ ဘံၭအလးဖၧၩ့အ့ၬ, တၭပမိအီၩထံၫလၧထံၫဖၧၩ့လ ဖၪဆ့အ့ၬ. ပမိလ့ၩလၧစဎွၩအဖၧၩ့ၥၭတၭ, ပကၠၪပဲၩ ပၥၭလၧစူၪထွ့ၪအ့ၬ လၧစူၪစ့ၪအ့ၬ, ထီးလၧပခၫ့ဂၬန",
			"18": "<sup>18</sup> ခးအနဲၩ့လဖၪလီၫ.- တၭအံဒၧၫ့ စံၭဝ့ၫ, နခၫ့ဂၬဘၪ ယၧၩအ့ၬး ယမိဂဲၫထၪ့ ထၫ့ဒုၪဒၩဘၪခိၬနၧၩ လၧနၭၥံၪ",
			"19": "<sup>19</sup> ဖၩ့ၥံၪလီၫ.- ၦအံၫစရ့လၭဖိၪစံၭဝ့ၫ, ပမိလ့ၩလၧနဖၧၩ့ ၥၭမုတၭ, ယၧၩမွဲဂ့ၩ, ဒဲယဆၧဖိၪဆၧဎါမွဲဂ့ၩ, အ့ၪ အီၩနထံၫတၭ ယမိဖ့ၪအဎွ့ၩလီၫ. ဆၧဂူၫဂၩယမၩ",
			"20": "<sup>20</sup> နးမံၩ့အ့ၬ, မွဲန့ၫယမိခၫ့ဂၬ လၧယခၪ့လီၫ.- တၭအဆၧ စံၭဝ့ၫဒၪ, နမိခၫ့ဂၬဘၪအ့ၬ. တၭအံဒၧၫ့ဂဲၫထၪ့ထၫ့ဒုၪ",
			"21": "<sup>21</sup> ဒၩဘၪဝ့ၫဒဲအၡၩခမျၧးဖၭဒိၪလၧအစူၪဆီၪ့လီၫ.- တၭ အံဒၧၫ့လဖ့ၪဘၪ အံၫစရ့လၭခၫ့ဂၬ အခးနဲၩ့ထံၭနီၪ တၭ,အံၫစရ့လၭကၠၪခွံၬအၥၭ လၧအဝ့ၫဒၪလီၫ.",
			"22": "<sup>22</sup> တၭၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့ထီးအလူၬစဲၪ့ ထၪ့လၧကၫဒ့ၭတၭ, လ့ၩထၪ့လၧခိၪလီၩ့ဟီၫလီၫ.",
			"23": "<sup>23</sup> တၭယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ ဒဲစအၫရၧၫ့လၧခိၪ လီၩ့ဟီၫအလီၩ့ လၧအံဒၧၫ့အခးနဲၩ့ထံၭတၭ, စံၭဝ့ၫ",
			"24": "<sup>24</sup> ဒၪ,- စအၫရၧၫ့မိဘၪဆၧအီၪက့ၪကီၪ့ဝ့ၫ လၧအၡၩခ မျၧးလီၫ. အဂဲးဘဲၫယီၩ မွဲအလ့ၩနုၬလၧခးလၧယဖ့ၪ လၫ့ၦအံၫစရ့လၭဖိၪအ့ၬ. အဂဲးဘဲၫယီၩနၥံၪပိၩ့ထၪ့",
			"25": "<sup>25</sup> ယလူထီးထံၫမ့ရဘၫနီၪလီၫ.- မၩန့စအၫရၧၫ့ဒဲအဖိၪ ခွၫစအံၫလအ့ဇၧၫတၭ, ဂဲၫဆိၬဝ့ၫ လၧခိၪလီၩ့ ဟီၫ",
			"26": "<sup>26</sup> ဆံၭ.- တၭဘဲၪ့လၩ့ခွံၬစအၫရၧၫ့အကီၩ့အၥိၭ, ဒဲဒုၭ ကီၩ့ထၪ့ၥိၭထၪ့ဝ့ၫ လၧအဖိၪခွၫစအံၫလအ့ဇၧၫဆံၭ. တၭစအၫရၧၫ့ မိဘၪဆၧအီၪက့ၪကီၪ့ဝ့ၫ ဒဲမိဘၪၥံၫဝ့ၫ",
			"27": "<sup>27</sup> ထီးနီၪလီၫ.- စမိစ့ၭမၩဝ့ၫဘဲၫယဟိဝၩမၪလူၬဝ့ၫအၥိၭ တၭ, အဝ့ၫၥံၪလ့ၩထၪ့လၧခိၪလီၩ့ဟီၫ လၧဆၧအီၪ",
			"28": "<sup>28</sup> ကီၪ့နီၪထီးအလူၬအမ့ၬယၫလီၫ.- စမိစ့ၭဘဲၪ့လၩ့ခွံၬ စအၫရၧၫ့အကီၩ့အၥိၭတၭ, ဒုၭကီၩ့ထၪ့ၥိၭထၪ့ဝ့ၫလၧ အဖိၪခွၫစအံၫ လအ့ဇၧၫတၭ, စအၫရၧၫ့ၥံၫဝ့ၫထီးနီၪ လၧခိၪလီၩ့ဒၩ့ခိၪလီၫ. တၭစမိစ့ၭဒဲစအံၫလအ့ဇၧၫနီၪ",
			"29": "<sup>29</sup> ဂဲၫထဲၩ့လၩ့လၧခိၪလီၩ့ခိၪလီၫ.- ဆၧအီၪကီၪ့ထီးအ လူၬနီၪဒၪဘၪဝ့ၫ လၧစအၫရၧၫ့အၥၭစဲၪ့ထၪ့ယူၭတၭ, အဝ့ၫၥံၪဂၪ့ဝ့ၫလၧစအၫရၧၫ့အကၠီၩ့ အနံၩၥၧၫ့ဆံၫ, က ယဲၦအံၫစရ့လၭဖိၪ အဂံၪ့ဖိၪထီးအလူၬလီၫ."
		},
		"21": {
			"1": "<sup>1</sup> ထီးၦကၫနအၫ့ဖိၪအၫရၭအစဎွၩ လၧအအီၪဝ့ၫလၧ မုခံၫ့လခီၫနီၪ, နါဂၧၫ့ဝ့ၫလၧအံၫစရ့လၭဂဲၫလၧဖၧၩ့ၥၭ အၫၥရံၫ့တၭး အဝ့ၫဒၪဒုၭဆၧထၫ့ဒုၪဒၩ အံၫစရ့လၭ",
			"2": "<sup>2</sup> တၭ, ဖီၪ့န့ၦၡၩလနၩ့လီၫ.- အံၫစရ့လၭဆိၪလၩ့အၥၭ လၧဆၧဆိၪလၩ့အၥၭလၧယဟိဝၩတၭ, စံၭဝ့ၫဒၪ, နအ့ၪဖ့ၪလၫ့တၡါၦခမျၧးယီၩ လၧယစူၪဖၧၩ့တၭ, ယမိမၩဂၭဂီၩ့ အဒိၩ့အတဝၫ့ၥံၪလူၬထူၬဆံၫ့ဘၩ့လီၫ.",
			"3": "<sup>3</sup> ယဟိဝၩခိၭနၪ အံၫစရ့လၭအလူတၭ,ဖ့ၪလၫ့ခွံၬၦကၫ နအၫ့ဖိၪတၭ, အဝ့ၫၥံၪမၩဂၭဂီၩ့ခွံၬဝ့ၫ,ဒဲအဒိၩ့အတဝၫ့ လီၫ.တၭဆၧအလးနီၪ ဆၧကိၭဝ့ၫအမံၩ့လၧဟီမၫလီၫ.",
			"4": "<sup>4</sup> တၭအဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧခိၪလီၩ့ဟီၫနီၪ လ့ၩလၧ ဖၧၩ့ၥၭမၫဆမံၭဝီၩအနဲၩ့ထံၭ ဘဲၫၥိၭအမိလ့ၩဎဲၪ့ခး အံဒၧၫ့လီၫ. တၭၦခမျၧးအၥုၪ့ခိအၥၭဝီၩ လၧဖၧၩ့ၥၭ",
			"5": "<sup>5</sup> အကၠီၩ့လီၫ.- တၭၦခမျၧးချဲၩ့ထၫ့ဒုၪဒၩယွၩဒဲစမိစ့ၭ, မွဲနၥံၪဂဲၫဆိၬထၪ့ခွံၬပၧၩ လၧအံဇံၭအဖၧၩ့နီၪဘဲၫၥိၭ ပမိၥံၫလၧၡါမုနၧၫ့ဖၫယီၩ မွဲဘၪလဲၪး အဂဲးဘဲၫယီၩ ကိၪမွဲဂ့ၩ, ထံၫမွဲဂ့ၩအီၪအ့ၬး တၭပၥၭလဲၩလၧဆၧ အၪ့ဘျိၪယီၩလီၫ.",
			"6": "<sup>6</sup> ယဟိဝၩအၪ့မၧၫ့လၩ့ဂူမ့ၪလဖၪ လၧၦခမျၧးအကျၩ တၭ, အဝ့ၫၥံၪဖျၭၦခမျၧးတၭ, ၦအၪဂၩလၧအံၫစရ့",
			"7": "<sup>7</sup> လၭအကျၩၥံၫဝ့ၫဒၪလီၫ.- တၭၦခမျၧးဂဲၫလၧစမိစ့ၭ အအီၪစံၭဝ့ၫဒၪ, ပမၩယူၭဆၧဒဲၩဘၭယူၭ, အဂဲးဘဲၫ ယီၩပချဲၩ့ထၫ့ဒုၪဒၩယူၭ ယဟိဝၩဒဲနၧၩယူၭ, ဘၩဆိၪ ဖၪယဟိဝၩဘဲၫၥိၭအမိဒုၭစဲၪ့ထၪ့ခွံၬ ဂူလဖၪယီၩလၧ ပအီၪဆံၭ. တၭစမိစ့ၭဘၩဆိၪဖၪန့ ၦခမျၧးအဂးလီၫ.",
			"8": "<sup>8</sup> တၭယဟိဝၩစံၭစမိစ့ၭ တဲၩ့ဂူမ့ၪလၧနဂးနးဘီၩ့တၭ, အီၪက့ၪထၪ့ဝ့ၫ လၧနိၪဘီၩ့လဘီၩ့ အခံၫထိၭဆံၭ. တၭ ဆၧမိမၩအၥၭ လၧကယဲၦလၧဂူဖျၭဝ့ၫ လဂၩဂၩနီၪ",
			"9": "<sup>9</sup> ထီးအယိထၪ့ဝ့ၫတၭမိမၧၫ့ထၪ့ဝ့ၫလီၫ.- တၭစမိစ့ၭ တဲၩ့ဂူလဘီၩ့လၧထီးဝီၩတၭ, အီၪက့ၪထၪ့ဝ့ၫလၧနိၪ ဘီၩ့လဘီၩ့ အခံၫထိၭနီၪလီၫ. တၭဆၧမၩအၥၭလၧ ဂူအ့ၪဖျၭၦၡၩလဂၩဂၩနီၪ, ထီးအယိထၪ့ဘၪဂူထီး ဝီၩလဘီၩ့နီၪ မၧၫ့ထၪ့ဝ့ၫဒၪလီၫ.",
			"10": "<sup>10</sup> ၦအံၫစရ့လၭဖိၪ စဲၪ့ထၪ့တၭၥုၪ့အတဲၩလၧအိဘီၭ",
			"11": "<sup>11</sup> လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧအိဘီၭနီၪတၭ, ၥုၪ့အ တဲၩလၧအံဇအၭဘရံၫ့ လၧၡါမုနၧၫ့ဖၫလၧအအီၪလၧ မိအၭအမ့ၬယၫ လၧမုထၪ့လခီၫလီၫ.",
			"12": "<sup>12</sup> အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ ထီးနီၪတၭ, ၥုၪ့အတဲၩလၧခိၪ",
			"13": "<sup>13</sup> လီၩ့ဆူၭဇၫရ့ၭလီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ ထီးနီၪတၭ, ၥုၪ့အတဲၩလၧထံၫအၫနၫ့ဝါလခီၫ လၧအဂဲၫလၩ့လၧၡါ မုနၧၫ့ဖၫ လၧၦအၫမိၫဖိၪ အခးနဲၩ့ထံၭလဖၪလီၫ. အ ဂဲးဘဲၫယီၩထံၫအၫနၫ့နီၪ မွဲမိအၭအခးနဲၩ့လၧမိအၭဒဲ ၦအၫမိၫဖိၪအဘိၩ့ဆၧၩ့နီၪလီၫ.",
			"14": "<sup>14</sup> မၩအၥၭဘဲၫနီၪတၭဆၧစံၭဝ့ၫ လၧလံၬယဟိဝၩဒုၭ ၥုၭလၧဝ့ဟ့ၭ အီၪလၧစူၭဖၫအဖၧၩ့, ဒဲလၧအၫနၫ့ အ",
			"15": "<sup>15</sup> ထံၫချိၬလဖၪ,- ဒဲထံၫချိၬလဖၪလၧအကရဲၭဖၧၩ့ လၧအ လ့ၩလၩ့လၧအါအဆၧအီၪကီၪ့အလး လၧမိအၭအခး နဲၩ့နီၪလီၫ.",
			"16": "<sup>16</sup> တၭစဲၪ့ထၪ့ခွံၬထီးနီၪ ထီၩ့လၧဘံအၧၫလီၫ. အနီၪ မွဲထံၫဖၧၩ့ လၧယဟိဝၩစံၭစမိစ့ၭ, ဒုၭအီၪကီၪ့ၦခမျၧး ဆံၭတၭ ယမိဖ့ၪလၫ့အဝ့ၫၥံၪ လၧထံၫလီၫ.",
			"17": "<sup>17</sup> ထီးနီၪလဖၧၫ့ အံၫစရ့လၭ မၩထၭခိၪလယွ့ယီၩ, ထံၫဖၧၩ့ဧ့,မွဲထံၫထၪ့ဖျိၭဘီၪ ၥံၫကျံၩထၪ့နၥံၪဝ့ၫဘီၪ.",
			"18": "<sup>18</sup> ၦဒိၪလဖၪအၪ့ဎၬန့ဝ့ၫ, ၦခမျၧးအခိၪလဖၪခုၪ့လၩ့ဝ့ၫ, လၧအနိၪထိၭဘီၩ့လဖၪလီၫ.",
			"19": "<sup>19</sup> တၭလၧၡါမုနၧၫ့ဖၫနီၪဖိးလၧမၭတၫနၫတၭ, လၧမၭတၫနၫနီၪဖိးလၧနၫဟ့ၫလအ့လၭ,",
			"20": "<sup>20</sup> တၭလၧနၫဟ့ၫလအ့လၭနီၪဖိးလၧဘၫမီၭ, တၭလၧဘၫမီၭနီၪဖိးလၧခိၪလီၩ့ဆူၭ, လၧအအီၪလၧခးမိအၭအဖၧၩ့, ဖိးလၧခိၪလီၩ့ ပံစဂၫအဒၩ့ခိၪ လၧဆၧဒိၭအၥၭလၧ ယ့ၭၡမၧၫ့လီၫ.",
			"21": "<sup>21</sup> တၭအံၫစရ့လၭအၪ့မၧၫ့လၩ့အၥီၫ့ လဖၪလၧၦအၫ",
			"22": "<sup>22</sup> မိၫဖိၪ ထီၩ့လၧစဎွၩစဲဟၫ့တၭ စံၭဝ့ၫဒၪ,- ဒုၭခၫ့ဂၬ ပၧၩ လၧနခးဖၧၩ့နီၪဘီၪး ပကၠၪစိၩပၥၭ လၧဆံၬၥံၪ နၩၥံၪအဖၧၩ့, လၧစဘံၭမုအလးဖၧၩ့အ့ၬ. ပအီၩထံၫ လၧထံၫဖၧၩ့အ့ၬး ပမိလ့ၩလၧစဎွၩ အဖၧၩ့ၥၭထီးပခၫ့",
			"23": "<sup>23</sup> ဂၬခွံၬနခးလီၫ.- တၭစဲဟၫ့ဖ့ၪလၫ့ၦအံၫစရ့လၭဖိၪ ခၫ့ ဂၬအခးအနဲၩ့ ထံၭနီၪအ့ၬ. တၭစဲဟၫ့ဒုၭအီၪကီၪ့အ ၡၩခမျၧးထီးအလူၬနီၪ, လ့ၩထၪ့ထၫ့ဒုၪဒၩ အံၫစရ့လၭ လၧၡါမုနၧၫ့ဖၫတၭး ဂဲၫလၧယၫဟၭတၭ, ဒုၭဆၧလၧ",
			"24": "<sup>24</sup> အံၫစရ့လၭလီၫ.- တၭအံၫစရ့လၭဖ့ၬခွံၬဝ့ၫ လၧနၭအ နါတၭ, မၩန့အခးလၧအၫနၫ့ဖိးလၧယၫဘီၭ, လၧၦအၫ မၧၫ့ဖိၪအအီၪလီၫ. အဂဲးဘဲၫယီၩ ၦအၫမၧၫ့ဖိၪအခး",
			"25": "<sup>25</sup> နဲၩ့ထံၭအီၪဂုးခၧၫ့လီၫ.- အံၫစရ့လၭမၩန့ဒိၩ့ လဖၪ ထီးအလူၬတၭ, အံၫစရ့လၭအီၪဝ့ၫ လၧၦအၫမိၫဖိၪအ ဒိၩ့ထီးအလူၬအဖၧၩ့, လၧဟ့ၭၡဘၫ့အဖၧၩ့, ဒဲလၧအ",
			"26": "<sup>26</sup> တဝၫ့လဖၪအဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩ ဟ့ၭၡဘၫ့နီၪ မွဲၦအၫမိၫဖိၪ အစဎွၩစဲဟၫ့အဒိၩ့, လၧအဒုၭၥုၭလၧမိ အၭအစဎွၩလၧအခၪ့ထံၭလဂၩတၭ, မၩန့ယူၭအခး လၧအဖၧၩ့ဖိးလၧထံၫအၫနၫ့နီၪလီၫ.",
			"27": "<sup>27</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလၧအချဲၩ့ဝ့ၫလၧဆၧချဲၩ့ ထၭခိၪလဖၪ, စံၭဝ့ၫ, ဂဲၫနုၬလၧဟ့ၭၡဘၫ့, မွဲဒိၩ့စဲဟၫ့ဘၪဆၧၥုၪ့ထၪ့ဒဲတဲၩ့ဝဲၩအၥၭဘီၪ. အဂဲးဘဲၫယီၩမ့ၪစဲၪ့ထၪ့လၧဟ့ၭၡဘၫ့း",
			"28": "<sup>28</sup> မ့ၪလၪလၧစဲဟၫ့အဒိၩ့ဖၧၩ့အၪ့ခွံၬမိအၭအဒိၩ့အါ နီၪ, အၫနၫ့အလးထၪ့ထီၫအကဆါလဖၪလီၫ.",
			"29": "<sup>29</sup> မိအၭဧ့, နဘၪဆၧအၡၪ့ဖီၩၬ ခံမီၭအၡၩခမျၧးၥံၪဧ့, နၥံၪဂၭဂီၩ့ယူၭ, အီၪက့ၪအဖိၪခွၫၥံၪလၧၦဂၭဖျ့ၭစဲၪ့ဝ့ၫလဖၪ, ဒဲဖ့ၪကဲၪဎီးအဖိၪမုၪ လၧၦအၫမိၫဖိၪ အစဎွၩစဲဟၫ့.",
			"30": "<sup>30</sup> ပခၭဘၪယူၭဝ့ၫယူၭ, ဟ့ၭၡဘၫ့ဂၭဂီၩ့ယူၭဖိးလၧဒဲဘၧၫ့ယူၭ, တၭပမၩအီၪယူယူၭဝ့ၫဖိးလၧနိဖၫလၧအအီၪဘူၭလၧ မ့ၭဒဘၫယူၭ.",
			"31": "<sup>31</sup> တၭအံၫစရ့လၭ အီၪဝ့ၫလၧၦအၫမိၫဖိၪ အခးဖၧၩ့",
			"32": "<sup>32</sup> လီၫ.- တၭစမိစ့ၭအၪ့မၧၫ့ၦ လ့ၩယိၥူၪယအ့ဇၧၫတၭ, ဒုၭန့အတဝၫ့လဖၪ, ဒဲနၫ့ထၪ့ခွံၬၦအၫမိၫဖိၪ လၧအအီၪ ထီးနီၪလီၫ.",
			"33": "<sup>33</sup> အဝ့ၫၥံၪကၠၪအၥၭတၭ, လ့ၩထၪ့ဖၧၩ့ၥၭလၧဘၫၡၫ့ လီၫ. တၭဘၫၡၫ့အစဎွၩအီၭ ဂဲၫထၪ့ထၫ့ဒုၪဒၩဝ့ၫ, အ ဝ့ၫဒၪနီၪ ဒဲအၡၩခမျၧးထီးအလူၬ ဘဲၫၥိၭအမိဒုၭဆၧ",
			"34": "<sup>34</sup> ထီးအ့ဒအဲၫအဖၧၩ့နီၪလီၫ.- တၭယဟိဝၩစံၭစမိစ့ၭ, ထီးၥၭမဲၪလဂ့ၩ, အဂဲးဘဲၫယီၩ ယဖ့ၪလၫ့ခွံၬယူၭအ ဝ့ၫလၧနစူၪဖၧၩ့ ဒဲအၡၩခမျၧးထီးအလူၬ, ဒဲအထံၫၥံၪ ခးၥံၪဆ့တၭ, နမိမၩဝ့ၫ ဘဲၫနမၩၦအၫမိၫဖိၪ အစဎွၩ စဲဟၫ့လၧအအီၪ လၧဟ့ၭၡဘၫ့အဖၧၩ့အၥိၭနီၪလီၫ.",
			"35": "<sup>35</sup> တၭၦအံၫစရ့လၭဖိၪဖ့ၬခွံၬဝ့ၫ, ဒဲအဖိၪခွၫလဖၪ, ဒဲအ ၡၩခမျၧးထီးအလူၬ, ထီးအၡၩ ဖီၩ့ဖျ့ၭဝ့ၫ အီၪနးဂၩ အ့ၬ. တၭအဝ့ၫၥံၪမၩန့အခးလီၫ."
		},
		"22": {
			"1": "<sup>1</sup> ၦအံၫစရ့လၭဖိၪစဲၪ့ထၪ့တၭ, ၥုၪ့အတဲၩလၧမိအၭ အဆၧပျၩ့ဖၧၩ့ လၧထံၫယီၫဒၫ့ အယီၩလခီၫ, ဆဲၫဎၩ့ လၧဒိၩ့ယ့ၫရခိၫနီၪလီၫ.",
			"2": "<sup>2</sup> တၭစဇ့ၭဖီၫအဖိၪခွၫ စဘၫလၭဒၪဘၪကယဲဆၧလၧ",
			"3": "<sup>3</sup> အံၫစရ့လၭမၩဘၪၦအၫမိၫဖိၪလီၫ.- မိအၭၥၭမဲၪဆၧ လၧၦခမျၧးနီၪ အမ့ၬယၫနၭမၬ, အဂဲးဘဲၫယီၩ မွဲအ အီၪဝ့ၫအၪဂၩလီၫ. တၭမိအၭဘၪဆၧခိဆၧဝီၩ လၧၦ",
			"4": "<sup>4</sup> အံၫစရ့လၭဖိၪအကၠီၩ့လီၫ.- တၭမိအၭနီၪ စံၭမံဒအၫ့ အၦၥုၪ့က့ၭၥၭၡါလဖၪ, ဘိၩ့နဲၪ့ယီၩ ဆၧအီၪကီၪ့လ ဒီၪ့ယီၩမိအၪ့လဲၪ့ထၪ့ခွံၬ ကယဲဆၧအီၪဝၬဖီၩ့ပၧၩဘဲၫ ချီအၪ့လဲၪ့ထၪ့ခွံၬ နၪ့ၥံၪမံၩ့ၥံၪ လၧဆၧပျၩ့ဖၧၩ့အၥိၭ နီၪလီၫ. တၭအဆၧၫ့အထီထီးနီၪ စဇ့ၭဖီၫအဖိၪခွၫ",
			"5": "<sup>5</sup> စဘၫလၭမွဲၦမိအၭဖိၪအစဎွၩလီၫ.- တၭအဝ့ၫဒၪအၪ့ မၧၫ့လၩ့အၥီၫ့လဖၪ လၧစဘံအီၫအဖိၪခွၫ စဘၫလၫ့အ အီၪလၧပံၥီၫ လၧအအီၪလၧထံၫမိၡါအနဲၩ့, အီၪလၧ အၡၩခမျၧးအဖိၪအခးဖၧၩ့, ဘဲၫၥိၭအမိကိၭန့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ယိခွါ, ၦခမျၧးလစီၪ့ဂဲၫထၪ့ယူၭ လၧအံဇံၭ အဖၧၩ့ယူၭ, ယိခွါ, အဝ့ၫၥံၪလုၬဘံၭခွံၬ ဂၪ့ခိၪချိၫ့တၭ,",
			"6": "<sup>6</sup> အီၪဆဲၫဎၩ့လၧယမ့ၬယၫလီၫ.- တၭဘိၩ့နဲၪ့ယီၩဂဲၫ ဘီၪ, ဆိၪအၧၩ့ၦခမျၧးယီၩ လၧယဂးဆံၭး အဂဲးဘဲၫ ယီၩ အဝ့ၫၥံၪအဂဲးဆီၪ့နဲၪ့ အဘၭဆီၪ့နဲၪ့ယၧၩဒံၭ လီၫ. ဘၪလဘၪယမၩအ့ၪၥ့ၪ, ပမိဖ့ၬခွံၬဘၪဝ့ၫတၭ, ယမိနၫ့ထၪ့ခွံၬဝ့ၫ လၧထံၫၥံၪခးၥံၪအဖၧၩ့လီၫ. အဂဲး ဘဲၫယီၩ ယၥ့ၪယၫလၧၦလၧနဆိၪဂ့ၩဝ့ၫနီၪ ဘၪဆၧ ဆိၪဂ့ၩဝ့ၫ, ဒဲၦလၧနဆိၪအၧၩ့ဝ့ၫနီၪ ဘၪဆၧဆိၪအၧၩ့",
			"7": "<sup>7</sup> ဝ့ၫလီၫ.- မိအၭအၦၥုၪ့က့ၭၥၭၡါၥံၪ, ဒဲမံဒအၫ့အၦၥုၪ့ က့ၭၥၭၡါၥံၪနီၪ စဲၪ့ထၪ့တၭ, ဆၧချဲၩ့လၧမီၪအလူအ လံၩ့အလဲၫအီၪဝ့ၫ လၧအစူၪဖၧၩ့လီၫ. အဝ့ၫၥံၪဂဲၫဝ့ၫ လၧစဘၫလၫ့အအီၪတၭ, လီၩဘၪဝ့ၫလၧစဘၫလၭအ",
			"8": "<sup>8</sup> ဆၧချဲၩ့လီၫ.- တၭအဝ့ၫဒၪလီၩဘၪဝ့ၫ မံၫဒၪခလူၬလ နၩယီၩဘီၪ. တၭယမိဂဲၫဆိၬ နၥံၪအဆၧချဲၩ့, ဘဲၫယ ဟိဝၩမိချဲၩ့ဆၧလၧယၧၩ အၥိၭနီၪလီၫ. တၭမိအၭ အၦဒိၪလဖၪ အီၪလၧစဘၫလၫ့အၥိၭလီၫ.",
			"9": "<sup>9</sup> တၭယွၩဂဲၫလၧစဘၫလၫ့အအီၪ, စံၭဝ့ၫဒၪ, ၦၡၩအီၪ",
			"10": "<sup>10</sup> လၧနၥိၭယီၩမွဲၦလဖၪလဲၪ.- တၭစဘၫလၫ့စံၭယွၩနီၪ, စဇ့ၭဖီၫအဖိၪခွၫ, မိအၭအစဎွၩ ဘၫလၭလဂၩ အၪ့",
			"11": "<sup>11</sup> မၧၫ့လၫ့ၦၡၩလၧယအီၪ,- တၭစံၭဝ့ၫ, ယိခွါ, ၦခမျၧး လစီၪ့ဂဲၫထၪ့ယူၭလၧအံဇံၭအဖၧၩ့ လၧအလုၬဘံၭဂၪ့ ခိၪချိၫ့နီၪလီၫ. ဘိၩ့နဲၪ့ယီၩ, ဂဲၫဘီၪ, ဆိၪအၧၩ့အဝ့ၫ ၥံၪလၧယဂးဘီၪ, ဘၪလဘၪယမၩစၪအ့ၪၥ့ၪတၭ ယမိ",
			"12": "<sup>12</sup> နၫ့ထၪ့ခွံၬဝ့ၫလီၫ.- တၭယွၩစံၭစဘၫလၫ့နီၪ, ထီးလ့ၩ လၧအဝ့ၫၥံၪအၥိၭလဂ့ၩ, ဆိၪအၧၩ့ၦခမျၧးလဂ့ၩ အ ဂဲးဘဲၫယီၩ ၦလဖၪနီၪ ဘၪဆၧဆိၪဂ့ၩဝ့ၫလီၫ.",
			"13": "<sup>13</sup> ဆၧဖၩ့ထၪ့နီၪ စဘၫလၫ့ဂဲထုၪ့တၭ, လီၩဘၪစဘၫ လၭအၦဒိၪလဖၪ, ထဲၩ့ထဲၩ့လၧနၥံၪ အခးဒၪနၥံၪဝ့ၫ ဆံၭ. အဂဲးဘဲၫယီၩ ယွၩဖ့ၪလၫ့ယလ့ၩ လၧနၥံၪအၥိၭ",
			"14": "<sup>14</sup> အ့ၬ.- တၭမိအၭအၦဒိၪလဖၪဂဲထုၪ့တၭ, ထဲၩ့ထဲၩ့လၧ စဘၫလၭအအီၪတၭ, စံၭဝ့ၫဒၪ, စဘၫလၫ့ဂဲၫလၧပၥိၭ အၥၭအီၪအ့ၬ.",
			"15": "<sup>15</sup> တၭစဘၫလၭ အၪ့မၧၫ့လၩ့ဒီၭ ၦဒိၪလဖၪ အၪနဲၪ့",
			"16": "<sup>16</sup> ဒဲအလၩအဖၩ့ဒိၪနဲၪ့အဝ့ၫၥံၪနီၪဒံၭလီၫ.- အဝ့ၫၥံၪဂဲၫ လၧစဘၫလၫ့ အအီၪတၭ, စံၭဝ့ၫ, စဇ့ၭဖီၫအဖိၪခွၫ စဘၫလၭစံၭဘဲၫယီၩ, မွဲဆၧထီးပဒၩ့နဂဲၫလၧယအီၪ",
			"17": "<sup>17</sup> နးမံၩ့လဂ့ၩ.- အဂဲးဘဲၫယီၩယမိအီၪက့ၪဆၧလၩဖၩ့ ဒိၪဒိၪလ့ၬလၧနလီၩ့တၭ, ကယဲဆၧလၧနစံၭယၧၩထီး အလူၬယမိမၩလီၫ. ဂဲၫလါဆံၭ.ဆိၪအၧၩ့ၦခမျၧးလၧ",
			"18": "<sup>18</sup> ယဂးဆံၭ.- စဘၫလၫ့စံၭဆၧၫ့ဆၧတၭ,လီၩဘၪစဘၫ လၭအခ့ၫအၡၩလဖၪနီၪ, စဘၫလၭအ့ၪဖ့ၪလၫ့ယၧၩ လၧအဂံၪ့အဆၧလၧၫ့ဎွ့ၩ လၧကျိၪၥံၪစ့ၩၥံၪ, ထီၫ့ၥံၪ လွ့ၫၥံၪလါနၫ့တၭ, ယခၫ့ဂၬ ယဟိဝၩ ယယွၩအလူ, ဘဲၫၥိၭယမိမၩ ဆၧအဆံၭဒံၭမွဲဂ့ၩ, ဆၧအအၪမွဲဂ့ၩ",
			"19": "<sup>19</sup> ၥ့ၪအ့ၬ.- မွဲလါနၫ့ဘိၩ ဘဲၫၥိၭယမိၥ့ၪယၫဆၧလၧယ ဟိဝၩမိလီၩဘၪယၧၩ လၧဆၧအၪနဲၪ့အနီၪဒံၭတၭ, မံၫ ဒၪခလူၬနၥံၪဝ့ၫ ထီးယီၩကဲမုနၩခိၬဆ့ဘီၪ.",
			"20": "<sup>20</sup> ယွၩဂဲၫလၧစဘၫလၫ့အအီၪ လၧမုနၩလခီၫတၭ, စံၭ ဝ့ၫ, ၦလဖၪနီၪအ့ၪဂဲၫလၧနအီၪတၭ, ဂဲထုၪ့လ့ၩလၧအ ၥိၭဘီၪ. မွဲလါနၫ့ဆၧချဲၩ့လၧယချဲၩ့ဆၧ လၧနၧၩနီၪနမိ ဘၪမၩလီၫ.",
			"21": "<sup>21</sup> ဆၧဖၩ့ထၪ့နီၪ စဘၫလၫ့ဂဲထုၪ့တၭ, မၩထၪ့အကၥ့ၪ ယီၩ့အပီၩ့တၭ, လ့ၩဆၧလၧၦဒိၪလဖၪ အၥိၭလီၫ.",
			"22": "<sup>22</sup> မွဲအလ့ၩဆၧတၭ, ယွၩအၥၭထၪ့ခဲၩထၪ့ဝ့ၫလီၫ.တၭ ယဟိဝၩအၥီၫ့လဂၩ ဆၧၫ့ထုၪ့ထၫ့ဒုၪဒၩဝ့ၫ လၧဖၧၩ့ ၥၭနီၪလီၫ. တၭအဝ့ၫဒၪနီၪထူၬအကၥ့ၪယီၩ့, ဒဲအခ့ၫ",
			"23": "<sup>23</sup> အၡၩအီၪလၧအၥိၭနံၫဂၩလီၫ.- ကၥ့ၪယီၩ့လဒုၩနီၪ ဒၪဘၪယဟိဝၩအၥီၫ့လဂၩ အီၪဆၧၫ့ထုၪ့လၧဖၧၩ့ၥၭ တၭ,အီၪလၧအနၭယၩ့ထၪ့အၥၭ လၧအစူၪဖၧၩ့လီၫ. ကၥ့ၪယီၩ့နီၪကၠၪပဲၩခွံၬအၥၭ လၧဖၧၩ့ၥၭတၭ, လ့ၩထၪ့ လၧဆၧပျၩ့ဖၧၩ့တၭ, စဘၫလၫ့ဒိၪကၥ့ၪယီၩ့ ဘဲၫၥိၭ",
			"24": "<sup>24</sup> အမိကၠၪထဲၩ့အၥၭလၧဖၧၩ့ၥၭလီၫ.- တၭယဟိဝၩအ ၥီၫ့နီၪဆၧၫ့ထုၪ့လၧဖၧၩ့ၥၭ အီၪလၧစဘံၭမုအလးနံၫ ခီၫအဘိၩ့ဆၧၩ့, ဆၧအဒီၪ့အီၪဝ့ၫ လၧအယီၩလခီၫ,",
			"25": "<sup>25</sup> ဒဲဆၧအဒီၪ့အီၪဝ့ၫလၧအနီၪလခီၫလီၫ.- ကၥ့ၪယီၩ့ဒၪ ဘၪယဟိဝၩအၥီၫ့လဂၩတၭး နံၫ့ထဲးဆၧအဒီၪ့နီၪတၭ ဘၪထဲးစဘၫလၫ့အခၪ့ လၧဆၧဒီၪ့လီၩ့တၭ အဝ့ၫဒၪ",
			"26": "<sup>26</sup> ဒိၪဒီၭဝ့ၫလီၫ.- ယဟိဝၩအၥီၫ့နီၪ လ့ၩဒံၭလၧယၫတၭ, ဆၧၫ့ထုၪ့လၧဆၧအဆူၭအံၪ့ ထီးအကၠၪပဲၩခွံၬ အၥၭ လၧစူၪထွ့ၪမွဲဂ့ၩ, လၧစူၪစ့ၪမွဲဂ့ၩ, ဖၧၩ့ၥၭလအီၪဘၪ",
			"27": "<sup>27</sup> လီၫ.- ကၥ့ၪယီၩ့ဒၪဘၪယဟိဝၩအၥီၫ့တၭ, လၩ့ထံၩ ဖါဝ့ၫတၭ, စဘၫလၫ့အီၪလၧအဖၫ့ခိၪတၭ, စဘၫလၫ့ အၥၭထၪ့ခဲၩထၪ့တၭ, ဒိၪကၥ့ၪယီၩ့ လၧနိၪထိၭဘီၩ့",
			"28": "<sup>28</sup> လီၫ.- ယဟိဝၩဒုၭအၩ့ထၪ့ကၥ့ၪယီၩ့အနိၭတၭ, မွဲအ စံၭစဘၫလၫ့, ဘဲၫၥိၭနမိဒိၪယၧၩ ၥၧၫ့ဘျၩ့ယီၩတၭ,",
			"29": "<sup>29</sup> ယမၩယူၭနၧၩလၧဆၧနီၪလမံၩ့လဲၪ.- တၭစဘၫလၫ့ စံၭကၥ့ၪယီၩ့နီၪ, မွဲလၧနမၩကြၩ့ထမးယၧၩအဂဲးလီၫ. မွဲယဆိၫ့လၧနၭ လဘံၪ့အီၪလၧယစူၪဖၧၩ့း အဂဲးဘဲၫ",
			"30": "<sup>30</sup> ယီၩဘိၩ့နဲၪ့ယီၩ ယမိမၩၥံၫနၧၩလီၫ.- တၭကၥ့ၪယီၩ့ နီၪစံၭစဘၫလၫ့, ယမွဲနကၥ့ၪယီၩ့ လၧနထူၬနဝ့ၫလၧယ ကဲၪထၪ့နဆၧလံၩလံၩ ထီးလၧမုဆၫလနံၩယီၩမွဲအ့ၬ ဧၪ,ယမၩယုၩယါနၧၩ ဘဲၫယီၩၥိၭဆ့ဧၪ. တၭအဝ့ၫ",
			"31": "<sup>31</sup> ဒၪစံၭဝ့ၫနမၩအ့ၬ.- ထီးနီၪလဖၧၫ့ယဟိဝၩဝဲထၪ့စဘၫ လၫ့အမ့ၬတၭ, အဆၧဒၪဘၪယဟိဝၩအၥီၫ့အီၪဆၧၫ့ ထုၪ့လၧဖၧၩ့ၥၭတၭ, အနၭအီၪယၩ့ထၪ့အၥၭလၧအ စူၪဖၧၩ့တၭ, မွဲအၡီၫ့လၩ့အခိၪတၭ, ခိၬလၩ့ဝ့ၫလီၫ.",
			"32": "<sup>32</sup> တၭယဟိဝၩအၥီၫ့နီၪစံၭဝ့ၫ, နဒိၪနကၥ့ၪယီၩ့ ၥၧၫ့ဖၧၫ့ ယီၩမွဲဘၪလဲၪ, ယိခွါ, ယဝ့ၫဒၪယီၩ, ယဂဲၫထၫ့ဒုၪဒၩ နၧၩလီၫ. အဂဲးဘဲၫယီၩ နဖၧၩ့ၥၭမွဲဆၧမၩဂၭဂီၩ့လၧ",
			"33": "<sup>33</sup> ယမ့ၬယၫလီၫ.- တၭကၥ့ၪယီၩ့နီၪ ဒၪဘၪယၧၩတၭ, ကၠၪပဲၩခွံၬအၥၭ လၧယအီၪၥၧၫ့ဘျၩ့လီၫ. အ့ၪလကၠၪ ပဲၩဘၪအၥၭလၧယအီၪတၭ, မွဲမၬဘိၩ့နဲၪ့ယီၩ ယဖ့ၬ",
			"34": "<sup>34</sup> ၥံၫယူၭနၧၩဒဲဒုၭမၧၫ့အဝ့ၫနီၪလီၫ.- တၭစဘၫလၫ့စံၭ ယဟိဝၩအၥီၫ့ယမၩယူၭဆၧဒဲၩဘၭယူၭ, အဂဲးဘဲၫ ယီၩနဆၧၫ့ထုၪ့ထၫ့ဒုၪဒၩယၧၩ လၧဖၧၩ့ၥၭနီၪ ယၥ့ၪ ယၫအ့ၬ. ဘိၩ့နဲၪ့ယီၩအ့ၪမွဲဆၧအၧၩ့ လၧနမ့ၬယၫတၭ,",
			"35": "<sup>35</sup> ယမိထဲၩ့ထဲၩ့လၧယလးခဲၫ့လီၫ.- တၭယဟိဝၩအၥီၫ့ နီၪစံၭစဘၫလၫ့, လ့ၩဆၧလၧၦလဖၪနီၪအၥိၭဆံၭ. မွဲ လါနၫ့နမိဘၪချဲၩ့န့ၫဆၧချဲၩ့ လၧယချဲၩ့လၧနၧၩနီၪလီၫ. တၭစဘၫလၫ့လ့ၩဝ့ၫ လၧစဘၫလၭအၦဒိၪလဖၪနီၪအ ၥိၭလီၫ.",
			"36": "<sup>36</sup> တၭထီးစဘၫလၭနါဂၧၫ့ လၧစဘၫလၫ့ဂဲၫဝ့ၫတၭ, လ့ၩထၪ့အၪ့ဂၬဝ့ၫ လၧမိအၭအဒိၩ့လဖျိၫ့လၧအအီၪဝ့ၫ လၧဒိၩ့အၫနၫ့အနဲၩ့ လၧဆၧအနဲၩ့ထံၭအထုၬနီၪလီၫ.",
			"37": "<sup>37</sup> တၭစဘၫလၭစံၭ စဘၫလၫ့,ယအၪ့မၧၫ့ၦလ့ၩကိၭန့ နၧၩတၡါမွဲအ့ၬဧၪ. နလဂဲၫဘၪလၧယအီၪ မွဲဘၪလဲၪ.",
			"38": "<sup>38</sup> ယအီၪက့ၪဆၧလၩဖၩ့လၧနလီၩ့လၥ့ၪဘၪဧၪ.- တၭစ ဘၫလၫ့စံၭစဘၫလၭ, ယိခွါဘိၩ့နဲၪ့ယီၩ ယဂဲၫယူၭ လၧနအီၪယူၭး ယမိစံၭဆၧလမံၩ့မံၩ့နီၪ, မွဲယစီၩ့ယ မၩ့ဒၪယဝ့ၫအီၪဆ့ဧၪး ဆၧချဲၩ့လၧယွၩအီၪက့ၪလၧယ",
			"39": "<sup>39</sup> နိၭနီၪယချဲၩ့ဆၧနီၪလီၫ.- တၭစဘၫလၫ့နီၪလ့ၩဆၧ လၧစဘၫလၭအၥိၭတၭ, အဝ့ၫၥံၪဂဲၫထီၩ့လၧကၧဇၭ ဟုစီၭလီၫ.",
			"40": "<sup>40</sup> စဘၫလၭလုထၪ့ချီဖၫၥံၪဒဲၥိၪတၭ, အၪ့မၧၫ့လၩ့ဆၧ လၧစဘၫလၫ့, ဒဲလၧၦဒိၪလဖၪလၧအအီၪလၧအၥိၭ",
			"41": "<sup>41</sup> အအီၪလီၫ.- တၭဆၧမၩအၥၭလၧဆၧဖၩ့ထၪ့လနံၩနီၪ စဘၫလၭမၩန့စဘၫလၫ့တၭ ၥိၫ့ထၪ့ဝ့ၫလၧဘၫအလၭ အလးထၪ့ထီၫလဖၪ, ဘဲၫၥိၭလၧအလးထီးနီၪ မိဒၪ ဘၪဝ့ၫၦခမျၧးအအၪထုၬနီၪလီၫ."
		},
		"23": {
			"1": "<sup>1</sup> တၭစဘၫလၫ့စံၭစဘၫလၭ, မၩထၪ့န့ယၧၩလၧဆၧ လုလးနွ့ၫဖျိၪ့တၭတဲၩ့ဝဲၩန့ယၧၩ လၧချီဖၫနွ့ၫဒုၩ, ဒဲၥိၪ",
			"2": "<sup>2</sup> ဖၫနွ့ၫဒုၩထီးယီၩဆံၭ.- စဘၫလၭမၩဝ့ၫဘဲၫစဘၫလၫ့ ချဲၩ့ဆၧအၥိၭနီၪတၭ, စဘၫလၭဒဲစဘၫလၫ့လုထၪ့ချီ ဖၫလဒုၩ, ဒဲၥိၪဖၫလဒုၩလၧဆၧလုလး လဖျိၪ့ဘၪလ",
			"3": "<sup>3</sup> ဖျိၪ့အဖၫ့ခိၪလီၫ.- တၭစဘၫလၫ့စံၭစဘၫလၭ, ဆၧၫ့ ထုၪ့လၧနဆၧလုမ့ၪအနဲၩ့ထံၭတၭ, ယမိလ့ၩဆၧလီၫ. ဘၪလဘၪယဟိဝၩ မိဂဲၫဒၪလိၬလၧယၧၩတၭ, ဆၧလၧ အဒုၭနဲၪယၧၩနီၪ ယမိလီၩဘၪနၧၩလီၫ. တၭအဝ့ၫ",
			"4": "<sup>4</sup> လ့ၩထၪ့ဝ့ၫလၧဆၧစီၩ့ခိၪလီၫ.- ယွၩဒၪလိၬလၧစဘၫ လၫ့တၭ, အဝ့ၫဒၪစံၭဝ့ၫ, ယတဲၩ့ဝဲၩယူၭဆၧလုလးနွ့ၫ ဖျိၪ့တၭ, ယလုထၪ့ယူၭချီဖၫလဒုၩ, ဒဲၥိၪဖၫလဒုၩလၧ ဆၧလုလးလဖျိၪ့ဘၪလဖျိၪ့ အဖၫ့ခိၪဆုၬဆုၬယူၭ.",
			"5": "<sup>5</sup> ယဟိဝၩအီၪက့ၪဆၧချဲၩ့လထံၪ လၧဘၫလၫ့အနိၭ တၭ, စံၭဝ့ၫဒၪ, ထဲၩ့ထဲၩ့လၧစဘၫလၭ အအီၪဆံၭး",
			"6": "<sup>6</sup> တၭနမိဘၪချဲၩ့ဆၧဘဲၫယီၩ,- မွဲအထဲၩ့ထဲၩ့ဝ့ၫလၧအ အီၪတၭ, ယိခွါ, အဝ့ၫနီၪဆၧၫ့ထုၪ့ လၧအဆၧလုမ့ၪအ နဲၩ့ထံၭ, အဝ့ၫဒၪနီၪ, ဒဲမိအၭအၦဒိၪထီးအလူၬလီၫ.အ",
			"7": "<sup>7</sup> ဝ့ၫဒၪထုၭထၪ့အဆၧချဲၩ့ဒီၩ့တၭ, စံၭဝ့ၫဒၪ,- လၧအၫ ရမၫ့နီၪမိအၭအစဎွၩဘၫလၭ ကိၭန့ယၧၩလၧခိၪလီၩ့လၧမုထၪ့လခီၫ, စံၭ, ဂဲၫဘီၪ, ဆိၪအၧၩ့ယၫကူၭလၧယဂး ဒဲဂဲၫချဲၩ့ၥၭမဲၪအံၫစရ့လၭဆံၭ.",
			"8": "<sup>8</sup> ၦၡၩလၧယွၩလဆိၪအၧၩ့ဘၪနီၪ, မွဲယမိဆိၪအၧၩ့ ဘဲၫၥ့ၪလဲၪၬ တၭၦၡၩလၧယဟိဝၩ လချဲၩ့ၥၭမဲၪဘၪ",
			"9": "<sup>9</sup> နီၪ,ယမိချဲၩ့ၥၭမဲၪဘဲၫၥ့ၪလဲၪၬ အဂဲးဘဲၫယီၩ လၧခိၪ လီၩ့ခိၪယဒၪဘၪအဝ့ၫနီၪ, ဒဲလၧဆၧစီၩ့ခိၪယယိဝ့ၫ, ယိခွါ, ၦခမျၧးမိအီၪဝ့ၫလၩ့မဲၩဒၪဆၧ, တၭဆၧဝံထၪ့နၬထၪ့အဝ့ၫၥံၪ လၧၦဆၨၩလဖၪအကျၩ",
			"10": "<sup>10</sup> အ့ၬ.- မွဲပလၫဝံထၪ့နၬထၪ့ယၫကူၭအမုၬ မိၥ့ၪလဂၩ လဲၪၬ ဒဲအံၫစရ့လၭလံပိၩ့လပိၩ့ အဆၧဝံထၪ့နၬထၪ့ နီၪလဲၪၬ မွဲယၥံၫလါ ဘဲၫၦတီၩၦလီၩ့ၥံၫဝ့ၫ အၥိၭနီၪ ဆံၭ. တၭယမုနံၩထုၬနီၪ, မွဲအမၩလါအၥၭဘဲၫအဝ့ၫဒၪအ ၥိၭဆံၭ.",
			"11": "<sup>11</sup> တၭစဘၫလၭစံၭစဘၫလၫ့, နမၩယၧၩဘဲၫၥ့ၪလဲၪး ယမၩန့နၧၩ ဘဲၫၥိၭနမိဆိၪအၧၩ့ ယဒုၪယဒၩတၭ, ယိ",
			"12": "<sup>12</sup> ခွါ, နဆိၪဂ့ၩဝ့ၫတၡါလီၫ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့တၭ, စံၭ ဝ့ၫ, ဆၧလၧယဟိဝၩအီၪက့ၪလၧယနိၭနီၪ ယဘၪထီး လၩ့ယၥၭတၭ, ချဲၩ့ဆၧနီၪ, မွဲအ့ၬဧၪ.",
			"13": "<sup>13</sup> တၭစဘၫလၭစံၭဝ့ၫဂဲၫလါလၧယၥိၭ လၧဆၧအလး လစီၪ့ဒၪထီးနမိဒၪဘၪနဝ့ၫဆံၭ. နမိဒၪဘၪန့ၫအဆၧ အထုၬတၭ, နမိဒၪဘၪနဝ့ၫထီးအလူၬအ့ၬ. တၭဆိၪအၧၩ့",
			"14": "<sup>14</sup> အဝ့ၫၥံၪလၧယဂးထီးနီၪဆံၭ.- တၭမွဲအဂဲၫဆိၬဝ့ၫလၧ ဆၧပျၩ့ဇိဖံၫ့အဖၧၩ့, လၧပံစဂၫအဒၩ့ခိၪတၭ, မၩထၪ့ဆၧ လုလးနွ့ၫဖျိၪ့တၭ, လုထၪ့ချီဖၫလဒုၩ, ဒဲၥိၪဖၫလဒုၩလၧ",
			"15": "<sup>15</sup> ဆၧလုလးလဖျိၪ့ဘၪလဖျိၪ့အဖၫ့ခိၪလီၫ.- တၭအဝ့ၫစံၭ စဘၫလၭ, ဆၧၫ့ထုၪ့ထီးယီၩ လၧနဆၧလုမ့ၪအနဲၩ့ထံၭ ဆံၭ. တၭယဝ့ၫဒၪယီၩ ယမိလ့ၩထၪ့ဒၪလိၬဆၧ ထီး",
			"16": "<sup>16</sup> နီၪလီၫ.- ယဟိဝၩဂဲၫထၪ့ဒၪလိၬ လၧစဘၫလၫ့တၭ,အီၪ က့ၪဆၧချဲၩ့လထံၪ လၧအနိၭတၭ စံၭဝ့ၫ, ထဲၩ့ဒီၭလၧ",
			"17": "<sup>17</sup> စဘၫလၭအအီၪတၭ စံၭဝ့ၫဘဲၫယီၩ,- ထီးအဂဲၫထဲၩ့ ဝ့ၫလၧအအီၪတၭ, ယိခွါ အဝ့ၫဒၪဆၧၫ့ထုၪ့လၧဆၧလု မ့ၪအနဲၩ့ထံၭ ဒဲမိအၭအၦဒိၪလဖၪ အီၪလၧအၥိၭလီၫ. တၭစဘၫလၭ စံၭဝ့ၫ, ယဟိဝၩ ချဲၩ့ဆၧဘဲၫၥ့ၪလဲၪ.",
			"18": "<sup>18</sup> တၭအဝ့ၫဒၪထုၭထၪ့ အဆၧချဲၩ့ဒီၩ့တၭ, စံၭဝ့ၫဒၪ, ဂဲထုၪ့စဘၫလၭဧ့, တၭခိၭနၪဘီၪ,",
			"19": "<sup>19</sup> ခိၭနၪယလူ, စဇံၭဖီၫအဖိၪခွၫဧ့, ယွၩမွဲၦၡၩလၧအချဲၩ့ဘျံၭချဲၩ့ဘျၪဆၧအ့ၬး တၭမွဲၦၡၩဖိၪလၧအမိနၪ့ထၪ့နီၫ့ယါလၩ့ထဲၩ့အၥၭဆ့ အ့ၬ. အ့ၪစံၭဆၧလမံၩ့နီၪ, မွဲအမၩဘၪအ့ၬဧၪ. အ့ၪချဲၩ့ဆၧတၭ, မွဲအမၩဂုးမၩခၧၫ့အ့ၬဧၪ.",
			"20": "<sup>20</sup> ယိခွါယဒိၭန့ဆၧလၧယဘၪဆိၪဂ့ၩဆၧတၭ, အဝ့ၫဒၪ ဆိၪဂ့ၩဝ့ၫနီၪ, တၭယမၩကဒၩထဲၩ့ၥ့ၪအ့ၬ.",
			"21": "<sup>21</sup> မွဲအဒၪဘၪဆၧအၧၩ့လၧယၫကူၭအဖၧၩ့အ့ၬ, ဒဲဒၪအဆၧမၩအၧၩ့လၧအံၫစရ့လၭအဖၧၩ့အ့ၬး ယဟိဝၩအီၪလၧအၥိၭလီၫ. တၭဆၧကိၭၡၭၥၭထိၬဘၪဆဲၫ့ လၧစဎွၩအီၪ လၧအဝ့ၫ ၥံၪအကျၩ,",
			"22": "<sup>22</sup> ယွၩဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫလၧအံဇံၭအဖၧၩ့, မွဲအအီၪလၧအဂဲးဆီၪ့ဘၭဆီၪ့ ဘဲၫဆၧဒိၪအၥိၭလီၫ.",
			"23": "<sup>23</sup> မွဲမၬဆၧလီးဆၧဘွဲၩ လၧအမိထၫ့ဒၩဘၪယၫကူၭ လအီၪဘၪ, ဒဲဆၧအူၪဆၧပီၩ လၧအမိဘၪအံၫစရ့လၭ လအီၪဘၪနီၪး ဘဲၫအယီၩအၥိၭ, ၦၡၩမိစံၭလၧယၫ ကူၭအဂဲး, ဒဲလၧအံၫစရ့လၭအဂဲးနီၪး မွဲယွၩမၩယူၭ လၧဆၧနီၪလမံၩ့လဲၪၬ",
			"24": "<sup>24</sup> ယိခွါ, ၦခမျၧးမိဂဲထုၪ့ဘဲၫဆၬလၥၧၫ့ဖၭဒိၪအၥိၭ တၭ,ဘဲၫဆၬလၥၧၫ့ၥၭဘၪ့အၥိၭနီၪ မိဂဲထုၪ့ထၪ့လီၫ. ဘိၩ့အလချႃၭအၪ့ဒံၭဘၪ ဆၧအၪ့ဂူၬန့လချႃၭအီၩဒံၭ ဘၪဆၧမၩၥံၫအၥွံၪနီၪ, မံၫနၩ့ဘၪအ့ၬ.",
			"25": "<sup>25</sup> တၭစဘၫလၭ စံၭစဘၫလၫ့, ဆိၪအၧၩ့ဝ့ၫဧီၪ, ဆိၪ အၧၩ့လဂ့ၩ, ဆိၪဂ့ၩဝ့ၫဧီၪ, ဆိၪဂ့ၩလဂ့ၩ.",
			"26": "<sup>26</sup> စဘၫလၫ့ချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭစဘၫလၭ, ဆၧလၧ ယဟိဝၩချဲၩ့ဆၧထီးအလူၬ ယဘၪမၩနီၪ, ယလီၩဘၪ နၧၩမွဲအ့ၬဧၪ.",
			"27": "<sup>27</sup> တၭစဘၫလၭစံၭစဘၫလၫ့, ဂဲၫလါဘီၪ, ယမိၥိၫ့ ထၪ့နၧၩ လၧအလးအဂူၫဂၩလစီၪ့, ဘၪလဘၪမိဘၪ ယွၩအၥၭလၧနမိဆိၪအၧၩ့ ဘၪအဝ့ၫၥံၪထီးနီၪလၧယ ဂးလီၫ.",
			"28": "<sup>28</sup> တၭစဘၫလၭလ့ၩၥိၫ့ထၪ့ စဘၫလၫ့လၧပံအီၫအဒၩ့",
			"29": "<sup>29</sup> ခိၪလၧအဆဲၫဎၩ့ လၧယ့ၭၡမၧၫ့နီၪလီၫ.- တၭစဘၫ လၫ့စံၭစဘၫလၭ, မၩထၪ့န့ယၧၩ ဆၧလုလးနွ့ၫဖျိၪ့ တၭ, တဲၩ့ဝဲၩန့ယၧၩချီဖၫနွ့ၫဒုၩ, ဒဲၥိၪဖၫနွ့ၫဒုၩ ထီး ယီၩဆံၭ.",
			"30": "<sup>30</sup> စဘၫလၭမၩဝ့ၫဘဲၫစဘၫလၫ့ စံၭဝ့ၫအၥိၭနီၪတၭ, လုထၪ့ချီဖၫလဒုၩ, ဒဲၥိၪဖၫလဒုၩ. လၧဆၧလုလးလ ဖျိၪ့ဘၪလဖျိၪ့ အဖၫ့ခိၪဆုၬဆုၬလီၫ."
		},
		"24": {
			"1": "<sup>1</sup> ထီးစဘၫလၫ့ဒၪဘၪဝ့ၫ လၧအဘၪယဟိဝၩအၥၭ လၧအမိဆိၪဂ့ၩ ၦအံၫစရ့လၭ နီၪတၭ, လ့ၩအၪ့ဎၬ ဆၧအူၪဆၧပီၩ ဘဲၫအအၪ့ဎၬယူၭလဘျၩ့ဘျၩ့အၥိၭ နီၪအ့ၬ. မွဲအအီၪက့ၪအမ့ၬ တီၩလၧၡါမုနၧၫ့ဖၫလီၫ.",
			"2": "<sup>2</sup> စဘၫလၫ့ကျဲၪ့ထၪ့အမ့ၬတၭ, ဒၪဘၪအံၫစရ့လၭအီၪ ဝ့ၫဘဲၫအဒီၪ့လဖၪ အၥိၭနီၪတၭ, ယွၩအၥၭအီၪထၪ့",
			"3": "<sup>3</sup> လၧအလီၩ့လီၫ.- တၭအဝ့ၫဒၪမၩန့ အဆၧချဲၩ့ဒီၩ့တၭ, စံၭဝ့ၫ, စဘံအီၫအဖိၪခွၫစဘၫလၫ့စံၭဆၧ, ဒဲၦလၧအမ့ၬဝဲထၪ့အၥၭစံၭဆၧ,",
			"4": "<sup>4</sup> ၦလၧအနါဂၧၫ့ယွၩအလူအထၫစံၭဆၧ, လၧအဒၪဆၧလၧယၫလခီၫ ဘၪဆဲၫ့လၧၦၥ့ၪဆၧလူၬ, လၩ့လါနၫ့ လၧဆၧမံၫမးအဖၧၩ့နီၪ အမ့ၬအီၪဝဲထၪ့ အၥၭတၭ,",
			"5": "<sup>5</sup> နတဲၩလဖၪဂ့ၩဆံၭဒိၪလဲၪၬ ယၫကူၭဧ့, ဒဲနအီၪအလးလဖၪ, အံၫစရ့လၭဧ့ၬ",
			"6": "<sup>6</sup> ပၠၪလၩ့အၥၭဘဲၫခိၪလီၩ့ဆူၭအၥိၭ, ဘဲၫကျိၭအလးလၧထံၫမိၡါအနဲၩ့အၥိၭ, ဘဲၫၥံၪ့ကၠီၫလၧယဟိဝၩၥုၪ့ဝ့ၫအၥိၭ, ဘဲၫၥံၪ့ၡိၫအ့ရ့ၭ လၧထံၫနဲၩ့အၥိၭနီၪလီၫ.",
			"7": "<sup>7</sup> မွဲအမိဂါလၩ့ခွံၬထံၫ လၧအအီၪလၧထံၫဆဲၩဖၧၩ့, တၭအချံၫအၥၪမိအီၪ လၧထံၫအၪအကျၩလီၫ. အစဎွၩမိထၪ့ထီၫနဲၪ့စအၫဂၭ, တၭအဘၩ့အမုး မိဘၪဆၧအီၪက့ၪထၪ့ထီၫဝ့ၫလီၫ.",
			"8": "<sup>8</sup> ယွၩဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫလၧအံဇံၭ, အီၪလၧအဂဲးဆီၪ့ဘၭဆီၪ့ ဘဲၫဆၧဒိၪအၥိၭ, တၭမိအၪ့ခွံၬ ၦဆၨၩလဖၪ အဒုၪအဒၩနီၪ, ဒဲမၩခါ အဎွံၪ, ဒဲခၭဘၪအဝ့ၫလၧအဖျါလဖၪလီၫ.",
			"9": "<sup>9</sup> မွဲအခိၬလၩ့ဝ့ၫ, မံၫနၩ့ဝ့ၫဘဲၫဆၬလၥၧၫ့အၥိၭ, ဒဲဘဲၫ ဆၬလၥၧၫ့မိအၥိၭး မွဲပလၫ မိထိၪဂဲထုၪ့ဝ့ၫလဂၩလဲၪ. ၦလၧအဆိၪဂ့ၩနၧၩနီၪ ဘၪဆိၪဂ့ၩယူၭး တၭၦလၧအဆိၪအၧၩ့နၧၩနီၪ ဘၪဆိၪအၧၩ့ယူၭ,",
			"10": "<sup>10</sup> စဘၫလၭအၥၭထၪ့ခဲၩထၪ့ဘၪ စဘၫလၫ့တၭ, ဒဲၩ လိၬအစူၪယၫၥၭလီၫ. တၭစဘၫလၭ စံၭစဘၫလၫ့, ယကိၭန့နၧၩ ဘဲၫၥိၭနမိဆိၪအၧၩ့ ယဒုၪယဒၩလီၫ. တၭ,ယိခွါ, နဆိၪဂ့ၩယူၭတၡါဝ့ၫ ၥၧၫ့ဘျၩ့ယၫယူၭ.",
			"11": "<sup>11</sup> တၭဘိၩ့နဲၪ့ယီၩထဲၩ့စဲၪ့ဖျိၭနဝ့ၫ ထီၩ့လၧနလးဒၪနဝ့ၫ ဆံၭ. ယစံၭလၧယမိအီၪက့ၪ ဆၧလၩဖၩ့ဒိၪလၧနလီၩ့ လီၫ. တၭယိခွါ, ယဟိဝၩပဒၩ့ဆၧ လၧနန့ဘၪဆၧ လၩဖၩ့လီၫ.",
			"12": "<sup>12</sup> တၭစဘၫလၫ့စံၭစဘၫလၭ, ယဝ့ၫဒၪယစံၭနၥီၫ့လၧ",
			"13": "<sup>13</sup> နအၪ့မၧၫ့လၩ့လၧယအီၪလဖၪနီၪ- စဘၫလၭအ့ၪဖ့ၪ လၫ့ယၧၩအဂံၪ့အဆၧလၧၫ့ဎွ့ၩ လၧကျိၪၥံၪစ့ၩၥံၪထီၫ့ ၥံၪလွ့ၫၥံၪလါနၫ့တၭ, ယခၫ့ဂၬ ယဟိဝၩအဆၧမၪလူၬ ဘဲၫၥိၭယမိမၩဆၧဂ့ၩမွဲဂ့ၩ, ဆၧအၧၩ့မွဲဂ့ၩ, လၧယၥၭ ဒၪယဝ့ၫၥ့ၪအ့ၬ. ဆၧလၧယဟိဝၩချဲၩ့ဆၧနီၪ ယမိချဲၩ့ ဆၧဎွ့ၩနီၪ, မွဲအ့ၬဧၪ,",
			"14": "<sup>14</sup> တၭဘိၩ့နဲၪ့ယီၩ, ယိခွါ, ယမိလ့ၩလၧယၡၩခမျၧး လီၫ. ဂဲၫဘီၪ, ယမိဒုၭၥ့ၪယၫနၧၩ လၧဆၧလၧၦခမျၧး မိမၩနၡၩခမျၧး လၧမုနံၩလဖၪလၧယၫလခီၫနီၪလီၫ.",
			"15": "<sup>15</sup> မွဲအထုၭထၪ့အဆၧချဲၩ့ဒီၩ့တၭ, စံၭဝ့ၫဒၪ, စဘံအီၫအ ဖိၪခွၫစဘၫလၫ့စံၭဆၧ, ဒဲၦလၧအမ့ၬဝဲထၪ့အၥၭစံၭဆၧ,",
			"16": "<sup>16</sup> ၦဂၧၫ့ဘၪယွၩအလူအထၫ ဒဲၥ့ၪယၫဆၧၥ့ၪယၫ ဘၪဆဲၫ့ လၧဆၧထီၫထုၬလဂၩ စံၭဆၧ, ၦဒၪဆၧလၧယၫလခီၫဘၪဆဲၫ့လၧၦၥ့ၪဆၧလူၬ, လၩ့လါနၫ့လၧဆၧမံၫမးအဖၧၩ့နီၪ အမ့ၬဝဲထၪ့အၥၭ တၭ,",
			"17": "<sup>17</sup> ယမိဒၪဘၪဝ့ၫလါနၫ့ဘိၩ့နဲၪ့ယီၩမွဲအ့ၬ. ယမိယိဝ့ၫလါနၫ့, အီၪဘူၭမွဲအ့ၬး ၡၪလဖျိၪ့မိထၪ့ဘၭဝ့ၫလၧယၫကူၭအဖၧၩ့, ဒဲစဎွၩအနိၪထိၭလဘီၩ့မိထၪ့လၧအံၫစရ့လၭ, တၭမိဒိၪဘၪမိအၭအနိၫ့လဖၪ, ဒဲမၩဂၭဂီၩ့ခွံၬကယဲၦတုၩ့ထၪ့တုၩ့လၩ့ဖိၪလီၫ.",
			"18": "<sup>18</sup> တၭအံဒၧၫ့မိကဲၪထၪ့ဆၧန့ၥၫ, ဒဲစံအၫမိကဲၪထၪ့ဆၧန့ၥၫလၧအဒုၪအဒၩအဂး, ဒဲအံၫစရ့လၭမိမၩနၧၩ့မၩစၪဆၧလီၫ.",
			"19": "<sup>19</sup> ၦလၧအမိပၧၩ့ဆၧလဂၩ မိဂဲၫထၪ့လၧယၫကူၭ, တၭမိမၩဂၭဂီၩ့ဒိၩ့ၥံၪတဝၫ့ၥံၪ လၧအအီၪလၩ့ထး လီၫ.",
			"20": "<sup>20</sup> ထီးအယိဝ့ၫလၧအၫမလ့ၭနီၪတၭ, မၩန့အဆၧချဲၩ့ ဒီၩ့တၭစံၭဝ့ၫဒၪ, အၫမလ့ၭမွဲၦဆၨၩလဖၪအခိၪ, မွဲလါနၫ့အထုၬနီၪ မွဲဆၧဂၭဂီၩ့အဆိၩအကၠၪလီၫ.",
			"21": "<sup>21</sup> အဝ့ၫယိဝ့ၫလၧၦကံၫ့နဲၭဖိၪတၭ, ထုၭထၪ့ အဆၧ ချဲၩ့ဒီၭတၭ, စံၭဝ့ၫဒၪ, နအီၪအလးအီၪဂုးခၧၫ့, ဒဲနအီၪက့ၪနၥွံၫလၧလိးဖၧၩ့,",
			"22": "<sup>22</sup> မွဲလါနၫ့ဆၧမိအၪ့ခွံၬကံၫ့နဲၭနီၪ ဆံၭယံၬလဲၪ, ထီးအၭၡၧၫမိအၪ့မၧၫ့ဎီးနၧၩလီၫ.",
			"23": "<sup>23</sup> မွဲအထုၭထၪ့အဆၧချဲၩ့ဒီၩ့တၭ, စံၭဝ့ၫဒၪ, အၩလါၬ ထီးယွၩမိမၩဆၧနီၪတၭ, မွဲပလၫမိမၧၫ့လဂၩလဲၪ.",
			"24": "<sup>24</sup> တၭကဘၩ့လဖၪမိဂဲၫလၧဆံၭထံၫ့အနဲၩ့, တၭမိမၩၡၪ့မၩနၭအၭၡၧၫ ဒဲမိမၩၡၪ့မၩနၭအံဘၧၫ, တၭအဝ့ၫဒၪ မိထီၩ့လၧဆၧဂၭဂီၩ့ အဆိၩအကၠၪဆ့",
			"25": "<sup>25</sup> လီၫ.- စဘၫလၫ့ဂဲထုၪ့တၭ, လ့ၩဆၧဒဲထဲၩ့ထဲၩ့လၧအ လးတၭ, စဘၫလၭလ့ၩလၧအဖၧၩ့ၥၭဒၪဝ့ၫဆ့လီၫ."
		},
		"25": {
			"1": "<sup>1</sup> အံၫစရ့လၭအီၪဝ့ၫ လၧဆံၭထံၫ့အဖၧၩ့တၭ, ၦခ မျၧးမၩဆၧလဲးဆၧဘျၪ လၧမိအၭအဖိၪမုၪလဖၪလီၫ.",
			"2": "<sup>2</sup> အဝ့ၫၥံၪကိၭန့ ၦခမျၧးလဖၪ လၧအယွၩၥံၪအဆၧလု လဖၪတၭ, ၦခမျၧးအၪ့ဆၧဒဲဘၩထၪ့ အဝ့ၫၥံၪအယွၩ",
			"3": "<sup>3</sup> လဖၪလီၫ.- တၭအံၫစရ့လၭ အီၪက့ၪဎုၬလိၬအၥၭလၧ ဘၫအလၭပံအီၫလီၫ. တၭယဟိဝၩ အၥၭထၪ့ခဲၩထၪ့",
			"4": "<sup>4</sup> ဘၪအံၫစရ့လၭလီၫ.- ယဟိဝၩစံၭစမိစ့ၭ, မၩန့ၦခ မျၧးအခိၪကိၭအဂၩတၭ, စၧၩ့လၩ့ၥံၫအဝ့ၫၥံၪ လၧယ ဟိဝၩအမ့ၬယၫ, လၧမုအမ့ၬယၫဆံၭ. တၭယဟိဝၩ အၥၭထၪ့ဆီၪ့မိကၠၪခွံၬအၥၭ လၧအံၫစရ့လၭ အအီၪ",
			"5": "<sup>5</sup> လီၫ.- တၭစမိစ့ၭစံၭအံၫစရ့လၭ အၡၩစ့ၩရၫ့ခွးလဖၪ နီၪးၦလၧအအီၪက့ၪဎုၬလိၬအၥၭ လၧဘၫအလၭပံအီၫ လဖၪနီၪမၩၥံၫနၥံၪဝ့ၫလဂၩ လၧအၡၩဒၪဝ့ၫ, လဂၩလၧ အၡၩဒၪဝ့ၫဆံၭ.",
			"6": "<sup>6</sup> တၭ,ယိခွါ, ၦအံၫစရ့လၭဖိၪလဂၩ ဂဲၫဆိၬၦမံဒအၫ့ မုၪလဂၩ လၧအထၧၫ့ဖုဝဲၥံၪ အအီၪလၧစမိစ့ၭ အမ့ၬ ယၫ, ဒဲလၧၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့ထီးအလူၬ အမ့ၬယၫ, လၧအဝ့ၫၥံၪဂၪ့ဝ့ၫ လၧဆၧအီၪကီၪ့အတဲၩ",
			"7": "<sup>7</sup> ဆံၫ့ဎံၪအတရၫ့အဘိၩ့ဘၭနီၪလီၫ.- တၭၦလုဆၧလ ဂၩစအၫရၧၫ့အဖိၪခွၫ စအံၫလအ့ဇၧၫအဖိၪခွၫ စဖံနအၭ ဒၪဘၪဝ့ၫတၭ ဂဲထုၪ့လၧဆၧအီၪကီၪ့အကျၩတၭ, မၩန့",
			"8": "<sup>8</sup> ဖၩ့လဘံၪ့လၧအစူၪဖၧၩ့,- တၭလ့ၩဆီးၦအံၫစရ့လၭ ဖိၪလဂၩ လၧအတဲၩဖၧၩ့တၭ, ဆ့ၭဖျီၫ့ၦနံၫဂၩ, ၦအံၫ စရ့လၭအၡၩခွၫလဂၩ ဒဲၦမုၪလဂၩ ထီးအဂူၭဖိၫ့ဖိး လီၫ. တၭဆၧၥံၫဖျဲၪအီၪထီဝ့ၫ လၧၦအံၫစရ့လၭဖိၪအ",
			"9": "<sup>9</sup> ကျၩလီၫ.- တၭၦလၧအၥံၫလၧဆၧၥံၫဖျဲၪအဖၧၩ့နီၪမွဲ ၦၡၩနံၫလၬလံထီၫ့လီၫ. ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,",
			"10": "<sup>10</sup> ၦလု ဆၧစအၫရၧၫ့အဖိၪခွၫ စအံၫလအ့ဇၧၫအဖိၪခွၫ စဖံန အၭလဂၩနီၪ, ထီးအၥၭဆီၪ့လၧယဂး လၧအဝ့ၫၥံၪအ ကျၩတၭ, ဒုၭကၠၪခွံၬယၥၭထၪ့ လၧၦအံၫစရ့လၭဖိၪ အအီၪတၭ, ယမၩလူၬခွံၬၦအံၫစရ့လၭဖိၪ လၧယၥၭ",
			"12": "<sup>12</sup> ကဲၪ့အဖၧၩ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, စံၭ, ယိခွါ, ယဖ့ၪလၫ့အဝ့ၫ လၧယဆၧအုၩ့လၩ့ဘၪဆဲၫ့ လၧဆၧ",
			"13": "<sup>13</sup> မၩဘၪလိၬအိၭလိၬလီၫ.- တၭအဝ့ၫဒၪဒဲအချံၫအၥၪ လၧအလးခဲၫ့နီၪ မိန့ဘၪဝ့ၫဆၧအုၩ့လၩ့ ဘၪဆဲၫ့လၧၦ လုဆၧအဆိၩအကၠၪလီၫ. အဂဲးဘဲၫယီၩ မွဲအၥၭဆီၪ့ လၧယွၩလခီၫတၭ, မၩဆၧဖီၩ့ဖျ့ၭ လၧၦအံၫစရ့လၭဖိၪ အဂးလီၫ.",
			"14": "<sup>14</sup> တၭၦအံၫစရ့လၭဖိၪ လၧအဘၪဆၧမၩၥံၫဝ့ၫလၧ ၦမံဒအၫ့မုၪလဂၩအၥိၭနီၪ, မွဲၦဒိၪလၧစစံမအၧၫ့ဖိၪအ",
			"15": "<sup>15</sup> ကျၩစစၫလုၫအဖိၪခွၫ, အမံၩ့မွဲစဇံၫ့မရဲၫလီၫ.- တၭၦ မံဒအၫ့မုၪလၧအဘၪဆၧမၩၥံၫဝ့ၫလဂၩနီၪ အမံၩ့မွဲနး ကိဇဘံၫ စဇၧၫအဖိၪမုၪလီၫ. အဝ့ၫနီၪ မွဲၦခမျၧးအခိၪ လၧမံဒအၫ့အဖၧၩ့လီၫ. ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,",
			"16": "<sup>16</sup> မၩ",
			"18": "<sup>18</sup> ခိမၩဝီၩၦမံဒအၫ့ဖိၪတၭ ကျီၪ့ခွံၬအဝ့ၫၥံၪဆံၭ.- အဂဲး ဘဲၫယီၩ အဝ့ၫၥံၪမၩခိမၩဝီၩနၥံၪ လၧအမၩအၧၩ့ဆၧ လၧအအၪ့လွ့ၫန့နၥံၪ လၧဆၧဘၪဆဲၫ့လၧပံအီၫ, ဒဲဆၧ ဘၪဆဲၫ့လၧမံဒအၫ့မုၪအၦဒိၪ အဖိၪမုၪနးကိဇဘံၫ, အ ဝ့ၫၥံၪအထၧၫ့ဖုဝဲမုၪ လၧအဘၪဆၧမၩၥံၫဝ့ၫ လၧဆၧ ၥံၫဖျဲၪအမုနံၩလဖၪ လၧပံအီၫအကၠီၩ့လီၫ."
		},
		"26": {
			"1": "<sup>1</sup> လၧဆၧၥံၫဖျဲၪအလးခဲၫ့နီၪ ဆၧမၩအၥၭ လၧယဟိ ဝၩချဲၩ့ဆၧလၧစမိစ့ၭ, ဒဲၦလုဆၧစအၫရၧၫ့ အဖိၪခွၫ",
			"2": "<sup>2</sup> စအံၫလအ့ဇၧၫလဂၩတၭ, စံၭဝ့ၫဒၪ,- ဝံထၪ့နၬထၪ့ၦ အံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့ထီးအလူၬ လၧအၥၭၡါ အနံၪ့နံၫဆံၫ, ဒဲနံၫဆံၫအဖၫ့ခိၪနီၪ ဘဲၫအဖါလဖၪအဂံၪ့ အၥိၭ, ကယဲၦလ့ၩဒုၭၥုၭၥ့ၪ လၧအံၫစရ့လၭ အဖၧၩ့",
			"3": "<sup>3</sup> နီၪဆံၭ.- စမိစ့ၭ ဒဲစအံၫလအ့ဇၧၫ ၦလုဆၧလဂၩနီၪ ချဲၩ့ထၪ့လၧအဝ့ၫၥံၪ လၧမိအၭအဆၧ ပျၩ့ဖၧၩ့ လၧ",
			"4": "<sup>4</sup> ယီၫဒၫ့အနဲၩ့ ဆဲၫဎၩ့လၧယ့ၫရခိၫတၭ, စံၭဝ့ၫဒၪ,- ၦ လၧအၥၭၡါအနံၪ့နံၫဆံၫ ဒဲနံၫဆံၫအဖၫ့ခိၪနီၪ, ဘဲၫယ ဟိဝၩမၪလူၬစမိစ့ၭ, ဒဲၦအံၫစရ့လၭဖိၪအၥိၭ လၧအ စဲၪ့ထၪ့ခွံၬလၧခးအံဇံၭနီၪလီၫ.",
			"5": "<sup>5</sup> စရုဘံၫ့အံၫစရ့လၭအဖိၪဝဲၡါယီၩး လၧစရုဘံၫ့အ ဖိၪခွၫမွဲစဟၫနီၭ, ၦဟၫနီၭအဂံၪ့ဖိၪလဒီၪ့း လၧစပၫလုၫ",
			"6": "<sup>6</sup> နီၪ,ၦပၫလုၫအဂံၪ့ဖိၪလဒီၪ့,- လၧစဟ့ဇရၧၫ့နီၪ, ၦဟ့ ဇရၧၫ့အဂံၪ့ဖိၪလဒီၪ့း လၧစကၫမဲၫနီၪ, ၦကၫမဲၫအဂံၪ့ဖိၪ",
			"7": "<sup>7</sup> လဒီၪ့လီၫ.- အနီၪမွဲၦရုဘံၫ့ဖိၪအဂံၪ့ဒီၪ့လဖၪ, ဒဲၦလၧ အဘၪဆၧဝံထၪ့နၬထၪ့လၧအကျၩနီၪ မွဲၦလံလၬၥၧၫ့",
			"8": "<sup>8</sup> ထီၫ့နွ့ၫယၩၥၧၫ့ဆံၫလီၫ.- တၭစပၫလုၫအဖိၪခွၫၥံၪမွဲစ",
			"9": "<sup>9</sup> အံၫလဲအၭ,- ဒဲစအံၫလဲအၭအဖိၪခွၫၥံၪနီၪ မွဲစန့ၫမၠႃၫ အ့လၭဒဲစဒၫၥၫ့, ဒဲစအဘဲရၫ့လီၫ. အဝ့ၫနီၪစဒၫၥၫ့,ဒဲစ အဘဲရၫ့လၧအမံၩ့ဂၧၫ့ထၪ့ၥၩလၩ့ လၧဆၧအီၪကီၪ့အ ကျၩလၧအထၪ့အဲၪ့လိၬဆိၭချဲၩ့လိၬ လၧစမိစ့ၭ, ဒဲစအၫ ရၧၫ့လၧစကိရၫအဆၧအီၪကီၪ့အကျၩ, အဆၧၫ့အထီ",
			"10": "<sup>10</sup> ထီးအထၪ့အဲၪ့လိၬဆိၭချဲၩ့လိၬ လၧယဟိဝၩလီၫ.- တၭ ထီးဆၧအီၪကီၪ့လဒီၪ့နီၪၥံၫ, ထီးမ့ၪအၪ့ခွံၬ ၦၡၩနံၫ ယၩယဲဆံၫတၭ, ဂၪ့ခိၪအၩ့ထၪ့အနိၭ ဒဲအၪ့ယုလၩ့ခွံၬ",
			"11": "<sup>11</sup> ဝ့ၫဒဲစကိရၫတၭ, ကဲၪထၪ့ဝ့ၫလၧဆၧမၩနဲၪ့လီၫ.- မွဲလါ နၫ့စကိရၫအဖိၪလဖၪ ၥံၫဝ့ၫအ့ၬ.",
			"12": "<sup>12</sup> စစံမအၧၫ့အဖိၪခွၫလဖၪ ဘဲၫအဝ့ၫၥံၪအဂံၪ့ဒီၪ့လဖၪ အၥိၭနီၪး လၧစန့ၫမၠႃၫအ့လၭနီၪ, ၦန့ၫမၠႃၫအ့လၭအ ဂံၪ့ဖိၪလဒီၪ့, လၧစယၫမံၫ့နီၪ, ၦယၫမံၫ့ အဂံၪ့ဖိၪလ",
			"13": "<sup>13</sup> ဒီၪ့းလၧစယၫကံၫ့နီၪ ၦယၫကံၫ့အဂံၪ့ဖိၪလဒီၪ့း- လၧ စဇံၫရၫနီၪ, ၦဇံၫရၫအဂံၪ့ဖိၪလဒီၪ့, လၧစၡၫအၧလၭ",
			"14": "<sup>14</sup> နီၪ, ၦၡၫအၧလၭ အဂံၪ့ဖိၪလဒီၪ့လီၫ.- အနီၪမွဲၦစံမ အၧၫ့ဖိၪ အဂံၪ့ဒီၪ့လဖၪလီၫ. ၦနံၫလၬနံၫ ထီၫ့နံၫယၩ အီၪဝ့ၫလီၫ.",
			"15": "<sup>15</sup> စဂၭအဖိၪခွၫလဖၪ ဘဲၫအဝ့ၫၥံၪအဂံၪ့ဒီၪ့လဖၪအၥိၭ နီၪ,လၧစဇံဖၧၫ့ဖိၪနီၪ, ၦဇံဖၧၫ့အဂံၪ့ဖိၪလဒီၪ့း လၧစ ဟၭဂဲၫနီၪ, ၦဟၭဂဲၫအဂံၪ့ဖိၪလဒီၪ့း လၧစရှုနဲၫနီၪ,",
			"16": "<sup>16</sup> ၦရှုနဲၫအဂံၪ့ဖိၪလဒီၪ့း- လၧစအီၭဇနဲၫနီၪ, ၦအီၭဇ နဲၫအဂံၪ့ဖိၪလဒီၪ့း လၧစအံရဲၫနီၪ, ၦအံရဲၫအဂံၪ့ဖိၪလ",
			"17": "<sup>17</sup> ဒီၪ့း- လၧစအရိဒံၫနီၪ, ၦအရိဒံၫအဂံၪ့ဖိၪလဒီၪ့း လၧ",
			"18": "<sup>18</sup> စအရံလဲၫနီၪ, ၦအရံလဲၫအဂံၪ့ဖိၪလဒီၪ့လီၫး- အနီၪ မွဲစဂၭအဖိၪခွၫၥံၪအဂံၪ့ဒီၪ့လဖၪ, ဘဲၫၦလၧအဘၪဆၧ ဝံထၪ့နၬထၪ့ဝ့ၫအၥိၭနီၪ, ၦလံလၬယဲယၩလီၫ.",
			"19": "<sup>19</sup> စယုဒၫအဖိၪခွၫၥံၪ မွဲစအံရၫဒဲစအိနၫ့နီၪလီၫ. တၭ စအံရၫဒဲစအိနၫ့နီၪ ၥံၫဝ့ၫလၧခးကၫနအၫ့အဖၧၩ့လီၫ.",
			"20": "<sup>20</sup> တၭစယုဒၫအဖိၪခွၫလဖၪ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪ အၥိၭ နီၪးလၧစၡံလၫနီၪ, ၦၡံလၫအဂံၪ့ဖိၪလဒီၪ့, လၧစဖၫ ရ့ၭနီၪ, ၦဖၫရ့ၭအဂံၪ့ဖိၪလဒီၪ့း လၧစဇံရၫနီၪၦဇံရၫ",
			"21": "<sup>21</sup> အဂံၪ့ဖိၪလဒီၪ့း တၭစဖၫရ့ၭအဖိၪခွၫလဖၪမွဲလၧစဟ့ ဇရၧၫ့နီၪ, ၦဟ့ဇရၧၫ့အဂံၪ့ဖိၪလဒီၪ့း လၧဟၫမလၭ",
			"22": "<sup>22</sup> နီၪၦဟၫမလၭအဂံၪ့ဖိၪလဒီၪ့လီၫ.- အနီၪမွဲစယုဒၫအ ဂံၪ့ဒီၪ့လဖၪ, ဘဲၫၦလၧအဘၪ ဆၧဝံထၪ့နၬထၪ့ဝ့ၫအ ၥိၭနီၪ, ၦနွ့ၫလၬဎူၫထီၫ့ယဲယၩလီၫ.",
			"23": "<sup>23</sup> စအံစခၫအဖိၪခွၫလဖၪ ဘဲၫအဝ့ၫၥံၪအဂံၪ့ဒီၪ့လဖၪ အၥိၭနီၪ, လၧစတိလၫနီၪ, ၦတိလၫအဂံၪ့ဖိၪလဒီၪ့း",
			"24": "<sup>24</sup> လၧစဖုအၫနီၪၦဖုအၫအဂံၪ့ဖိၪလဒီၪ့း- လၧစယၫၡၧၭ နီၪ, ၦယၫၡၧၭအဂံၪ့ဖိၪလဒီၪ့း လၧစၡံၭမရၧၫ့နီၪ, ၦ",
			"25": "<sup>25</sup> ၡံၭမရၧၫ့အဂံၪ့ဖိၪလဒီၪ့လီၫ.- အနီၪမွဲစအံၫစခၫအဂံၪ့ ဒီၪ့လဖၪဘဲၫၦလၧအဘၪ ဆၧဝံထၬနၬထၪ့ဝ့ၫအၥိၭနီၪ ၦဎူၫလၬလံထီၫ့ၥၧၫ့ယၩလီၫ.",
			"26": "<sup>26</sup> စဇ့ၭဘလၧၫ့အဖိၪခွၫလဖၪ ဘဲၫအဝ့ၫၥံၪအဂံၪ့ဒီၪ့လ ဖၪအၥိၭနီၪး လၧစစံရ့ၭနီၪ ၦစံရ့ၭအဂံၪ့ဖိၪ လဒီၪ့း လၧစအံလၧၫ့နီၪ, ၦအံလၧၫ့အဂံၪ့ဖိၪလဒီၪ့း လၧစယၫ",
			"27": "<sup>27</sup> လံလၭနီၪ, ၦယၫလံလၭအဂံၪ့ဖိၪလဒီၪ့လီၫ.- အနီၪမွဲ စဇ့ၭဘလၧၫ့အဖိၪၥံၪအဂံၪ့ဒီၪ့လဖၪ ဘဲၫၦလၧအဘၪ ဆၧဝံထၪ့နၬထၪ့ဝ့ၫအၥိၭနီၪ ၦဎူၫလၬယဲယၩလီၫ.",
			"28": "<sup>28</sup> တၭစယိၥၭအဖိၪခွၫလဖၪ ဘဲၫအဝ့ၫၥံၪအဂံၪ့ဒီၪ့လ",
			"29": "<sup>29</sup> ဖၪအၥိၭနီၪ, မွဲစမနၭစ့ၫဒဲစအံဖြံၫ့လီၫ.- စမနၭစ့ၫအဖိၪ ခွၫလဖၪနီၪ, လၧစမၫခဲၫနီၪ, ၦမၫခဲၫအဂံၪ့ဖိၪလဒီၪ့း တၭစမၫခဲၫနီၪထၪ့ဖိၪစဂံလအၭ, လၧစဂံလအၭနီၪ,ၦ",
			"30": "<sup>30</sup> ဂံလအၭအဂံၪ့ဖိၪလဒီၪ့း- အနီၪစဂံလအၭအဖိၪခွၫ, လၧစဇံစၧၫနီၪ, ၦဇံစၧၫအဂံၪ့ဖိၪလဒီၪ့း လၧစဟံလ့ၭ",
			"31": "<sup>31</sup> နီၪ,ၦဟံလ့ၭအဂံၪ့ဖိၪလဒီၪ့း- တၭလၧစအၫစြံၫအံလၭ နီၪ, ၦအၫစြံၫအံလၭအဂံၪ့ဖိၪလဒီၪ့း တၭလၧစၡ့ကံၫ့",
			"32": "<sup>32</sup> နီၪ,ၦရှ့ကံၫ့အဂံၪ့ဖိၪလဒီၪ့း- တၭလၧစၡမဲဒၫနီၪၦၡမဲ ဒၫအဂံၪ့ဖိၪလဒီၪ့း တၭလၧစဟံဖၧၫနီၪ, ၦဟံဖၧၫအဂံၪ့",
			"33": "<sup>33</sup> ဖိၪလဒီၪ့လီၫ.- တၭစဟံဖၧၫအဖိၪခွၫ စဇံၫလိဖဟၭနီၪ အဖိၪခွၫအီၪအ့ၬး အ့ၪမွဲအဖိၪမုၪၥံၪအီၪတၭ, စဇံၫ လိဖဟၭအဖိၪမုၪအမံၩ့နီၪမွဲနးမၫလၫ, ဒဲနးနိအၫ, ဒဲနး",
			"34": "<sup>34</sup> ဟီၭလၫ, ဒဲနးမံလကၫ, ဒဲနးတၧဇၫလီၫ.- အနီၪမွဲစမနၭ စ့ၫအဂံၪ့ဒီၪ့လဖၪတၭ, ၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧအကျၩနီၪမွဲၦယဲလၬနံၫထီၫ့နွ့ၫယၩလီၫ.",
			"35": "<sup>35</sup> အယီၩမွဲစအံဖြံၫ့အဖိၪခွၫလဖၪ ဘဲၫအဝ့ၫၥံၪအဂံၪ့ ဒီၪ့လဖၪအၥိၭနီၪး လၧစရှုၥလၫနီၪၦရှုၥလၫအဂံၪ့ဖိၪ လဒီၪ့,လၧစဘံခၧၫနီၪ, ၦဘံခၧၫအဂံၪ့ဖိၪလဒီၪ့း လၧ",
			"36": "<sup>36</sup> စတၫဟၫ့နီၪ, ၦတၫဟၫ့အဂံၪ့ဖိၪလဒီၪ့လီၫ.- အယီၩ မွဲစရှုၥလၫအဖိၪခွၫလဖၪ, လၧစအံရၫ့နီၪ, ၦအံရၫ့အ",
			"37": "<sup>37</sup> ဂံၪ့ဖိၪလဒီၪ့နီၪလီၫ.- အနီၪမွဲစအံဖြံၫ့အဖိၪခွၫၥံၪအဂံၪ့ ဒီၪ့လဖၪ, ဘဲၫၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧအ ကျၩအၥိၭနီၪ, ၦၥၧၫ့လၬနံၫထီၫ့ယဲယၩလီၫ. ၦလဖၪ နီၪမွဲစယိၥၭအဖိၪခွၫ ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪလီၫ.",
			"38": "<sup>38</sup> စဘံၪ့ယမံၫ့အဖိၪခွၫလဖၪ ဘဲၫအဝ့ၫၥံၪအဂံၪ့ဒီၪ့လ ဖၪအၥိၭနီၪ, လၧစဘံလၫနီၪ, ၦဘံလၫအဂံၪ့ဖိၪလဒီၪ့း လၧစအၭၡဘ့လၭနီၪ, ၦအၭၡဘ့လၭအဂံၪ့ဖိၪလဒီၪ့း",
			"39": "<sup>39</sup> လၧစအဟဲရၫ့နီၪ, ၦအဟဲရၫ့အဂံၪ့ဖိၪလဒီၪ့း- လၧစရှု ဖၫ့နီၪ, ၦရှုဖၫ့အဂံၪ့ဖိၪလဒီၪ့း လၧစဟုဖၫ့နီၪ, ၦဟုဖၫ့အ",
			"40": "<sup>40</sup> ဂံၪ့ဖိၪလဒီၪ့လီၫ.- တၭစဘံလၫအဖိၪခွၫနီၪ, မွဲစအၫ ဒၭဒဲစနၫအမၫ့လီၫ. လၧစအၫဒၭနီၪ, ၦအၫဒၭအဂံၪ့ ဖိၪလဒီၪ့, လၧစနၫအမၫ့နီၪၦနၫအမၫ့အဂံၪ့ဖိၪလဒီၪ့,",
			"41": "<sup>41</sup> အနီၪမွဲစဘံၪ့ယမံၫ့အဖိၪခွၫလဖၪ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪ အၥိၭနီၪ, တၭၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့လၧအကျၩ နီၪမွဲၦလံလၬယဲထီၫ့ဎူၫယၩလီၫ.",
			"42": "<sup>42</sup> အယီၩမွဲစဒၫ့အဖိၪခွၫလဖၪ ဘဲၫအဝ့ၫအဂံၪ့ဒီၪ့လဖၪ အၥိၭနီၪ, လၧစရှုဟၫ့နီၪ, ၦရှုဟၫ့အဂံၪ့ဖိၪလဒီၪ့လီၫ. အနီၪမွဲစဒၫ့အဒီၪ့, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪလီၫ.",
			"43": "<sup>43</sup> ၦရှုဟၫ့ဖိၪအဂံၪ့ဒီၪ့လဖၪထီးအလူၬ, ဘဲၫၦလၧအဘၪ ဆၧဝံထၪ့နၬထၪ့ဝ့ၫအၥိၭနီၪ, မွဲၦဎူၫလၬလံထီၫ့လံယၩ လီၫ.",
			"44": "<sup>44</sup> စအၭၡၧၫအဖိၪခွၫလဖၪ ဘဲၫအဝ့ၫၥံၪအဂံၪ့ဒီၪ့လဖၪ အၥိၭနီၪ, လၧစယံမနၫနီၪ, ၦယံမနၫအဂံၪ့ဖိၪလဒီၪ့,လၧ စယ့ၭရှုၫအဲၫနီၪ, ၦယ့ၭရှုၫအဲၫအဂံၪ့ဖိၪလဒီၪ့း လၧစ",
			"45": "<sup>45</sup> ဘရဲအၫနီၪ, ၦဘရဲအၫအဂံၪ့ဖိၪလဒီၪ့လီၫ.- လၧစဘရဲ အၫအဖိၪခွၫလဖၪနီၪ, လၧစဟံဘၧၫနီၪ, ၦဟံဘၧၫအ ဂံၪ့ဖိၪလဒီၪ့လၧစမၫလခံၫအ့လၭ အဂံၪ့ဖိၪလဒီၪ့လီၫ. တၭစအၭၡၧၫအဖိၪမုၪအမံၩ့ မွဲနးစၫရၫလီၫ.",
			"46": "<sup>46</sup> အ နီၪမွဲစအၭၡၧၫအဖိၪခွၫလဖၪ အဂံၪ့ဒီၪ့လဖၪ, ဘဲၫအ ဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫအၥိၭနီၪ, မွဲၦယဲလၬၥၧၫ့ထီၫ့ လံယၩလီၫ.",
			"48": "<sup>48</sup> စနၭၥလဲၫ အဖိၪခွၫလဖၪ ဘဲၫအဝ့ၫၥံၪအဂံၪ့ဒီၪ့လ ဖၪအၥိၭနီၪး လၧစယၫဇအ့လၭနီၪ, ၦယၫဇအ့လၭအ ဂံၪ့ဖိၪလဒီၪ့း လၧစဂုနဲၫနီၪ, ၦဂုနဲၫအဂံၪ့ဖိၪလဒီၪ့း",
			"49": "<sup>49</sup> လၧစယ့ဇၧၫနီၪ, ၦယ့ဇၧၫအဂံၪ့ဖိၪလဒီၪ့း လၧစၡံလံၫ့",
			"50": "<sup>50</sup> နီၪ,ၦၡံလံၫ့အဂံၪ့ဖိၪလဒီၪ့လီၫ.- အနီၪမွဲစနၭၥလဲၫအ ဂံၪ့ဒီၪ့လဖၪ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪ တၭၦလၧအ ဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ မွဲၦလံလၬယဲထီၫ့လံယၩလီၫ.",
			"51": "<sup>51</sup> ၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧၦအံၫစရ့လၭဖိၪ အကျၩနီၪ, မွဲၦဎူၫကုၬလထီၫ့နွ့ၫယၩၥၧၫ့ဆံၫလီၫ. ယဟိဝၩ ချဲၩ့ဆၧလၧ စမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,",
			"52": "<sup>52</sup> ခး လဘံၪ့နီၪ မိဘၪဆၧနၩ့ဖၭဝ့ၫ လၧၦလဖၪနီၪ အဆၧန့ ၥၫအဂး, ဘဲၫအမံၩ့အဆၧဝံထၪ့နၬထၪ့ဝ့ၫ အၥိၭနီၪ",
			"54": "<sup>54</sup> လီၫ.- လၧၦအၪဂၩနီၪ နမိဘၪဖ့ၪလၫ့ဆၧန့ၥၫလၧအ အၪ,ဒဲလၧၦအၡၩနီၪ နမိဘၪဖ့ၪလၫ့ဆၧန့ၥၫ လၧအၡၩ လဆံၭလီၫ. ဘဲၫၦဘၪဆၧဝံထၪ့ နၬထၪ့ဝ့ၫ လဖၪအ ဆၧဝံထၪ့နၬထၪ့အၥိၭနီၪ, မိဘၪဆၧဖ့ၪလၫ့ဝ့ၫလၧအ ဆၧန့ၥၫဆုၬဆုၬ ဘဲၫနီၪအၥိၭလီၫ.",
			"55": "<sup>55</sup> မွဲလါနၫ့ခးနီၪမိဘၪဆၧအၪ့နၩ့ဖၭဝ့ၫ လၧအဖၭဆၧ နီၪလီၫ. ဘဲၫအဖါအဒီၪ့လဖၪ အမံၩ့အၥိၭနီၪ မိန့ၥၫ",
			"56": "<sup>56</sup> ဆၧလီၫ.- ဘဲၫဆၧဖၭဝ့ၫအၥိၭနီၪ, အဆၧန့ၥၫမိဘၪ ဆၧအၪ့နၩ့ဖၭ လၧအၪဂၩအဆၧၫ့ ဘဲၫလၧၡၩဂၩအ ဆၧၫ့အၥိၭနီၪလီၫ.",
			"57": "<sup>57</sup> တၭအယီၩမွဲ ၦလၧအဘၪဆၧဝံထၪ့ နၬထၪ့ဝ့ၫလၧ ၦလံဝဲၫဖိၪအကျၩ, ဘဲၫအဂံၪ့ဒီၪ့လဖၪအၥိၭနီၪ, လၧ စဂၧၡၧၫ့, ၦဂၧၡၧၫ့အဂံၪ့ဖိၪလဒီၪ့း လၧစကိဟၭနီၪ, ၦကိဟၭအဂံၪ့ဖိၪလဒီၪ့, လၧစမရၫရဲၫနီၪ, ၦမရၫရဲၫ",
			"58": "<sup>58</sup> အဂံၪ့ဖိၪလဒီၪ့လီၫ.- အယီၩမွဲ ၦလံဝဲၫဖိၪ အဂံၪ့ဒီၪ့ လဖၪးၦလံဘနဲၫအဂံၪ့ဖိၪလဒီၪ့, ၦဟံဘြၧၫ့အဂံၪ့ဖိၪ လဒီၪ့, ၦမၫလံၫအဂံၪ့ဖိၪလဒီၪ့, ၦမုၡဲၫအဂံၪ့ဖိၪလ",
			"59": "<sup>59</sup> ဒီၪ့,ၦကိရၫအဂံၪ့ဖိၪလဒီၪ့လီၫ.- တၭစကိဟၭနီၪထၪ့ ဖိၪစအၫမရၫ့လီၫ. တၭစအၫမရၫ့အမၫအမံၩ့ မွဲနးယီၭ ကဘ့ၭ, စလံဝဲၫအဖိၪမုၪ လၧဆၧအီၪဖျဲၪဝ့ၫလၧစလံဝဲၫ အဂး လၧအံဇံၭအဖၧၩ့လီၫ. တၭလၧစအၫမရၫ့ အ ဂးနီၪမွဲအအီၪဖျဲၪန့စအၫရၧၫ့, ဒဲစမိစ့ၭ, ဒဲအထၧၫ့ဖုဝဲ",
			"60": "<sup>60</sup> မုၪနးမံရအၫ့လီၫ.- တၭလၧစအၫရၧၫ့အဂးနီၪ, ဆၧ အီၪဖျဲၪန့ဝ့ၫစနၫဒၭ ဒဲစအဘဲဟုၫ, ဒဲစအံၫလအ့ဇၧၫ,",
			"61": "<sup>61</sup> ဒဲစအံၥမၫလီၫ.- တၭစနၫဒၭဒဲစအဘဲဟုၫ,ထီးအမၩ ဘိၪ့မ့ၪလၩ့မဲၩဒၪဆၧ လၧယဟိဝၩအမ့ၬယၫတၭ, ၥံၫ",
			"62": "<sup>62</sup> ဝ့ၫလီၫ.- တၭၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧအ ကျၩနီၪ, မွဲၦနံၫလၬၥၧၫ့ထီၫ့လီၫ. ၦထီးအလူၬနီၪ, မွဲၦ ခွၫလၧအအီၪလၩလဘံၪ့, ဒဲလၩလဘံၪ့အဖၫ့ခိၪလီၫ. အဂဲးဘဲၫယီၩ မွဲအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧအံၫစရ့ လၭဖိၪအကျၩအ့ၬ. အဂဲးဘဲၫယီၩ ဆၧဖ့ၪလၫ့ဝ့ၫလၧ ဆၧန့ၥၫလၧၦအံၫစရ့လၭဖိၪ အကျၩနးမံၩ့အ့ၬ.",
			"63": "<sup>63</sup> ၦလဖၪနီၪ မွဲၦလၧအဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫ လၧ စမိစ့ၭ, ဒဲၦလုဆၧစအံၫလအ့ဇၧၫ, လၧအဝံထၪ့နၬထၪ့ ၦအံၫစရ့လၭဖိၪလၧမိအၭအဆၧပျၩ့ဖၧၩ့ လၧထံၫယီၫ",
			"64": "<sup>64</sup> ဒၫ့အနဲၩ့ဆဲၫဎၩ့လၧယ့ၫရခိၫလီၫ.- မွဲလါနၫ့လၧၦလၧ စမိစ့ၭ, ဒဲၦလုဆၧလဂၩစအၫရၧၫ့ ဝံထၪ့နၬထၪ့ဝ့ၫအ ကျၩနီၪ, ၦလၧအဝံထၪ့ဝ့ၫလၧၦအံၫစရ့လၭဖိၪအကျၩ",
			"65": "<sup>65</sup> ထီးၡါမုနၧၫ့ဖၫစဲနၫနီၪအီၪနးဂၩအ့ၬ.- အဂဲးဘဲၫယီၩ ယဟိဝၩစံၭယူၭ ဆၧလၧအဂဲးနီၪအဝ့ၫၥံၪ မိၥံၫတၡါ လၧၡါမုနၧၫ့ဖၫလီၫ. တၭအီၪလၩ့ထးဘၪနးဂၩအ့ၬ. အီၪလၩ့ထးန့ၫစယဖၧၫနံၫအဖိၪခွၫ စကၫလ့ၭ, ဒဲစနိၫ့ အဖိၪခွၫစယီရှုၫအ့ၫလီၫ."
		},
		"27": {
			"1": "<sup>1</sup> တၭစမနၭစ့ၫအဖိၪခွၫ, စမၫခၧၫအဖိၪခွၫ, စဂံလအၭ အဖိၪခွၫ, စဟ့ဖၧၫအဖိၪခွၫ, စဇံၫလိဖဟၭအဖိၪမုၪ လဖၪအီၪလၧစယိၥၭ အဖိၪခွၫ စမနၭစ့ၫအဂံၪ့ဒီၪ့လ ဖၪအကျၩနီၪ, ဂဲၫဝ့ၫလီၫ. အယီၩမွဲအဖိၪမုၪလဖၪ အမံၩ့,နးမၫလၫ, နးနိလၫ, ဒဲနးဟီၭလၫ, ဒဲနးမံလကၫ,",
			"2": "<sup>2</sup> ဒဲနးတၧဇၫလီၫ.- တၭအဝ့ၫၥံၪဆၧၫ့ထုၪ့ဝ့ၫလၧစမိစ့ၭ အမ့ၬယၫ, ဒဲလၧၦလုဆၧလဂၩ စအံၫလအ့ဇၧၫအမ့ၬ ယၫ, ဒဲလၧၦဒိၪလဖၪ, ဒဲဆၧအီၪကီၪ့ထီးအလူၬအမ့ၬ ယၫထီးဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪ အတရၫ့နီၪတၭ,",
			"3": "<sup>3</sup> စံၭဝ့ၫဒၪ,- ပဖါလဂၩနီၪ ၥံၫဝ့ၫလၧၡါမုနၧၫ့ဖၫတၭ, အီၪ လၧၦလၧအအီၪကိၩ့အီၪကီၪ့ ထၫ့ဒုၪဒၩဘၪယဟိဝၩ အကျၩလၧကိရၫအဆၧအီၪကီၪ့အဖၧၩ့အ့ၬး မွဲအၥံၫ ဝ့ၫလၧအဆၧ ဒဲၩဘၭဒၪဝ့ၫအဖၧၩ့တၭ, အဖိၪခွၫၥံၪ",
			"4": "<sup>4</sup> အီၪအ့ၬး- မွဲပဖါအဖိၪခွၫလအီၪဘၪအကၠီၩ့တၭ, အ မံၩ့မိဘၪဆၧထူၭခွံၬဝ့ၫ လၧအၦၡၩဒီၪ့ဖိၪအကျၩနီၪ မွဲဘၪလဲၪ. ဖ့ၪလၫ့ပၧၩလၧဆၧန့ၥၫ လၧပထၧၫ့ဖုဝဲအ",
			"5": "<sup>5</sup> ကျၩနီၪဆံၭ.- တၭစမိစ့ၭဒုၭဂဲၫအဝ့ၫၥံၪ အမူၭနီၪလၧ",
			"6": "<sup>6</sup> ယဟိဝၩအမ့ၬယၫလီၫ.- ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ",
			"7": "<sup>7</sup> တၭစံၭဝ့ၫဒၪ,- စဇံၫလိဖဟၭအဖိၪမုၪလဖၪနီၪ ချဲၩ့ဆၧ တီၩတီၩလီၫ. နမိဘၪဖ့ၪလၫ့အဝ့ၫၥံၪ လၧဆၧန့ၥၫလၧ အဖါအထၧၫ့ဖုဝဲအကျၩနီၪတၡါတၭ, နမိဘၪဒုၭန့ဘၪ",
			"8": "<sup>8</sup> အဝ့ၫၥံၪလၧအဖါအဆၧန့ၥၫနီၪလီၫ.- တၭနဘၪချဲၩ့ ဆၧလၧၦအံၫစရ့လၭဖိၪတၭ, စံၭ,ၦလဂၩဂၩအ့ၪၥံၫထီး အဖိၪခွၫလအီၪဘၪနီၪ, နၥံၪဘၪဒုၭန့ၥၫ လၧအဖိၪမုၪ",
			"9": "<sup>9</sup> လီၫ.- တၭအဖိၪမုၪအ့ၪလအီၪဘၪနီၪ ထီးနီၪလဖၧၫ့န",
			"10": "<sup>10</sup> ၥံၪဘၪဖ့ၪလၫ့အဆၧန့ၥၫနီၪ လၧအထၧၫ့ဖုဝဲလီၫ.- အ ထၧၫ့ဖုဝဲအ့ၪလအီၪဘၪတၭ, နၥံၪဘၪဖ့ၪလၫ့အဆၧန့",
			"11": "<sup>11</sup> ၥၫနီၪလၧအဖါအထၧၫ့ဖုဝဲလီၫ.- တၭအဖါအထၧၫ့ဖုဝဲ အ့ၪလအီၪဘၪနီၪ နၥံၪဘၪဖ့ၪလၫ့အဆၧန့ၥၫ လၧအ ဘူၭအထံးလၧအဘူၭထုၬ လၧအဂံၪ့ဒီၪ့ဖိၪအကျၩတၭ, အဝ့ၫဒၪမိန့ၥၫဝ့ၫလီၫ. တၭအနီၪမိကဲၪထၪ့ဆၧစ့ၩရၫ့ အၥနိၫလၧၦအံၫစရ့လၭဖိၪအဂး ဘဲၫယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪလီၫ.",
			"12": "<sup>12</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, လ့ၩထၪ့လၧခိၪလီၩ့အၭဘ ရံၫ့နီၪ ဒဲယိဘၪခးလဘံၪ့လၧယဖ့ၪလၫ့ ၦအံၫစရ့လၭ",
			"13": "<sup>13</sup> ဖိၪနီၪဆံၭ.- ထီးနအ့ၪဒၪဘၪဂီၩ့တၭ, နမိဘၪဆၧအီၪ က့ၪကီၪ့နၧၩလၧနၡၩခမျၧး, ဘဲၫနထၧၫ့ဖုဝဲ စအၫရၧၫ့",
			"14": "<sup>14</sup> ဘၪဆၧအီၪက့ၪကီၪ့ဝ့ၫအၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩန ၥံၪပိၩ့ထၪ့ယဆၧမၪလူၬ လၧၡါမုနၧၫ့ဖၫဇံၫ့အဖၧၩ့လၧ ဆၧအီၪကီၪ့အတုၩ့ထၪ့တုၩ့လၩ့အဖၧၩ့ ထီးနၥံၪအီၪ က့ၪဆံၫ့ဎံၪယၧၩ အလးအီၪ လၧအဝ့ၫၥံၪ အမ့ၬယၫ ထီးထံၫနဲၩ့နီၪလီၫ. အဝ့ၫနီၪမွဲမ့ရဘၫ အထံၫလၧကၫ ဒ့ၭအဖၧၩ့လၧၡါမုနၧၫ့ဖၫဇံၫ့လီၫ. စမိစ့ၭချဲၩ့ဆၧလၧယဟိဝၩတၭ, စံၭဝ့ၫဒၪ,",
			"15": "<sup>15</sup> မွဲယ ဟိဝၩ, ဆၧယၪအၥၭထီးအလူၬ အယွၩနီၪ အီၪက့ၪၦ",
			"17": "<sup>17</sup> လဂၩလၧဆၧအီၪကီၪ့အဖၫ့ခိၪဆံၭ.- ၦလၧအမိလ့ၩ ထၪ့လၧအဝ့ၫၥံၪအမ့ၬယၫ, ဒဲလၧအမိဂဲၫနုၬ လၧအဝ့ၫ ၥံၪအမ့ၬယၫ, ဒဲလၧအမိဒုၭလ့ၩထၪ့အဝ့ၫၥံၪ, ဒဲလၧအ မိဒုၭနုၬအဝ့ၫၥံၪနီၪဆံၭး အဂဲးဘဲၫယီၩ ဘဲၫၥိၭယဟိ ဝၩအဆၧအီၪကီၪ့ ထီးမၩအၥၭ ဘဲၫၥိၪလၧၦယိဝ့ၫလ အီၪဘၪအၥိၭနီၪလဂ့ၩ.",
			"18": "<sup>18</sup> တၭယဟိဝၩစံၭစမိစ့ၭ, မၩန့စနိၫ့အဖိၪခွၫစယီရှုၫ အ့ၫၦလၧၥၭနီၪအီၪလၧအဖၧၩ့တၭ, အီၪက့ၪနစူၪလၧ",
			"19": "<sup>19</sup> အလီၩ့,- တၭအီၪက့ၪအဝ့ၫ လၧၦလုဆၧစအံၫလအ့ ဇၧၫလဂၩအမ့ၬယၫ, ဒဲလၧဆၧအီၪကီၪ့ထီးအလူၬအ မ့ၬယၫတၭ, မၪလူၬဝ့ၫလၧအဝ့ၫၥံၪအမ့ၬယၫနီၪဆံၭ.",
			"20": "<sup>20</sup> တၭနဘၪအီၪက့ၪနလၩနဖၩ့ လၧအလီၩ့, ဘဲၫၥိၭၦအံၫ စရ့လၭဖိၪ အဆၧအီၪကီၪ့ထီးအလူၬ မိခိၭနၪဝ့ၫလီၫ.",
			"21": "<sup>21</sup> တၭအဝ့ၫဒၪမိဘၪဆၧၫ့ထုၪ့ လၧၦလုဆၧစအံၫလအ့ ဇၧၫလဂၩအမ့ၬယၫ ဘဲၫၥိၭအဝ့ၫနီၪမိအၪ့ကံၩ့ ဆၧလၧ အဂး ဘဲၫဆၧစ့ၩရၫ့ဘၪဆဲၫ့ လၧယုရံၫ့ ဒဲၥုၪ့မံၫ့အၥိၭ, လၧယဟိဝၩအမ့ၬယၫလီၫ. ထီးအဝ့ၫဒၪအလူအီၪဝ့ၫ နီၪ,အဝ့ၫၥံၪမိလ့ၩထၪ့, ဒဲထီးအဝ့ၫဒၪအလူအီၪဝ့ၫနီၪ, မိဘၪဂဲၫနုၬး အဝ့ၫဒၪ, ဒဲၦအံၫစရ့လၭဖိၪထီးအလူၬ အီၪလၧအၥိၭၦအီၪကီၪ့ဖိၪထီးအလူၬလီၫ.",
			"22": "<sup>22</sup> စမိစ့ၭမၩဝ့ၫဘဲၫယဟိဝၩ မၪလူၬဝ့ၫအၥိၭနီၪတၭ, မၩန့စယီရှုၫအ့ၫတၭ, အီၪက့ၪဝ့ၫလၧၦလုဆၧစအံၫလ",
			"23": "<sup>23</sup> အ့ဇၧၫအမ့ၬယၫ,- ဒဲလၧဆၧအီၪကီၪ့ ထီးအလူၬအမ့ၬ ယၫတၭ, အီၪက့ၪအစူၪလၧအလီၩ့တၭ, မၪလူၬဝ့ၫဘဲၫ ယဟိဝၩမၪလူၬဆၧ လၧစမိစ့ၭအစူၪဖၧၩ့အၥိၭနီၪလီၫ."
		},
		"28": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, မၪလူၬ ၦအံၫစရ့လၭဖိၪတၭ စံၭအဝ့ၫၥံၪ, ယဆၧမၩဘိၪ့ယ ဆၧအၪ့လၧယဆၧလုမ့ၪအဂးလၧဆၧနၧၫ့မၧၫ့မုၬလၧ ယဂးနီၪ, နၥံၪဘၪထီးလၩ့နၥံၪအၥၭ မၩဘိၪ့ဝ့ၫလၧ အဆၧၫ့အထီဒၪဝ့ၫလီၫ.",
			"3": "<sup>3</sup> တၭနဘၪစံၭအဝ့ၫၥံၪ, အယီၩမွဲဆၧလုမ့ၪလၧနၥံၪ ဘၪမၩဘိၪ့ယဟိဝၩနီၪ, ၥိၪလနံၪ့ဖိၪ အလၧၫ့အဎွ့ၩ နံၫဒုၩ, လနံၩဘၪလနံၩ, ဆၧလုမ့ၪလထံၪဎးဘီၩ့ဎး",
			"4": "<sup>4</sup> လီၫ.- ၥိၪဖိၪလဒုၩနီၪ နဘၪလုထၪ့ဝ့ၫလၧဂီၩလခီၫ,ဒဲ ၥိၪဖိၪနံၫဒုၩလဒုၩနီၪ နဘၪလုထၪ့လၧမုဂၪလၩ့လခီၫ,",
			"5": "<sup>5</sup> ဒဲကိၪမုၬလအ့ဖၭ ဆံၫပိၩ့လပိၩ့ လၧဆၧလုမၩဘိၪ့ ကိၪမုၬအဂးလဲၩဎုၬ လၧၥိၪ ထီးအၥၭလဟံၫ့လံပိၩ့လ",
			"6": "<sup>6</sup> ပိၩ့,- မွဲဆၧလုမ့ၪလထံၪဎးဘီၩ့ဎး လၧဆၧစ့ၩရၫ့လၧ ခိၪလီၩ့စဲနၫအလီၩ့, လၧဆၧနၧၫ့မၧၫ့မုၬအဂး, ဆၧလု",
			"7": "<sup>7</sup> မ့ၪလၧယဟိဝၩအဂးလီၫ.- တၭဆၧလုအီၩနီၪမွဲဆၧ လဟံၫ့လံပိၩ့လပိၩ့ လၧၥိၪဖိၪလဒုၩအဂးလီၫ. လၧဆၧ အလးဆံၫ့ဎံၪအဖၧၩ့နီၪ, နဘၪအၪ့မၧၫ့ၦၡၩ ဂါလၩ့စ ဘံၭထံၫဂ့ၩထုၬဆၧလုအီၩ, လၧယဟိဝၩအဂးလီၫ.",
			"8": "<sup>8</sup> တၭၥိၪနံၫဒုၩလဒုၩနီၪ နဘၪလုထၪ့လၧမုဂၪလၩ့နီၪး ဘဲၫဆၧမၩဘိၪ့ကိၪမုၬ လၧဂီၩလခီၫအၥိၭ, ဒဲဘဲၫဆၧ လုအီၩအၥိၭနီၪ, နဘၪမၩဘိၪ့ဝ့ၫ, ဆၧလုမ့ၪဘၪဆဲၫ့ လၧဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩအဂးလီၫ.",
			"9": "<sup>9</sup> တၭလၧမးၥံၫအနံၩနီၪ ၥိၪလနံၪ့ဖိၪအလၧၫ့အဎွ့ၩနံၫ ဒုၩ, ဒဲကိၪမုၬနံၫအ့စရိၫ လၧဆၧမၩဘိၪ့ကိၪမုၬအဂး",
			"10": "<sup>10</sup> လဲၩဎုၬလၧၥိၪ, ဒဲအဆၧလုအီၩလီၫ.- လၧဆၧလုမ့ၪလ ထံၪဎးဘီၩ့ဎး ဒဲအဆၧလုအီၩအဖၫ့ခိၪနီၪ, အယီၩမွဲ ဆၧလုမ့ၪကိၭမးၥံၫအနံၩဒ့ၭ အီၪဝ့ၫလီၫ.",
			"11": "<sup>11</sup> တၭလၧနၥံၪအလၩအခၪ့ထံၭလဖၪနီၪ နၥံၪမၩဘိၪ့ ယဟိဝၩလၧဆၧလုမ့ၪ, ချီဖၫဖိၪနံၫဒုၩ, ဒဲၥိၪဖၫလဒုၩ,",
			"12": "<sup>12</sup> ဒဲၥိၪလနံၪ့ဖိၪအလၧၫ့အဎွ့ၩနွ့ၫဒုၩ,- ကိၪမုၬၥၧၫ့အ့စ ရိၫ,ဆၧမၩဘိၪ့ကိၪမုၬလဲၩဎုၬ လၧၥိၪလၧချီဖၫလဒုၩ အဂး,ဒဲကိၪမုၬနံၫအ့စရိၫ ဆၧမၩဘိၪ့ကိၪမုၬလဲၩဎုၬ",
			"13": "<sup>13</sup> လၧၥိၪလၧၥိၪဖၫလဒုၩအဂးလီၫ.- ဒဲကိၪမုၬလအ့စရိၫ လဲၩဎုၬလၧၥိၪ, ဆၧမၩဘိၪ့ကိၪမုၬ လၧၥိၪဖိၪလဒုၩအ ဂး,ဆၧလုမ့ၪ, ဆၧနၧၫ့မၧၫ့မုၬဆၧလုမၩ လၧမ့ၪလၧ",
			"14": "<sup>14</sup> ယဟိဝၩအဂးလီၫ.- တၭအဆၧလုအီၩနီၪ မွဲစဘံၭ ထံၫဖိၭဖၫ့ဟံၫ့လၧချီဖၫလဒုၩအဂးတၭး လဟံၫ့ၥၧၫ့ ပိၩ့လပိၩ့လၧၥိၪဖၫလဒုၩအဂး, ဒဲလဟံၫ့လံပိၩ့လပိၩ့ လၧၥိၪဖိၪလဒုၩအဂးလီၫ. အနီၪမွဲဆၧလုမ့ၪ လၧလၩ လဘံၪ့ဘၪလဘံၪ့အဂး, လၧလၩလဖၪ လၧလနံၪ့အ",
			"15": "<sup>15</sup> ထးဖၧၩ့နီၪအဂးလီၫ.- တၭလၧဆၧလုလထံၪဎးဘီၩ့ဎး ဒဲအဆၧလုအီၩအဖၫ့ခိၪနီၪ, ဘ့ၪဖိၪလဒုၩမိဘၪဆၧလု ထၪ့ဝ့ၫလၧဆၧလုဆၧဒဲၩဘၭအဂးလီၫ.",
			"16": "<sup>16</sup> တၭလၩခၪ့ထံၭ လၩထၪ့လဆံၫလံနံၩလနံၩနီၪမွဲ",
			"17": "<sup>17</sup> ယဟိဝၩအဆၧလ့ၩဖၬလီၫ.- တၭလၩထၪ့လဆံၫယဲ နံၩလနံၩနီၪဆၧမၩဘိၪ့ဝ့ၫး ၦဘၪအၪ့ကိၪလအီၪဘၪ",
			"18": "<sup>18</sup> လၧမံၪနွ့ၫနံၩလီၫ.- မုခၪ့ထံၭလနံၩနီၪ မွဲဆၧကိၭကီၪ့ ဆံၫ့ဎံၪလီၫ. နၥံၪမၩဘၪဆၧအဎီးအၡၩ အဆၧနးမံၩ့",
			"19": "<sup>19</sup> အ့ၬ.- နၥံၪဘၪမၩဘိၪ့ဆၧလုမၩလၧမ့ၪ, ဆၧလုမ့ၪလၧ ယဟိဝၩအဂး, ချီဖၫဖိၪနံၫဒုၩ, ဒဲၥိၪဖၫလဒုၩ, ဒဲၥိၪလ နံၪ့ဖိၪနွ့ၫဒုၩတၭ, အဝ့ၫၥံၪမိဘၪအီၪလၧဆၧအလၧၫ့အ",
			"20": "<sup>20</sup> ဎွ့ၩလၧနၥံၪအဂးလီၫ.- တၭအဆၧမၩဘိၪ့ကိၪမုၬနီၪ, မွဲကိၪမုၬလဲၩဎုၬလၧၥိၪလီၫ. ၥၧၫ့အ့စရိၫလၧနၥံၪဘၪ မၩဘိၪ့လၧချီဖၫလဒုၩအဂး, နံၫအ့စရိၫလၧၥိၪဖၫလ",
			"21": "<sup>21</sup> ဒုၩအဂးလီၫ.- လအ့စရိၫလၧၥိၪဖိၪလဒုၩအဂးနီၪန",
			"22": "<sup>22</sup> မိဘၪမၩဘိၪ့လၧၥိၪဖိၪနွ့ၫဒုၩအဂးဆုၬဆုၬ,- တၭဘ့ၪ လဒုၩလၧဆၧလုဆၧဒဲၩဘၭအဂး ဘဲၫၥိၭအမိမၩဆၧ",
			"23": "<sup>23</sup> ဖီၩ့ဖျ့ၭလၧနၥံၪအဂးလီၫ.- လၧဆၧလုမ့ၪလၧဂီၩလခီၫ လၧအမွဲဆၧလုမ့ၪလထံၪဎးလဘီၩ့ဎး အမ့ၬယၫနီၪ,န",
			"24": "<sup>24</sup> ၥံၪဘၪမၩဘိၪ့ဆၧလဖၪနီၪလီၫ.- ဘဲၫဆၧလဖၪအၥိၭ နီၪနၥံၪဘၪမၩၥံၫ့ၥံၫ့နံၩနွ့ၫနံၩယၫနီၪ ဆၧလုမ့ၪအဆၧ အၪ့ဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩအဂးလီၫ. လၧဆၧလု မ့ၪလထံၪဎးဒဲအဆၧလုအီၩအဖၫ့ခိၪနီၪ, နၥံၪဘၪမၩ",
			"25": "<sup>25</sup> ဘိၪ့ဝ့ၫလီၫ.- တၭနွ့ၫနံၩလနံၩနီၪ နၥံၪဘၪအီၪလၧဆၧ ကိၭကီၪ့ဆံၫ့ဎံၪလီၫ. နၥံၪမၩဘၪဆၧ အဎီးအၡၩအ ဆၧမၩနးမံၩ့အ့ၬ.",
			"26": "<sup>26</sup> တၭထီးနၥံၪမၩဘိၪ့ယဟိဝၩ လၧဆၧအၥၫ့, လၧန ၥံၪအဆၧနွ့ၫလဖၪအဖၧၩ့ လၧၥၪဆိၫအမုနံၩနီၪနၥံၪမိ ဘၪအီၪလၧဆၧကိၭကီၪ့ဆံၫ့ဎံၪလီၫ. နၥံၪမၩဘၪဆၧ",
			"27": "<sup>27</sup> အဎီးအၡၩအဆၧမၩနးမံၩ့အ့ၬ.- တၭနၥံၪဘၪမၩဘိၪ့ ဆၧလုမ့ၪ, လၧဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩအဂးချီဖၫ",
			"28": "<sup>28</sup> ဖိၪနံၫဒုၩ, ၥိၪဖၫလဒုၩ, ၥိၪလနံၪ့ဖိၪနွ့ၫဒုၩ,- ဒဲအဆၧ မၩဘိၪ့ကိၪမုၬ, အီၪလၧကိၪမုၬလဲၩဎုၬလၧၥိၪ, ၥၧၫ့အ့ စရိၫလၧချီဖိၪလဒုၩအဂး, နံၫအ့စရိၫလၧၥိၪဖၫလဒုၩ",
			"29": "<sup>29</sup> အဂး,- လအ့စရိၫလၧၥိၪဖိၪလဒုၩအဂး, လၧၥိၪဖိၪ",
			"30": "<sup>30</sup> နွ့ၫဒုၩအဂးဆုၬဆုၬ,- ဒဲဘ့ၪဖိၪလဒုၩ, ဘဲၫၥိၭအမိမၩ",
			"31": "<sup>31</sup> ဆၧဖီၩ့ဖျ့ၭလၧနၥံၪအဂးလီၫ.- တၭလၧဆၧလုမ့ၪလ ထံၪဎးဘီၩ့ဎးဒဲအဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲအဆၧလုအီၩ အဖၫ့ခိၪနီၪ, နၥံၪဘၪမၩဘိၪ့ဆၧနီၪလဖၪတၭ, ဘၪအီၪ အလၧၫ့အဎွ့ၩလၧနၥံၪအဂးလီၫ."
		},
		"29": {
			"1": "<sup>1</sup> တၭလၩနွ့ၫဘံၪ့လဘံၪ့လၩထၪ့လနံၩနီၪ နၥံၪဘၪ အီၪလၧဆၧအီၪကီၪ့ဆံၫ့ဎံၪလီၫ. နၥံၪမၩဘၪဆၧအဎီး အၡၩအဆၧမၩ နးမံၩ့အ့ၬ. မွဲမုအူၪထၪ့ခွ့ၩလဖၪအ",
			"2": "<sup>2</sup> နံၩလနံၩလၧနၥံၪအဂးလီၫ.- တၭနၥံၪဘၪလုထၪ့ဆၧ လုမ့ၪလၧဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩအဂး, ချီဖၫဖိၪလ ဒုၩ, ၥိၪဖၫလဒုၩ, ၥိၪလနံၪ့ဖိၪအလၧၫ့အဎွ့ၩ နွ့ၫဒုၩ,",
			"3": "<sup>3</sup> ဒဲအဆၧမၩဘိၪ့ကိၪမုၬလဲၩဎုၬ လၧၥိၪ, ၥၧၫ့အ့စရိၫလၧ ချီဖၫလဒုၩအဂး, နံၫအ့စရိၫလၧၥိၪဖၫလဒုၩအဂး,",
			"4": "<sup>4</sup> ဒဲလအ့စရိၫလၧၥိၪဖိၪလဒုၩအဂး လၧၥိၪဖိၪနွ့ၫဒုၩအ",
			"5": "<sup>5</sup> ဂးဆုၬဆုၬ,- ဒဲဘ့ၪဖိၪလဒုၩ လၧဆၧလုဆၧဒဲၩဘၭအ",
			"6": "<sup>6</sup> ဂး,ဘဲၫၥိၭအမိမၩဆၧဖီၩ့ဖျ့ၭ လၧနၥံၪအဂးလီၫ.- လၧ နီၪအဖၫ့ခိၪလၩလဘံၪ့နီၪ အဆၧလုမ့ၪ, ဒဲအဆၧမၩ ဘိၪ့ကိၪမုၬ, ဒဲဆၧလုမ့ၪလထံၪဎးဘီၩ့ဎး, ဒဲအဆၧမၩ ဘိၪ့ကိၪမုၬ, ဒဲအဆၧလုအီၩလဖၪ, ဘဲၫဆၧစ့ၩရၫ့အၥိၭ, လၧဆၧနၧၫ့မၧၫ့မုၬအဂး, ဆၧလုမ့ၪလၧ ယဟိဝၩအဂးလီၫ.",
			"7": "<sup>7</sup> တၭလၩနွ့ၫဘံၪ့လဘံၪ့ လၩထၪ့ဆံၫနံၩနီၪ နၥံၪဘၪ အီၪလၧဆၧကိၭကီၪ့ဆံၫ့ဎံၪတၭ, နၥံၪဘၪဆၪ့လၩ့နၥံၪ အၥၭလီၫ. နၥံၪမၩဘၪဆၧအဎီးအၡၩ အဆၧမၩနး",
			"8": "<sup>8</sup> မံၩ့အ့ၬ.- နၥံၪဘၪမၩဘိၪ့ယဟိဝၩလၧဆၧလုမ့ၪ, ဆၧ နၧၫ့မၧၫ့မုၬ, ချီဖၫဖိၪလဒုၩ, ၥိၪလနံၪ့ဖိၪနွ့ၫဒုၩ, ဘၪ",
			"9": "<sup>9</sup> အီၪအလၧၫ့အဎွ့ၩလၧနၥံၪအဂး,- ဒဲအဆၧမၩဘိၪ့ကိၪ မုၬ, ကိၪမုၬလဲၩဎုၬလၧၥိၪၥၧၫ့အ့စရိၫ လၧချီဖၫလဒုၩ",
			"10": "<sup>10</sup> အဂး, နံၫအ့စရိၫလၧၥိၪဖၫလဒုၩအဂး,- လအ့စရိၫ လၧၥိၪဖိၪလဒုၩအဂး, လၧၥိၪဖိၪနွ့ၫဒုၩအဂးဆုၬဆုၬ,",
			"11": "<sup>11</sup> ဘ့ၪဖိၪလဒုၩလၧဆၧလု ဆၧဒဲၩဘၭအဂးလီၫ. လၧနီၪ အဖၫ့ခိၪဆၧ မၩဖီၩ့ဖျ့ၭအဆၧလုဆၧဒဲၩဘၭ, ဒဲဆၧ လုမ့ၪလထံၪဎး, ဒဲအဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲအဆၧလု အီၩအီၪဝ့ၫလီၫ.",
			"12": "<sup>12</sup> တၭလၩနွ့ၫဘံၪ့လဘံၪ့ လဆံၫယဲနံၩလနံၩနီၪ နၥံၪ ဘၪအီၪလၧဆၧကိၭကီၪ့ဆံၫ့ဎံၪလီၫ. နၥံၪမၩဘၪဆၧ အဎီးအၡၩအဆၧမၩနးမံၩ့အ့ၬ. တၭနၥံၪဘၪမၩဘိၪ့",
			"13": "<sup>13</sup> ဆၧလၧယဟိဝၩနွ့ၫနံၩလီၫ.- တၭနၥံၪဘၪမၩဘိၪ့ဆၧ လုမ့ၪ, ဆၧလုလၧမ့ၪအဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩ အဂး, ချီဖၫဖိၪလဆံၫၥၧၫ့ဒုၩ, ၥိၪဖၫနံၫဒုၩ, ၥိၪလနံၪ့ဖိၪ",
			"14": "<sup>14</sup> လဆံၫလံဒုၩ, ဘၪအီၪအလၧၫ့အဎွ့ၩ,- ဒဲအဆၧမၩ ဘိၪ့ကိၪမုၬ, ကိၪမုၬလဲၩဎုၬလၧၥိၪၥၧၫ့အ့စရိၫ လၧချီ ဖၫလဒုၩအဂး လၧချီဖၫလဆံၫၥၧၫ့ဒုၩအဂးဆုၬဆုၬ, နံၫအ့စရိၫလၧၥိၪဖၫလဒုၩအဂး, လၧၥိၪဖၫနံၫဒုၩအ",
			"15": "<sup>15</sup> ဂးဆုၬဆုၬ,- ဒဲလအ့စရိၫလၧၥိၪဖိၪလဒုၩအဂး လၧ",
			"16": "<sup>16</sup> ၥိၪဖိၪလဆံၫလံဒုၩအဂးဆုၬဆုၬ,- ဒဲဘ့ၪဖိၪလဒုၩလၧ ဆၧလုဆၧဒဲၩဘၭအဂးလီၫ. လၧနီၪအဖၫ့ခိၪဆၧလုမ့ၪ လထံၪဎးဘီၩ့ဎးအဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲအဆၧလုအီၩ နီၪအီၪဝ့ၫလီၫ.",
			"17": "<sup>17</sup> တၭလၧမုနံၫနံၩလနံၩနီၪ, ချီဖၫဖိၪလဆံၫနံၫဒုၩ, ၥိၪ ဖၫနံၫဒုၩ, ၥိၪလနံၪ့ဖိၪအလၧၫ့အဎွ့ၩ လဆံၫလံဒုၩ,",
			"18": "<sup>18</sup> ဒဲအဝ့ၫၥံၪအဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲအဆၧလုအီၩလဖၪ လၧချီဖၫၥံၪအဂး, လၧၥိၪဖၫၥံၪအဂး, ဒဲလၧၥိၪဖိၪၥံၪ အဂး, ဘဲၫအဆၧဝံထၪ့နၬထၪ့အၥိၭ, ဘဲၫဆၧစ့ၩရၫ့အ",
			"19": "<sup>19</sup> ၥိၭ,- ဒဲဘ့ၪဖိၪလဒုၩလၧဆၧလု ဆၧဒဲၩဘၭအဂးလီၫ. လၧနီၪအဖၫ့ခိၪ ဆၧလုမ့ၪထံၪဎး, ဒဲအဆၧမၩဘိၪ့ကိၪ မုၬ ဒဲအဆၧလုအီၩ အီၪဝ့ၫလီၫ.",
			"20": "<sup>20</sup> တၭလၧမုၥၧၫ့နံၩလနံၩနီၪ, ချီဖၫလဆံၫလဒုၩ, ၥိၪ ဖၫနံၫဒုၩ, ၥိၪလနံၪ့ဖိၪအလၧၫ့အဎွ့ၩ လဆံၫလံဒုၩ,",
			"21": "<sup>21</sup> ဒဲအဝ့ၫၥံၪအဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲအဆၧလုအီၩလဖၪ, လၧချီဖၫၥံၪအဂး, လၧၥိၪဖၫၥံၪအဂး, ဒဲလၧၥိၪဖိၪၥံၪ အဂး, ဘဲၫအဆၧဝံထၪ့နၬထၪ့အၥိၭ, ဘဲၫဆၧစ့ၩရၫ့",
			"22": "<sup>22</sup> အၥိၭ,- ဒဲဘ့ၪလဒုၩလၧဆၧလု ဆၧဒဲၩဘၭအဂးလီၫ. လၧနီၪအဖၫ့ခိၪ ဆၧလုမ့ၪလထံၪဎးဘီၩ့ဎး, ဒဲအဆၧ မၩဘိၪ့ကိၪမုၬ, ဒဲအဆၧလုအီၩနီၪအီၪဝ့ၫလီၫ.",
			"23": "<sup>23</sup> တၭလၧမုလံနံၩလနံၩနီၪ, ချီဖၫဆံၫဒုၩ, ၥိၪဖၫနံၫဒုၩ,",
			"24": "<sup>24</sup> ၥိၪလနံၪ့ဖိၪအလၧၫ့အဎွ့ၩ လဆံၫလံဒုၩ,- ဒဲအဝ့ၫၥံၪ အဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲအဆၧလုအီၩလဖၪ လၧချီဖၫ ၥံၪအဂး, လၧၥိၪဖၫအဂး, ဒဲလၧၥိၪဖိၪၥံၪအဂး, ဘဲၫအ",
			"25": "<sup>25</sup> ဆၧဝံထၪ့နၬထၪ့အၥိၭ, ဘဲၫဆၧစ့ၩရၫ့အၥိၭ,- ဒဲဘ့ၪ လဒုၩလၧဆၧလု ဆၧဒဲၩဘၭအဂးလီၫ. လၧနီၪအဖၫ့ ခိၪဆၧလုမ့ၪလထံၪဎးဘီၩ့ဎး, ဒဲအဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲအဆၧလုအီၩအီၪဝ့ၫလီၫ.",
			"26": "<sup>26</sup> တၭလၧမုယဲနံၩလနံၩနီၪ ချီဖၫခွံၫဒုၩ, ၥိၪဖၫနံၫဒုၩ,",
			"27": "<sup>27</sup> ၥိၪလနံၪ့ဖိၪအလၧၫ့အဎွ့ၩလဆံၫလံဒုၩ,- ဒဲအဝ့ၫၥံၪအ ဆၧမၩဘိၪ့ကိၪ, ဒဲအဆၧလုအီၩလဖၪ လၧချီဖၫၥံၪအ ဂး, လၧၥိၪဖၫၥံၪအဂး, ဒဲလၧၥိၪဖိၪၥံၪအဂး, ဘဲၫအဆၧ",
			"28": "<sup>28</sup> ဝံထၪ့နၬထၪ့အၥိၭ, ဘဲၫဆၧစ့ၩရၫ့အၥိၭနီၪ,- ဒဲဘ့ၪလ ဒုၩလၧဆၧလု ဆၧဒဲၩဘၭအဂးလီၫ. လၧနီၪအဖၫ့ခိၪ ဆၧလုမ့ၪ လထံၪဎးဘီၩ့ဎး, ဒဲအဆၧမၩဘိၪ့ ကိၪမုၬ, ဒဲအဆၧလုအီၩ အီၪဝ့ၫလီၫ.",
			"29": "<sup>29</sup> တၭလၧမုဎူၫနံၩလနံၩနီၪ ချီဖၫဎိၭဒုၩ, ၥိၪဖၫနံၫဒုၩ,",
			"30": "<sup>30</sup> ၥိၪလနံၪ့ဖိၪအလၧၫ့အဎွ့ၩ လဆံၫလံဒုၩ,- ဒဲအဝ့ၫၥံၪအ ဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲအဆၧလုအီၩလဖၪ လၧချီဖၫၥံၪ အဂး, ဒဲလၧၥိၪဖၫၥံၪအဂး, လၧၥိၪဖိၪၥံၪအဂး, ဘဲၫအ",
			"31": "<sup>31</sup> ဆၧဝံထၪ့နၬထၪ့အၥိၭ, ဘဲၫဆၧစ့ၩရၫ့အၥိၭနီၪ,- ဒဲဘ့ၪ လဒုၩလၧဆၧလု ဆၧဒဲၩဘၭအဂးလီၫ. လၧနီၪအဖၫ့ ခိၪဆၧလုမ့ၪ လထံၪဎးလဘီၩ့ဎး အဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲအဆၧလုအီၩ အီၪဝ့ၫလီၫ.",
			"32": "<sup>32</sup> တၭလၧမုနွ့ၫနံၩလနံၩနီၪ ချီဖၫဖိၪနွ့ၫဒုၩ, ၥိၪဖၫဖိၪ",
			"33": "<sup>33</sup> နံၫဒုၩ, ၥိၪလနံၪ့ဖိၪအလၧၫ့အဎွ့ၩ လဆံၫလံဒုၩ,- ဒဲအ ဝ့ၫၥံၪအဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲအဆၧလုအီၩလဖၪ လၧ ချီဖၫၥံၪအဂး, လၧၥိၪဖၫၥံၪအဂး, လၧၥိၪဖိၪၥံၪအဂး, ဘဲၫအဆၧဝံထၪ့နၬထၪ့အၥိၭ, ဘဲၫဆၧစ့ၩရၫ့အၥိၭနီၪ,",
			"34": "<sup>34</sup> ဒဲဘ့ၪလဒုၩလၧဆၧလု ဆၧဒဲၩဘၭအဂးလီၫ. လၧနီၪ အဖၫ့ခိၪ, ဆၧလုမ့ၪလထံၪဎး ဘီၩ့ဎး အဆၧမၩဘိၪ့ ကိၪမုၬ, ဒဲအဆၧလုအီၩ အီၪဝ့ၫလီၫ.",
			"35": "<sup>35</sup> မုဎိၭနံၩလနံၩနီၪ နၥံၪဘၪအီၪလၧဆၧအီၪကိၩ့အီၪ ကီၪ့ဆံၫ့ဎံၪလီၫ. နၥံၪမၩဘၪဆၧအဎီးအၡၩ အဆၧ",
			"36": "<sup>36</sup> မၩနးမံၩ့အ့ၬ.- တၭနဘၪမၩဘိၪ့ဆၧလုမ့ၪ, ဆၧလု မၩလၧမ့ၪဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩအဂး, ချီဖၫလ ဒုၩ, ၥိၪဖၫလဒုၩ, ၥိၪလနံၪ့ဖိၪအလၧၫ့အဎွ့ၩ နွ့ၫဒုၩ,",
			"37": "<sup>37</sup> အဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲအဆၧလုအီၩလၧချီဖၫအဂး, လၧၥိၪဖၫအဂး, ဒဲလၧၥိၪဖိၪလဖၪအဂး, ဘဲၫအဆၧဝံ",
			"38": "<sup>38</sup> ထၪ့နၬထၪ့အၥိၭ, ဘဲၫဆၧစ့ၩရၫ့အၥိၭ,- ဒဲဘ့ၪလဒုၩ လၧဆၧလု ဆၧဒဲၩဘၭအဂးလီၫ. လၧနီၪအဖၫ့ခိၪ ဆၧ လုမ့ၪလထံၪဎးဘီၩ့ဎး, ဒဲအဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲအ ဆၧလုအီၩ အီၪဝ့ၫလီၫ.",
			"39": "<sup>39</sup> တၭဆၧလဖၪနီၪ နၥံၪဘၪမၩဘိၪ့ လၧနၥံၪမၩဘိၪ့ ယဟိဝၩလၧအဆၧၫ့အထီ လၧဆၧဖၭနံၭဖၭၥၫ့ လၧန ၥံၪအဆၧလုမ့ၪအဂး, ဒဲလၧနၥံၪအဆၧမၩဘိၪ့ ကိၪမုၬ အဂး, ဒဲလၧနၥံၪအဆၧလုအီၩအဂး, ဒဲလၧနၥံၪအဆၧ လုဘၪလိၬအိၭလိၬအဂးလီၫ. လၧနီၪအဖၫ့ခိၪ နၥံၪအ ဆၧမၩဘိၪ့ဘၪဆဲၫ့ လၧနၥံၪအဆၧ ဆိၪလၩ့နၥံၪအၥၭ လဖၪ, ဒဲနၥံၪမၩဘိၪ့ဒၪဆၧလဖၪ အီၪဝ့ၫလီၫ.",
			"40": "<sup>40</sup> တၭစမိစ့ၭလီၩဘၪ ၦအံၫစရ့လၭဖိၪ ဘဲၫကယဲဆၧ လၧယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪလီၫ."
		},
		"30": {
			"1": "<sup>1</sup> တၭစမိစ့ၭချဲၩ့ဆၧလၧ ၦဒီၪ့ၥံၪအခိၪလဖၪ လၧၦအံၫ စရ့လၭဖိၪအဂဲးတၭ, စံၭဝ့ၫဒၪ,အယီၩမွဲဆၧလၧယဟိ",
			"2": "<sup>2</sup> ဝၩမၪလူၬဆၧ,- ၦၡၩအ့ၪဆိၪလၩ့အၥၭလၧယဟိဝၩ အဂးမွဲဂ့ၩ, ဆိၪလၩ့စၧၩ့ထၬအၥၭမွဲဂ့ၩ,မၩဂၭဂီၩ့ဘၪ အဆၧချဲၩ့အ့ၬ, မိဘၪမၩဘဲၫကယဲဆၧလၧအထၪ့ဖျ့ၭ လၧအနိၭအၥိၭနီၪလီၫ.",
			"3": "<sup>3</sup> ၦမုၪလၧအၥၭဘၪ့လၧအအီၪ လၧအဖါအဂံၪ့လဂၩ နီၪအ့ၪဆိၪလၩ့စၧၩ့ထၬအၥၭ လၧယဟိဝၩအဂးတၭ,",
			"4": "<sup>4</sup> အဖါအ့ၪနါဂၧၫ့အဆိၪလၩ့အၥၭ, ဒဲဆၧလၧအစၧၩ့ထၬ အၥၭနီၪ, အဖါအ့ၪအီၪလၩ့မါပံၭတၭ, ထီးနီၪလဖၧၫ့ ကယဲအဆၧဆိၪလၩ့အၥၭ မိအီၪဂုးအီၪခၧၫ့, ဒဲကယဲ ဆၧလၧအစၧၩ့ထၬအၥၭ လမံၩ့လါလါနီၪ မိအီၪဂုးအီၪ",
			"5": "<sup>5</sup> ခၧၫ့ထီးအလူၬလီၫ.- အ့ၪမွဲမုလနံၩလၧအနါဂၧၫ့ဆၧ နီၪအဖါ အ့ၪလအုၩ့လၩ့ဘၪတၭ, အဆၧဆိၪလၩ့အ ၥၭ, ဒဲအဆၧစၧၩ့ထၬလၧအစၧၩ့ထၬအၥၭနီၪ အီၪဂုး အီၪခၧၫ့နးမံၩ့အ့ၬ. တၭယဟိဝၩမိကွဲၪဖျါခွံၬအဝ့ၫနီၪ, အဂဲးဘဲၫယီၩ အဖါလအုၩ့လၩ့ဘၪလီၫ.",
			"6": "<sup>6</sup> ၦမုၪနီၪအ့ၪအီၪလၧအဝၩတၭ, အ့ၪဆိၪလၩ့အၥၭ မွဲဂ့ၩ, အ့ၪမၩထၪ့ဖျ့ၭလၧအနိၭ လၧဆၧစၧၩ့ထၬအၥၭ",
			"7": "<sup>7</sup> လမံၩ့မံၩ့မွဲဂ့ၩ,- အဝၩအ့ၪနါဂၧၫ့တၭ, မုလနံၩလၧအ နါဂၧၫ့, အ့ၪအီၪလၩ့မါပံၭတၭ, အဆၧဆိၪလၩ့အၥၭ မိအီၪဂုးအီၪခၧၫ့တၭ, အဆၧစၧၩ့ထၬ လၧအစၧၩ့ထၬ",
			"8": "<sup>8</sup> အၥၭမိအီၪဂုးအီၪခၧၫ့လီၫ.- တၭမုလနံၩလၧအနါဂၧၫ့ ဆၧနီၪအဝၩ အ့ၪလအုၩ့လၩ့ဘၪတၭ, အဆၧဆိၪလၧ အဆိၪလၩ့အၥၭနီၪ, ဒဲဆၧလၧအထၪ့ဖျ့ၭလၧအနိၭလၧ အစၧၩ့ထၬအၥၭ လၧအဝ့ၫနီၪ မိကဲၪထၪ့ဆၧပျီၩပျီၩ တၭ, ယဟိဝၩမိကွဲၪဖျါခွံၬအဝ့ၫလီၫ.",
			"9": "<sup>9</sup> အ့ၪမွဲကယဲၦမုၪမဲၫ, ဒဲၦမုၪလၧအလၩ့ၡၪ လၧအဝၩ လဂၩလါလါနီၪ အဆၧဆိၪလၩ့အၥၭ လၧအစၧၩ့ထၬ",
			"10": "<sup>10</sup> အၥၭနီၪ မိအီၪဂုးအီၪခၧၫ့လၧအဂးလီၫ.- တၭအ့ၪဆိၪ လၩ့အၥၭလၧ အဝၩအဂံၪ့ဖၧၩ့မွဲဂ့ၩ, အ့ၪစၧၩ့ထၬအၥၭ လၧဆၧစၧၩ့ထၬ အီၪလၧဆၧဆိၪလၩ့အၥၭ မွဲဂ့ၩတၭ, အဝၩအ့ၪနါဂၧၫ့ဝ့ၫတၭ, အီၪလၩ့မါပံၭနီၪ, အဆၧဆိၪ",
			"11": "<sup>11</sup> လၩ့အၥၭထီးအလူၬ မိအီၪဂုးအီၪခၧၫ့,- တၭအဆၧ စၧၩ့ထၬလၧအစၧၩ့ထၬအၥၭနီၪ မိအီၪဂုးအီၪခၧၫ့ကိၭ",
			"12": "<sup>12</sup> မံၩ့ဒ့ၭလီၫ.- အ့ၪမွဲမုလနံၩ လၧအနါဂၧၫ့ဝ့ၫနီၪ အဝၩ အ့ၪအီၪက့ၪပျီၩပျီၩတၡါတၭ, ဆၧထၪ့ဖျ့ၭလၧအနိၭ လၧအဆိၪလၩ့အၥၭ အဂဲးမွဲဂ့ၩ, လၧအဆၧစၧၩ့ထၬ လၧအစၧၩ့ထၬအၥၭ အဂဲးမွဲဂ့ၩ, အီၪဂုးအီၪခၧၫ့ နးမံၩ့ အ့ၬ. အဝၩမၩဝ့ၫပျီၩပျီၩတၭ, ယဟိဝၩ မိကွဲၪဖျါခွံၬ",
			"13": "<sup>13</sup> အဆၧလီၫ.- ကယဲဆၧဆိၪလၩ့အၥၭ, ဒဲကယဲဆၧဆိၪ လၩ့စၧၩ့ထၬအၥၭ ဘဲၫၥိၭအမိဆၪ့လၩ့အၥၭနီၪ အဝၩ",
			"14": "<sup>14</sup> မၩဂုးမၩခၧၫ့ၥ့ၪ, မၩဂၭဂီၩ့ၥ့ၪဆ့လီၫ.- အ့ၪမွဲအဝၩ အ့ၪအီၪလၩ့မါပံၭ လနံၩဘၪလနံၩတၭ, အဆၧဆိၪ လၩ့အၥၭထီးအလူၬမွဲဂ့ၩ, အဆၧစၧၩ့ထၬ လၧအအီၪ လၧအလီၩ့ထီးအလူၬမွဲဂ့ၩ, မွဲအဒုၭအီၪဂုးအီၪခၧၫ့ဝ့ၫ လီၫ. မုလနံၩလၧအနါဂၧၫ့ဝ့ၫနီၪ, အ့ၪအီၪလၩ့မါပံၭ",
			"15": "<sup>15</sup> တၭ,ဒုၭအီၪဂုးအီၪခၧၫ့ဝ့ၫလီၫ.- တၭလၧအနါဂၧၫ့ဝ့ၫ အလးခဲၫ့နီၪ အ့ၪမၩဂၭဂီၩ့တၡါတၭ, ထီးနီၪလဖၧၫ့ မွဲအဝ့ၫဒၪ မိဘၪၦမုၪအဆၧအၧၩ့ဆၧၥၫ့လီၫ.",
			"16": "<sup>16</sup> ဆၧလဖၪနီၪ မွဲၥနိၫလဖၪလၧ ယဟိဝၩမၪလူၬစမိစ့ၭ လၧၦထၧၫ့မၫဝၩအဂဲး, ဒဲလၧအဖါဒဲအဖိၪမုၪအၥၭဘၪ့ အီၪလၧအဖါအဂံၪ့ အဂဲးနီၪလီၫ."
		},
		"31": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, မၩအၧၩ့ ဆၧၫ့ၦမံဒအၫ့ဖိၪ လၧၦအံၫစရ့လၭဖိၪအဂးဆံၭ. လၧ ခဲၫ့ထဲၩ့တၭ, နမိဘၪဆၧအီၪက့ၪကီၪ့နၧၩ လၧၦၡၩခမျၧး လီၫ.",
			"3": "<sup>3</sup> စမိစ့ၭချဲၩ့ဆၧလၧၦခမျၧးတၭ, စံၭဝ့ၫဒၪ, အၪ့မၩ န့နၥံၪဝ့ၫလနၩ့နၩ့ လၧနၥံၪအစူၪဝဲၩ လၧဒုၭၥုၭအဂး ဆံၭးတၭမွဲအလ့ၩထၫ့ဒုၪဒၩ ၦမံဒအၫ့ဖိၪတၭ, မၩအၧၩ့",
			"4": "<sup>4</sup> ဆၧၫ့ၦမံဒအၫ့ဖိၪ လၧယဟိဝၩအဂးဆံၭ.- လၧၦလဒီၪ့ အကျၩၦၡၩလထီၫ့, ၦလဒီၪ့အကျၩ ၦၡၩလထီၫ့နီၪ နၥံၪဘၪအၪ့မၧၫ့လၩ့ လ့ၩဒုၭၥုၭလၧၦအံၫစရ့လၭဖိၪ",
			"5": "<sup>5</sup> အဒီၪ့ထီးအလူၬ အကျၩလီၫ.- တၭဆၧအၪ့နၩ့ဖၭဝ့ၫ လၧၦအံၫစရ့လၭဖိၪ အထီၫ့လဖၪအကျၩလဒီၪ့လထီၫ့, လဒီၪ့လထီၫ့, ၦလလၬနံၫထီၫ့ အီၪလၧအစူၪဝဲၩ လၧ",
			"6": "<sup>6</sup> ဒုၭၥုၭအဂးလီၫ.- တၭစမိစ့ၭအၪ့မၧၫ့လၩ့ အဝ့ၫၥံၪလ့ၩ ဒုၭၥုၭ, လၧလဒီၪ့အကျၩၦလထီၫ့, လဒီၪ့အကျၩၦလ ထီၫ့, အဝ့ၫၥံၪနီၪ ဒဲၦလုဆၧစအံၫလအ့ဇၧၫ အဖိၪခွၫ စဖံနအၭ ဘဲၫၥိၭအမိဒုၭၥုၭ, အီၪလၧအဆၧဖိၪ ဆၧ လံၩဆံၫ့ဎံၪ, ခွ့ၩလဖၪဒၪလ့ၬလၧအစူၪဖၧၩ့ ဘဲၫၥိၭအ",
			"7": "<sup>7</sup> မိအူၪဝ့ၫလီၫ.- အဝ့ၫၥံၪဒုၭဆၧလၧၦမံဒအၫ့ဖိၪ, ဘဲၫ ယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪတၭ, မၩၥံၫၦခွၫထီး",
			"8": "<sup>8</sup> အလူၬလီၫ.- တၭလၧၦလၧအဘၪဆၧမၩၥံၫဝ့ၫအဂူၫ ဂၩအမ့ၬယၫနီၪ, မွဲအမၩၥံၫမံဒအၫ့အစဎွၩလဖၪ, စအံ ဝဲၫ, ဒဲစရံကံၫ့, ဒဲစဇၧၫ, ဒဲစဟၧၫ, ဒဲစရံဘၫ, မံဒအၫ့အ စဎွၩယဲဂၩလီၫ. တၭစဘံအီၫ အဖိၪခွၫ စဘၫလၫ့နီၪ",
			"9": "<sup>9</sup> အဝ့ၫၥံၪမၩၥံၫဝ့ၫလၧနၭဆ့လီၫ.- တၭၦအံၫစရ့လၭ ဖိၪဖီၪ့န့အၪ့မၧၫ့ကဲၪဎီး ၦမံဒအၫ့မုၪ, ဒဲအဖိၪဒံၩဖိၪၥၪ တၭ,မၩဆီၪ့ကယဲအဆၧဖိၪဆၧဎါ, ဒဲကယဲအဆၧဖိၪ ဆၧလံၩ ဒဲကယဲအစူၪလးအခၪ့ခိၪ ထီးအလူၬလီၫ.",
			"10": "<sup>10</sup> တၭဆူၭထၪ့ခွံၬအဒိၩ့အတဝၫ့, လၧအအီၪလၧအဖၧၩ့ ထီးအလူၬ, ဒဲအလးအီၪလၧအခိၪဒၧၩ့ဂ့ၩ ထီးအလူၬ",
			"11": "<sup>11</sup> လၧမ့ၪလီၫ.- တၭလၧၦၡၩအကျၩမွဲဂ့ၩ, လၧဆၧဖိၪ ဆၧဎါအကျၩမွဲဂ့ၩ, အၪ့မၩန့ဝ့ၫလၧဆၧအၪ့ဂူၬန့ထီး",
			"12": "<sup>12</sup> အလူၬ, ဒဲဆၧမၩန့ဆီၪ့ထီးအလူၬလီၫ.- တၭအဝ့ၫၥံၪ ဂဲၫဆိၬၦလၧအအၪ့မၧၫ့ဎီး, ဒဲဆၧဖိၪဆၧဎါလၧအမၩ န့ဆီၪ့, ဒဲဆၧဖိၪဆၧလံၩလၧအအၪ့ဂူၬန့နီၪ လၧစမိစ့ၭ ဒဲၦလုဆၧစအံၫလအ့ဇၧၫ, ဒဲၦအံၫစရ့လၭဖိၪ အဆၧ အီၪကီၪ့အအီၪ, လၧၦၥုၪ့တဲၩအလး လၧမိအၭအဆၧ ပျၩ့ဖၧၩ့ လၧအအီၪလၧထံၫယီၫဒၫ့အနဲၩ့ ဆဲၫဎၩ့လၧ ယ့ၫရခိၫလီၫ.",
			"13": "<sup>13</sup> တၭစမိစ့ၭ, ဒဲၦလုဆၧစအံၫလအ့ဇၧၫလဂၩ ဒဲဆၧ အီၪကီၪ့အၦဒိၪလဖၪ ထီးအလူၬနီၪ လ့ၩထၪ့အၪ့ဂၬ",
			"14": "<sup>14</sup> ဝ့ၫလၧၦၥုၪ့တဲၩအလးလၧခီၫ့လီၫ.- တၭစမိစ့ၭအၥၭ ထၪ့ၦၥုၭမုအၡၩ ယိဝ့ၫလဖၪ, ဒဲၦလထီၫ့အခိၪလဖၪ, ဒဲၦလယၩ အခိၪလဖၪ လၧအဂဲၫထဲၩ့ထၪ့လၧဒုၭၥုၭ",
			"15": "<sup>15</sup> လီၫ.- တၭစမိစ့ၭစံၭဝ့ၫ, နၥံၪဒုၭမၧၫ့ဒံၭၦမုၪလဖၪထီး",
			"16": "<sup>16</sup> အလူၬဆ့လီၫ.- ယိခွါ, မွဲလၧစဘၫလၫ့အဆၧချဲၩ့အ ကၠီၩ့တၭ, အဝ့ၫၥံၪဒုၭမၩမၪဘၪ ၦအံၫစရ့လၭဖိၪ လၧ ယဟိဝၩလၧပံအီၫအဂဲးတၭ, ဆၧၥံၫဖျဲၪအီၪထၪ့ဝ့ၫလၧ",
			"17": "<sup>17</sup> ယဟိဝၩ အဆၧအီၪကီၪ့အကျၩလီၫ.- ဆၧမၩအၥၭ ဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩမၩၥံၫကယဲၦခွၫ လၧဖိၪဒံၩဖိၪ ၥၪအကျၩ, ဒဲကယဲၦမုၪလၧအၥ့ၪယၫၦခွၫမံၫဎုၬဝ့ၫနီၪ",
			"18": "<sup>18</sup> မၩၥံၫအဝ့ၫၥံၪကိၭဂၩဒ့ၭဆံၭ.- အ့ၪမွဲကယဲဖိၪၥၪမုၪ လၧအလမံၫဎုၬဒံၭဘၪ လၧၦခွၫတၭ, လၥ့ၪယၫဘၪၦ ခွၫနီၪဒုၭမၧၫ့ဒံၭအဝ့ၫၥံၪ ထီးအလူၬ လၧနၥံၪအဂးဒၪ",
			"19": "<sup>19</sup> နၥံၪဝ့ၫဆံၭ.- တၭနၥံၪဝ့ၫလဖၪယီၩ အီၪလၧၦၥုၪ့တဲၩ အလးလၧခီၫ့နွ့ၫနံၩဆံၭ. တၭကယဲၦလၧအမၩၥံၫၦ ၡၩလဂၩဂၩနီၪ, ဒဲကယဲၦလၧအထိၭဘၪ ၦလၧအဘၪ ဆၧမၩၥံၫဝ့ၫလဂၩဂၩနီၪ, မၩဆံၫ့ထၪ့နၥံၪအနၫ့ဆါဒၪ နၥံၪဝ့ၫ, ဒဲၦလၧနၥံၪဖီၪ့န့အၪ့မၧၫ့ဎီးဝ့ၫ လၧၥၧၫ့နံၩလ",
			"20": "<sup>20</sup> နံၩ, ဒဲလၧနွ့ၫနံၩလနံၩနီၪဆံၭ.- တၭမၩဆံၫ့ထၪ့နၥံၪ အကီၩ့အၥိၭ ထီးအလူၬ, ကယဲဆၧလၧအမၩဝ့ၫလၧ ဆၧဖံၭ, ဒဲကယဲဆၧလၧအမၩဝ့ၫ လၧဘ့ၪအဆီၪ့, ဒဲက ယဲဆၧမၩဝ့ၫလၧၥံၪ့ထီးအလူၬဆံၭ.",
			"21": "<sup>21</sup> တၭၦလုဆၧစအံၫလအ့ဇၧၫလဂၩနီၪ စံၭၦၥုၭဖိၪ လၧအဂဲၫဒုၭၥုၭလဖၪနီၪ, အယီၩ မွဲဆၧမၪလူၬအဆၧ",
			"22": "<sup>22</sup> ၥနိၫလၧယဟိဝၩမၪလူၬ စမိစ့ၭနီၪ,- ထီၫ့ၥံၪလွ့ၫၥံၪ, ကျိၪၥံၪစ့ၩၥံၪ, ထီးၥံၪၡၬၥံၪ, ထၭ, ၡၬဘွၩ, ဒဲၡၬၥၧၫ့,",
			"23": "<sup>23</sup> ကယဲဆၧလၧအထိးမ့ၪနီၪအ့ၪနၧၩ့တၭ, နၥံၪဘၪဒုၭခၫ့ ဂၬမ့ၪထီးအလူၬတၭ, မိဆံၫ့ထၪ့လီၫ. မွဲလါနၫ့မိဘၪ ဆၧမၩဆံၫ့ဝ့ၫ လၧဆၧလၩ့ဖၭအထံၫတၭ, ကယဲဆၧ လၧအထိးမ့ၪအ့ၪလနၧၩ့ဘၪနီၪ, နၥံၪဘၪဒုၭခၫ့ဂၬထံၫ",
			"24": "<sup>24</sup> လီၫ.- တၭနွ့ၫနံၩလနံၩနီၪ, နၥံၪဘၪအၪ့ဆူၫဝၭနၥံၪ အကီၩ့အၥိၭတၭ, နၥံၪမိဆံၫ့ထၪ့တၭ, နၥံၪမိလ့ၩနုၬ ဘၪလၧၦၥုၪ့တဲၩအလးဖၧၩ့လီၫ.",
			"25": "<sup>25</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ၦၡၩ မွဲဂ့ၩ, ဆၧဖိၪဆၧဎါမွဲဂ့ၩ, ဝံထၪ့နၬထၪ့ဆၧမၩန့ဆီၪ့ လဖၪ,နဝ့ၫဒၪ, ဒဲၦလုဆၧစအံၫလအ့ဇၧၫ, ဒဲအဆၧအီၪ",
			"27": "<sup>27</sup> ကီၪ့အဖါအခိၪလဖၪနီၪဆံၭ.- တၭအၪ့နၩ့ဖၭဆၧမၩ န့ဆီၪ့လၧနံၫပိၩ့နီၪ, လပိၩ့လၧၦလၧအအီၪက့ၪအၥၭ လၧအမိဒုၭဆၧတၭ, လ့ၩဒုၭၥုၭဝ့ၫလဖၪအဂး, ဒဲလပိၩ့",
			"28": "<sup>28</sup> လၧဆၧအီၪကီၪ့ထီးအလူၬအဂးဆံၭ.- တၭမၩန့အခီၫ့ လၧၦလၧအလ့ၩဒုၭၥုၭလဖၪ လၧယဟိဝၩအဂးဆံၭ. လၧၦၡၩယဲယၩအကျၩလဂၩ, လၧချီအကျၩမွဲဂ့ၩ, လၧ ကၥ့ၪယီၩ့ အကျၩမွဲဂ့ၩ, လၧၥိၪ ဒဲဘ့ၪ အကျၩမွဲဂ့ၩ, မၩန့လဒုၩလဒုၩ လၧယဲယၩအကျၩ လဆၫ့လဆၫ့နီၪ",
			"29": "<sup>29</sup> ဆံၭ.- တၭလၧအဝ့ၫၥံၪဖိၭဖၫ့နီၪ မၩန့ဖ့ၪလၫ့ၦလုဆၧ စအံၫလအ့ဇၧၫလဂၩ လၧဆၧမၩဘိၪ့ဆိၬထၪ့ ဝံဝါဝ့ၫ",
			"30": "<sup>30</sup> လၧယဟိဝၩအဂးဆံၭ.- တၭလၧၦအံၫစရ့လၭဖိၪအ ဆၧလခီၫအကျၩနီၪ, နဘၪမၩန့လၧအပိၩ့ယဲဆံၫလပိၩ့ နီၪလပိၩ့, လၧၦၡၩအကျၩ, လၧချီအကျၩ, လၧကၥ့ၪ ယီၩ့အကျၩ, ဒဲလၧၥိၪ ဒဲလၧဘ့ၪအကျၩ, လၧဆၧဖိၪ ဆၧဎါအဒိၩ့ထီးအလူၬ အကျၩနီၪ, ဒဲဖ့ၪလၫ့ဝ့ၫလၧၦ လံဝဲၫဖိၪလၧအယိယဟိဝၩ အတဲၩဆံၫ့ဎံၪအဆၧယိ",
			"31": "<sup>31</sup> လီၫ.- တၭစမိစ့ၭ, ဒဲၦလုဆၧစအံၫလအ့ဇၧၫလဂၩမၩ ဝ့ၫဘဲၫယဟိဝၩ မၪလူၬစမိစ့ၭ အၥိၭနီၪလီၫ.",
			"32": "<sup>32</sup> တၭဆၧအၪ့ဂူၬန့ လၧအအီၪလၩ့ထး လၧဆၧလၧအ မၩန့ဆီၪ့လၧၦၥုၭဖိၪဖီၪ့န့ဝ့ၫနီၪ မွဲၥိၪဎူၫကုၬနွ့ၫလၬယဲ ထီၫ့,",
			"33": "<sup>33</sup> ချီၥံၪနွ့ၫလၬနံၫထီၫ့,- ဒဲကၥ့ၪယီၩ့ဎူၫလၬ",
			"35": "<sup>35</sup> လထီၫ့,- ဒဲၦၡၩၥၧၫ့လၬနံၫထီၫ့ လၧၦမုၪလၧအလၥ့ၪ ယၫဘၪၦခွၫလၧအမံၫဎုၬဝ့ၫနီၪလီၫ.",
			"36": "<sup>36</sup> တၭလခီၫလၧအမွဲ ၦလၧအလ့ၩဒုၭၥုၭလဖၪ အဂး",
			"37": "<sup>37</sup> နီၪ, မွဲၥိၪၥၧၫ့ကုၬၥၧၫ့လၬ နွ့ၫထီၫ့ယဲယၩလီၫ.- တၭ ယဟိဝၩအခီၫ့ လၧၥိၪအကျၩနီၪ မွဲဎူၫယၩနွ့ၫဆံၫယဲ",
			"38": "<sup>38</sup> ဒုၩလီၫ.- တၭချီနီၪအီၪဝ့ၫ ၥၧၫ့လၬဎူၫထီၫ့လီၫ. တၭ ယဟိဝၩ အၥီၫ့နီၪ မွဲနွ့ၫဆံၫနံၫဒုၩ လၧအကျၩလီၫ.",
			"39": "<sup>39</sup> တၭကၥ့ၪယီၩ့အီၪဝ့ၫ ၥၧၫ့လၬယဲယၩလီၫ. တၭယဟိ",
			"40": "<sup>40</sup> ဝၩအခီၫ့နီၪ မွဲဎူၫဆံၫလဒုၩ လၧအကျၩလီၫ.- တၭၦၡၩ အီၪလလၬဎူၫထီၫ့လီၫ. ယဟိဝၩအခီၫ့နီၪ မွဲၥၧၫ့ဆံၫ",
			"41": "<sup>41</sup> နံၫဂၩလၧအကျၩလီၫ.- တၭစမိစ့ၭ ဖ့ၪလၫ့အခီၫ့နီၪ, ယဟိဝၩ အဆၧမၩဘိၪ့ဆိၬထၪ့ဝံဝါဝ့ၫ, လၧၦလုဆၧ စအံၫလအ့ဇၧၫလဂၩ ဘဲၫယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭ နီၪလီၫ.",
			"42": "<sup>42</sup> တၭလၧၦအံၫစရ့လၭဖိၪ အဆၧလခီၫလၧ စမိစ့ၭအၪ့",
			"43": "<sup>43</sup> နၩ့ဖၭခွံၬ လၧၦလၧအဒုၭၥုၭလဖၪနီၪ,- (ဒဲဆၧအီၪကီၪ့ အဆၧလခီၫနီၪ မွဲၥၧၫ့ကုၬၥၧၫ့လၬနွ့ၫထီၫ့ယဲယၩလီၫ. တၭချီၥံၪၥၧၫ့လၬဎူၫထီၫ့,",
			"44": "<sup>44</sup> ဒဲကၥ့ၪယီၩ့ၥၧၫ့လၬယဲ ယၩ,",
			"46": "<sup>46</sup> ဒဲၦၡၩလလၬဎူၫထီၫ့,)- တၭၦအံၫစရ့လၭ ဖိၪအဆၧလခီၫနီၪ လၧၦၡၩအကျၩမွဲဂ့ၩ, လၧဆၧဖိၪ ဆၧဎါအကျၩမွဲဂ့ၩ, စမိစ့ၭ မၩန့လၧအပိၩ့ယဲဆံၫပိၩ့ နီၪလပိၩ့တၭ, ဖ့ၪလၫ့ဝ့ၫလၧၦလံဝဲၫဖိၪ လၧအယိယ ဟိဝၩအတဲၩဆံၫ့ဎံၪနီၪ, ဘဲၫယဟိဝၩ မၪလူၬစမိစ့ၭ အၥိၭနီၪလီၫ.",
			"48": "<sup>48</sup> ၦယိဆၧ, ၦလၧအအီၪဝ့ၫ လၧၦၥုၭဖိၪအထီၫ့လဖၪ အဖၫ့ခိၪ, ၦလထီၫ့အခိၪလဖၪ, ၦလယၩအခိၪလဖၪနီၪ",
			"49": "<sup>49</sup> ဂဲၫလၧစမိစ့ၭအအီၪ,- တၭအဝ့ၫၥံၪစံၭစမိစ့ၭ, နခ့ၫနၡၩ ဝံထၪ့နၬထၪ့ၦၥုၭဖိၪအဆၧဝံဆၧနၬ လၧအအီၪလၧပ",
			"50": "<sup>50</sup> ဖၫ့လၬတၭ, လၩ့မါဘၪနးဂၩအ့ၬ.- မၩအၥၭဘဲၫနီၪ တၭ,ပဂဲၫဆိၬလဂၩအဂးဒၪဝ့ၫ လဂၩအဂးဒၪဝ့ၫ, အ ဆၧမၩဘိၪ့ယဟိဝၩ လၧဆၧလၧပဒၪန့ လၧကယၧၩ့ ထီၫ့အကျၩ, ထဲၫ့ဎွံၪၥံၪ, ၥွ့ၫၥံၪ, စူၪၥံၭၥံၪ, ဆၧအခွၩ့ ၥံၪ, ဒဲထံၩၥံၪဖဲၫၥံၪ, ဘဲၫၥိၭပမိမၩဆၧဖီၩ့ဖျ့ၭလၧပၥၭ",
			"51": "<sup>51</sup> ၡီၩ့အဂးလၧယဟိဝၩအမ့ၬယၫလီၫ.- တၭစမိစ့ၭဒဲၦ လုဆၧစအံၫလအ့ဇၧၫလဂၩနီၪ မၩန့ထီၫ့ၥံၪလွ့ၫၥံၪလၧ အမွဲကယၧၩ့ကယီၫ လၧဆၧတဲၩ့ဝ့ၫ ထီးအလူၬလီၫ.",
			"52": "<sup>52</sup> တၭကယဲဆၧမၩဘိၪ့နီၪ အထီၫ့လၧၦၥုၭဖိၪလထီၫ့အ ခိၪလဖၪ, ဒဲၦၥုၭဖိၪလယၩအခိၪလဖၪ မၩဘိၪ့ဝ့ၫနီၪ,",
			"53": "<sup>53</sup> မွဲၡက့လၭ လလၬဎူၫထီၫ့နွ့ၫယၩယဲဆံၫလီၫ.- (ၦၥုၭ ဖိၪန့ဆီၪ့ဆၧလဂၩ လၧအဂးဒၪဝ့ၫလဂၩ လၧအဂးဒၪ ဝ့ၫလီၫ.)",
			"54": "<sup>54</sup> တၭစမိစ့ၭ ဒဲၦလုဆၧစအံၫလအ့ဇၧၫလဂၫနီၪမၩန့ ထီၫ့ၥံၪလွ့ၫၥံၪလၧၦၥုၭဖိၪ လထီၫ့အခိၪလဖၪ, ဒဲလၧၦ ၥုၭဖိၪလယၩအခိၪလဖၪတၭ, ဂဲၫဆိၬဝ့ၫလၧဆၧအီၪ ကီၪ့အတဲၩဆံၫ့ဎံၪဖၧၩ့, ဆၧနၪ့ထၪ့ထဲၩ့လၧၦအံၫစရ့ လၭဖိၪအဂး လၧယဟိဝၩအမ့ၬယၫလီၫ."
		},
		"32": {
			"1": "<sup>1</sup> တၭၦရုဘံၫ့ဖိၪ, ဒဲၦဂၭဖိၪၥံၪအီၪလၧဆၧဖိၪဆၧဎါအ ဒိၩ့အၪအၪလ့ၬလီၫ. ထီးအဝ့ၫၥံၪ ဒၪဘၪခးယၫဇၧၫ, ဒဲခးဂံလအၭတၭ, ယိခွါ, ဆၧအလးနီၪမွဲဆၧဖိၪဆၧ",
			"2": "<sup>2</sup> ဎါအလးလီၫ.- တၭၦဂၭဖိၪ, ဒဲၦရုဘံၫ့ဖိၪၥံၪဂဲၫချဲၩ့ဆၧ လၧစမိစ့ၭ, ဒဲၦလုဆၧစအံၫလအ့ဇၧၫလဂၩ ဒဲဆၧအီၪ",
			"3": "<sup>3</sup> ကီၪ့အၦဒိၪလဖၪတၭ, စံၭဝ့ၫဒၪ,- အၭတရီၭ, ဒဲၫဘၫ့, ဒဲယၫဇၧၫ, ဒဲနံမၫ,ဒဲဟ့ၭၡဘၫ့, ဒဲအ့လအ့လၫ,ဒဲၡံဘၫ့,",
			"4": "<sup>4</sup> ဒဲနံဘိၫ, ဒဲဘံအၫ့,- ခးလၧယဟိဝၩဖ့ၬခွံၬ လၧၦအံၫ စရ့လၭဖိၪအဆၧအီၪကီၪ့အမ့ၬယၫနီၪ, မွဲဆၧဖိၪဆၧ ဎါအခးတၭ, နခ့ၫနၡၩလဖၪယီၩ အီၪလၧဆၧဖိၪဆၧ",
			"5": "<sup>5</sup> ဎါလီၫ.- တၭအဝ့ၫၥံၪစံၭဝ့ၫဒၪ, ပအ့ၪန့ဘၪဆၧအခိး အတၩ လၧနမ့ၬယၫတၭ, မွဲဆၧဖ့ၪလၫ့ နခ့ၫနၡၩယီၩ လၧခးနီၪလၧဆၧဖီၪ့ထၬအဂးဆံၭ. မွဲအထီးဒုၭခၫ့ဂၬ ပၧၩလၧထံၫယီၫဒၫ့လဂ့ၩ.",
			"6": "<sup>6</sup> တၭစမိစ့ၭစံၭစဂၭအဖိၪ, ဒဲစရုဘံၫ့အဖိၪလဖၪ, မွဲန ၥံၪအထၧၫ့ဖုဝဲ မိလ့ၩဒုၭဆၧတၭ, နၥံၪမိဆၧၫ့နၩ့ထီး",
			"7": "<sup>7</sup> ယီၩဆ့ဧၪ.- နၥံၪမၩလၩ့ဆါ ၦအံၫစရ့လၭဖိၪအၥၭ အဂဲးအဘၭ ဘဲၫၥိၭအထီးလ့ၩခၫ့ဂၬ လၧထံၫၥံၪခးၥံၪ",
			"8": "<sup>8</sup> လၧယဟိဝၩဖ့ၪလၫ့ဝ့ၫနီၪ, မွဲဘၪလဲၪ.- လၧယအၪ့မၧၫ့ နၥံၪအဖါလဖၪ လ့ၩဆၧလၧကၫဒ့ၭဘၫန့အၫ ဘဲၫၥိၭ အမိယိထံၫၥံၪခးၥံၪနီၪ အဝ့ၫၥံၪမၩဝ့ၫ ဘဲၫနီၪလီၫ.",
			"9": "<sup>9</sup> တၭအဝ့ၫၥံၪလ့ၩဝ့ၫထီၩ့ လၧအ့ၡကီၫလၭ အချိၬတၭ, ဒၪဘၪထံၫၥံၪခးၥံၪနီၪတၭ, မၩလၩ့ဆါၦအံၫစရ့လၭ ဖိၪအၥၭအဂဲးအဘၭ, ဘဲၫၥိၭအထီးလ့ၩနုၬဘၪ ထံၫ ၥံၪခးၥံၪလၧယဟိဝၩ ဖ့ၪလၫ့အဝ့ၫၥံၪနီၪ လဂ့ၩလီၫ.",
			"10": "<sup>10</sup> ယဟိဝၩအၥၭထၪ့ခဲၩထၪ့ဘၪဝ့ၫ လၧမုလနံၩနီၪတၭ,",
			"11": "<sup>11</sup> ဆိၪလၩ့အၥၭတၭစံၭဝ့ၫဒၪ,- မွဲမၬၦလၧအစဲၪ့ထၪ့လၧ အံဇံၭအဖၧၩ့လၧအၥၭၡါအနံၪ့ နံၫဆံၫဒဲနံၫဆံၫအဖၫ့ ခိၪနီၪ, မိဒၪဘၪထံၫၥံၪခးၥံၪ လၧယဆိၪလၩ့ယၥၭလၧ အဂဲးလၧစအၫဘြဟၫ့, ဒဲစအံစၭ, ဒဲစယၫကူၭၥံၪနးဂၩ အ့ၬ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဖိၬယခဲၫ့လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩ",
			"12": "<sup>12</sup> အ့ၬ.- မိဒၪဘၪဝ့ၫန့ၫၦကံၫ့နစဲၭဖိၪ စယဖၧၫနံၫအဖိၪခွၫ စကၫလ့ၭ, ဒဲစနိၫ့အဖိၪခွၫ စယီရှုၫအ့ၫနီၪလီၫ. အဝ့ၫ ၥံၪဖိၬယဟိဝၩအခဲၫ့ လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩ အဂဲးလီၫ.",
			"13": "<sup>13</sup> ယဟိဝၩ အၥၭထၪ့ခဲၩထၪ့ဘၪ အံၫစရ့လၭတၭ, အၪ့ မၧၫ့အဂၭဝံၩ့ဝၩ့ဆၧ လၧၡါမုနၧၫ့ဖၫအနံၪ့လံဆံၫ ထီးၦ လဆိၩလၧအမၩဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬယၫနီၪ",
			"14": "<sup>14</sup> လူၬဝ့ၫလီၫ.- တၭယိခွါ, နၥံၪဂဲထုၪ့လၧနၥံၪ အဖါလဖၪ အလး, ၦဆၧဒဲၩဘၭဖိၪ အဆၧအၪထၪ့, ဘဲၫၥိၭနၥံၪ မိမၩထၪ့ယဟိဝၩအၥၭထၪ့ဆီၪ့ဘၪ ၦအံၫစရ့လၭဖိၪ",
			"15": "<sup>15</sup> နီၪလီၫ.- အဂဲးဘဲၫယီၩ နၥံၪအ့ၪကၠၪထဲၩ့နၥံၪအၥၭလၧ ဆၧဖိၬအခဲၫ့တၭ, အဝ့ၫဒၪမိလ့ၩဒၪဒီၭဝ့ၫ လၧၡါမုနၧၫ့ ဖၫအဖၧၩ့တၭ, နၥံၪမိမၩဂၭဂီၩ့ၦခမျၧးယီၩ ထီးအလူၬ လီၫ.",
			"16": "<sup>16</sup> အဝ့ၫၥံၪၥူၭဘူၭအၥၭ လၧအအီၪတၭ, စံၭဝ့ၫဒၪ,ပမိ မၩၥိၪဒဲဘ့ၪအဖီၩ့လဖၪ လၧပဆၧဖိၪဆၧဎါ အဒိၩ့အ",
			"17": "<sup>17</sup> ဂး, ဒဲဒိၩ့လဖၪ လၧပဖိၪဒံၩဖိၪၥၪအဂးထီးယီၩ,- အ့ၪ မွဲပဝ့ၫဒၪပနၫ့ဆါဒၪပဝ့ၫ ပမိလ့ၩချဲၫ့ချဲၫ့ အီၪလၧပစူၪ ဝဲၩလၧၦအံၫစရ့လၭဖိၪ အမ့ၬယၫ, ထီးပဒုၭလ့ၩနုၬဝ့ၫ လၧအလးလီၫ. တၭပဖိၪဒံၩဖိၪၥၪလဖၪ မိအီၪလၧဒိၩ့",
			"18": "<sup>18</sup> လဖၪအီၪလၧအခိၪဒၧၩ့ လၧၦခးဖိၪအကၠီၩ့လီၫ.- ၦအံၫ စရ့လၭဖိၪ လချႃၭန့ဒံၭဘၪအဆၧ န့ၥၫလဂၩလါလါ",
			"19": "<sup>19</sup> တၭ,ပမိဂဲၫထဲၩ့ထဲၩ့ လၧပဂံၪ့ပဎၫ့အ့ၬ.- အဂဲးဘဲၫယီၩ ပန့ၥၫဆၧလၧယီၫဒၫ့ဝါလခီၫ လၧပမ့ၬယၫအ့ၬ. အဂဲး ဘဲၫယီၩပန့ၥၫဆၧအီၪလၧယီၫဒၫ့ လၧအယီၩလၧမုထၪ့ လခီၫယီၩလီၫ.",
			"20": "<sup>20</sup> စမိစ့ၭ စံၭအဝ့ၫၥံၪ, နၥံၪအ့ၪမၩဆၧနီၪလမံၩ့, နၥံၪအ့ၪ လ့ၩဒုၭၥုၭအီၪ လၧနၥံၪအစူၪဝဲၩ လၧယဟိဝၩအမ့ၬ",
			"21": "<sup>21</sup> ယၫတၭ,- နၥံၪအ့ၪလ့ၩခၫ့ဂၬယီၫဒၫ့ အီၪလၧနၥံၪအစူၪ ဝဲၩလၧယဟိဝၩအမ့ၬယၫ ထီးလၧအနၫ့ထၪ့ခွံၬအဒုၪ",
			"22": "<sup>22</sup> အဒၩလၧအမ့ၬယၫတၭ,- ဆၧအ့ၪမၩနၧၩ့မၩစၪခးဖိၪ ဒၪဝ့ၫလၧယဟိဝၩအမ့ၬယၫတၭး လၧခဲၫ့ထဲၩ့နီၪနၥံၪ မိဂဲၫထဲၩ့ဘၪတၭ, နၥံၪအဆၧဒဲၩဘၭအီၪလၧယဟိဝၩ",
			"23": "<sup>23</sup> အမ့ၬယၫ ဒဲလၧအံၫစရ့လၭအမ့ၬယၫအ့ၬ.- အ့ၪမွဲနၥံၪ အ့ၪလမၩဘၪဘဲၫနီၪတၭ, ယိခွါ, နၥံၪမၩမၪဘၪယူၭယ ဟိဝၩယူၭတၭ, ၥ့ၪယၫတၡါနၥံၪဝ့ၫ လၧနၥံၪအဆၧ",
			"24": "<sup>24</sup> ဒဲၩဘၭမိဒၪန့ဘၪနၥံၪနီၪဆံၭ.- မၩဒိၩ့ၥံၪတဝၫ့ၥံၪလၧ နၥံၪအဖိၪဒံၩဖိၪၥၪအဂး, ဒဲဖီၩ့လဖၪလၧနၥံၪအၥိၪအ ဘ့ၪအဂး ဘဲၫဆၧလၧအထၪ့ဖျ့ၭ လၧနၥံၪအနိၭနီၪဆံၭ.",
			"25": "<sup>25</sup> ၦဂၭဖိၪဒဲၦရုဘံၫ့ဖိၪ ချဲၩ့ဆၧၫ့ဆၧလၧစမိစ့ၭတၭ,စံၭ ဝ့ၫဒၪ, နခ့ၫနၡၩမိမၩဝ့ၫ ဘဲၫပကဆါမၪလူၬဝ့ၫအၥိၭနီၪ",
			"26": "<sup>26</sup> လီၫ.- ပဖိၪဒံၩဖိၪၥၪပဖိၪပမၫ, ပၥိၪပဘ့ၪ, ဒဲပဆၧဖိၪ ဆၧဎါအဒိၩ့ထီးအလူၬနီၪ မိအီၪဘၪထီးနီၪ လၧဂံလ",
			"27": "<sup>27</sup> အၭအဒိၩ့လဖၪအဖၧၩ့လီၫ.- အ့ၪမွဲနခ့ၫနၡၩမိလ့ၩခၫ့ ဂၬဆၧအီၪလၧအစူၪဝဲၩကိၭဂၩဒ့ၭ, လၧယဟိဝၩအမ့ၬ ယၫဘဲၫၥိၭအမိဒုၭၥုၭ ဘဲၫယကဆါစံၭဝ့ၫအၥိၭနီၪလီၫ.",
			"28": "<sup>28</sup> တၭစမိစ့ၭမၪလူၬၦလုဆၧစအံၫလအ့ဇၧၫ, ဒဲစနိၫ့အ ဖိၪခွၫစယီရှုအ့ၫ, ဒဲၦအံၫစရ့လၭဖိၪအဒီၪ့လဖၪအဖါ",
			"29": "<sup>29</sup> အခိၪလဖၪလၧအဝ့ၫၥံၪအဂဲးအကၠီၪ့း- တၭစမိစ့ၭစံၭ အဝ့ၫၥံၪ, ၦဂၭဖိၪ, ဒဲၦရုဘံၫ့ဖိၪအ့ၪခၫ့ဂၬ ယီၫဒၫ့လၧန ၥံၪအၥိၭအီၪလၧအစူၪဝဲၩ ဘဲၫၥိၭအမိဒုၭၥုၭ လၧယဟိ ဝၩအမ့ၬယၫကိၭဂၩဒ့ၭတၭ, ဆၧအ့ၪမၩနၧၩ့မၩစၪၦ ခးဖိၪလဖၪ လၧနၥံၪအမ့ၬယၫဂီၩ့တၭ, နၥံၪမိဘၪဖ့ၪ လၫ့အဝ့ၫၥံၪ လၧခးဂံလအၭလၧအဆၧန့ၥၫ အဂးလီၫ.",
			"30": "<sup>30</sup> အ့ၪမွဲအဝ့ၫၥံၪ အ့ၪလခၫ့ဂၬဘၪဆၧလၧနၥံၪအၥိၭ အီၪလၧအစူၪဝဲၩတၭ, မိဘၪန့ၥၫဆၧလၧနၥံၪ အကျၩ",
			"31": "<sup>31</sup> လၧခးကၫနအၫ့အဖၧၩ့လီၫ.- ၦဂၭဖိၪ,ဒဲၦရုဘံၫ့ဖိၪလ ဖၪစံၭဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, ဘဲၫယဟိဝၩ စံၭနခ့ၫန",
			"32": "<sup>32</sup> ၡၩအၥိၭနီၪ ပမိမၩဘဲၫနီၪၥိၭလီၫ.- ပမိလ့ၩခၫ့ဂၬဆၧ အီၪလၧပစူၪဝဲၩ လၧယဟိဝၩအမ့ၬယၫ, လၧခးကၫန အၫ့အဖၧၩ့ ဘဲၫၥိၭပန့ဘၪဆၧန့ၥၫ လၧယီၫဒၫ့အယီၩ လခီၫမိကဲၪထၪ့ပဆၧလီၫ.",
			"33": "<sup>33</sup> တၭစမိစ့ၭဖ့ၪလၫ့ၦဂၭဖိၪ, ဒဲၦရုဘံၫ့ဖိၪ,ဒဲစယိၥၭအ ဖိၪခွၫစမနၭစ့ၫလခီၫဒီၪ့နီၪ လၧၦအၫမိၫဖိၪ အစဎွၩစဲ ဟၫ့အဘၩ့အမုး, ဒဲဘၫၡၫ့အစဎွၩအီၭ အဘၩ့အမုး အထံၫၥံၪခးၥံၪ ဒဲအဒိၩ့လဖၪ လၧအနဲၩ့ထံၭ, ဒိၩ့လဖၪ လၧခးဖၧၩ့ဝၬဖီၩ့ဝ့ၫလီၫ.",
			"34": "<sup>34</sup> တၭၦဂၭဖိၪလဖၪ မၩကဲၪထၪ့ဒဲၫဘၫ့, ဒဲအၭတရီၭ,",
			"35": "<sup>35</sup> ဒဲအရိအၧၫ, ဒဲအၭရီၭ, ဒဲၡိဖၫ့, ဒဲယၫဇၧၫ, ဒဲယီၭဘံၫ",
			"36": "<sup>36</sup> အၫ,- ဒဲဘ့ၭၥနံၫ့မၫ ဒဲဘ့ၭၥဟၫရၫ့, ဒိၩ့လဖၪအီၪလၧ အခိၪဒၧၩ့တၭ, မၩဖီၩ့လဖၪ လၧၥိၪဒဲဘ့ၪအဂးလီၫ.",
			"37": "<sup>37</sup> ၦရုဘံၫ့ဖိၪလဖၪ မၩကဲၪထၪ့ဟ့ၭၡဘၫ့, ဒဲအ့ၫလအ့",
			"38": "<sup>38</sup> လၫ, ဒဲကၧယၭၥ့အံၫ့,- ဒဲနံဘိၫ, ဒဲဘၫအလၭမံအၫ့, (အ ဝ့ၫၥံၪအမံၩ့အၪ့လဲၩအၥၭ) ဒဲၡံတမၫလီၫ. တၭဒိၩ့လၧ အမၩကဲၪထၪ့ဝ့ၫနီၪ ကိၭဝ့ၫအမံၩ့လၧအဂူၫဂၩ လဖၪ နီၪလီၫ.",
			"39": "<sup>39</sup> စမနၭစ့ၫအဖိၪခွၫစမၫခၧၫအဖိၪလဖၪ လ့ၩဝ့ၫလၧဂံ လအၭတၭ, မၩန့ဝ့ၫဒဲနၫ့ထၪ့ခွံၬ ၦအၫမိၫဖိၪလၧအအီၪ",
			"40": "<sup>40</sup> လၧအဖၧၩ့လီၫ.- တၭစမိစ့ၭဖ့ၪလၫ့ဂံလအၭ လၧမနၭ စ့ၫအဖိၪခွၫစမၫခၧၫတၭ, အဝ့ၫဒၪအီၪဝ့ၫ လၧအဖၧၩ့",
			"41": "<sup>41</sup> လီၫ.- စမနၭစ့ၫအဖိၪခွၫ စယၫအၧၫလ့ၩမၩန့တဝၫ့လ",
			"42": "<sup>42</sup> ဖၪတၭ, ကိၭအမံၩ့လၧဟၫဝီၭယၫအၧၫလီၫ.- စနိဘၫ လ့ၩမၩန့ကံနၭ, ဒဲအတဝၫ့လဖၪတၭ, ကိၭအမံၩ့လၧနိ ဘၫဘဲၫအမံၩ့ဒၪဝ့ၫ အၥိၭနီၪလီၫ."
		},
		"33": {
			"1": "<sup>1</sup> အယီၩမွဲၦအံၫစရ့လၭဖိၪ အလ့ၩဆၧလၧအစဲၪ့ထၪ့ ခွံၬလၧခးအံဇံၭအဖၧၩ့, ဒဲအၥုၭမုလၧစမိစ့ၭ, ဒဲစအၫ",
			"2": "<sup>2</sup> ရၧၫ့အစူၪဖၧၩ့လီၫ.- တၭစမိစ့ၭကွ့ၭအလ့ၩဆၧလဖၪ, ဘဲၫအလ့ၩဆၧအၥိၭ ဘဲၫယဟိဝၩ မၪလူၬဝ့ၫ အၥိၭ လီၫ. တၭအယီၩမွဲအလ့ၩဆၧ ဘဲၫအစဲၪ့ထၪ့အၥိၭနီၪ လီၫ.",
			"3": "<sup>3</sup> လၩခၪ့ထံၭ လဆံၫယဲနံၩလနံၩနီၪ အဝ့ၫၥံၪစဲၪ့ထၪ့ ခွံၬလၧရမံစ့ၭလီၫ. ဘိၪ့လ့ၩဖၬဖီၩ့ခွံၬလနံၩနီၪ ၦအံၫ စရ့လၭဖိၪစဲၪ့ထၪ့ခွံၬ လၧဆၧအစူၪယူၬထၪ့အၥၭလၧ",
			"4": "<sup>4</sup> ၦအံဇံၭဖိၪၥံၪထီးအလူၬ အမ့ၬယၫနီၪ, မွဲလၧၦအံဇံၭ ဖိၪၥံၪခုၪ့လၩ့ဘၧၩ့ခွံၬ အဖိၪဝဲၡါထီးအလူၬ အဘိၩ့ဘၭ, မွဲၦလၧယဟိဝၩကျီၪ့ၥံၫခွံၬဝ့ၫ လၧအကျၩလီၫ. တၭယ ဟိဝၩဒုၭအီၪထၪ့ဆၧစ့ၩရၫ့ လၧအဝ့ၫၥံၪအယွၩလဖၪ",
			"5": "<sup>5</sup> အလီၩ့ဆ့လီၫ.- ၦအံၫစရ့လၭဖိၪစဲၪ့ထၪ့ခွံၬ လၧရမံစ့ၭ",
			"6": "<sup>6</sup> နီၪတၭ, ၥုၪ့တဲၩလၧစၧကီၭနီၪလီၫ.- တၭအဝ့ၫၥံၪစဲၪ့ ထၪ့ခွံၬလၧစၧကီၭနီၪ, ၥုၪ့တဲၩလၧအံၥၫ့လၧအအီၪလၧ",
			"7": "<sup>7</sup> ၡါမုနၧၫ့ဖၫအနဲၩ့ထံၭလီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧအံ ၥၫ့နီၪ, ထဲၩ့ထဲၩ့လၧပဲၫဟဟဲရီၭ လၧအအီၪဝ့ၫ လၧဘၫ အလၭဇံဖိၫ့အမ့ၬယၫတၭ, ၥုၪ့တဲၩဆဲၫဎၩ့လၧမံဂဒီၫ",
			"8": "<sup>8</sup> လၭနီၪလီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧပဲၫဟဟဲရီၭတၭ, ခၫ့ဂၬ မၫဆမံၭအၥၭခံဖၧၩ့ လၧၡါမုနၧၫ့ဖၫတၭ, လ့ၩ ဝ့ၫၥၧၫ့နံၩဖၧၩ့ၥၭ လၧၡါမုနၧၫ့ဖၫ အံၥၫ့အဖၧၩ့တၭ ၥုၪ့",
			"9": "<sup>9</sup> တဲၩလၧမၫရၫလီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧမၫရၫနီၪ တၭ,လ့ၩထီၩ့လၧ အံလံၫ့လီၫ. တၭလၧအံလံၫ့အဖၧၩ့ နီၪထံၫဖၧၩ့အီၪလဆံၫနံၫဖၧၩ့, ဒဲၥံၪ့စီၩ့မလီၫ့အထံၭနွ့ၫ",
			"10": "<sup>10</sup> ဆံၫလီၫ. တၭအဝ့ၫၥံၪၥုၪ့တဲၩထီးနီၪလီၫ.- အဝ့ၫၥံၪစဲၪ့ ထၪ့ခွံၬလၧအံလံၫ့နီၪတၭ, ၥုၪ့တဲၩလၧမၫဆမံၭဝီၩအ",
			"11": "<sup>11</sup> နဲၩ့ထံၭနီၪလီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧမၫဆမံၭဝီၩ အနဲၩ့ထံၭနီၪတၭ, ၥုၪ့တဲၩလၧၡါမုနၧၫ့ဖၫဇံၫ့နီၪလီၫ.",
			"12": "<sup>12</sup> အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧၡါမုနၧၫ့ဖၫဇံၫ့နီၪတၭ, ၥုၪ့တဲၩ",
			"13": "<sup>13</sup> လၧဒီၭဖကၫအဖၧၩ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧဒီၭ",
			"14": "<sup>14</sup> ဖကၫနီၪတၭ, ၥုၪ့တဲၩလၧအၫလၧၭအဖၧၩ့လီၫ.- အဝ့ၫ ၥံၪ့စဲၪ့ထၪ့ခွံၬလၧအၫလၧၭနီၪ ၥုၪ့တဲၩလၧရဖံဒံၫ့အဖၧၩ့",
			"15": "<sup>15</sup> ထီးထံၫလၧၦခမျၧးအီၪဝ့ၫ အဂးနီၪအီၪအ့ၬ.- အဝ့ၫၥံၪ စဲၪ့ထၪ့ခွံၬလၧရဖံဒံၫ့နီၪတၭ, ၥုၪ့တဲၩလၧၡါမုနၧၫ့ဖၫ",
			"16": "<sup>16</sup> စဲနၫအဖၧၩ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧၡါမုနၧၫ့ဖၫစဲ နၫတၭ, ၥုၪ့တဲၩ လၧကံၭဘြီၫဟၭတဝၫ အဖၧၩ့လီၫ.",
			"17": "<sup>17</sup> အဝ့ၫၥံၪ့စဲၪ့ထၪ့ခွံၬ လၧကံၭဘြီၫဟၭတဝၫနီၪတၭ, ၥုၪ့",
			"18": "<sup>18</sup> တဲၩလၧဟၫဇရီၭအဖၧၩ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧ",
			"19": "<sup>19</sup> ဟၫဇရီၭနီၪတၭ, ၥုၪ့တဲၩလၧရံၭၥမၫအဖၧၩ့လီၫ.- အ ဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧရံၭၥမၫနီၪတၭ, ၥုၪ့တဲၩလၧရံမၧၫ့",
			"20": "<sup>20</sup> ပၫရံၭအဖၧၩ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧရံမၧၫ့ပၫရံၭ",
			"21": "<sup>21</sup> နီၪတၭ, ၥုၪ့တဲၩလၧလံဘနၫအဖၧၩ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ ထၪ့ခွံၬလၧလံဘနၫနီၪတၭ, ၥုၪ့တဲၩ လၧရံၭစၫအဖၧၩ့",
			"22": "<sup>22</sup> လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧရံၭစၫနီၪတၭ, ၥုၪ့တဲၩ",
			"23": "<sup>23</sup> လၧကဟ့လၥၫအဖၧၩ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧ ကဟ့လၥၫနီၪတၭ, ၥုၪ့တဲၩလၧခိၪလီၩ့ၡၫဖၧၫအလီၩ့",
			"24": "<sup>24</sup> လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧခိၪလီၩ့ၡၫဖၧၫနီၪတၭ, ၥုၪ့",
			"25": "<sup>25</sup> တဲၩလၧဟၫရဒၫအဖၧၩ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧ ဟၫရဒၫနီၪတၭ, ၥုၪ့တဲၩလၧမၭဟံလီၭ အဖၧၩ့လီၫ.",
			"26": "<sup>26</sup> အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧမၭဟံလီၭနီၪတၭ, ၥုၪ့တဲၩလၧ",
			"27": "<sup>27</sup> တၫဟၭအဖၧၩ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧတၫဟၭ",
			"28": "<sup>28</sup> နီၪတၭ, ၥုၪ့တဲၩလၧတၫရၫအဖၧၩ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ ထၪ့ခွံၬ လၧတၫရၫနီၪတၭ, ၥုၪ့တဲၩလၧမံၥကၫအဖၧၩ့",
			"29": "<sup>29</sup> လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့လၧမံၥကၫနီၪတၭ, ၥုၪ့တဲၩလၧ",
			"30": "<sup>30</sup> ဟၭၡမိနၫ အဖၧၩ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧဟၭ",
			"31": "<sup>31</sup> ၡမိနၫနီၪတၭ, ၥုၪ့တဲၩလၧမိၫစရီၭအဖၧၩ့လီၫ.- အဝ့ၫ ၥံၪ့စဲၪ့ထၪ့ခွံၬ လၧမိၫစရီၭနီၪတၭ, ၥုၪ့တဲၩလၧဘ့နယၫ",
			"32": "<sup>32</sup> အကၫ့အဖၧၩ့လီၫ.- အဝ့ၫၥံၪ့စဲၪ့ထၪ့ခွံၬလၧဘ့နယၫအ",
			"33": "<sup>33</sup> ကၫ့နီၪတၭ, ၥုၪ့တဲၩလၧဟီဟဂံဒၭအဖၧၩ့လီၫ.- အဝ့ၫ ၥံၪစဲၪ့ထၪ့ခွံၬ လၧဟီဟဂံဒၭနီၪတၭ, ၥုၪ့တဲၩလၧယီၭ",
			"34": "<sup>34</sup> ဘၥၫအဖၧၩ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧ ယီၭဘၥၫနီၪ",
			"35": "<sup>35</sup> တၭ, ၥုၪ့တဲၩလၧအံၫဘြိနၫအဖၧၩ့လီၫ.- အဝ့ၫၥံၪ့စဲၪ့ ထၪ့ခွံၬလၧအံၫဘြိနၫနီၪတၭ, ၥုၪ့တဲၩလၧအံဇအၧၫ့ဂံ",
			"36": "<sup>36</sup> ဘၧၫအဖၧၩ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧအံဇအၧၫ့ဂံ ဘၧၫနီၪတၭ, ၥုၪ့တဲၩလၧၡါမုနၧၫ့ဖၫဇံၫ့ လၧအမွဲကၫ",
			"37": "<sup>37</sup> ဒ့ၭလီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧကၫဒ့ၭနီၪတၭ, ၥုၪ့ တဲၩလၧခိၪလီၩ့ဟီၫအလီၩ့ လၧအအီၪလၧခးအံဒၧၫ့အ နဲၩ့ထံၭနီၪလီၫ.",
			"38": "<sup>38</sup> ၦလုဆၧစအၫရၧၫ့ လ့ၩထၪ့ဘၭခိၪလီၩ့ဟီၫ ဘဲၫယ ဟိဝၩမၪလူၬဝ့ၫအၥိၭနီၪတၭ, ၦအံၫစရ့လၭဖိၪစဲၪ့ထၪ့ ခွံၬလၧခးအံဇံၭအလးခဲၫ့ အနံၪ့လံဆံၫ လၩယဲဘံၪ့",
			"39": "<sup>39</sup> လဘံၪ့လၩထၪ့လနံၩနီၪၥံၫဝ့ၫထီးနီၪလီၫ.- တၭလၧ စအၫရၧၫ့ၥံၫဝ့ၫလၧခိၪလီၩ့ဟီၫအလီၩ့နီၪ အၥၭၡါယူၭ လယၩနံၫဆံၫၥၧၫ့နံၪ့လီၫ.",
			"40": "<sup>40</sup> တၭၦခးကၫနအၫ့ဖိၪ အစဎွၩအၫရၭ လၧအအီၪဝ့ၫ လၧမုခံၫ့လခီၫ, လၧခးကၫနအၫ့အဖၧၩ့နီၪ နါဂၧၫ့ဝ့ၫလၧ ၦအံၫစရ့လၭဖိၪဂဲၫဝ့ၫလီၫ.",
			"41": "<sup>41</sup> အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧခိၪလီၩ့ဟီၫနီၪတၭ, ၥုၪ့တဲၩ",
			"42": "<sup>42</sup> လၧဇၫလမိနၫအဖၧၩ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧဇၫ",
			"43": "<sup>43</sup> လမိနၫနီၪတၭ, ၥုၪ့တဲၩလၧပုနၧၫ့အဖၧၩ့လီၫ.- အဝ့ၫၥံၪ စဲၪ့ထၪ့ခွံၬလၧပုနၧၫ့နီၪတၭ, ၥုၪ့တဲၩလၧအီဘီၭအဖၧၩ့",
			"44": "<sup>44</sup> လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧအီဘီၭနီၪတၭ, ၥုၪ့တဲၩ လၧအံဇအၭဘရံၫ့အဖၧၩ့, အီၪလၧမိအၭ အနဲၩ့ထံၭ",
			"45": "<sup>45</sup> လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧ အဲအံၫ့နီၪတၭ, ၥုၪ့တဲၩ",
			"46": "<sup>46</sup> လၧဒဲၫဘၫ့ဂၭအဖၧၩ့လီၫ.- အဝ့ၫၥံၪ့စဲၪ့ထၪ့ခွံၬ လၧဒဲၫ ဘၫ့ဂၭနီၪတၭ, ၥုၪ့တဲၩလၧအၫလမၧၫ့ဒံၭဘျၫၥံၫ့အဖၧၩ့",
			"47": "<sup>47</sup> လီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧအၫလမၧၫ့ဒံၭဘျၫၥံၫ့နီၪ တၭ,ၥုၪ့တဲၩ လၧအၭဘရံၫ့ အခိၪလီၩ့ခိၪ လၧအအီၪ လၧနံဘိၫအမ့ၬယၫလီၫ.",
			"48": "<sup>48</sup> အဝ့ၫၥံၪ့စဲၪ့ထၪ့ခွံၬ လၧအၭဘရံၫ့အခိၪလီၩ့ထိၩ့ချိၬ နီၪတၭ, ၥုၪ့တဲၩလၧမိအၭအဆၧပျၩ့ဖၧၩ့ လၧထံၫယီၫ",
			"49": "<sup>49</sup> ဒၫ့အနဲၩ့ဆဲၫဎၩ့ လၧယ့ၫရခိၫနီၪလီၫ.- အဝ့ၫၥံၪ့ၥုၪ့တဲၩ လၧယီၫဒၫ့အနဲၩ့ လၧဘ့ၭယ့ၭစမီၭဖိး လၧအၫဘလၭ ၡံၭထံၫ့အီၪလၧ မိအၭအဆၧပျၩ့ဖၧၩ့လီၫ.",
			"50": "<sup>50</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ လၧမိအၭအဆၧပျၩ့ဖၧၩ့ လၧထံၫယီၫဒၫ့အနဲၩ့ဆဲၫဎၩ့ လၧယ့ၫရခိၫတၭ, စံၭဝ့ၫ",
			"51": "<sup>51</sup> ဒၪ,- ချဲၩ့ဆၧလၧၦအံၫစရ့လၭဖိၪတၭ, စံၭအဝ့ၫၥံၪ, ထီး နၥံၪအ့ၪခၫ့ဂၬထၪ့ထံၫယီၫဒၫ့ လၧခးကၫနအၫ့အဖၧၩ့",
			"52": "<sup>52</sup> နီၪ,- နၥံၪဘၪနၫ့ထၪ့ခွံၬ ၦခးဖိၪထီးအလူၬလၧနၥံၪအ မ့ၬယၫတၭ, မၩဂၭဂီၩ့ခွံၬ အဆၧဂၩ့လၧအကွ့ၭဝ့ၫထီး အလူၬ, ဒဲမၩဂၭဂီၩ့ခွံၬ အဆၧဂၩ့ၥိၫ့ဝ့ၫထီးအလူၬတၭ,",
			"53": "<sup>53</sup> မၩလၩ့ဎီးခွံၬ အလးထၪ့ထီၫလဖၪလီၫ.- တၭနၥံၪဘၪ မၩန့ခး, ဒဲၦအီၪလၧအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩယဖ့ၪ",
			"54": "<sup>54</sup> လၫ့နၥံၪလၧခးနီၪ ဘဲၫၥိၭနၥံၪမိမၩန့ဝ့ၫလီၫ.- နၥံၪဘၪ ဖၭဆၧတၭ, နၥံၪဘၪအၪ့နၩ့ဖၭ ထံၫၥံၪခးၥံၪအဆၧၫ့ လၧဆၧန့ၥၫ လၧနၥံၪအဂံၪ့ဒီၪ့လဖၪအဂးလီၫ. လၧၦ အအၪလဖၪနီၪ နၥံၪဘၪဖ့ၪလၫ့ဝ့ၫ လၧဆၧန့ၥၫဆၧလၧ အအၪတၭ, ၦလၧအၡၩလဖၪနီၪ နၥံၪဘၪဖ့ၪလၫ့ဝ့ၫ လၧဆၧန့ၥၫဆၧလၧအၡၩလီၫ. ၦဘၪအီၪလၧအလး ထီးအလးလၩ့ဘၪ လၧဖၭဆၧလီၫ. ဘဲၫနၥံၪအဖါအ ဒီၪ့လဖၪအၥိၭနီၪ နၥံၪမိန့ၥၫဆၧလီၫ.",
			"55": "<sup>55</sup> အ့ၪမွဲနၥံၪအ့ၪလနၫ့ထၪ့ခွံၬဘၪ ၦခးဖိၪလၧနၥံၪအမ့ၬ ယၫတၭ, ဆၧမိမၩအၥၭ လၧၦလၧနၥံၪဒုၭအီၪလၩ့ထး လဖၪနီၪမိကဲၪထၪ့ဆၧဆူၪ လၧနၥံၪအမ့ၬၥၪဖၧၩ့, ဒဲဆၧ ဆူၪဆၧမဲၪလၧနၥံၪအဂုၬဖၩဖၧၩ့, ဒဲမိမၩခိမၩဝီၩနၥံၪ",
			"56": "<sup>56</sup> လၧခးဖၧၩ့ လၧနၥံၪအီၪလၧအဖၧၩ့လီၫ.- တၭဆၧမိ မၩအၥၭလၧယမိမၩနၥံၪ, ဘဲၫယအီၪက့ၪယၥၭ လၧ ယမိမၩအဝ့ၫၥံၪအၥိၭနီၪလီၫ."
		},
		"34": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ,စံၭဝ့ၫဒၪ, မၪလူၬ ၦအံၫစရ့လၭဖိၪတၭ, စံၭအဝ့ၫၥံၪ,ထီးနၥံၪလ့ၩနုၬလၧ ခးကၫနအၫ့အဖၧၩ့တၭ, (အနီၪမိကဲၪထၪ့နၥံၪန့ၥၫဝ့ၫ",
			"3": "<sup>3</sup> ခးကၫနအၫ့ဒၪလ့ၬ အဆၧၫ့လဖၪနီၪ,)- နၥံၪအဆၧၫ့ လၧမုခံၫ့လခီၫနီၪ မိအီၪလၧၡါမုနၧၫ့ဖၫ ဇံၫ့လၧအံဒၧၫ့ အနဲၩ့ဒဲနၥံၪအခးဆၧၫ့ လၧမုခံၫ့လခီၫနီၪ မိမွဲမၫဆမံၭ",
			"4": "<sup>4</sup> ထံၫဂၫ့လၧအထုၬ လၧမုထၪ့လခီၫလီၫ.- တၭနၥံၪအခး အဆၧၫ့နီၪ မိဎဲၪ့ဝ့ၫလၧမုခံၫ့လခီၫ လၧအၭရၭဘံၫ့အ ဆၧစီၩ့ခိၪတၭ, လ့ၩထၪ့လၧဇံၫ့တၭ, အထုၬလၧမုခံၫ့ လခီၫနီၪမိအီၪလၧကၫဒ့ၭဘၫန့အၫ, ဒဲမိလ့ၩဒံၭဖိးလၧ",
			"5": "<sup>5</sup> ဟၫဇၫအၭဒၫ, ဒဲလ့ၩထၪ့ဖိးလၧအၭဇမၧၫ့လီၫ.- တၭ ခးအဆၧၫ့နီၪမိလ့ၩဎဲၪ့ လၧအၭဇမၧၫ့ဖိးလၧအံဇံၭအ ထံၫမိၡါတၭ, အထုၬမိအီၪလၧမၫဆမံၭနဲၩ့နီၪလီၫ.",
			"6": "<sup>6</sup> တၭခးအဆၧၫ့ လၧမုနုၬလခီၫနီၪ နၥံၪမိအီၪလၧမၫ ဆမံၭဖၭဒိၪလၧအနဲၩ့ထံၭအဂးလီၫ. အနီၪမိကဲၪထၪ့ နၥံၪအခးအနဲၩ့ထံၭ လၧမုနုၬလခီၫလီၫ.",
			"7": "<sup>7</sup> တၭအယီၩမိကဲၪထၪ့နၥံၪအခးအဆၧၫ့ လၧမုဖၩလၧ မၫဆမံၭ ဖၭဒိၪနီၪ နဘၪထိၪဆၧဖိး လၧခိၪလီၩ့ ဟီၫ",
			"8": "<sup>8</sup> လီၫ.- တၭလၧခိၪလီၩ့ဟီၫနီၪ နၥံၪဘၪထိၪဆၧဖိးလၧ ဆၧလ့ၩနုၬ လၧဟၫမၭတၭ, အဆၧၫ့မိလ့ၩထၪ့လၧဇံ",
			"9": "<sup>9</sup> ဒၭ,- ဒဲဖိးလၧဇံဖၧၫ့တၭ, အထုၬနီၪမိအီၪလၧဟၫဇ အံနၫ့လီၫ. အနီၪမိကဲၪထၪ့နၥံၪအခးအဆၧၫ့ လၧမုဖၩ လခီၫလီၫ.",
			"10": "<sup>10</sup> တၭနၥံၪဘၪထိၪနၥံၪအခးအဆၧၫ့ လၧမုထၪ့လခီၫ",
			"11": "<sup>11</sup> လၧဟၫဇအံနၫ့ဖိးလၧၡ့ဖၫ့လီၫ.- တၭအဆၧၫ့နီၪမိလ့ၩ လၩ့လၧၡ့ဖၫ့ဖိးလၧရံၭဘလၫ အီၪလၧအၫအံၫ့လၧမု ထၪ့လခီၫတၭ, အဆၧၫ့နီၪ မိလ့ၩလၩ့ဖိးလၧမၫဆမံၭ",
			"12": "<sup>12</sup> ခံၫ့န့ဆရ့ၭလၧမုထၪ့လခီၫလီၫ.- တၭအဆၧၫ့နီၪမိဘၪ လ့ၩဖိးလၩ့လၧယီၫဒၫ့အနဲၩ့တၭ, အထုၬနီၪမိအီၪလၧ မၫဆမံၭထံၫဂၫ့နီၪလီၫ. အဝ့ၫနီၪမိကဲၪထၪ့ နၥံၪအခး,",
			"13": "<sup>13</sup> ဒဲအဆၧၫ့ဝၬဖီၩ့ဝ့ၫလီၫ.- စမိစ့ၭမၪလူၬ ၦအံၫစရ့လၭ ဖိၪတၭ, စံၭဝ့ၫဒၪ, အနီၪမွဲခးလၧနၥံၪမိန့ဘၪ လၧဖၭ ဆၧ, လၧယဟိဝၩမၪလူၬ ဖ့ၪလၫ့ၦခွံၫဒီၪ့ ဒဲလခီၫဒီၪ့",
			"14": "<sup>14</sup> လီၫ.- အဂဲးဘဲၫယီၩ ၦရုဘံၫ့ဖိၪလဒီၪ့ ဘဲၫအဖါလဖၪ အဂံၪ့အၥိၭနီၪ, ဒဲၦဂၭဖိၪလဒီၪ့ ဘဲၫအဖါလဖၪအဂံၪ့ အၥိၭနီၪ န့ဘၪယူၭ. တၭၦမနၭစ့ၫဖိၪ လခီၫဒီၪ့နီၪန့",
			"15": "<sup>15</sup> ဘၪယူၭအဆၧန့ၥၫဆၧယူၭ.- နံၫဒီၪ့ဒဲလခီၫဒီၪ့နီၪန့ဘၪ ယူၭအဆၧန့ၥၫဆၧလၧ ထံၫယီၫဒၫ့အယီၩလခီၫ, ဆဲၫ ဎၩ့လၧယ့ၫရခိၫလၧမုထၪ့လခီၫယူၭ.",
			"16": "<sup>16</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, အ ယီၩမွဲၦၡၩအမံၩ့ လၧအဘၪအၪ့နၩ့ဖၭခးအဆၧၫ့လၧ နၥံၪအဂးလဖၪ, ၦလုဆၧစအံၫလအ့ဇၧၫ,ဒဲစနိၫ့အဖိၪ",
			"18": "<sup>18</sup> ခွၫစယီရှုၫအ့ၫနီၪလီၫ.- တၭနၥံၪဘၪမၩန့ လၧၦလဒီၪ့ အၦဒိၪလဂၩ, လၧၦလဒီၪ့အၦဒိၪလဂၩ, ဘဲၫၥိၭအမိ",
			"19": "<sup>19</sup> အၪ့နၩ့ဖၭန့အဆၧန့ၥၫဆၧအဆၧၫ့လီၫ.- အယီၩမွဲၦ",
			"20": "<sup>20</sup> လဖၪနီၪအမံၩ့,- စယဖၧၫနံၫအဖိၪခွၫ စကၫလ့ၭလၧ",
			"21": "<sup>21</sup> ၦယုဒၫဖိၪ လဒီၪ့အကျၩ,- ဒဲစအၫမဟၧၭ အဖိၪခွၫ",
			"22": "<sup>22</sup> စၡံမုၫအ့လၭ လၧၦစံမအၧၫ့ဖိၪလဒီၪ့အကျၩ,- စစံၭ စလၧၫ့အဖိၪခွၫစအ့လဒၭ လၧၦဘံၪ့ယမံၫ့ဖိၪလဒီၪ့အ",
			"23": "<sup>23</sup> ကျၩ,- တၭစယီၭလဲၫအဖိၪခွၫစဘၧၭကဲၫ,လၧၦဒၫ့ဖိၪ",
			"24": "<sup>24</sup> လဒီၪ့အၦဒိၪ,- ဒဲစအ့ဖိၭအဖိၪခွၫစဟၫနအ့လၭ, စယိ ၥၭအဖိၪအလံၩ အၦဒိၪနီၪ လၧၦမနၭစ့ၫဖိၪ လဒီၪ့အ",
			"25": "<sup>25</sup> ကျၩ, ဒဲစၡံၭမတၫ့အဖိၪခွၫ စက့မၠူၫအ့လၭ, ၦအံဖြံၫ့",
			"26": "<sup>26</sup> ဖိၪလဒီၪ့အၦဒိၪ,- ဒဲစပၫနၭအဖိၪခွၫစအလံၭစဖၫ့ၦဇ့ၭ ဘလၧၫ့ဖိၪလဒီၪ့အၦဒိၪ, ဒဲစအၭဇၫ့အဖိၪခွၫ စပၫလ",
			"27": "<sup>27</sup> တံၫအ့လၭ, ၦအံၭစခၫဖိၪလဒီၪ့အၦဒိၪ,- ဒဲစၡလိမဲၫ အဖိၪခွၫ စအဘဲဟၧၭ, ၦအၭၡၧၫဖိၪလဒီၪ့အၦဒိၪ,",
			"28": "<sup>28</sup> ဒဲစအၫမဟၧၭအဖိၪခွၫ ပ့ၭဒဟ့လၭ, ၦနၭၥလဲၫဖိၪလ ဒီၪ့အၦဒိၪလီၫ.",
			"29": "<sup>29</sup> အဝ့ၫၥံၪနီၪမွဲၦလၧယဟိဝၩမၪလူၬဝ့ၫ ဘဲၫၥိၭအမိ အၪ့နၩ့ဖၭဆၧန့ၥၫအဆၧၫ့ လၧခးကၫနအၫ့အဖၧၩ့လၧ ၦအံၫစရ့လၭဖိၪ အဂးလီၫ."
		},
		"35": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ လၧမိအၭအဆၧပျၩ့ဖၧၩ့ လၧယီၫဒၫ့အနဲၩ့ဆဲၫဎၩ့ လၧယ့ၫရခိၫတၭ, စံၭဝ့ၫဒၪ,",
			"2": "<sup>2</sup> မၪလူၬ ၦအံၫစရ့လၭဖိၪ လၧအမိဘၪဖ့ၪလၫ့ဒိၩ့လဖၪ လၧအဆၧန့ၥၫအကျၩ လၧၦလံဝဲၫဖိၪ, ဘဲၫၥိၭအမိအီၪ ဝ့ၫလၧအဖၧၩ့ဆံၭ. တၭနၥံၪဘၪဖ့ၪလၫ့ၦလံဝဲၫဖိၪလၧ",
			"3": "<sup>3</sup> ဆၧအလးလၧဒိၩ့လဖၪ အနဲၩ့ထံၭဝၬဖီၩ့ဝ့ၫလီၫ.- တၭ ဒိၩ့လဖၪနီၪ မိအီၪဝ့ၫလၧအဝ့ၫၥံၪအီၪဝ့ၫအဂး, ဒဲဆၧ အနဲၩ့ထံၭဝၬဖီၩ့လဖၪနီၪ မိအီၪလၧအဆၧဖိၪဆၧဎါ အဒိၩ့အဂး, ဒဲလၧအစူၪလးအခၪ့ခိၪအဂး, ဒဲလၧအ",
			"4": "<sup>4</sup> ဆၧဖိၪဆၧဎါထီးအလူၬအဂးလီၫ.- တၭဒိၩ့အနဲၩ့ထံၭ ဝၬဖီၩ့နီၪ လၧနၥံၪဘၪဖ့ၪလၫ့ ၦလံဝဲၫဖိၪၥံၪနီၪ မိအီၪ",
			"5": "<sup>5</sup> လၧဒိၩ့ခိၪဒၧၩ့ လၧခီၫ့အဖျါလထီၫ့ဝၬဖီၩ့ဝ့ၫလီၫ.- တၭ နၥံၪမိဘၪထိၪ လၧဒိၩ့မုထၪ့လခီၫအဖျါနံၫထီၫ့, ဒဲလၧ မုခံၫ့လခီၫနီၪ အဖျါနံၫထီၫ့, ဒဲလၧမုနုၬလခီၫနီၪ အဖျါ နံၫထီၫ့, ဒဲလၧမုဖၩလခီၫနီၪ အဖျါနံၫထီၫ့လီၫ. ဒိၩ့နီၪ အီၪဝ့ၫလၧအၥၭခံဖၧၩ့တၭ, ဆၧနီၪမိကဲၪထၪ့ဝ့ၫလၧဒိၩ့",
			"6": "<sup>6</sup> အဆၧအၪ့အဆၪအလး လၧအဂးလီၫ.- တၭလၧဒိၩ့ လၧနၥံၪမိဘၪဖ့ၪလၫ့ ၦလံဝဲၫဖိၪအကျၩနီၪ ဒိၩ့မိဘၪ အီၪဎူၫဒိၩ့ လၧဆၧဖလ့ၬအဂး လၧနၥံၪမိဘၪအီၪက့ၪ ဝ့ၫလၧၦမၩၥံၫၦၡၩအဂး, ဘဲၫၥိၭအမိစဲၪ့ဖျ့ၭ ထီးနီၪ လီၫ. တၭလၧနီၪအဖၫ့ခိၪ နၥံၪမိဘၪအီၪက့ၪအၪထၪ့",
			"7": "<sup>7</sup> ဒိၩ့လံဆံၫနံၫဒိၩ့လီၫ.- ဒိၩ့ၥံၪတဝၫ့ၥံၪလၧနၥံၪမိဘၪ ဖ့ၪလၫ့ ၦလံဝဲၫဖိၪ ထီးအလူၬနီၪမွဲလံဆံၫဎိၭဒိၩ့လီၫ.",
			"8": "<sup>8</sup> အဝ့ၫၥံၪနီၪ, ဒဲဆၧအၪ့အဆၪအလးလဖၪလီၫ.- တၭ ဒိၩ့လဖၪလၧနၥံၪမိဘၪဖ့ၪလၫ့ လၧၦအံၫစရ့လၭဖိၪအ န့ၥၫဆၧအကျၩနီၪ, လၧအအၪအကျၩနီၪ,နၥံၪမိမၩန့ လၧအအၪတၭ, လၧအၡၩအကျၩနီၪ,နၥံၪမိဘၪမၩန့ လၧအၡၩလီၫ. ကယဲၦကိၭအဂၩမိဘၪဖ့ၪလၫ့ဆၧလၧ အဒိၩ့အကျၩနီၪ လၧၦလံဝဲၫဖိၪ, ဘဲၫအဆၧန့ၥၫ လၧ အန့ဘၪၥၫအၥိၭနီၪလီၫ.",
			"9": "<sup>9</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ချဲၩ့ ဆၧလၧၦအံၫစရ့လၭဖိၪတၭ စံၭအဝ့ၫၥံၪ, ထီးနၥံၪခၫ့",
			"11": "<sup>11</sup> ဂၬထံၫယီၫဒၫ့ လၧခးကၫနအၫ့အဖၧၩ့တၭ,- နၥံၪမိ ဘၪအီၪက့ၪလၩ့ဒိၩ့လဖၪ လၧအမိကဲၪထၪ့ဒိၩ့ဖလ့ၬ လၧနၥံၪအဂး, ဘဲၫၥိၭၦလၧအမၩၥံၫဆၧလၧအမၩၥံၫ",
			"12": "<sup>12</sup> ရှုၭၦၡၩအကၠီၩ့လဂၩမိစဲၪ့ဖျ့ၭထီးနီၪလီၫ.- တၭအဝ့ၫ ၥံၪမိကဲၪထၪ့ဒိၩ့ဖလ့ၬ လၧၦအၪ့ဎၬဆၧၥွံၪအစူၪဖၧၩ့, ဘဲၫၥိၭၦလၧအမၩၥံၫၦၡၩလဂၩနီၪ, ဘိၩ့အလချႃၭ ဆၧၫ့ထုၪ့ဒံၭဘၪလၧဆၧအီၪကီၪ့အမ့ၬယၫ လၧဆၧစ့ၩ",
			"13": "<sup>13</sup> ရၫ့အဖၧၩ့နီၪ, ထီးၥံၫလဂ့ၩ,- တၭလၧဒိၩ့လဖၪလၧ နၥံၪမိဘၪဖ့ၪလၫ့အကျၩနီၪ, ဎူၫဒိၩ့မိအီၪလၧနၥံၪလၧ",
			"14": "<sup>14</sup> ဆၧဖီၩ့ဖျ့ၭအဂးလီၫ.- နၥံၪဘၪအီၪက့ၪလၩ့ ၥၧၫ့ဒိၩ့ လၧယီၫဒၫ့လၧအယီၩလခီၫ, ဒဲနၥံၪဘၪအီၪက့ၪၥၧၫ့ဒိၩ့ လၧခးကၫနအၫ့အဖၧၩ့ လၧအမိကဲၪထၪ့ဒိၩ့ဖလ့ၬလီၫ.",
			"15": "<sup>15</sup> ဎူၫဒိၩ့နီၪ မိကဲၪထၪ့ဆၧဖလ့ၬ လၧၦအံၫစရ့လၭဖိၪအ ဂး,ဒဲလၧၦလခီၫဘၩ့မုးဖိၪအဂး, ဒဲလၧၦလၧအအီၪ လၧအကျၩအဂး, ဘဲၫၥိၭၦလၧအမၩၥံၫရှုၭၦၡၩလဂၩ ဂၩနီၪ, မိစဲၪ့ဖျ့ၭထီးနီၪ ကိၭဂၩဒ့ၭလီၫ.",
			"16": "<sup>16</sup> တၭအ့ၪဖ့ၬဝ့ၫလၧထၭလမံၩ့မံၩ့ ထီးအဆၧၥံၫဝ့ၫနီၪ, မွဲဝ့ၫလၧၦမၩၥံၫဒၪၦၡၩလီၫ. ၦလၧအမၩၥံၫဒၪၦၡၩ နီၪမိဘၪဆၧမၩၥံၫဝ့ၫတၡါဆ့လီၫ.",
			"17": "<sup>17</sup> အ့ၪခွံၬဘၪဝ့ၫလၧလိး လၧအစူၪဖၧၩ့ လၧအမၩၥံၫဆၧ ၥ့ၪတၭ, အဝ့ၫဒၪအ့ၪၥံၫနီၪ, မွဲၦမၩၥံၫဒၪၦၡၩလီၫ. ၦလၧ အမၩၥံၫဒၪၦၡၩနီၪ မိဘၪဆၧမၩၥံၫဝ့ၫ တၡါဆ့လီၫ.",
			"18": "<sup>18</sup> အ့ၪဒိၪဝ့ၫလၧၥံၪ့လကုၭ လၧအစူၪလၧအမၩၥံၫဆၧၥ့ၪ တၭ,အဝ့ၫဒၪအ့ၪၥံၫတၭ, မွဲၦမၩၥံၫဒၪၦၡၩတၭ, ၦမၩ",
			"19": "<sup>19</sup> ၥံၫဒၪဝ့ၫနီၪ မိဘၪဆၧမၩၥံၫဝ့ၫတၡါဆ့လီၫ.- ၦအၪ့ဎၬ ဆၧအၥွံၪအနၫ့ဆါဒၪဝ့ၫနီၪ မိဘၪမၩၥံၫ ၦမၩၥံၫဒၪၦ ၡၩလဂၩနီၪလီၫ. ထီးအဘၪခီၩ့ဝ့ၫတၭ, မိမၩၥံၫဝ့ၫ",
			"20": "<sup>20</sup> လီၫ.- တၭအ့ၪဆ့ၭဝ့ၫလၧအၥၭဂဲၫ့ဆၧအကၠီၩ့, အ့ၪ",
			"21": "<sup>21</sup> အီၪခိၭတၭ ခွံၬဝ့ၫလၧဆၧလမံၩ့မံၩ့ထီးအၥံၫ,- အ့ၪ ထၫ့ဒုၪဒၩဝ့ၫတၭ, မ့ၭဝ့ၫလၧအစူၪနီၪ အဝ့ၫဒၪအ့ၪၥံၫ နီၪ,ၦလၧအမၩၥံၫဝ့ၫလဂၩနီၪ မိဘၪဆၧမၩၥံၫဝ့ၫတၡါ ဆ့လီၫ. မွဲဝ့ၫလၧၦမၩၥံၫဒၪၦၡၩလီၫ. ထီးအဘၪခီၩ့ ဝ့ၫတၭ, ၦအၪ့ဎၬဆၧအၥွံၪနီၪ မိမၩၥံၫၦလၧအမၩၥံၫ ဒၪၦၡၩနီၪလီၫ.",
			"22": "<sup>22</sup> အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, လထၫ့ဒၩဘၪဝ့ၫတၭ, အ့ၪ ဆ့ၭရှုၭဘၪတၭ, လအီၪခိၭဘၪဝ့ၫနီၪ, အ့ၪခွံၬဆၧလ",
			"23": "<sup>23</sup> မံၩ့မံၩ့လၧအဘၪဝ့ၫတၭ,- လဒၪဘၪဝ့ၫနီၪ, အ့ၪခွံၬဝ့ၫ လၧလိးထီးအၥံၫတၭ, အ့ၪလမွဲဘၪအဒုၪအဒၩ, ဒဲအ့ၪ",
			"24": "<sup>24</sup> လအၪ့ဎၬမၩအၧၩ့ဘၪတၭ,- ဆၧအီၪကီၪ့မိဘၪစ့ၩရၫ့ ဆၧလၧၦမၩၥံၫဆၧ ဒဲၦအၪ့ဎၬဆၧၥွံၪအဘိၩ့ဆၧၩ့နီၪ",
			"25": "<sup>25</sup> ဘဲၫဆၧစ့ၩရၫ့လဖၪယီၩ အၥိၭနီၪလီၫ.- ဆၧအီၪကီၪ့ ဘၪမၩဂၭဖျ့ၭ ၦမၩၥံၫဆၧလၧၦအၪ့ဎၬ ဆၧၥွံၪအစူၪ ဖၧၩ့တၭ, ဆၧအီၪကီၪ့မိဘၪဒုၭထဲၩ့ထဲၩ့ဝ့ၫ လၧဒိၩ့ ဖလ့ၬ လၧအစဲၪ့နုၬလၧအဖၧၩ့တၭ, မိအီၪထီးနီၪထီး ၦလုဆၧအခိၪ လၧအဘၪဆၧဂုၪဝ့ၫ လၧၥိၪဆံၫ့ဎံၪလ ဂၩၥံၫဝ့ၫလီၫ.",
			"26": "<sup>26</sup> အ့ၪမွဲၦမၩၥံၫဆၧအ့ၪစဲၪ့ထၪ့ခွံၬ တၡါလၧဒိၩ့ဖလ့ၬ",
			"27": "<sup>27</sup> အနဲၩ့လၧအနုၬလၧအဖၧၩ့တၭ,- ၦအၪ့ဎၬဆၧအၥွံၪ လဂၩအ့ၪဒၪန့ဝ့ၫလၧဒိၩ့ဖလ့ၬအနဲၩ့လၧခီၫ့တၭ, ၦအၪ့ ဎၬဆၧအၥွံၪနီၪ အ့ၪမၩၥံၫၦမၩၥံၫဒၪဆၧတၭ, ဆၧၥွံၪ",
			"28": "<sup>28</sup> အီၪလၧအလီၩ့အ့ၬ.- အဂဲးဘဲၫယီၩမွဲအကြၨၭအီၪဝ့ၫ လၧအဒိၩ့ဖလ့ၬ ထီးၦလုဆၧအခိၪၥံၫဝ့ၫလီၫ. အ့ၪမွဲ ၦလုဆၧအခိၪၥံၫဝ့ၫအလးခဲၫ့နီၪ ၦမၩၥံၫၦၡၩလဂၩနီၪ မိထဲၩ့ထဲၩ့ဘၪ လၧအဆၧဖီၪ့ထၬအဂၪ့ခိၪလီၫ.",
			"29": "<sup>29</sup> ဆၧလဖၪနီၪ မိကဲၪထၪ့ဝ့ၫလၧဆၧစ့ၩရၫ့အၥနိၫလၩ့ လၧနၥံၪအဆၨၩအဆၬ လဆိၩဘၪလဆိၩ လၧနၥံၪ အီၪအလးကိၭစီၪ့ဒ့ၭလီၫ.",
			"30": "<sup>30</sup> ၦလၧအမၩၥံၫဒၪၦၡၩလဂၩဂၩနီၪ, ၦလၧအမၩၥံၫ ဒၪၦၡၩ မိဘၪဆၧမၩၥံၫဝ့ၫ လၧၦထိးအၥၭလဖၪ အ ဆၧချဲၩ့အကၠီၩ့လီၫ. အ့ၪမွဲၦလဂၩဎး ထိးဘၪအၥၭ",
			"31": "<sup>31</sup> ထီးအဆၧၥံၫအ့ၬ.- တၭထီးမၩန့ဆၧမၩဖီၩ့ဖျ့ၭလၧၦ မၩၥံၫဒၪၦၡၩ လၧအကြၨၭၥံၫလဂၩအဂးနီၪလဂ့ၩ, မွဲ",
			"32": "<sup>32</sup> အမိဘၪဆၧမၩၥံၫတၡါဝ့ၫလီၫ.- ၦလၧအစဲၪ့ဆၧလၧ ဒိၩ့ဖလ့ၬဖၧၩ့အဂးနီၪ, လၧၦလုဆၧအခိၪလချႃၭၥံၫဒံၭ ဘၪနီၪ, ဘဲၫၥိၭအမိဂဲၫထဲၩ့အီၪ လၧထံၫၥံၪခးၥံၪအ ဖၧၩ့တၭ, ထီးမၩန့ဆၧဂၭဖျ့ၭအဎွ့ၩနးမံၩ့လဂ့ၩ.",
			"33": "<sup>33</sup> တၭထီးမၩဘၪၥၭလိၪ ထံၫၥံၪခးၥံၪလၧနၥံၪအီၪလၧ အဖၧၩ့လဂ့ၩ, အဂဲးဘဲၫယီၩ ဆၧၥွံၪမၩဘၪၥၭလိၪ ခးနီၪလီၫ. တၭခးနီၪမိဘၪ ဆၧမၩဖီၩ့ဖျ့ၭဝ့ၫ လၧဆၧ ၥွံၪဂါလၩ့လၧအဖၧၩ့ န့ၫလၧၦလၧအဂါလၩ့ဝ့ၫ လဂၩ",
			"34": "<sup>34</sup> အၥွံၪနီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, မၩဘၪၥၭလိၪခး လၧနၥံၪမိအီၪ လၧအဖၧၩ့, မွဲအလး လၧယအီၪလၧ အဖၧၩ့နီၪလဂ့ၩ. အဂဲးဘဲၫယီၩ ဆၧလၧယၧၩယဟိ ဝၩလဂၩယီၩ ယအီၪလၧၦအံၫစရ့လၭဖိၪ အကျၩနီၪလီၫ."
		},
		"36": {
			"1": "<sup>1</sup> လၧစယိၥၭအဖိၪခွၫၥံၪအဂံၪ့ဒီၪ့လဖၪအကျၩ, စမ နၭစ့ၫအဖိၪခွၫ စမၫခၧၫအဖိၪခွၫ စဂံလအၭအဖိၪၥံၪအ ဂံၪ့ဒီၪ့လဖၪ အဖါၥံၪအခိၪလဂၩနီၪ ဂဲၫဘူၭတၭ, ချဲၩ့ ဆၧလၧစမိစ့ၭအမ့ၬယၫ, ဒဲလၧၦအံၫစရ့လၭဖိၪ အဖါ",
			"2": "<sup>2</sup> အခိၪအၦဒိၪလဖၪအမ့ၬယၫတၭ,- စံၭဝ့ၫဒၪ, ယဟိဝၩ မၪလူၬပကဆါလၧအမိဖ့ၪလၫ့ ထံၫၥံၪခးၥံၪလၧၦအံၫ စရ့လၭဖိၪ အန့ၥၫဆၧအဂး လၧဖၭဆၧအကၠီၩ့တၭ, ယဟိဝၩမၪလူၬ ပကဆါလၧအမိဖ့ၪလၫ့ ပထၧၫ့ဖုဝဲစ ဇံၫလိဖဟၭအဆၧန့ၥၫ လၧအဖိၪမုၪလဖၪ အကျၩနီၪ",
			"3": "<sup>3</sup> လီၫ.- အ့ၪန့အဝၩ လၧၦအံၫစရ့လၭဖိၪ အဒီၪ့ဂူၫဂၩ လဖၪအဖိၪတၭ, အဆၧန့ၥၫမိဘၪ ဆၧမၩန့ဝ့ၫလၧပဖါ လဖၪအဆၧန့ၥၫအဖၧၩ့တၭ, မိဘၪဆၧအီၪက့ၪကီၪ့ ဝ့ၫလၧၦလဒီၪ့ လၧအထိးဆၧၫ့ဝ့ၫ လၧအဖၧၩ့လီၫ. တၭ မိဘၪဆၧမၩန့ဝ့ၫလၧအဂး, လၧပန့ၥၫဆၧအဖၧၩ့လီၫ.",
			"4": "<sup>4</sup> ထီးၦအံၫစရ့လၭဖိၪ အယုဘလံၫအထီဘၪတၭ, အ ဆၧန့ၥၫနီၪ မိဘၪဆၧအီၪက့ၪကီၪ့ လၧၦလဒီၪ့အဆၧန့ ၥၫလၧအထိးဆၧၫ့ဝ့ၫ လၧအဖၧၩ့လီၫ. တၭအဆၧန့ၥၫ နီၪမိဘၪဆၧမၩန့ထၪ့ခွံၬ လၧပဖါလဒီၪ့အဆၧ န့ၥၫအ ဖၧၩ့လီၫ.",
			"5": "<sup>5</sup> တၭစမိစ့ၭမၪလူၬ ၦအံၫစရ့လၭဖိၪ ဘဲၫယဟိဝၩအ လူစံၭဝ့ၫအၥိၭ, စယိၥၭအဖိၪခွၫလဖၪ အဆၨၩနီၪချဲၩ့",
			"6": "<sup>6</sup> ဆၧဘၪယူၭ.- အယီၩမွဲဆၧလၧယဟိဝၩ မၪလူၬလၧ စဇံၫလိဖဟၭအဖိၪမုၪလဖၪ အဂဲးအကၠီၪ့တၭ, စံၭဝ့ၫ, မိန့ဒၪဝ့ၫအဝၩထီးအဘၪအမ့ၬဆံၭ. မွဲလါနၫ့မိန့ဘၪ",
			"7": "<sup>7</sup> အဝၩလၧအဖါအဒီၪ့လဒီၪ့ အကျၩနီၪလီၫ.- တၭၦအံၫ စရ့လၭဖိၪအဆၧန့ၥၫနီၪ ၥုၭဘၪအၥၭလဒီၪ့ဘၪလဒီၪ့ လဒီၪ့ဘၪလဒီၪ့အ့ၬ. အဂဲးဘဲၫယီၩ ၦအံၫစရ့လၭဖိၪ လဂၩလါလါနီၪ မိဘၪဘုၭထၬလိၬအၥၭ လၧအဖါလ",
			"8": "<sup>8</sup> ဖၪလဒီၪ့အဆၧန့ၥၫလီၫ.- တၭကယဲၦၡၩအဖိၪမုၪလၧ အအီၪလၧဆၧန့ၥၫ လၧၦအံၫစရ့လၭဖိၪလဒီၪ့ လၧအ ဒီၪ့လဖၪအကျၩနီၪ မိဘၪကဲၪထၪ့ၦလၧအဖါလဒီၪ့အ ဒီၪ့ဖိၪလဂၩအမၫ, ဘဲၫၥိၭၦအံၫစရ့လၭဖိၪမိန့ၥၫအဖါ",
			"9": "<sup>9</sup> အဆၧန့ၥၫကိၭဂၩဒ့ၭနီၪလီၫ.- တၭဆၧန့ၥၫနီၪၥုၭဘၪ အၥၭလၧလဒီၪ့ဘၪလဒီၪ့အ့ၬ. ကယဲၦအံၫစရ့လၭဖိၪ မိဘၪဖီၪ့ထၬ ဆၧလၧအန့ၥၫဒၪဝ့ၫ လဂၩလါလါလီၫ.",
			"10": "<sup>10</sup> ဘဲၫယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪ စဇံၫလိဖဟၭ",
			"11": "<sup>11</sup> အဖိၪမုၪလဖၪ မၩဝ့ၫဘဲၫနီၪအၥိၭလီၫ.- တၭစဇံၫလိ ဖဟၭအဖိၪမုၪလဖၪ, နးမၫလၫ, ဒဲနးတၧဇၫ, ဒဲနးဟီၭ လၫ, ဒဲနးမံလကၫ, ဒဲနးနိအၫနီၪ, န့အဝၩလၧအဖါအ",
			"12": "<sup>12</sup> ထၧၫ့ဖုဝဲခွၫလဖၪနီၪလီၫ.- တၭအဝ့ၫၥံၪန့အဝၩလၧ စယိၥၭအဖိၪခွၫ စမနၭစ့ၫအဖိၪခွၫလဖၪ အဂံၪ့ဒီၪ့ဖိၪ လီၫ. တၭအဆၧန့ၥၫနီၪ အီၪဒၪဆၧလၧအဖါအဂံၪ့ဖိၪ",
			"13": "<sup>13</sup> လဒီၪ့အဖၧၩ့လီၫ.- ဆၧလဖၪနီၪ မွဲဆၧမၪလူၬလဖၪ, ဒဲဆၧစ့ၩရၫ့လဖၪ လၧယဟိဝၩမၪလူၬ ၦအံၫစရ့လၭ ဖိၪလဖၪလၧစမိစ့ၭအစူၪဖၧၩ့ လၧမိအၭအဆၧပျၩ့ဖၧၩ့ လၧယီၫဒၫ့အနဲၩ့ဆဲၫဎၩ့ လၧယ့ၫရခိၫနီၪလီၫ."
		}
	}
};
module.exports = book;